INSERT INTO `COMENTARIO` VALUES (7,'\n\"More computing sins are committed in the name of efficiency \n (without necessarily achieving it) than for any other single\n reason - including blind stupidity.\" -- W.A. Wulf','008451a05e1e7aa32c75119df950d405265e0904',45881),(8,'\n\"Pascal /n./ A programming language named after a man who would \n turn over in his grave if he knew about it.\" \n -- From the Jargon File','008451a05e1e7aa32c75119df950d405265e0904',45090),(9,'\n\"After I\'m dead I\'d rather have people ask why I have no monument \n than why I have one.\"\n -- Cato the Elder (234-149 BC, AKA Marcus Porcius Cato)','0159a99ed28b0581890608d24ada9decc4874197',44127),(10,'\n\"When the rich think about the poor, they have poor ideas.\"\n -- Evita Peron ','0159a99ed28b0581890608d24ada9decc4874197',64),(11,'\n\"Save the whales! Collect the whole set!\"','0286dd552c9bea9a69ecb3759e7b94777635514b',35952),(12,'\n\"I criticize by creation - not by finding fault.\" \n -- Cicero (106-43 B.C.)','0286dd552c9bea9a69ecb3759e7b94777635514b',39809),(13,'\n\"True and false are attributes of speech, not of things. And\n where speech is not, there is neither truth nor falsehood.\"\n -- Thomas Hobbes','04f1241ed2b1b531c2c853ce1eeff952cd0f40f3',45561),(14,'\n\"[A book by Henry James] is like a church lit but without a \n congregation to distract you, with every light and line \n focused on the high altar. And on the altar, very reverently \n placed, intensely there, is a dead kitten, an eggshell, a \n bit of string.\" -- H.G. Wells on Henry James','04f1241ed2b1b531c2c853ce1eeff952cd0f40f3',45253),(15,'\n\"I\'ve always wanted to be somebody, but I should have been\n more specific.\" -- George Carlin','05a8ea5382b9fd885261bb3eed0527d1d3b07262',43346),(16,'\n\"The graveyards are full of indispensable men.\"\n -- Charles de Gaulle (1890-1970)','05a8ea5382b9fd885261bb3eed0527d1d3b07262',44127),(17,'\n\"Those who see and feel beyond illusion have acquired a far\n greater gift than could ever be derived from studying scripture\n and philosophy books, for these were meant only to guide the\n blind.\"\n -- Shawn Mikula','06349be70bd2d5dd98d36b9b8dba0a057500fdac',44944),(18,'\n\"The wise man will love; all others will desire.\"\n -- Afranius','06349be70bd2d5dd98d36b9b8dba0a057500fdac',45449),(19,'\n\"Be tolerant of the human race.  Your whole family belongs to it \n -- and some of your spouse\'s family too.\" -- Anonymous.','0716d9708d321ffb6a00818614779e779925365c',45561),(20,'\n\"Conservatives are not necessarily stupid, but most stupid\n people are conservatives.\"\n -- John Stuart Mill','0716d9708d321ffb6a00818614779e779925365c',36879),(21,'\nFinster\'s Law: A closed mouth gathers no feet.','08a35293e09f508494096c1c1b3819edb9df50db',43599),(22,'\n\"I suppose that it takes a $1000/hour lawyer to write contracts\n that a $250/hour lawyer cannot find holes in. \n -- John Herbster in b.p.d.non-technical','08a35293e09f508494096c1c1b3819edb9df50db',43348),(23,'\n\"Each nation knowing it has the only true religion and the only\n sane system of government, each despising all the others, each\n an ass and not suspecting it.\"\n -- Mark Twain','097ccd4f03d962011101c1221009e53461a0993f',36757),(24,'\n\"His philosophy was a mixture of three famous schools -- the Cynics,\n the Stoics and the Epicureans -- and summed up all three of them in\n his famous phrase, \'You can\'t trust any bugger further than you can\n throw him, and there\'s nothing you can do about it, so let\'s have a \n drink.\'\"\n -- Terry Pratchett (Small Gods) ','097ccd4f03d962011101c1221009e53461a0993f',43348),(25,'\n\"I have often regretted my speech, never my silence.\"\n -- Xenocrates (396-314 B.C.)','0a57cb53ba59c46fc4b692527a38a87c78d84028',43080),(26,'\n\"Always code as if the guy who ends up maintaining your code will\n be a violent psychopath who knows where you live.\"\n -- Martin Golding','0a57cb53ba59c46fc4b692527a38a87c78d84028',31913),(27,'\nBowie\'s Theorem: If an experiment works, you must be using the \nwrong equipment.','0ade7c2cf97f75d009975f4d720d1fa6c19f4897',64),(28,'\n\"Follow me--I know the way\"\n- Herman Cohen, as he led at large group astray at Nugget 1994','0ade7c2cf97f75d009975f4d720d1fa6c19f4897',44403),(29,'\n\"May your fondest wish be granted.\"\n -- Traditional Chinese curse','0ca9277f91e40054767f69afeb0426711ca0fddd',35950),(30,'\n\"Tooth decay was a perennial national problem that meant a\n mouthful of silver for patients, and for dentists a pocketful\n of gold.\" -- Claudia Wallis ','0ca9277f91e40054767f69afeb0426711ca0fddd',43348),(31,'\n\"There is no reason anyone would want a computer in their home.\"\n -- Ken Olson, president, chairman and founder of Digital \n    Equipment Corp., 1977','114d4eefde1dae3983e7a79f04c72feb9a3a7efd',44944),(32,'\n\"To iterate is human, to recurse divine.\" -- L. Peter Deutsch','114d4eefde1dae3983e7a79f04c72feb9a3a7efd',45253),(33,'\n\"When you hear hoofbeats, think of horses, not zebras.\"\n-- Old saying','12c6fc06c99a462375eeb3f43dfd832b08ca9e17',36757),(34,'\n\"A witty saying proves nothing.\"\n -- Voltaire (1694-1778)','12c6fc06c99a462375eeb3f43dfd832b08ca9e17',31913),(35,'\n\"A woman is an occasional pleasure but a cigar is always a smoke.\"\n -- Groucho Marx','12f0de3dc76e067d21ed85125716e02e9f1e69f0',33738),(36,'\n\"It\'s easy to imagine how you will act when things go according to plan,\nthat\'s why you must always prepare yourself for what you will do when\nthey don\'t.\"\n- Unknown','12f0de3dc76e067d21ed85125716e02e9f1e69f0',45561),(37,'\nGoebel\'s Second Law Of Useless Difficulty: The fastest way to get \nsomething done is to determine that it isn\'t worth doing.','1352246e33277e9d3c9090a434fa72cfa6536ae2',39809),(38,'\n\"To travel is to discover that everyone is wrong about other\n countries.\"\n -- Aldous Huxley','1352246e33277e9d3c9090a434fa72cfa6536ae2',42471),(39,'\n\"If there has to be a blood bath, let\'s get it over with.\"\n --Ronald Reagan, Vietnam','13682ac418603aa0966369d46bbf282f562acf47',45561),(40,'\n\"Humanity without religion is like a serial killer without a\n chainsaw.\"\n -- Unknown','13682ac418603aa0966369d46bbf282f562acf47',35952),(41,'\n\"So I was in my car, and I was driving along, and my boss rang up\n and he said \'You\'ve been promoted\'. And I swerved.\n And then he rang up a second time and said \'You\'ve been promoted\n again\'. And I swerved again.\n He rang up a third time and said \'You\'re managing director.\' \n And I went into a tree.\n And a policeman came up and said \'What happened to you?\'\n And I Said \'I careered off the road.\'\" -- Tommy Cooper','14bb99f81147d2705f53a1d75337b2ec3e10d23a',44944),(42,'\n\"Hell is paved with good samaritans.\" -- William M. Holden','14bb99f81147d2705f53a1d75337b2ec3e10d23a',43080),(43,'\n\"A runner thinks less in terms of beating others, than in simply running\nthe best he has within himself.\"\n- Unknown','1574bddb75c78a6fd2251d61e2993b5146201319',39809),(44,'\n\"A state of war only serves as an excuse for domestic tyranny.\"\n -- Aleksandr Solzhenitsyn','1574bddb75c78a6fd2251d61e2993b5146201319',64),(45,'\n\"The gulf between what we feel we are doing and what others perceive us\nto be doing will remain the most ultra of all distances, one that no\namount of miles or words can finally bridge.\"\n- Hart','16b06bd9b738835e2d134fe8d596e9ab0086a985',64),(46,'\n\"I\'m tired.\"\n- Jussie Hammalainen','16b06bd9b738835e2d134fe8d596e9ab0086a985',45253),(47,'\n\"The trouble with the world is that the stupid are cocksure and\n the intelligent are full of doubt.\" -- Bertrand Russell','17503a6b2326f09fbc4e3a7c03874c7333002038',43599),(48,'\n\"Fascism is capitalism in decay.\"\n -- Vladimir Ilyich Lenin','17503a6b2326f09fbc4e3a7c03874c7333002038',44403),(49,'\n\"Love: The warm feeling you get towards someone who meets your\n neurotic needs.\"','17ba0791499db908433b80f37c5fbc89b870084b',32929),(50,'\n\"When you start off by telling those who disagree with you that\n they are not