d about stopping terrorism. Well, there\'s a\n really easy way: stop participating in it.\" -- Noam Chomsky','22d200f8670dbdb3e253a90eee5098477c95c23d',64),(62,'\n\"Today it is fashionable to talk about the poor. Unfortunately,\n it is not fashionable to talk with them.\"\n -- Mother Teresa','22d200f8670dbdb3e253a90eee5098477c95c23d',45883),(63,'\n\"Climb the mountains and get their good tidings.  The winds will blow\ntheir freshness into you, and the storms, their energy.  Your cares\nand tensions will drop away like the leaves of autumn.\"\n- John Muir','25293f2761d658cc70c19515861842d712751bdc',31913),(64,'\n\"Because I do it with one small ship, I am called a terrorist\n(pirate?). You do it with a whole fleet and are called an\n emperor.\"\n -- St. Augustine','25293f2761d658cc70c19515861842d712751bdc',39809),(65,'\n\"If you are going through hell, keep going.\"\n    - Sir Winston Churchill (1874-1965)','2659fc519890c924f82b4475ddd71b058178d02b',45449),(66,'\n\"The harder the conflict, the more glorious the triumph. What we\nobtain too cheap, we esteem too lightly; it is dearness only that\ngives everything its value. I love the man that can smile in trouble,\nthat can gather strength from distress and grow brave by reflection.\"\n- Thomas Paine','2659fc519890c924f82b4475ddd71b058178d02b',43080),(67,'\n\"Vote early and vote often.\" -- Al Capone (1899-1947)','26e7458dc56ab2830fadba7bd2c1aa10e981518d',45561),(68,'\n\"I am not young enough to know everything.\"\n -- Oscar Wilde (1854-1900)','26e7458dc56ab2830fadba7bd2c1aa10e981518d',36757),(69,'\n\"God, I must be crazy.\"\n- Unknown','2a2b47bf21a372f267deccbb420567f3d450b3c0',35950),(70,'\n\"You cannot depend on your eyes when your imagination is out\n of focus.\" -- Mark Twain','2a2b47bf21a372f267deccbb420567f3d450b3c0',34631),(71,'\n\"When a government lasts a long while, it deteriorates by\n insensible degrees. Republics end through luxury, monarchies\n through poverty.\"\n -- Montesquieu','2a459380709e2fe4ac2da