amming designed \n to teach students about stacks.\" -- Edsger Dijkstra','50336bc687eb161ee9fb0ddb8cf2b7e65bad865f',35950),(115,'\n\"If computers get too powerful, we can organize them into a\n committee - that will do them in.\"','511a418e72591eb7e33f703f04c3fa16df6c90bd',32929),(116,'\n\"Everybody\'s worried about stopping terrorism. Well, there\'s a\n really easy way; stop participating in it.\"\n -- Noam Chomsky','511a418e72591eb7e33f703f04c3fa16df6c90bd',44281),(117,'\n\"A witty saying proves nothing.\"\n -- Voltaire (1694-1778)','524e05dc77239f3a15dab766aaa59a9e432efde7',36757),(118,'\n\"Don\'t try to teach a pig to sing, it can\'t be done and it only\n ticks off the pig.\"\n -- Robert Heinlein','524e05dc77239f3a15dab766aaa59a9e432efde7',43346),(119,'\n\"Modern morality and manners suppress all natural instincts,\n keep people ignorant of the facts of nature and make them\n fighting drunk on bogey tales.\"\n -- Aleister Crowley','536fb6934062440c464ca2eef82b0be8e6b36cc8',31909),(120,'\n\"Anyone who considers arithmetical methods of producing random\n numbers is, of course, in a state of sin.\" -- John von Neumann','536fb6934062440c464ca2eef82b0be8e6b36cc8',35952),(121,'\n\"Distrust all in whom the impulse to punish is powerful.\"\n -- Nietzsche','54ceb91256e8190e474aa752a6e0650a2df5ba37',34631),(122,'\n\"It is a government of the people by the people for the people\n no longer; it is a government of corporations by corporations\n for corporations.\"\n -- Rutherford B. Hayes','56ad4d4deaec98465c419b4a8ea7bfc1ed38c4d9',45881),(123,'\n\"If you were my husband, I\'d give you poison.\" \n -- Lady Astor to Churchill\n \n\"If you were my wife, I\'d take it.\"\n  -- Curchill to Lady Astor','56ad4d4deaec98465c419b4a8ea7bfc1ed38c4d9',45449),(124,'\n\"Technology: No Place for Wimps!\" -- Scott Adams','572e20738130fddc7c389f2ab14f4e4b22a97c39',43080),(125,'\nDr. Caligari\'s Come-Back: A bad sector disk error occurs only \nafter you\'ve done several hours of work without performing a \nbackup.','572e20738130fddc7c389f2ab14f4e4b22a97c39',43346),(126,'\n\"Three o\'clock is always too late or too early for anything you \n want to do.\" -- Jean-Paul Sartre (1905-1980)','58f0744907ea8bd8e0f51e568f1536289ceb40a5',35952),(127,'\n\"Everybody sooner or later, sits down to a banquet of\n consequences.\"\n -- Robert Louis Stevenson','58f0744907ea8bd8e0f51e568f1536289ceb40a5',42471),(128,'\n\"In the end, we will remember not the words of our enemies, but\n the silence of our friends.\"\n -- Martin Luther King, Jr.','59129aacfb6cebbe2c52f30ef3424209f7252e82',44944),(129,'\n\"It is better to be feared than loved, if you cannot be both.\"\n -- Niccolo Machiavelli','59129aacfb6cebbe2c52f30ef3424209f7252e82',43080),(130,'\n\"I sometimes think that God in creating man somewhat\n overestimated his ability.\"\n -- Oscar Wilde','5a5b0f9b7d3f8fc84c3cef8fd8efaaa6c70d75ab',45449),(131,'\n\"Cast aside those who liken godliness to whimsy and who try to\n combine their greed for wealth with their desire for a happy\n afterlife.\"\n -- Kahlil Gibran','5a5b0f9b7d3f8fc84c3cef8fd8efaaa6c70d75ab',36757),(132,'\n\"I don\'t feel good.\" -- Luther Burbank, dying words','5b384ce32d8cdef02bc3a139d4cac0a22bb029e8',43346),(133,'\n\"Most software today is very much like an Egyptian pyramid with\n millions of bricks piled on top of each other, with no \n structural integrity, but just done by brute force and thousands\n of slaves.\" -- Alan Kay','5b384ce32d8cdef02bc3a139d4cac0a22bb029e8',45253),(134,'\n\"The best time I ever had with Joan Crawford was when I pushed \n her down the stairs in \'Whatever Happened to Baby Jane?\'\"\n -- Bette Davis','5c8f5ac0b7ad23c110793ad1fcf4d3c8d41344d5',39809),(135,'\n\"Statistically one hundred percent of the shots you don\'t take\n don\'t go in.\"\n -- Wayne Gretsky','5c8f5ac0b7ad23c110793ad1fcf4d3c8d41344d5',45090),(136,'\n\"The question of whether a computer can think is no more \n interesting than the question of whether a submarine can swim.\" \n -- Edsger Dijkstra ','5e796e48332af4142b10ca0f86e65d9bfdb05884',31913),(137,'\n\"Whatever is begun in anger ends in shame.\"\n -- Benjamin Franklin (1706-1790)','5e796e48332af4142b10ca0f86e65d9bfdb05884',43080),(138,'\n\"Glory is fleeting, but obscurity is forever.\"\n-- Napoleon Bonaparte (1769-1821)','601ca99d55f00a2e8e736676b606a4d31d374fdd',35950),(139,'\nGlyme\'s Formula For Success: The secret of success is sincerity. \nOnce you can fake that, you\'ve got it made.','601ca99d55f00a2e8e736676b606a4d31d374fdd',43080),(140,'\n\"Throughout American history, the government has said we\'re in an \n unprecedented crisis and that we must live without civil \n liberties until the crisis is over. It\'s a hoax.\" \n -- Yale Kamisar, 1990.','6052521b7625e31d4ee9cc706732484fcf850877',43346),(141,'\n\"The road to wisdom?\"\n Well its plain and simple to express:\n Err and err and err again,\n but less and less and less.\" -- Piet Hein','6052521b7625e31d4ee9cc706732484fcf850877',45449),(142,'\n\"I read about an Eskimo hunter who asked the local missionary\n priest, \'If I did not know about God and sin, would I go to\n hell?\' \'No,\' said the priest, \'not if you did not know.\' \'Then\n why,\' asked the Eskimo earnestly, \'did you tell me?\'\"\n -- Annie Dillard','61188f24396807ba7ca38919a158766de935852e',39809),(143,'\n\"I want to thank the rest of you for making me look normal.\"\n- Gordon Ainsleigh','61188f24396807ba7ca38919a158766de935852e',35658),(144,'\n\"Good code is its own best documentation. As you\'re about to add\n a comment, ask yourself, \'How can I improve the code so that\n this comment isn\'t needed?\' Improve the code and then document\n it to make it even clearer.\" -- Steve McConnell Code Complete','6216f8a75fd5bb3d5f22b6f9958cdede3fc086c2',36757),(145,'\n\"The significant problems we face cannot be solved at the same \n level of thinking we were at when we created them.\"\n -- Albert Einstein (1879-1955)','6216f8a75fd5bb3d5f22b6f9958cdede3fc086c2',45090),(146,'\n\"There was a time when I believed in the story and the scheme\n of salvation, so far as I could understand it, just as I\n believed there was a Devil. Suddenly the light broke through to\n me and I saw a silly story, and each generation nowadays\n swallows it with greater difficulty. Why do people go on\n pretending about this Christianity?\"\n -- H. G. Wells','632667547e7cd3e0466547863e1207a8c0c0c549',31909),(147,'\n\"Liberty and democracy become unholy when their hands are dyed\n red with innocent blood.\" -- Mahatma Gandhi','632667547e7cd3e0466547863e1207a8c0c0c549',35950),(148,'\n\"It\'s not at all important to get it right the first time. It\'s\n vitally important to get it right the last time.\" \n -- Andrew Hunt and David Thomas','64e095fe763fc62418378753f9402623bea9e227',39809),(149,'\n\"It makes no difference as to the name of the God, since love\n is the real God of all in the world.\"\n -- Apache','64e095fe763fc62418378753f9402623bea9e227',45449),(150,'\n\"War is hell and all that, but it has a good deal to recommend\n it. It wipes out all the small nuisances of peacetime.\"\n -- Ian Hay','667be543b02294b7624119adc3a725473df39885',44944),(151,'\n\"If the automobile had followed the same development cycle as \n the computer, a Rolls-Royce would today cost $100, get a \n million miles per gallon, and explode once a year, killing \n everyone inside.\" -- Robert X. Cringely.','667be543b02294b7624119adc3a725473df39885',32929),(152,'\n\"Reality is that which, when you stop believing in it, doesn\'t \ngo away.\" -- Philip K. Dick.','683e725c03a87baaad2623231644e944e537acab',33738),(153,'\n\"Incorrect documentation is often worse than no documentation.\"\n -- Bertrand Meyer','683e725c03a87baaad2623231644e944e537acab',36879),(154,'\n\"It\'s the pain of the consequences that\'s all out of proportion.\"\n- Kenny Moore','69e56976fc9bee70c1d2eaa85c0c8dea9f722a2f',45449),(155,'\n\"Criticism is prejudice made plausible.\" \n -- Henry Louis Mencken (1880-1956)','69e56976fc9bee70c1d2eaa85c0c8dea9f722a2f',64),(156,'\n\"A people that values its privileges above its principles soon \n loses both.\"\n -- Dwight D. Eisenhower (1890-1969), Inaugural Address, \n    January 20, 1953','6b6277afcb65d33525545904e95c2fa240632660',42471),(157,'\n\"The reasonable man adjusts himself to the world, the\n unreasonable one persists in trying to adapt the world to\n himself; therefore all progress depends on the unreasonable\n man.\"\n -- George Bernard Shaw','6b6277afcb65d33525545904e95c2fa240632660',33738),(158,'\n\"Why would anyone want to do this a second time?\"\n- Sue Haupt','6c1e671f9af5b46d9c1a52067bdf0e53685674f7',35952),(159,'\n\"Democracy is where you can say what you think even if you don\'t \n think.\"','6c1e671f9af5b46d9c1a52067bdf0e53685674f7',32929),(160,'\n\"Happiness is an imaginary condition, formerly attributed by\n the living to the dead, now usually attributed by adults to\n children, and by children to adults.\"\n -- Thomas Szasz','6fb84aed32facd1299ee1e77c8fd2b1a6352669e',45090),(161,'\n\"In science one tries to tell people, in such a way as to be \n understood by everyone, something that no one ever knew before. \n But in poetry, it\'s the exact opposite.\"\n -- Paul Dirac (1902-1984)','6fb84aed32facd1299ee1e77c8fd2b1a6352669e',45561),(162,'\nClarke\'s Third Law: Any sufficiently advanced technology is \nindistinguishable from magic.','708a77db476d737e54b8bf4663fc79b346d696d2',45881),(163,'\n\"The most important job is not to be Governor, or First Lady in \n my case.\" -- George W. Bush','708a77db476d737e54b8bf4663fc79b346d696d2',44127),(164,'\n\"Anyone who starts a sentence, \'With all due respect ...\'\n is about to insult you.\" -- unknown','717b2f3d8816830549097908c134e1729c516542',31909),(165,'\n\"What I am against is quotas. I am against hard quotas, quotas \n they basically delineate based upon whatever. However they \n delineate, quotas, I think, vulcanize society. So I don\'t know \n how that 