unidentified \"Utah runner\", from Red Fisher','87d538ef1c1db71603e60f278446c86470162380',31913),(198,'\n\"Why tell me that a man is a fine speaker, if it is not the\n truth that he is speaking?\"\n -- Thomas Carlyle','887309d048beef83ad3eabf2a79a64a389ab1c9f',44281),(199,'\n\"It\'s very hard in the beginning to understand that the whole\nidea is not to beat the other runners.  Eventually you learn that\nthe competition is against the little voice inside you that wants\nyou to quit.\"\n- George Sheehan','887309d048beef83ad3eabf2a79a64a389ab1c9f',32929),(200,'\n\"I heard someone tried the monkeys-on-typewriters bit trying for \n the plays of W. Shakespeare, but all they got was the collected \n works of Francis Bacon.\" -- Bill Hirst','8b7471f4ae0bf59f5f0a425068c05d96f4801b9e',35658),(201,'\n\"Beyond its entertainment value, Baywatch has enriched and,\n in many cases, helped save lives. I\'m looking forward to\n the opportunity to continue with a project which has has\n such a significance for so many.\" \n -- David Hasselhoff, Actor','8b7471f4ae0bf59f5f0a425068c05d96f4801b9e',44403),(202,'\n\"A sure cure for seasickness is to sit under a tree.\" \n -- Spike Milligan.','8bd7954c40c1e59a900f71ea3a266732609915b1',33738),(203,'\n\"If McDonalds were run like a software company, one out of every\n hundred Big Macs would give you food poisoning, and the response\n would be, \'We\'re sorry, here\'s a coupon for two more.\'\"\n -- Mark Minasi ','8bd7954c40c1e59a900f71ea3a266732609915b1',42471),(204,'\n\"As long as you keep making RFM (Relentless Forward Motion), you will\nfinish.\"\n- Stacey Page','8e63fd3e77796b102589b1ba1e4441c7982e4132',64),(205,'\n\"A computer is like an Old Testament god, with a lot of rules and\n no mercy\" -- Joseph Campbell','8e63fd3e77796b102589b1ba1e4441c7982e4132',36757),(206,'\n\"The bureaucracy is expanding to meet the needs of an expanding\n bureaucracy.\" -- Unknown','8ee51caaa2c2f4ee2e5b4b7ef5a89db7df1068d7',45449),(207,'\n\"It is hard to free fools from chains they revere.\"\n -- Voltaire','8ee51caaa2c2f4ee2e5b4b7ef5a89db7df1068d7',45561),(208,'\nLieberman\'s Law: Everybody lies; but it doesn\'t matter, since \nnobody listens.','8effee409c625e1a2d8f5033631840e6ce1dcb64',44403),(209,'\n\"The United States is in no sense founded upon the Christian\n doctrine.\"\n -- George Washington Administration Treaty','8effee409c625e1a2d8f5033631840e6ce1dcb64',39809),(210,'\n\"I know that there are people in this world who do not love \n their fellow human beings, and I hate people like that.\" \n -- Tom Lehrer','902ba3cda1883801594b6e1b452790cc53948fda',44403),(211,'\n\"I\'m not into working out.  My philosophy: No pain, no pain.\" \n -- Carol Leifer.','902ba3cda1883801594b6e1b452790cc53948fda',33738),(212,'\n\"Once a new technology starts rolling, if you\'re not part of the\n steamroller, you\'re part of the road.\" -- Stewart Brand','91032ad7bbcb6cf72875e8e8207dcfba80173f7c',44403),(213,'\nAlbrecht\'s Law: Social innovations tend to the level of minimum \ntolerable well-being.','91032ad7bbcb6cf72875e8e8207dcfba80173f7c',44403),(214,'\n\"I can\'t embrace a male god who has persecuted female sexuality\n throughout the ages; and that persecution still goes on today,\n all over the world.\"\n -- Amanda Donohoe','9109c85a45b703f87f1413a405549a2cea9ab556',32929),(215,'\n\"if you keep doing what you\'ve always done, you\'ll keep getting\n what you\'ve always gotten.\"\n -- Jim Rohn','9109c85a45b703f87f1413a405549a2cea9ab556',36879),(216,'\n\"Everything that can be invented has been invented.\"\n -- Charles H. Duell, Commissioner, U.S. Office of Patents, 1899','91dfde1d6e005e422f64a59776234f1f4c80b5e4',44403),(217,'\n\"Always enjoy yourself.  Never give up.  Don\'t think of being tired.\nKeep on going until you cross the finish line.  Don\'t be upset if you\ndon\'t win.\"\n- Unknown','91dfde1d6e005e422f64a59776234f1f4c80b5e4',33738),(218,'\n\"Humor is also a way of saying something serious.\"\n -- T. S. Eliot (1888 - 1965)','92cfceb39d57d914ed8b14d0e37643de0797ae56',39809),(219,'\n\"The public is wonderfully tolerant. It forgives everything\n except genius.\"\n -- Oscar Wilde','92cfceb39d57d914ed8b14d0e37643de0797ae56',32929),(220,'\n\"Run hard, run long!\"\n- Jay Hodde','934385f53d1bd0c1b8493e44d0dfd4c8e88a04bb',43080),(221,'\nLady Astor: \"Mr. Churchill, you\'re drunk!\"\nWinston Churchill: \"Yes, and you, Madam, are ugly. But tomorrow, \nI shall be sober.\"','934385f53d1bd0c1b8493e44d0dfd4c8e88a04bb',43599),(222,'\n\"Humor is a rubber sword - it allows you to make a point without \n drawing blood.\" -- Mary Hirsch','94940e534aedd3f6d9bb77c6322f6641dbb7432a',64),(223,'\n\"The best way to predict the future is to invent it.\" \n -- Alan Kay','94940e534aedd3f6d9bb77c6322f6641dbb7432a',44127),(224,'\n\"I\'m not a member of any organized political party, I\'m a \n Democrat!\" -- Will Rogers (1879-1935)','95e815d1541bf6f358cfffbe66ab3af0d0c09d09',45883),(225,'\n\"Too many of today\'s children have straight teeth and crooked\n morals.\" -- Unknown high school principal','95e815d1541bf6f358cfffbe66ab3af0d0c09d09',42471),(226,'\n\"Plan to throw one away, you will anyhow.\" -- Fred Brooks','972a67c48192728a34979d9a35164c1295401b71',45449),(227,'\n\"\'Everything you say is boring and incomprehensible\', she said, \n \'but that alone doesn\'t make it true.\'\" -- Franz Kafka','972a67c48192728a34979d9a35164c1295401b71',45881),(228,'\nFlo Capp\'s Observation: The next best thing to doing something \nsmart is not doing something stupid.','98fbc42faedc02492397cb5962ea3a3ffc0a9243',45090),(229,'\n\"Except as its clown and jester, society does not encourage\n individuality, and the State abhors it.\"\n -- Bernard Berenson','98fbc42faedc02492397cb5962ea3a3ffc0a9243',33738),(230,'\n\"Just remember this: No one ever won the olive wreath with an\nimpressive training diary.\"\n- Marty Liquori','9a79be611e0267e1d943da0737c6c51be67865a0',36757),(231,'\n\"I shall not waste my days in trying to prolong them.\"\n -- Ian L. Fleming (1908-1964)','9a79be611e0267e1d943da0737c6c51be67865a0',43346),(232,'\n\"... The CIA has overthrown functioning democracies in over\n twenty countries.\"\n -- John Stockwell, former CIA official','9d8974baddfc0e53300829f37e5fc88b0f5ce61b',36757),(233,'\n\"If you can see the light coming out of the other ear, you\'re an Ultra runner.\n- Unknown','9d8974baddfc0e53300829f37e5fc88b0f5ce61b',43080),(234,'\n\"The will to do, the soul to dare.\"\n- Sir Walter Scott','9e071a3a594a8964cbefe784f8a6afaa94c0de17',42471),(235,'\n\"If the automobile had followed the same development cycle as \n the computer, a Rolls-Royce would today cost $100, get a \n million miles per gallon, and explode once a year, killing \n everyone inside.\" -- Robert X. Cringely.','9e071a3a594a8964cbefe784f8a6afaa94c0de17',35658),(236,'\n\"To the Honourable Member opposite I say, when he goes home \n tonight, may his mother run out from under the porch and bark at \n him\" -- John G. Diefenbaker','9e44d2771c052d44058245eda6cb334689ca78cc',31913),(237,'\nGreen\'s Law Of Debate: Anything is possible if you don\'t know \nwhat you\'re talking about.','9e44d2771c052d44058245eda6cb334689ca78cc',43599),(238,'\n\"I am become death, shatterer of worlds.\"\n -- Robert J. Oppenheimer (1904-1967) (citing from the \n    Bhagavad Gita, after witnessing the world\'s first nuclear \n    explosion)','9e6a55b6b4563e652a23be9d623ca5055c356940',44281),(239,'\n\"All I need to make a comedy is a park, a policeman and a pretty \n girl.\" -- Charlie Chaplin (1889-1977), in My Autobiography (1964)','a1422e6a168630cdd214ac5e31ca01ae1bee8d92',44127),(240,'\n\"I had as many doubts as anyone else. Standing on the starting line,\nwe\'re all cowards.\"\n- Alberto Salazar','a1422e6a168630cdd214ac5e31ca01ae1bee8d92',44944),(241,'\n\"If economists were held in the same regard as medical \n practitioners, our courts would be overwhelmed with malpractice\n suits\" -- unknown','a17554a0d2b15a664c0e73900184544f19e70