hat\'s the tarp at the aid station. Run to it ... there\'s\nno trail just run down through the boulders but don\'t go too far off to\nthe left or you\'ll end up trying to go down a cliff.\"\n- Jim Pomroy, R.D. Elkhorn Mountain 100K 1997','a72b20062ec2c47ab2ceb97ac1bee818f8b6c6cb',43599),(251,'\n\"Never attribute to malice that which is adequately explained\n by stupidity.\" -- Hanlon\'s razor','a929eb33e338738d2a91e955ce7623764480253c',45561),(252,'\n\"Three o\'clock is always too late or too early for anything you \n want to do.\" -- Jean-Paul Sartre (1905-1980)','a929eb33e338738d2a91e955ce7623764480253c',31909),(253,'\n\"It is now possible for a flight attendant to get a pilot \n pregnant.\" -- Richard J. Ferris, president of United Airlines','a9334987ece78b6fe8bf130ef00b74847c1d3da6',64),(254,'\n\"The Bible was a consolation to a fellow alone in the old cell. \n The lovely thin paper with a bit of matress stuffing in it, if \n you could get a match, was as good a smoke as I ever tasted.\" \n -- Brendan Behan.','a9334987ece78b6fe8bf130ef00b74847c1d3da6',45883),(255,'\n\"When you are 99 miles into a 100-mile running race, your brain is not\nthe same brain you started with\".\n- Paul Huddle','ac2646028f5b8b9bbf7a967f4ac71b8866135211',31913),(256,'\n\"If there was anything that depressed him more than his own \n cynicism, it was that quite often it still wasn\'t as cynical as \n real life.\"\n -- Terry Pratchett (Guards! Guards!) ','ac2646028f5b8b9bbf7a967f4ac71b8866135211',36879),(257,'\n\"They always say time changes things, but you actually have to\n change them yourself.\" -- Andy Warhol','ac3478d69a3c81fa62e60f5c3696165a4e5e6ac4',44403),(258,'\n\"Never explain, your friends do not need it and your enemies\n will not believe you anyway.\"\n -- Elbert Hubbard','ac3478d69a3c81fa62e60f5c3696165a4e5e6ac4',44944),(259,'\n\"Reports are sketchy, but we have heard that in the first \n heart transplant operation in Belgium, both patient and \n donor are doing fine.\" -- Radio news announcer','acf1fffc01dc0193aa07d0b1de723c292a2c826d',32929),(260,'\n\"Once you eliminate the impossible, whatever remains, no matter \n how improbable, must be the truth.\"\n -- Sherlock Holmes (by Sir Arthur Conan Doyle, 1859-1930)','acf1fffc01dc0193aa07d0b1de723c292a2c826d',44127),(261,'\n\"I did not know how to say goodbye. It was harder still, when I\n refused to say it.\"\n -- Native American saying','ae1e7198bc3074ff1b2e9ff520c30bc1898d038e',43080),(262,'\n\"The target suffered a terminal illness before a firing squad\n in Baghdad.\"\n -- CIA officer at US Senate hearing on 1963 overthrow of Iraqi\n Prime Minister Kassem','ae1e7198bc3074ff1b2e9ff520c30bc1898d038e',32929),(263,'\n\"Why do we kill people who are killing people to show that\n killing people is wrong?\"\n -- Holly Near','aee544ceddfe7ab69a02f82bdf8ce6ea3862ff02',35950),(264,'\n\"You can know the name of a bird in all the languages of the \n world, but when you\'re finished, you\'ll know absolutely nothing\n whatever about the bird... So let\'s look at the bird and see\n what it\'s doing -- that\'s what counts. I learned very early \n the difference between knowing the name of something and knowing\n something.\" -- Richard Feynman','aee544ceddfe7ab69a02f82bdf8ce6ea3862ff02',45561),(265,'\n\"The difference between fiction and reality? Fiction has to make \n sense.\" -- Tom Clancy','af3e133428b9e25c55bc59fe534248e6a0c0f17b',43348),(266,'\n\"Would you like to liberate yourself from the lower realms of\n life? Would you like to save the world from the degradation and\n destruction it seems destined for? Then step away from shallow\n mass movements and quietly go to work on your own\n self-awareness.\"\n -- Lao tzu','af3e133428b9e25c55bc59fe534248e6a0c0f17b',31909),(267,'\n\"Crossposting isn\'t inherently evil, in the same sense that \n necrophilia doesn\'t really hurt anybody.  One wonders only \n whether it\'s appropriate to the occasion.\" -- Rick Gordon','b16a457a3302d7c1f4563df2ffc96dcc