a \n drink.\'\"\n -- Terry Pratchett (Small Gods) ','b7eb6c689c037217079766fdb77c3bac3e51cb4c',35658),(289,'\n\"Everything should be made as simple as possible, but not\n simpler.\"\n -- Albert Einstein','b888b29826bb53dc531437e723738383d8339b56',39809),(290,'\n\"There is a rumour going around that I have found God. I think \n this is unlikely because I have enough difficulty finding my \n keys, and there is empirical evidence that they exist.\"\n -- Terry Pratchett','b888b29826bb53dc531437e723738383d8339b56',43080),(291,'\n\"The world is a tragedy to those who feel, but a comedy to those\n who think.\" -- Horace Walpole (1717-1797)','bc33ea4e26e5e1af1408321416956113a4658763',35941),(292,'\n\"To love oneself is the beginning of a lifelong romance\"\n -- Oscar Wilde (1854-1900)','bc33ea4e26e5e1af1408321416956113a4658763',36879),(293,'\n\"A closed mouth gathers no foot.\"','bcf814ab41506290ab1b8158ebda6ee61b4bb579',33738),(294,'\n\"A camel is a horse designed by a committee\" -- Unknown','bcf814ab41506290ab1b8158ebda6ee61b4bb579',45561),(295,'\n\"An intellectual is someone who has found something more \n interesting than sex.\" -- Edgar Wallace.','bd307a3ec329e10a2cff8fb87480823da114f8f4',36757),(296,'\n\"The people that I have met are not foolish; they are aware of how\ntired and cold and hungry and frightened and hurting and discouraged\nand disoriented and how possibly injured they will become. They know\nthey will face great physical, mental, emotional, and possibly\nspiritual challenges as they make their way to the finish. This is\nwhat they are racing against. This is their challenge. This is what\nI admire.\"\n- Carolyn Erdman','bd307a3ec329e10a2cff8fb87480823da114f8f4',35941),(297,'\n\"Perfection is achieved, not when there is nothing more to add, \n but when there is nothing left to take away.\"\n -- Antoine de Saint Exupry','be057d4ca44c10a0fc1dfcffd99cce1490291dc7',43346),(298,'\n\"An empty stomach is not a good political advisor.\"\n -- Albert Einstein','