le. \n Between five, it\'s fantastic.\" -- Woody Allen','c28aca23f1ef3718a464383d925c66842078edaa',45881),(309,'\n\"Great spirits often encounter violent opposition from mediocre minds.\"\n- Albert Einstein','c5b76da3e608d34edb07244cd9b875ee86906328',42471),(310,'\n\"A [pseudo]random number generator is much like sex: when it\'s \n good it\'s wonderful, and when it\'s bad it\'s still pretty good.\" \n -- G. Marsaglia ','c5b76da3e608d34edb07244cd9b875ee86906328',43346),(311,'\n\"The best long distance runners eat raw meat, run naked and sleep in the snow.\"\n- Alaska Airlines advertisement honoring Iditarod dogs (from Dana Roueche)','c66c65175fecc3103b3b587be9b5b230889c8628',34631),(312,'\n\"I liked your opera. I think I will set it to music.\"\n -- Beethoven to a fellow composer','c66c65175fecc3103b3b587be9b5b230889c8628',36879),(313,'\n\"A closed mouth gathers no foot.\"','c8306ae139ac98f432932286151dc0ec55580eca',44403),(314,'\n\"Each of us is confined to a world of our own making.\"\n -- Shawn Mikula','c8306ae139ac98f432932286151dc0ec55580eca',45090),(315,'\n\"Any code of your own that you haven\'t looked at for six or more\n months might as well have been written by someone else.\" \n -- Eagleson\'s law','c9ca442765657fc90e9e779c34d0d2259d2c3c5b',31913),(316,'\n\"... The biggest detractors of communism and socialism always\n seem to want to embrace the worst excesses of both.\"\n -- <Skullhunter>','c9ca442765657fc90e9e779c34d0d2259d2c3c5b',31913),(317,'\n\"It is preoccupation with possessions, more than anything else,\n that prevents us from living freely and nobly.\"\n -- Bertrand Russell','ca3512f4dfa95a03169c5a670a4c91a19b3077b4',36879),(318,'\n\"Behind every successful man is a woman, behind her is his wife.\"\n -- Groucho Marx','ca3512f4dfa95a03169c5a670a4c91a19b3077b4',36879),(319,'\n\"More computing sins are committed in the name of efficiency\n (without necessarily achieving it) than for any other single\n reason - including blind stupidity.\" -- W.A. Wu