h, would it?\" -- Albert Einstein','5d23e965603269f7674c2fc33318f5d5af406f6f',39809),(548,'\n\"The pessimist complains about the wind; the optimist expects it\n to change; the realist adjusts the sails.\" \n -- William Arthur Ward','5e06d22c8893e27d5a7243bd185faa94cc593072',45561),(549,'\n\"A man must love a thing very much if he not only practices it without any hope of\nfame and money, but even practices it without any hope of doing it well.\"\n- G. K. Chesterton','5e06d22c8893e27d5a7243bd185faa94cc593072',35658),(550,'\n\"Thank you for sending me a copy of your book - I\'ll waste no \n time reading it.\" -- Moses Hadas (1900-1966)','5f1cd7c3fb68ae7c679f8c33966610670d32ff1e',33738),(551,'\n\"Boredom and fatigue are very similar experiences.\"\n- Al Howie','5f1cd7c3fb68ae7c679f8c33966610670d32ff1e',45090),(552,'\n\"Don\'t be so humble - you are not that great.\"\n-- Golda Meir (1898-1978) to a visiting diplomat','5f573b82f1da8677c86d695538c530d136b6c489',35952),(553,'\n\"I knew I was an unwanted baby when I saw that my bath toys\n were a toaster and a radio.\" -- Joan Rivers','5f573b82f1da8677c86d695538c530d136b6c489',43599),(554,'\n\"The biggest conspiracy of all is the claim that there are no\n conspiracies!\"\n -- Michael Rivero','5f6955d227a320c7f1f6c7da2a6d96a851a8118f',31909),(555,'\n\"Experience is what you get when you were expecting something\n else.\"','5f6955d227a320c7f1f6c7da2a6d96a851a8118f',43348),(556,'\n\"I have never let my schooling interfere with my education.\"\n -- Mark Twain (1835-1910)','640bacfb48aefac1f91028c01603e5c78d4f63ca',35952),(557,'\n\"Wherever there is great property, there is great inequality,\n for one very rich man; there must be at least five hundred\n poor.\"\n -- Adam Smith','640bacfb48aefac1f91028c01603e5c78d4f63ca',45253),(558,'\n\"When ideas fail, words come in very handy.\" -- Goethe (1749-1832)','682a03f4cd9e0c79b8a1f0e34266b9651ad9821c',35941),(559,'\n\"Software obeys the law of gaseous expansion - it continues to\n gro