high school principal','8ada660e06b787f245667943dc948dafab997e25',35952),(606,'\n\"Naturally we feel that mentally ill people are not what we are\n looking for when we hire programmers - although there is no\n empirical data to support or contradict that view... Is it\n appropriate to give tests for mental illness to anyone applying\n for any kind of job?\" \n -- Weinberg The Psychology of Computer Programming','8ada660e06b787f245667943dc948dafab997e25',31909),(607,'\n\"Boredom and fatigue are very similar experiences.\"\n- Al Howie','8c4a0a7afbb10de1e63107ce71805605f1a81765',45253),(608,'\n\"Always be wary of any helpful item that weighs less than its \n operating manual.\"\n -- Terry Pratchett (Jingo) ','8c4a0a7afbb10de1e63107ce71805605f1a81765',31913),(609,'\n\"There are perhaps 5% of the population that simply *can\'t* think.\n There are another 5% who *can*, and *do*.\n The remaining 90% *can* think, but *don\'t*.\" -- Robert A. Heinlein','8d396f9047754b91e68d992920b521280cd9d351',45253),(610,'\n\"Ask people why they have deer heads on their walls and they \n tell you it\'s because they\'re such beautiful animals. I think \n my wife is beautiful, but I only have photographs of her on the \n wall.\" -- George Carlin','8d396f9047754b91e68d992920b521280cd9d351',34631),(611,'\n\"If the lessons of history teach us anything it is that nobody \n learns the lessons that history teaches us.\"','8d6f9131366dac0c298ee725e6577d6e0a54e832',44403),(612,'\n\"Some tortures are physical\n And some are mental,\n But the one that is both\n Is dental.\"\n -- Ogden Nash','8d6f9131366dac0c298ee725e6577d6e0a54e832',42471),(613,'\n\"He who knows nothing is closer to the truth than he whose mind\n is filled with falsehoods and errors.\"\n -- Thomas Jefferson','8da4dabfaeb4a44681c9777c85db39140e3e12e6',43346),(614,'\n\"In nature, there are neither rewards nor punishments; there\n are consequences.\"\n -- Robert G. Ingersoll','8da4dabfaeb4a44681c9777c85db39140e3e12e6',45881),(615,'\n\"Co