22ee6',43080),(625,'\n\"I never met a hill I couldn\'t walk.\"\n- Larry Stice','98fcc378d7f5adda37f271debf5d7a4d1cdd37b9',45561),(626,'\n\"My experience in Amsterdam is that cyclists ride where the hell \n they like and aim in a state of rage at all pedestrians while \n ringing their bell loudly, the concept of avoiding people being \n foreign to them. \n \n My dream holiday would be a) a ticket to Amsterdam b) immunity \n from prosecution and c) a baseball bat.\"\n -- Terry Pratchett','98fcc378d7f5adda37f271debf5d7a4d1cdd37b9',31909),(627,'\n\"Cancel the kitchen scraps for lepers and orphans! No more\n merciful beheadings! And call off Christmas!\"\n -- The Sheriff of Nottingham','9a15f42d1c524c306eb91c3df1216db248a8f224',36879),(628,'\n\"I invented the term Object-Oriented, and I can tell you I did \n not have C++ in mind.\" -- Alan Kay','9a15f42d1c524c306eb91c3df1216db248a8f224',45883),(629,'\n\"We all agree that your theory is crazy, but is it crazy enough?\"\n -- Niels Bohr (1885-1962)','9a3d6127374af09c22015bf3ede3ac00a36e3ec6',43346),(630,'\n\"We didn\'t lose the game; we just ran out of time.\"\n    - Vince Lombardi','9a3d6127374af09c22015bf3ede3ac00a36e3ec6',43348),(631,'\n\"The chain reaction of evil -- wars producing more wars -- must\n be broken, or we shall be plunged into the dark abyss of \n annihilation.\" -- Martin Luther King, Jr.','9a61b86ecef7f4f8978d90273acfe0236bae7479',36757),(632,'\n\"Men are not disturbed by things, but the view they take of \n things.\" -- Epictetus (55-135 A.D.)\n\n\"What about things like bullets?\"\n -- Herb Kimmel, Behavioralist, Professor of Psychology, upon \n    hearing the above quote (1981)','9a61b86ecef7f4f8978d90273acfe0236bae7479',32929),(633,'\n\"It is only those who have neither fired a shot nor heard the\n shrieks and groans of the wounded who cry aloud for blood...\n War is hell.\" -- General William Tecumseh Sherman','9a70776c743352cfcf688e52512673332e5e4007',36757),(634,'\n\"Every day I get up and look through the Forbes list of the \n richest people in America. If I\'m not there, I go to work.\"\n -- Robert Orben','9a70776c743352cfcf688e52512673332e5e4007',31909),(635,'\n\"A computer is like an Old Testament god, with a lot of rules and\n no mercy\" -- Joseph Campbell','9aaa0b523023790b2cf1df9dc629ba14abd0edd5',34631),(636,'\n\"Pontius Pilate was the first great censor, and Jesus Christ\n the first great victim of censorship.\"\n -- Ben Lindsay','9aaa0b523023790b2cf1df9dc629ba14abd0edd5',64),(637,'\n\"Paramount among the responsibilities of a free press is the duty\n to prevent any part of the government from deceiving the \n people.\" -- Hugo Black, Supreme Court Justice','9c882d5c6a1aa240b2672dce0ffb03360abcaca5',45881),(638,'\n\"There is not now, nor has there ever been, nor will there ever be,\n any programming language in which it is the least bit difficult to\n write bad code.\" -- Flon\'s Law','9c882d5c6a1aa240b2672dce0ffb03360abcaca5',64),(639,'\n\"Debugging is twice as hard as writing the code in the first place.\n Therefore, if you write the code as cleverly as possible, you are,\n by definition, not smart enough to debug it.\"\n -- Brian Kernighan','9d323717c1d5f918d8b0267c157186d6e6b64ec9',64),(640,'\n\"An effective way to deal with predators is to taste terrible.\"','9d323717c1d5f918d8b0267c157186d6e6b64ec9',43346),(641,'\n\"It would now be technically possible to unify the world,\n abolish war and poverty altogether, if men desired their own\n happiness more than the misery of their enemies.\"\n -- Bertrand Russel','9f9af029585ba014e07cd3910ca976cf56160616',45883),(642,'\n\"Too much knowledge can hold you back.  Ignorance on the other hand, now\nthat was something that could get you to the finish line.\"\n- Mark Will-Weber','9f9af029585ba014e07cd3910ca976cf56160616',35952),(643,'\n\"If god created us in his image we have certainly returned the\n compliment.\"\n -- Voltaire','9ffd1ae121c4f26fe7f0c45ecdc85fa6ac245bf0',43599),(644,'\n\"Christianity makes suffering contagious.\"\n -- Nietzsche','9ffd1ae121c4f26fe7f0c45ecdc85fa6ac245bf0',35952),(645,'\nPeter\'s Principle: In every hierarchy, each employee tends to \nrise to the level of his incompetence.','a02b857f2eff73e8e188f35529dd91f8144b23b9',45881),(646,'\n\"It\'s not worth doing something unless someone, somewhere, would \n much rather you weren\'t doing it.\"\n -- Terry Pratchett','a02b857f2eff73e8e188f35529dd91f8144b23b9',43080),(647,'\n\"Irrationally held truths may be more harmful than reasoned\n errors.\"\n -- Thomas Huxley','a0d04378f37973ffa3b2aa8b3e27a3f0a98de06d',45090),(648,'\n\"You can get more with a kind word and a gun than you can with a \n kind word alone.\" -- Al Capone (1899-1947)','a0d04378f37973ffa3b2aa8b3e27a3f0a98de06d',39809),(649,'\n\"It is dangerous to be right in matters on which the\n established authorities are wrong.\"\n -- Voltaire','a165fbd61c277745f187eaac7182d9c05d0d1171',35658),(650,'\n\"Comedy is nothing more than tragedy deferred.\"\n -- Pico Iyer, Time','a165fbd61c277745f187eaac7182d9c05d0d1171',45883),(651,'\n\"We don\'t make mistakes, we just have happy little accidents.\"\n-- Bob Ross, \"The Joy of Painting\" ','a1773d62a609dd09e98ea1aebeddbd949b78bf83',36879),(652,'\n\"Your biggest challenge isn\'t someone else.  It\'s the ache in your lungs\nand the burning in your legs, and the voice inside you that yells\n\'CAN\'T\", but you don\'t listen.  You just push harder.  And then you hear\nthe voice whisper \'can\'.  And you discover that the person you thought\nyou were is no match for the one you really are.\"\n- Unknown','a1773d62a609dd09e98ea1aebeddbd949b78bf83',35941),(653,'\n\"The same people that wrote the bible thought the world was\n flat.\"\n -- Unknown - (disputed)','a5133248b1b55f7b0f0f989caafe254d9c16b6a7',36879),(654,'\n\"To sit alone with my conscience will be judgment enough for me.\"\n -- Charles William Stubbs','a5133248b1b55f7b0f0f989caafe254d9c16b6a7',45253),(655,'\n\"You will get through the tired times, don\'t give up. There is lots of\ntime.  Walk and in a while you will be running again.\"\n- Rolly Portelance','a609bb8ab05a0d13db9eb1d0d3b1383d1703c17d',43346),(656,'\n\"Asswhole = a complete ass\" -- John McTaggart in bpot','a609bb8ab05a0d13db9eb1d0d3b1383d1703c17d',35941),(657,'\n\"I have not failed. I\'ve just found 10,000 ways that won\'t work.\"\n -- Thomas Alva Edison (1847-1931)','a84c9aa070f9d126532293b8687d2ff3966060f0',45561),(658,'\n\"Beware of computer programmers that carry screwdrivers.\"\n -- Leonard Brandwein.','a84c9aa070f9d126532293b8687d2ff3966060f0',39809),(659,'\n\"Hanlon\'s Razor: Never attribute to malice that which can be \n adequately explained by stupidity.\"','a93c168323147d1135503939396cac628dc194c5',45449),(660,'\n\"Man is the best computer we can put aboard a spacecraft... and \n the only one that can be mass produced with unskilled labor.\"\n -- Wernher von Braun ','a93c168323147d1135503939396cac628dc194c5',45253),(661,'\n\"Peace is over rated. Any slave can have peace. Just pick the\n cotton.\"\n -- TheSong','abf749051d8b000946c71a2e216e55eeb49cf414',39809),(662,'\n\"Isn\'t it enough to see that a garden is beautiful without\n having to believe that there are fairies at the bottom of it\n too?\"\n -- Douglas Adams','abf749051d8b000946c71a2e216e55eeb49cf414',44281),(663,'\n\"You will get through the tired times, don\'t give up. There is lots of\ntime.  Walk and in a while you will be running again.\"\n- Rolly Portelance','acfdd18ea7f4a2ba74132ba977dc207204142994',64),(664,'\n\"Mother-in-law = A woman who destroys her son-in-law\'s peace of \n mind by giving him a piece of hers.\" -- Anonymous.','acfdd18ea7f4a2ba74132ba977dc207204142994',64),(665,'\n\"Friends applaud, the Comedy is over.\" \n -- Ludwig von Beethoven, dying words','ae5ffa6599c837509139132ef41c7856f33a50f7',44403),(666,'\n\"Real stupidity beats artificial intelligence every time.\"\n -- Terry Pratchett (Hogfather) ','ae5ffa6599c837509139132ef41c7856f33a50f7',39809),(667,'\n\"Mother-in-law = A woman who destroys her son-in-law\'s peace of \n mind by giving him a piece of hers.\" -- Anonymous.','af06318c33c8e41c70083ee23dbe19426f1f9c5b',32929),(668,'\n\"Sometimes, the best answer is a more interesting question\"\n -- Terry Pratchett ','af06318c33c8e41c70083ee23dbe19426f1f9c5b',45883),(669,'\n\"Humor is just another defense against the universe.\"\n -- Mel Brooks (1926- )','af53d4aa0b9131f18f84130767ee5b1dcbcb63be',35658),(670,'\n\"Cholesterol is your natural defence against excessive \n circulation of blood, which can carry venoms, poisons and other \n toxins around your body.\" -- Michael Warner, in bpot','af53d4aa0b9131f18f84130767ee5b1dcbcb63be',44281),(671,'\n\"Ask people why they have deer heads on their walls and they \n tell you it\'s because they\'re such beautiful animals. I think \n my wife is beautiful, but I only have photographs of her on the \n wall.\" -- George Carlin','b00168585f7b81b68f0ef02ffa919c710fb6f592',32929),(672,'\n\"I don\'t believe in the after life, although I am bringing a\n change of underwear.\" -- Woody Allen.','b00168585f7b81b68f0ef02ffa919c710fb6f592',35941),(673,'\n\"Tooth decay was a perennial national problem that meant a\n mouthful of silver for patients, and for dentists a pocketful\n of gold.\" -- Claudia Wallis ','b0c68924acc44f1f1ed598a8b2b2d4568b02dcfc',45090),(674,'\n\"As soon as we started programming, we found to our surprise\n that it wasn\'t as easy to get programs right as we had thought.\n Debugging had to be discovered. I can remember the exact\n instant when I realized that a large part of my life from then\n on was going to be spent in finding mistakes in my own\n programs.\" -- Maurice Wilkes discovers debugging, 1949','b0c68924acc44f1f1ed598a8b2b2d4568b02dcfc',31909),(675,'\n\"They laughed when I said I\'d be a comedian. They aren\'t \n laughing now.\"','b4ef7df17d3dc74720cd2a8fe98a173f9576d007',35941),(676,'\n\"Why do grandparents and grandchildren get along so well?  They \n have the same enemy -- the mother.\" -- Claudette Colbert.','b4ef7df17d3dc74720cd2a8fe98a173f9576d007',45883),(677,'\nClarke\'s Third Law: Any sufficiently advanced technology is \nindistinguishable from magic.','b6e2efd8ffb991dd3ea069b7b9286d5e31f97b36',35950),(678,'\n\"Real stupidity beats artificial intelligence every time.\"\n -- Terry Pratchett (Hogfather) ','b6e2efd8ffb991dd3ea069b7b9286d5e31f97b36',44403),(679,'\n\"If I can see it, I can run to it.\"\n- Randi Bromka Young','b6e7a22c25e9e7146913841b0995288c688f9bf8',45883),(680,'\n\"Nobody should ever run a race where they are lapped by the sun.\"\n- friend of Alex Swenson, referring to 100 mile races','b6e7a22c25e9e7146913841b0995288c688f9bf8',43080),(681,'\n\"If you were plowing a field, which would you rather use? Two \n strong oxen or 1024 chickens?\"\n -- Seymour Cray (1925-1996), father of supercomputing','b70706fdb0027063c33c00f7ce3e040221dd70bb',44127),(682,'\n\"The establishment of Christianity arrested the normal\n development of the physical sciences for over fifteen hundred\n years.\"\n -- Andrew Dickson White','b70706fdb0027063c33c00f7ce3e040221dd70bb',31909),(683,'\n\"Free from desire, you realize the mystery. Caught in desire,\n you see only the manifestations.\"\n -- Tao Te Ching','b741f2520f68d7b8abfecea2d88015fc823ef8bb',35658),(684,'\n\"This country, with its institutions, belongs to the people who\n inhabit it. Whenever they shall grow weary of the existing\n government, they can exercise their constitutional right of\n amending it, or exercise their revolutionary right to overthrow\n it.\"\n -- Abraham Lincoln','b741f2520f68d7b8abfecea2d88015fc823ef8bb',35658),(685,'\n\"Early to rise, Early to bed, Makes a man healthy but socially \n dead.\" -- The Warner Brothers (Animaniacs)','ba30fd97b4127db56e9f4d3d9c030d71646fd2e7',45090),(686,'\n\"Reality is that which, when you stop believing in it, doesn\'t \ngo away.\" -- Philip K. Dick.','ba30fd97b4127db56e9f4d3d9c030d71646fd2e7',44127),(687,'\n\"Only those who will risk going too far can possibly find out how far\nthey can go.\"\n- T.S. Eliot','ba613d1fc0d9300175611e31cca7cf9f525056cb',39809),(688,'\n\"So I rang up a local building firm, I said \'I want a skip outside\n my house.\' He said \'I\'m not stopping you.\'\" -- Tommy Cooper','ba613d1fc0d9300175611e31cca7cf9f525056cb',45253),(689,'\n\"Man is the religious animal. He is the only religious animal.\n He is the only animal that has the True Religion, several of\n them. He is the only animal that loves his neighbor as himself\n and cuts his throat, if his theology isn\'t straight. He has\n made a graveyard of the globe in trying his honest best to\n smooth his brother\'s path to happiness and heaven.\"\n -- Mark Twain','baab34018148392463ef4c49b5a924409cf5f7b0',36879),(690,'\n\"None are more hopelessly enslaved than those who falsely\n believe they are free.\"\n -- Johann Wolfgang von Goethe','baab34018148392463ef4c49b5a924409cf5f7b0',39809),(691,'\n\"The problem with people who have no vices is that \n generally you can be pretty sure they\'re going to \n have some pretty annoying virtues.\"          \n -- Elizabeth Taylor','bbcbb1e844266f4abdfc29b3d8a64628607fa47e',35658),(692,'\n\"Nothing exists except atoms and empty space; everything else\n is opinion.\"\n -- Democritus','bbcbb1e844266f4abdfc29b3d8a64628607fa47e',43348),(693,'\n\"The degree of one\'s emotion varies inversely with one\'s\n knowledge of the facts. The less you know, the hotter you get.\"\n -- Bertrand Russel','bc15c774dca4499ea6fb42da7d216ca54f8c697e',31909),(694,'\n\"Minsky\'s Second Law: Don\'t just do something. Stand there.\"\n-- Marvin Minsky','bc15c774dca4499ea6fb42da7d216ca54f8c697e',35941),(695,'\n\"Christian is a VERB not a noun.\"\n -- Meria Heller','bc62305b6cff49d43aed5f6550716c89890a3ccc',33738),(696,'\n\"The use of COBOL cripples the mind; its teaching should, \n therefore, be regarded as a criminal offense.\" \n -- Edsger Dijkstra ','bc62305b6cff49d43aed5f6550716c89890a3ccc',36879),(697,'\n\"Nothing beats experience.\"\n- Unknown','be4d979ef9808e41a6adf3bbefc4331248e88604',36757),(698,'\n\"I am sufficiently proud of my knowing something to be modest\n about my not knowing everything.\"\n -- Vladimir Nabokov','be4d979ef9808e41a6adf3bbefc4331248e88604',31913),(699,'\n\"The number of miles I have run since I was a toddler would have\ntaken me around the world several times, and I still cannot define\nprecisely my joy in running.  There is no sacrifice in it.  I lead\nwhat I regard a normal life.  In my case, I thoroughly enjoy\nrunning 100-odd miles a week.  If I didn\'t I wouldn\'t do it.  Who\ncan define happiness? To some, happiness is a warm puppy or a glass\nof cold beer.  To me, happiness is running in the hills with my\nmates around me.\" \n- Ron Clarke','c0ba17c23a26ff8c314478bc69f30963a6e4a754',45253),(700,'\n\"If quantum physics doesn\'t confuse you then you don\'t \n understand it.\" -- Niels Bohr  ','c0ba17c23a26ff8c314478bc69f30963a6e4a754',43080),(701,'\n\"The more I study religions the more I am convinced that man\n never worshipped anything but himself.\"\n -- Sir R. F. Burton','c1a38b8a671f58b20d4079b68d6533216db2a364',32929),(702,'\n\"Everything secret degenerates, even the administration of \n justice.\" -- Lord Acton','c1a38b8a671f58b20d4079b68d6533216db2a364',45449),(703,'\n\"Do, or do not. There is no \'try\'.\"\n -- Yoda (\'The Empire Strikes Back\')','c28097ad29ab61bfec58d9b4de53bcdec687872e',45090),(704,'\n\"The difference between \'involvement\' and \'commitment\' is like an \n eggs-and-ham breakfast: the chicken was \'involved\' - the pig was \n \'committed\'.\" -- unknown','c28097ad29ab61bfec58d9b4de53bcdec687872e',45561),(705,'\n\"Just drive down that road, until you get blown up.\"\n -- General George Patton, reconnaissance troops','c30749cf5bc74c7c3a7e5c8411512825e95333a8',43599),(706,'\n\"Let him who takes the Plunge remember to return it by Tuesday.\"','c30749cf5bc74c7c3a7e5c8411512825e95333a8',36879),(707,'\n\"MOST things in moderation\"\n- Unknown','c415505dca69be631ca5d391b3ccd2b44b52d017',35950),(708,'\n\"The years of peak mental activity are undoubtedly between \nthe ages of four and eighteen.  At four we know all the \nquestions, at eighteen all the answers.\" -- unknown','c415505dca69be631ca5d391b3ccd2b44b52d017',35658),(709,'\n\"It is unbecoming for young men to utter maxims.\"\n -- Aristotle (384-322 B.C.)','c439c60b7bf00fc6d80b76312309f8dc6107f635',44127),(710,'\n\"The use of anthropomorphic terminology when dealing with \n computing systems is a symptom of professional immaturity.\"\n -- Edsger Dijkstra','c439c60b7bf00fc6d80b76312309f8dc6107f635',33738),(711,'\n\"Three o\'clock is always too late or too early for anything you \n want to do.\" -- Jean-Paul Sartre (1905-1980)','c829eb96cef056a9003d7ab56ed6072e99089985',44127),(712,'\n\"One-tenth of the folks run the world. One-tenth watch them run\n it, and the other eighty percent don\'t know what the hell\'s\n going on.\"\n -- Jake Simmons','c829eb96cef056a9003d7ab56ed6072e99089985',44281),(713,'\n\"It\'s easy to imagine how you will act when things go according to plan,\nthat\'s why you must always prepare yourself for what you will do when\nthey don\'t.\"\n- Unknown','c837307a9a2ad4d08ca61a4f1bd848ba3d6890fc',43599),(714,'\n\"Society in every state is a blessing, but government, even in\n its best stage, is but a necessary evil; in its worst stage, an\n intolerable one.\"\n -- Thomas Paine','c837307a9a2ad4d08ca61a4f1bd848ba3d6890fc',43346),(715,'\n\"Momma always said life was like a box of chocolates. You never\n know what you\'re gonna get.\" -- Forest Gump ','c9f13c16144065a9ebccb216f3ec832b33e1693c',45253),(716,'\n\"Religion is what keeps the poor from murdering the rich.\"\n -- Napoleon','c9f13c16144065a9ebccb216f3ec832b33e1693c',32929),(717,'\n\"Many a man will have the courage to die gallantly, but will\n not have the courage to say, or even to think, that the cause\n for which he is asked to 