nd to provide for it.\" -- Patrick Henry','300122350a32530a2c2103b46ed07eacdc82aff8',45883),(872,'\n\"Do you ever wake up in the middle of the night and just think to \n yourself, \'I am just full of hot gas?\'\"\n -- David Letterman to Rush Limbaugh','3219b5be78da72e80e0918d458b9ece3825a68e1',34631),(873,'\n\"Just go out there and simutaneously piss in your shorts, fart like a\nfoghorn and drink from your mud-caked bottle. While you\'re at it let\nsome liquid dribble down your chin onto your shirt, look up at the\nstarry night and laugh like a raving lunatic. Fook em all. You\'re doing\nwhat you love to do and no one can stop you.\"\n- Michael Musca, as told to Will Brown','3219b5be78da72e80e0918d458b9ece3825a68e1',36879),(874,'\n\"I do not feel obliged to believe that the same God who has\n endowed us with sense, reason, and intellect has intended us to\n forgo their use.\"\n -- Galileo Galilei','329a970dfa7f977b158a7450f283716d1b46ac73',44281),(875,'\n\"There is no sport in hate when all the rage is on one side.\"\n -- Percy B. Shelley','329a970dfa7f977b158a7450f283716d1b46ac73',39809),(876,'\n\"What difference does it make to the dead, the orphans, and the\n homeless, whether the mad destruction is wrought under the name\n of totalitarianism or the holy name of liberty and democracy?\"\n -- Mohandas Gandhi','329dc1daf9fb9d5e75d687dd9e0740e1c72796c3',64),(877,'\n\"I prayed for twenty years but received no answer until I\n prayed with my legs.\"\n -- Frederick Douglass, escaped slave','329dc1daf9fb9d5e75d687dd9e0740e1c72796c3',39809),(878,'\n\"I saw a human skull the other day. There was an inscription\n below it: \'Look long and hard at me, for I was once as you are\n and you will soon be as I am.\'\"\n -- Unknown','3352d0d8278c176fa61d82326d7e51dabd2a032e',45883),(879,'\nRule Of Accuracy: When working toward the solution of a problem \nit always helps you to know the answer.','3352d0d8278c176fa61d82326d7e51dabd2a032e',45881),(880,'\n\"It is only those who have n