 stick it.\" -- Unknown','5a73b747ec74bdd97d5f05bf1ea48d0707e87e50',33738),(926,'\n\"A mathematician is a machine for turning coffee into theorems.\"\n -- Alfrd Rnyi (also attributed to Paul Erds)','5a9295d8fa430d03c34c8f7145f47117fb940f31',44281),(927,'\n\"Beware of bugs in the above code; I have only proved it correct,\n not tried it.\" -- Donald Knuth','5a9295d8fa430d03c34c8f7145f47117fb940f31',45883),(928,'\n\"So apparently Delphi now has both aristocrats [Counts, Cardinals]\n and dogs [Pointers, Setters] ... <g>\" \n -- Andrew Fiddian-Green in borland.public.delphi.nativeapi.win32','5c64cc5d7cc05237d16fa2873e58b5923c489b73',45090),(929,'\n\"Too much is better than not enough.\"\n- Kyle Rothweiler','5c64cc5d7cc05237d16fa2873e58b5923c489b73',33738),(930,'\n\"Just as a picture is drawn by an artist, surroundings are\n created by the activities of the mind.\"\n -- Buddha','5dd8b53aacfc461407333cffac2e4acce3337ebf',39809),(931,'\n\"Coming back to where you started is not the same as never \n leaving.\"\n -- Terry Pratchett (A Hat Full of Sky) ','5dd8b53aacfc461407333cffac2e4acce3337ebf',64),(932,'\n\"Many people, meeting Aziraphale for the first time, formed three \n impressions: that he was English, that he was intelligent, and that\n he was gayer than a treeful of monkeys on nitrous oxide.\"\n -- Terry Pratchett (Good Omens) ','5e5ad0b76c7633737a8d81700681204e0167c0d9',45090),(933,'\n\"ARRRGH -- what in God\'s name ever possessed me to think this would be a\ngood thing to do?\"\n- Charles N. Steele','5e5ad0b76c7633737a8d81700681204e0167c0d9',31913),(934,'\n\"To date, despite the efforts of millions of true believers to\n support this myth, there is no more evidence for the\n Judeo-Christian god than any of the gods on Mount Olympus.\"\n -- Joseph Daleiden','5e63673cbc075e2d21cef6bde4c591c263380bee',36879),(935,'\n\"You can get more with a kind word and a gun than you can with a \n kind word alone.\" -- Al Capone (1899-1947)','5e63673cbc075e2d21cef6bde4c591c263380b