ual hardware. \n Hardware has limitations, software doesn\'t. It\'s a real shame that \n Turing machines are so poor at I/O.\"','6643521711328a1e282daf5a5da43970eb11a089',43080),(948,'\n\"Every day I get up and look through the Forbes list of the \n richest people in America. If I\'m not there, I go to work.\"\n -- Robert Orben','668f37d8c8de8ceafa1092495a78aaaa0efef934',36879),(949,'\n\"That is the saving grace of humor, if you fail no one is laughing \n at you.\" -- A. Whitney Brown','668f37d8c8de8ceafa1092495a78aaaa0efef934',45561),(950,'\n\"Adversity introduces a man to himself.\"\n- Unknown','68b7933743e4841afc42c7b7eb5b4974a1070228',45561),(951,'\n\"Well done is better than well said.\" \n -- Benjamin Franklin (1706-1790)','68b7933743e4841afc42c7b7eb5b4974a1070228',36757),(952,'\n\"If you gaze long into an abyss, the abyss will gaze back into \n you.\" -- Friedrich Nietzsche (1844-1900)','6c0ac76ca9fe1af889558d11fd9a75e1fb9a0b86',44403),(953,'\n\"PHP is a minor evil perpetrated and created by incompetent\n amateurs, whereas Perl is a great and insidious evil, perpetrated\n by skilled but perverted professionals.\" -- Jon Ribbens','6c0ac76ca9fe1af889558d11fd9a75e1fb9a0b86',44944),(954,'\n\"In politics, stupidity is not a handicap.\"\n -- Napoleon','6c4c04be8f82a4e053bde03dd716d59c841cfda9',45883),(955,'\n\"About the use of language: it is impossible to sharpen a pencil \n with a blunt axe. It is equally vain to try to do it with ten \n blunt axes instead.\" -- Edsger W. Dijkstra','6c4c04be8f82a4e053bde03dd716d59c841cfda9',43599),(956,'\n\"Just drive down that road, until you get blown up.\"\n -- General George Patton, reconnaissance troops','6cc71d91778fcdda0eb8709e9348240b251afe5e',35950),(957,'\n\"Acceptance without proof is the fundamental characteristic of\n Western religion, rejection without proof is the fundamental\n characteristic of Western science.\"\n -- Gary Zukav','6cc71d91778fcdda0eb8709e9348240b251afe5e',45253),(958,'\n\"Multitasking /adj./ 3 PCs