l and see two deer going:\n\'What the hell is he doing?\' On a track, I feel like a hamster.\"\n- Robin Williams, film star/comic/runner','7110e0d3f236986f20f4297a48a536d8fac5c411',64),(970,'\n\"Anyone who has two shirts when someone has none is not a\n Christian.\"\n -- Lenny Bruce','75988f5ac0575a8d3636291a136cf92664152ed3',45090),(971,'\n\"Every nation has its war party. It is not the party of democracy.\n It is the party of autocracy. It seeks to dominate absolutely.\"\n -- Senator Robert M. La Follette','75988f5ac0575a8d3636291a136cf92664152ed3',35950),(972,'\n\"Written laws are like spider\'s webs; they will catch, it is\n true, the weak and poor, but would be torn in pieces by the\n rich and powerful.\"\n -- Anacharsis','77873674e5df0c6b070f8dd195293533838ca7a1',39809),(973,'\n\"The longest hill must end in a valley.\"\n- Henry C. Beeching','77873674e5df0c6b070f8dd195293533838ca7a1',45253),(974,'\n\"Programming is like sex: one mistake and you have to support it \n for the rest of your life.\" -- Michael Sinz','77c8184f671aa0397dd897541ed5ec0a8be0380b',44944),(975,'\n\"When I die I\'m going to leave my body to science fiction.\"\n -- Steven Wright.','77c8184f671aa0397dd897541ed5ec0a8be0380b',35950),(976,'\n\"Humor is also a way of saying something serious.\"\n -- T. S. Eliot (1888 - 1965)','77d67ab1e3d05296a7131e197d9d3767fb900bad',31913),(977,'\n\"Democracy used to be a good thing, but now it has gotten into\n the wrong hands.\"\n -- Jessie Helms','77d67ab1e3d05296a7131e197d9d3767fb900bad',35950),(978,'\n\"Every program has (at least) two purposes: the one for which\n it was written, and another for which it wasn\'t.\" \n -- Alan J. Perlis','784ef0059227d57909c9d81632b89915adc03c22',39809),(979,'\n\"If you gaze long into an abyss, the abyss will gaze back into \n you.\" -- Friedrich Nietzsche (1844-1900)','784ef0059227d57909c9d81632b89915adc03c22',45883),(980,'\n\"I had as many doubts as anyone else. Standing on the starting line,\nwe\'re all cowards.\"\n- Alberto Salazar','7a698699a9229b278afa72593214582d739b9bad',44281),(981,'\nGreen\'s Law Of Debate: Anything is possible if you don\'t know \nwhat you\'re talking about.','7a698699a9229b278afa72593214582d739b9bad',45253),(982,'\n\"Richard Nixon is a no good, lying bastard. He can lie out of \n both sides of his mouth at the same time, and if he ever caught \n himself telling the truth, he\'d lie just to keep his hand in.\"\n -- Harry S. Truman.','7a95563490d87e3621966d553f06078acb822585',34631),(983,'\n\"And the users exclaimed with a laugh and a taunt: \'It\'s just what \n we asked for but not what we want.\'\"','7a95563490d87e3621966d553f06078acb822585',64),(984,'\n\"It is better to die on your feet than to live on your knees.\"\n- Dolores Ibarruri','7a9ca14dcab2ffdcfc790dac3afe5ba5be292823',45090),(985,'\n\"Vincit qui patitur: he conquers, who endures\"\n- Percy Cerutty','7a9ca14dcab2ffdcfc790dac3afe5ba5be292823',45090),(986,'\n\"Foreign aid is when the poor people of a rich country give\n money to the rich people of a poor country.\"\n -- Gary Hart, BC Comic Strip','7c33876368ece2e1b804a2d191df26be063e42d9',31913),(987,'\n\"Man is the religious animal. He is the only religious animal.\n He is the only animal that has the True Religion, several of\n them. He is the only animal that loves his neighbor as himself\n and cuts his throat, if his theology isn\'t straight. He has\n made a graveyard of the globe in trying his honest best to\n smooth his brother\'s path to happiness and heaven.\"\n -- Mark Twain','7c33876368ece2e1b804a2d191df26be063e42d9',45883),(988,'\n\"Quarrels would not last long if only one side was wrong.\"\n -- Francois Duc de la Rochefoucauld','7ec24305aabd039523e863b97fc436f600b30b42',45883),(989,'\n\"People who think they know everything greatly annoy those of\n us who do.\"','7ec24305aabd039523e863b97fc436f600b30b42',32929),(990,'\n\"Adopt the pace of nature; her secret is patience\"\n- Ralph Waldo Emerson','7ed28031fea3428609396624c50f0db45cfe70