015,'\n\"A great many people think they are thinking when they are\n merely rearranging their prejudices.\" -- William James','8a1beaee63fed318ca54d4f7d18cee4081c68a74',45561),(1016,'\n\"I object to violence because when it appears to do good, the\n good is only temporary; the evil it does is permanent.\"\n -- Mohandas Gandhi','8a1beaee63fed318ca54d4f7d18cee4081c68a74',44944),(1017,'\n\"A lot of these people who keep a gun at home for safety are the\n same ones who refuse to wear a seat belt.\" -- George Carlin','8a279e5c5354af5ae7810101fd16c35a749451cc',43080),(1018,'\n\"I am ready to meet my Maker. Whether my Maker is prepared for \n the great ordeal of meeting me is another matter.\"\n -- Sir Winston Churchill (1874-1965)','8a279e5c5354af5ae7810101fd16c35a749451cc',35658),(1019,'\n\"People only see what they are prepared to see.\"\n -- Ralph Waldo Emerson','8de23aaaec61b2cba81bd155ea66322737dea7d8',35952),(1020,'\n\"Some problems are so complex that you have to be highly\n intelligent and well informed just to be undecided about them.\"\n -- Laurence J. Peter','8de23aaaec61b2cba81bd155ea66322737dea7d8',32929),(1021,'\n\"Science is what people understand well enough to explain to a \n computer. All else is art.\" -- Donald Knuth','8f98b68c4d83cf50f7c863fe577a2c5e38b43236',36879),(1022,'\n\"All my humor is based upon destruction and despair. If the\n whole world were tranquil, without disease and violence, I\'d be\n standing on the breadline right in back of J. Edgar Hoover.\"\n -- Lenny Bruce','8f98b68c4d83cf50f7c863fe577a2c5e38b43236',32929),(1023,'\n\"Why am I so good at playing bitches? I think it\'s because \n I\'m not a bitch. Maybe that\'s why Miss Crawford always plays \n ladies.\" -- Bette Davis','904f2cc1c3677bb35876e91f4716341c06769cc6',35950),(1024,'\n\"Far away, there in the sunshine, are my highest aspirations. I may\nnot reach them, but I can look up and see their beauty, believe in\nthem, and try to follow where they may lead.\"\n- Louisa May Alcott