te','945335a6aaa02e8642218d06ddbb9073cb1e3d69',33738),(1035,'\n\"One-tenth of the folks run the world. One-tenth watch them run\n it, and the other eighty percent don\'t know what the hell\'s\n going on.\"\n -- Jake Simmons','9741f79aca77af5b5793817bd36737360dcb0a29',35658),(1036,'\n\"Happiness is your dentist telling you it won\'t hurt and then\n having him catch his hand in the drill.\" -- Johnny Carson','9741f79aca77af5b5793817bd36737360dcb0a29',44127),(1037,'\n\"Outside of a dog, a book is man\'s best friend. Inside of a dog, \n it\'s too dark to read.\" -- Groucho Marx','985d6ac20b189c12b3cad0bd3af82450e25024c8',35658),(1038,'\n\"Ignorance is always afraid of change.\"\n -- Jawaharlal Nehru','985d6ac20b189c12b3cad0bd3af82450e25024c8',34631),(1039,'\n\"Do you love your Creator? Love your fellow beings first.\"\n -- Prophet Muhammad','9a3e61b6bcc8abec08f195526c3132d5a4a98cc0',44127),(1040,'\nLynch\'s Law: When the going gets tough, everyone leaves.','9a3e61b6bcc8abec08f195526c3132d5a4a98cc0',39809),(1041,'\n\"My opinions might have changed, but not the fact that I am \n right.\"','9c676e003b8932ac49d4d3a18467c0b59e3e3fb6',45881),(1042,'\n\"It\'s not that I\'m afraid to die, I just don\'t want to be there\n when it happens.\" -- Woody Allen, From \'Death\' 1975.','9c676e003b8932ac49d4d3a18467c0b59e3e3fb6',45881),(1043,'\n\"Genius may have its limitations, but stupidity is not thus \n handicapped.\" -- Elbert Hubbard','9d4650d4e8944e0ebf5c32dd9706abc74343e3a8',35658),(1044,'\n\"I\'m sick of the pain!\"  Well, now, that\'s a shame\nBut you\'re strong, you\'re healthy, and bright.\nSo you\'ve had a bad stretch and you\'re ready to retch,\nShoulders back, move forward, and fight.\nIt\'s the plugging away that will win you the day,\nNow don\'t be a loser my friend!\nSo the goal isn\'t near, why advance to the rear.\nAll struggles eventually end.','9d4650d4e8944e0ebf5c32dd9706abc74343e3a8',36879),(1045,'\n\"War: first, one hopes to win; then one expects the enemy to\n lose; then, one is satisfied that he too is suffering; in the\n end, one is surprised that everyone has lost.\"\n -- Karl Kraus','9d6ad3cc125c3c4d07b17f6aac6ff9ebf9a338c8',45881),(1046,'\n\"They never open their mouths without subtracting from the \n sum of human knowledge.\" -- Thomas Brackett Reed','9d6ad3cc125c3c4d07b17f6aac6ff9ebf9a338c8',33738),(1047,'\n\"The most amazing achievement of the computer software industry\n is its continuing cancellation of the steady and staggering\n gains made by the computer hardware industry.\" -- Henry Petroski','9d94ce174298e08402d1271df4e20f4cb50f7340',31913),(1048,'\n\"A committee is a group of people who individually can do nothing\n but together can decide that nothing can be done.\" -- Fred Allen.','9d94ce174298e08402d1271df4e20f4cb50f7340',35658),(1049,'\n\"Only a fool tests the depth of the water with both feet.\"\n -- African proverb','9ed4f29f8b6857ffe123d6e41d5c699edc0d62a1',42471),(1050,'\n\"No one rules if no one obeys.\"\n -- <TaoDo>','9ed4f29f8b6857ffe123d6e41d5c699edc0d62a1',36757),(1051,'\n\"But in our enthusiasm, we could not resist a radical overhaul\n of the system, in which all of its major weaknesses have been\n exposed, analyzed, and replaced with new weaknesses.\" \n -- Bruce Leverett, Register Allocation in Optimizing Compilers','9ee0df7c8a647ff45e95abfac028ef5651be0ac5',44127),(1052,'\n\"Organizations which design systems are constrained to produce\n designs which are copies of the communication structures of these\n organizations. (For example, if you have four groups working on\n a compiler, you\'ll get a 4-pass compiler)\" -- Conway\'s Law','9ee0df7c8a647ff45e95abfac028ef5651be0ac5',45561),(1053,'\n\"We do have a zeal for laughter in most situations, give or\n take a dentist.\" -- Joseph Heller','9f682df245668969bbcd5395bdc2882591eeecde',34631),(1054,'\n\"Hain\'t we got all the fools in town on our side? And ain\'t\n that a big enough majority in any town?\"\n -- Mark Twain','9f682df245668969bbcd5395