easure in life is doing what people say you cannot do.\"\n- Bagehot','1c710b1ca4bc921803cf096a5b2bb48d55947e4d',31909),(1217,'\n\"Why don\'t they make the whole plane out of that black box stuff.\"\n -- Steven Wright.','1cf9ade625b515864393eacfeb943eaeb0e52814',36879),(1218,'\n\"It is time I stepped aside for a less experienced and less able \n man.\" -- Professor Scott Elledge on his retirement from Cornell','1cf9ade625b515864393eacfeb943eaeb0e52814',43346),(1219,'\n\"There is a country in Europe where multiple-choice tests are \n illegal.\" -- Sigfried Hulzer','1dd4b9d8e432a99a58165a17dd67e5bd8791272e',45253),(1220,'\n\"If we don\'t believe in freedom of expression for people we\n despise, we don\'t believe in it at all.\"\n -- Noam Chomsky','1dd4b9d8e432a99a58165a17dd67e5bd8791272e',34631),(1221,'\n\"Every war when it comes, or before it comes, is represented\n not as a war but as an act of self-defense against a homicidal\n maniac.\"\n -- George Orwell','23b23be9da2519c88f11c084310bcc0bf14417f8',45090),(1222,'\n\"Each nation knowing it has the only true religion and the only\n sane system of government, each despising all the others, each\n an ass and not suspecting it.\"\n -- Mark Twain','23b23be9da2519c88f11c084310bcc0bf14417f8',35950),(1223,'\n\"Liberty and democracy become unholy when their hands are dyed\n red with innocent blood.\" -- Mahatma Gandhi','2456caf1512365bb4622c2331d4dd695abb7652b',33738),(1224,'\n\"The President has kept all of the promises he intended to keep.\"\n -- Clinton aide George Stephanopolous speaking on Larry \n    King Live','2456caf1512365bb4622c2331d4dd695abb7652b',45253),(1225,'\n\"The radical invents the views. When he has worn them out, the\n conservative adopts them.\"\n -- Mark Twain','278e89d8c2da87688af1c1b00f468a10e7dbe61f',31909),(1226,'\n\"I have six locks on my door, all in a row. When I go out, I \n lock every other one. I figure no matter how long somebody \n stands there picking the locks, they are always locking three \n of them.\" -- George Carlin','278e89d8c2da87688af1c1b00f468a10e7dbe61f',44281),(1227,'\n\"A little inaccuracy sometimes saves a ton of explanation.\"\n -- H. H. Munro (Saki) (1870-1916)','27cfac7148112eaa048ea53bbeb10cacab631742',32929),(1228,'\nGoebel\'s Second Law Of Useless Difficulty: The fastest way to get \nsomething done is to determine that it isn\'t worth doing.','27cfac7148112eaa048ea53bbeb10cacab631742',43080),(1229,'\n\"If we continue to develop our technology without wisdom or\n prudence, our servant may prove to be our executioner.\"\n -- General Omar N. Bradley','2817850c98d05a2bfe8023ee026d996ef515a85d',35952),(1230,'\n\"You can know the name of a bird in all the languages of the \n world, but when you\'re finished, you\'ll know absolutely nothing\n whatever about the bird... So let\'s look at the bird and see\n what it\'s doing -- that\'s what counts. I learned very early \n the difference between knowing the name of something and knowing\n something.\" -- Richard Feynman','2817850c98d05a2bfe8023ee026d996ef515a85d',35950),(1231,'\n\"If you run hard, there\'s the pain -- and you\'ve got to work your way through\nthe pain ...  You know, lately it seems all you hear is \'Don\'t overdo it\' and\n\'Don\'t push yourself.\' Well, I think that\'s a lot of bull.  If you push the\nhuman body, it will respond.\"\n-Bob Clarke, NHL Hall of Famer','28903f610228f970292b06382eae94ae10efa9a0',44127),(1232,'\n\"They said I was the greatest pitcher they ever saw; I couldn\'t\n understand why they couldn\'t give me no justice.\"\n -- Satchel Paige','28903f610228f970292b06382eae94ae10efa9a0',45881),(1233,'\n\"News is what someone wants to suppress. Everything else is\n advertising.\"\n -- Ex-NBC news president Rubin Frank','298f93b1b0efeaf41f0ce468d29abfd252985869',64),(1234,'\n\"You have to stay in shape.  My grandmother, she started walking \n five miles a day when she was 60.  She\'s 97 today and we don\'t \n know where she is!\" -- Ellen DeGeneres.','298f93b1b