thing that no one ever knew before. \n But in poetry, it\'s the exact opposite.\"\n -- Paul Dirac (1902-1984)','4b14fe7493932c29c0d1b85a3ba120bd22079c3e',45561),(1279,'\n\"Wisdom is knowing what to do next. Virtue is doing it.\"\n -- David Starr Jordan','4c8596c838c9d498b000d5fab25d2c2ea657588e',45449),(1280,'\n\"Humor is always based on a modicum of truth. Have you ever heard \n a joke about a father-in-law?\" -- Dick Clark','4c8596c838c9d498b000d5fab25d2c2ea657588e',44944),(1281,'\n\"Some men, in order to prevent the supposed intentions of their\n adversaries, have committed the most enormous cruelties.\"\n -- Clearchus, in Xenophon','4c87e5e9fc1a564781c398618687a2f5cad0abb8',44127),(1282,'\n\"Gentlemen, you can\'t fight in here! This is the War Room!\"\n -- Dr. Strangelove','4c87e5e9fc1a564781c398618687a2f5cad0abb8',43080),(1283,'\n\"I don\'t approve of political jokes... I\'ve seen too many of them\n get elected.\" -- unknown','4cae599309683b04925ec1cb7d79dfab04709af8',45090),(1284,'\n\"You shall find out how salt is the taste of another man\'s\n bread, and how hard is the way up and down another man\'s\n stairs.\"\n -- Dante','4cae599309683b04925ec1cb7d79dfab04709af8',45090),(1285,'\n\"It is now possible for a flight attendant to get a pilot \n pregnant.\" -- Richard J. Ferris, president of United Airlines','4dcee7f85df40fc71dcad450a6cbc55190e1253b',35952),(1286,'\n\"Democracy is not an incident that happens overnight, nor a gift \n that America can give to the world. It is a culture which needs \n peace to evolve.\" -- Shirin Ebadi, Nobel Peace Laureate of Iran','4dcee7f85df40fc71dcad450a6cbc55190e1253b',35952),(1287,'\n\"Some think guts is sprinting at the end of a race. But guts is what got\nyou there to begin with. Guts start back in the hills with 6 miles to go\nand you\'re thinking of how you can get out of this race without anyone\nnoticing. Guts begin when you still have forty minutes of torture left\nand you\'re already hurting more than you ever remember.\"\n- George Sheehan','4de62d12209f2c3b18bc8a19eca399e914835762',31913),(1288,'\n\"A [pseudo]random number generator is much like sex: when it\'s \n good it\'s wonderful, and when it\'s bad it\'s still pretty good.\" \n -- G. Marsaglia ','4de62d12209f2c3b18bc8a19eca399e914835762',44403),(1289,'\n\"Always enjoy yourself.  Never give up.  Don\'t think of being tired.\nKeep on going until you cross the finish line.  Don\'t be upset if you\ndon\'t win.\"\n- Unknown','4f2706558a59b0c71f4a31a81345052fc8623919',31909),(1290,'\n\"Measuring programming progress by lines of code is like measuring\n aircraft building progress by weight.\" -- Bill Gates','4f2706558a59b0c71f4a31a81345052fc8623919',43348),(1291,'\n\"The years of peak mental activity are undoubtedly between \nthe ages of four and eighteen.  At four we know all the \nquestions, at eighteen all the answers.\" -- unknown','52342fa440fbbcdc12a30730096226018453ae15',64),(1292,'\n\"What a cruel thing is war: to separate and destroy families and \n friends, and mar the purest joys and happiness God has granted us \n in this world; to fill our hearts with hatred instead of love for \n our neighbors, and to devastate the fair face of this beautiful \n world.\" -- Robert E. Lee, letter to his wife, 1864','52342fa440fbbcdc12a30730096226018453ae15',45449),(1293,'\n\"Don\'t speak unless you can improve on the silence.\"\n -- Spanish proverb','53c53c5d2b630c0d912264bb9edf8cf6f0afa260',35941),(1294,'\n\"The Six Phases of a Project:\"\n   o Enthusiasm\n   o Disillusionment\n   o Panic\n   o Search for the Guilty\n   o Punishment of the Innocent\n   o Praise for non-participants\"','53c53c5d2b630c0d912264bb9edf8cf6f0afa260',33738),(1295,'\n\"If you believe in the existence of fairies at the bottom of\n the garden you are deemed fit for the bin. If you believe in\n parthenogenesis, ascension, transubstantiation and all the rest\n of it, you are deemed fit to govern the country.\"\n -- Jonathan Meades','540d3e47795cb7cf660d17fac99e2ad4296c26ca',45881),(1296,'\n\"We first fought... in the name of religion, then Communism, and \n now in the name of drugs and terrorism. Our excuses for global \n domination always change.\" -- Serj Tankian','540d3e47795cb7cf660d17fac99e2ad4296c26ca',45881),(1297,'\n\"I had as many doubts as anyone else. Standing on the starting line,\nwe\'re all cowards.\"\n- Alberto Salazar','581a8ed69cf5d505b989c438becd65e37c8de61e',44127),(1298,'\n\"You can\'t step twice into the same river.\"\n -- Heraclitus','581a8ed69cf5d505b989c438becd65e37c8de61e',39809),(1299,'\n\"You move from doing things to show other people you could, to\n where you do things to look into yourself, into your soul, and\n see who you are and what youre all about.\"\n- Scott Weber','5b5b3319a315a7bfac818b638ae5f0780fde9021',31909),(1300,'\n\"Respect the distance or it won\'t respect you.\"\n- Unknown','5b5b3319a315a7bfac818b638ae5f0780fde9021',45090),(1301,'\n\"I consider Christian theology to be one of the greatest\n disasters of the human race.\"\n -- Alfred North Whitehead','5c1dc07026ceafcb704bdff1375815f30a769a13',31909),(1302,'\n\"It\'s very hard in the beginning to understand that the whole\nidea is not to beat the other runners.  Eventually you learn that\nthe competition is against the little voice inside you that wants\nyou to quit.\"\n- George Sheehan','5c1dc07026ceafcb704bdff1375815f30a769a13',43080),(1303,'\n\"There must be more to life than having everything.\"\n -- Maurice Sendak','5d0fb669fb61cd51405bd09c1ac7e36a7407de8d',39809),(1304,'\n\"We will be known by the tracks we leave behind.\"\n -- Dakota proverb','5d0fb669fb61cd51405bd09c1ac7e36a7407de8d',45253),(1305,'\n\"We, on our side, are praying to Him to give us victory,\n because we believe we are right; but those on the other side\n pray to Him, too, for victory, believing they are right. What\n must He think of us?\"\n -- Abraham Lincoln','5dca477752fc50226595c6a93528eaf3297dbcf8',45881),(1306,'\n\"Hearing nuns\' confessions is 