s to thee.\"\n -- Zoroaster','70ac2ffcf11f24d59360e0d4cefb1816a96053a4',45090),(1328,'\n\"I was starting to hurt, but then I burped and took a crap and am feeling\nmuch better\"\n- Unknown, heard during the 1997 AR 50','70ac2ffcf11f24d59360e0d4cefb1816a96053a4',43348),(1329,'\n\"Anything that is too stupid to be spoken is sung.\"\n -- Voltaire (1694-1778)','72ab8108eff0514f059c30e2e277c37a9aaf1b04',43599),(1330,'\n\"Democracy is the process by which people choose the man who\'ll \n get the blame.\" -- Bertrand Russell','72ab8108eff0514f059c30e2e277c37a9aaf1b04',44281),(1331,'\n\"Where are we going, and why am I in this handbasket?\"\n -- Bumper Sticker','73fb9760f330bcf6d3b61d28a67ccc8ba37a7f8f',43346),(1332,'\n\"The most important single aspect of software development is to\n be clear about what you are trying to build.\" \n -- Bjarne Stroustrup','73fb9760f330bcf6d3b61d28a67ccc8ba37a7f8f',35941),(1333,'\n\"I didn\'t go out to fast, I just died too soon.\"\n- Unknown','74da6152f5b23ae319b48bec60aff34ee65862cc',34631),(1334,'\n\"Research is what I\'m doing when I don\'t know what I\'m doing.\"\n -- Wernher Von Braun (1912-1977)','74da6152f5b23ae319b48bec60aff34ee65862cc',31909),(1335,'\n\"The vast majority of mankind is trapped within perceptual\n prisons.\"\n -- Shawn Mikula','758a25f7dd163311b02efd5de19535312f7c1225',35950),(1336,'\n\"There are two ways to write error-free programs; only the third\n works.\" -- Alan J. Perlis','758a25f7dd163311b02efd5de19535312f7c1225',43599),(1337,'\n\"Some tortures are physical\n And some are mental,\n But the one that is both\n Is dental.\"\n -- Ogden Nash','75d2a5a3c528920d00425f29099eed114b9134e0',45881),(1338,'\n\"Black holes are where God divided by zero.\"\n    - Steven Wright','75d2a5a3c528920d00425f29099eed114b9134e0',39809),(1339,'\n\"It\'s not that I\'m afraid to die, I just don\'t want to be there\n when it happens.\" -- Woody Allen, From \'Death\' 1975.','77895c1f680568edb1fe3d4e386593e6f40679f6',35950),(1340,'\n\"Men have become the tools of their tools.\"\n -- Henry David Thoreau (1817-1862)','77895c1f680568edb1fe3d4e386593e6f40679f6',45561),(1341,'\nFlo Capp\'s Observation: The next best thing to doing something \nsmart is not doing something stupid.','7919ae519f96a6645a5640c381f954df58d2d2d2',43599),(1342,'\n\"There is another type of strength. It is being able to extend your\nenergy for a very long distance.\"\n- David LaPierre','7919ae519f96a6645a5640c381f954df58d2d2d2',43599),(1343,'\n\"... the designer of a new system must not only be the implementor\n and the first large-scale user; the designer should also write\n the first user manual. ... If I had not participated fully in \n all these activities, literally hundreds of improvements would\n never have been made, because I would never have thought of\n them or perceived why they were important.\" -- Donald Knuth','794bb3681babb52a3960b4b4802cb2941ec86aa5',45561),(1344,'\n\"In matters of conscience, the law of majority has no place.\"\n -- Mohandas Gandhi','794bb3681babb52a3960b4b4802cb2941ec86aa5',45090),(1345,'\n\"Why don\'t they make the whole plane out of that black box stuff.\"\n -- Steven Wright.','7fd2b74e8017425780436f5257d01e4ab14b9cc2',45449),(1346,'\n\"Military justice is to justice what military music is to music.\"\n -- Groucho Marx','7fd2b74e8017425780436f5257d01e4ab14b9cc2',35941),(1347,'\n\"Whatever you think you can do or believe you can do, begin it.\nAction has magic, grace and power in it.\"\n- Goethe','80cc9feae5756e54abd79a88f8a4e233160b5674',42471),(1348,'\n\"Object-oriented programming is a style of programming designed \n to teach students about stacks.\" -- Edsger Dijkstra','80cc9feae5756e54abd79a88f8a4e233160b5674',64),(1349,'\n\"An effective way to deal with predators is to taste terrible.\"','8157eff8389a499cc91e0a86a185f46ea99aa5d5',45561),(1350,'\n\"The hardest years in life are those between ten and seventy.\"\n -- Helen Hayes, age 83','8157eff8389a499cc91e0a86a185f46ea99aa5d5',43346),(1351,'\n\"A foolish consistency is the hobgoblin of little minds, adored\n by little statesmen and philosophers and divines.\"\n -- Ralph Waldo Emerson','81755a2845e39420c81902a3ce83dff1cfc782e7',45449),(1352,'\n\"I never advocated war except as a means of peace.\"\n -- Ulysses S. Grant','81755a2845e39420c81902a3ce83dff1cfc782e7',39809),(1353,'\n\"Most of you are familiar with the virtues of a programmer.\n There are three, of course: laziness, impatience, and hubris.\"\n -- Larry Wall','8290abc6c261e044710e7d616082ab51cb377262',31909),(1354,'\n\"Road sucks!\"\n- Skip & Tracey','8290abc6c261e044710e7d616082ab51cb377262',42471),(1355,'\n\"Being on the tightrope is living; everything else is waiting.\"\n -- Karl Wallenda','82a50612a57ad5c00b0df9bafbcd379d25c6fbda',33738),(1356,'\n\"... one of the main causes of the fall of the Roman Empire was \n that, lacking zero, they had no way to indicate successful \n termination of their C programs.\" -- Robert Firth','82a50612a57ad5c00b0df9bafbcd379d25c6fbda',31913),(1357,'\n\"When the rich think about the poor, they have poor ideas.\"\n -- Evita Peron ','83950160648e3b8fe394c1cd9633d79cad816c06',39809),(1358,'\n\"The victor will never be asked if he told the truth.\"\n -- Adolf Hitler','83950160648e3b8fe394c1cd9633d79cad816c06',45449),(1359,'\n\"You\'ll notice that Nancy Reagan never drinks water when Ronnie\n speaks.\" -- Robin Williams.','83a002e8ffbe10a8e5bfd289b565b247092a9b70',64),(1360,'\n\"Modern morality and manners suppress all natural instincts,\n keep people ignorant of the facts of nature and make them\n fighting drunk on bogey tales.\"\n -- Aleister Crowley','83a002e8ffbe10a8e5bfd289b565b247092a9b70',39809),(1361,'\nHubbard\'s Law: Don\'t take life too seriously; you won\'t get out \nof it alive.','84b0b577501b6c0162aea7c1353b300e66a9fe4a',44403),(1362,'\n\"The use of COBOL cripples the mind; its teaching should, \n therefore, be regarded as a criminal offense.\" \n -- Edsger Dijkstra ','84b0b577501b6c0162aea7c1353