ot harm anything,\n say and do things that make others happy.\"\n -- dreamslaughter','918fc64d3247435e25e80875ecaa5b39e3ed48c2',45561),(1395,'\n\"My occupation now, I suppose, is jail inmate.\"\n -- Unibomber Theodore Kaczynski, when asked in court what his \n    current profession was','918fc64d3247435e25e80875ecaa5b39e3ed48c2',45090),(1396,'\n\"The ink of the scholar is holier than the blood of the\n martyr.\"\n -- Prophet Muhammad','91eb375e8e71d9ce2f7cde8b0a757f66c94c998a',45881),(1397,'\n\"If the bone\'s not showin\', just keep goin\'!\"\n- Joan Risse at Angeles Crest, 9/95','91eb375e8e71d9ce2f7cde8b0a757f66c94c998a',35950),(1398,'\n\"He uses statistics as a drunken man uses lamp-posts... \n for support rather than illumination.\" \n -- Andrew Lang (1844-1912)','93f271ad5efd7ea64a800c9acfe0b34fc19f58e3',45449),(1399,'\n\"When did I realize I was God? Well, I was praying and I suddenly\n realized I was talking to myself.\"\n -- Peter O\'Toole.','93f271ad5efd7ea64a800c9acfe0b34fc19f58e3',31909),(1400,'\n\"If you ever drop your keys into a river of molten lava, let\n\'em go, because, man, they\'re gone.\"\n -- Jack Handey','961cc96ada94bed0d2ff9d76556e8651995d940f',35952),(1401,'\n\"The endurance athlete is the ultimate realist.\"\n- Marty Liquori','961cc96ada94bed0d2ff9d76556e8651995d940f',64),(1402,'\n\"The difference between pornography and erotica is lighting.\"\n -- Gloria Leonard','97e01b6f38ed3790a7fed91dda9b2f288222e77d',35950),(1403,'\n\"Education is a progressive discovery of our own ignorance.\"\n -- Will Durant','97e01b6f38ed3790a7fed91dda9b2f288222e77d',35950),(1404,'\n\"I remain convinced that obstinate addiction to ordinary language\n in our private thoughts is one of the main obstacles to progress\n in philosophy.\" -- Bertrand Russell','98079d38abe094b7ecaaf37b3519525df0abb891',44403),(1405,'\n\"Your talents are wasted as an engineer, Stan.  Your calling is\nelsewhere.\"\n- Alex Feldman\' AC97 report','98079d38abe094b7ecaaf37b3519525df0abb891',329