es his neighbor as himself\n and cuts his throat, if his theology isn\'t straight. He has\n made a graveyard of the globe in trying his honest best to\n smooth his brother\'s path to happiness and heaven.\"\n -- Mark Twain','ad1bf290f3ae791d4ca98700eafe4daf341b103c',45090),(1439,'\n\"The cardinal doctrine of a fanatic\'s creed is that his enemies\n are the enemies of God.\"\n -- Andrew Dickson White','ad2ad593b7a4db4d077dc9f94444092aad698ee9',45561),(1440,'\n\"Good code is short, simple, and symmetrical - the challenge\n is figuring out how to get there.\" -- Sean Parent','ad2ad593b7a4db4d077dc9f94444092aad698ee9',31913),(1441,'\n\"And the little screaming fact that sounds through all history:\n repression works only to strengthen and knit the repressed.\"\n -- John Steinbeck','ae694b0755cd5eed5886ec4d8e658bde9639331d',43080),(1442,'\n\"To the Honourable Member opposite I say, when he goes home \n tonight, may his mother run out from under the porch and bark at \n him\" -- John G. Diefenbaker','ae694b0755cd5eed5886ec4d8e658bde9639331d',35941),(1443,'\n\"If you have a procedure with 10 parameters, you probably \n missed some.\" -- Alan Perlis','aeaa8a872d9de96a7c8f7f1014fd6e4b1185f1d7',36757),(1444,'\n\"It is part of the general pattern of misguided policy that our\n country is now geared to an arms economy which was bred in an\n artificially induced psychosis of war hysteria and nurtured\n upon an incessant propaganda of fear.\"\n -- General Douglas MacArthur','aeaa8a872d9de96a7c8f7f1014fd6e4b1185f1d7',43080),(1445,'\n\"I never advocated war except as a means of peace.\"\n -- Ulysses S. Grant','af7166a5d6ddde19c3a7fd202d93ee963ea22132',45561),(1446,'\n\"I did say something along the lines of \'C makes it easy to\n shoot yourself in the foot; C++ makes it harder, but when you\n do, it blows your whole leg off.\'\" -- Bjarne Stroustrup','af7166a5d6ddde19c3a7fd202d93ee963ea22132',44403),(1447,'\n\"Imagine if every Thursday your shoes exploded if you tied them\n the usual way. This happens to us all the time with computers,\n and nobody thinks of complaining.\" -- Jeff Raskin','afc3bf9d346f20c15bd914465c0beae12e0dba2e',45449),(1448,'\n\"Running is a big question mark that\'s there each and every day.\nIt asks you, \'Are you going to be a wimp or are you going to be\nstrong today?\'\"\n- Peter Maher','afc3bf9d346f20c15bd914465c0beae12e0dba2e',45253),(1449,'\n\"Opportunities multiply as they are seized.\"\n -- Sun tzu','b19dc177a07ce563e09b457f13bf5a673ddfbba1',36757),(1450,'\n\"The more of us that do it, the harder it is for them to dismiss us\nas just a bunch of really weird people.  Especially when we otherwise\nappear so normal.\"\n- Dan Hawthorne','b19dc177a07ce563e09b457f13bf5a673ddfbba1',44403),(1451,'\nGummidges\'s Law: The amount of expertise varies in inverse \nproportion to the number of statements understood by the general \npublic.','b2029ba5ea1042d78c96d3888897571eea8c27fa',31913),(1452,'\n\"A man loses his illusions first, his teeth second, and his\n follies last.\" -- Helen Rowland','b2029ba5ea1042d78c96d3888897571eea8c27fa',32929),(1453,'\n\"Humor is the only test of gravity, and gravity of humor; for a \n subject which will not bear raillery is suspicious, and a jest \n which will not bear serious examination is false wit.\" \n -- Aristotle (384 BC-322 BC)','b246c7491a540d40da2bfe4e6780620f4f926797',36879),(1454,'\nBowie\'s Theorem: If an experiment works, you must be using the \nwrong equipment.','b246c7491a540d40da2bfe4e6780620f4f926797',43599),(1455,'\n\"Death is a low chemical trick played on everybody except sequoia\n trees.\" -- JJ Furnas.','b5586099944014e589f483efe663318aa1979d56',45253),(1456,'\n\"There are two ways of constructing a software design; one way is \n to make it so simple that there are obviously no deficiencies, \n and the other way is to make it so complicated that there are no \n obvious deficiencies. The first method is far more difficult.\" \n -- C. A. R. Hoare','b5586099944014e589f483efe