ot manage. Those who manage what they\n do not understand.\" -- Putt\'s Law','5cff99d9ee987e698a99ea820734b378ef524bff',35941),(1713,'\n\"The nourishment is palatable\" -- Emily Dickinson, dying words','5cff99d9ee987e698a99ea820734b378ef524bff',36879),(1714,'\n\"You\'re not puking and nothing\'s broken so get going.\"\n- Vivian McQueeney to her husband, Scott, in the middle of the climb to\n Whitney Portal during Badwater 2000','5fbdc8ab88676c89b2762cdda82d60d30a615164',32929),(1715,'\n\"Maybe this world is another planet\'s Hell.\"\n -- Aldous Huxley (1894-1963)','5fbdc8ab88676c89b2762cdda82d60d30a615164',45253),(1716,'\n\"He is simply a shiver looking for a spine to run up.\" \n -- Paul Keating','60ab3237001939bc10e6dea7db7c841aa3af78a5',43080),(1717,'\n\"Every journalist has a novel in him, which is an excellent\n place for it.\"','60ab3237001939bc10e6dea7db7c841aa3af78a5',44944),(1718,'\n\"If you can\'t see over it, walk it.\"\n- Unknown','61b5df41f1006a3d0ead4e4e6a6a61cb32496959',42471),(1719,'\n\"The Quitter\"\nWhen you\'re lost on the trail with the speed of a snail\nAnd defeat looks you straight in the eye\nAnd you\'re needing to sit, your whole being says quit\nYou\'re certain it\'s your time to die.\nBut the code of the trail is \"move forward don\'t fail\"\nThough your knees and ego are scarred.\nAll the swelling and pain is just part of the game\nIn the long run it\'s quitting that\'s hard!','61b5df41f1006a3d0ead4e4e6a6a61cb32496959',43080),(1720,'\n\"Rarely is the question asked: Is our children learning?\"\n -- George W. Bush','62362fbf882221470f099d8d0a119df93ce19831',44944),(1721,'\nCustomer: \"I\'m running Windows \'95.\"\nTech:     \"Yes.\"\nCustomer: \"My computer isn\'t working now.\"\nTech:     \"Yes, you said that.\"','62362fbf882221470f099d8d0a119df93ce19831',36757),(1722,'\n\"All propaganda must be so popular and on such an intellectual\n level, that even the most stupid of those toward whom it is\n directed will understand it ... Through cle