nd Oppression come to this land, it will be in \n the guise of fighting a foreign enemy.\"\n -- James Madison ','6f2c73e47a4a7da5ed35dc3954c0ea3e2fe863a3',45561),(1735,'\n\"Science is what people understand well enough to explain to a \n computer. All else is art.\" -- Donald Knuth','6f8246002c1c5967ffc5e0ec80f2d7b59a60b1e3',44281),(1736,'\n\"Sufficiently advanced incompetence is indistinguishable from malice.\"','6f8246002c1c5967ffc5e0ec80f2d7b59a60b1e3',31913),(1737,'\n\"Not even computers will replace committees, because committees \n buy computers.\" -- Unknown','6fe3dfe314684a658c1b19ca7a8e3abd29afe23e',45449),(1738,'\n\"I never miss a chance to have sex or appear on television.\"\n -- Gore Vidal','6fe3dfe314684a658c1b19ca7a8e3abd29afe23e',45449),(1739,'\n\"The greatest of all victories is to be victorious over yourself.\"\n- Unknown','706a95706215cee24eedce10a14654c8763799cb',43346),(1740,'\n\"Jehovah was not a moral god. He had all the vices and he\n lacked all the virtues. He generally carried out all his\n threats, but he never faithfully kept a promise.\"\n -- Robert G. Ingersoll','706a95706215cee24eedce10a14654c8763799cb',31909),(1741,'\n\"A runner\'s creed: I will win; if I cannot win, I shall be second;\nif I cannot be second, I shall be third; if I cannot place at all,\nI shall still do my best.\" \n- Ken Doherty','71ef3ed0695341b63e469eea3478e82b3aab9a27',44127),(1742,'\n\"I was raised in the Jewish tradition, taught never to marry a\n Gentile woman, shave on a Saturday night and, most especially, \n never to shave a Gentile woman on a Saturday night.\" \n -- Woody Allen.','71ef3ed0695341b63e469eea3478e82b3aab9a27',64),(1743,'\n\"Small minds run in the same gutter.\"\n -- Alfred E. Neuman','7325068e8007fede0cfd8909e0ca401be6875a5c',45090),(1744,'\n\"Room service? Send up a larger room.\"\n -- Groucho Marx','7325068e8007fede0cfd8909e0ca401be6875a5c',31913),(1745,'\n\"You\'re bound to be unhappy if you optimize everything.\" \n -- Donald Knuth','732c0a1