\"\n- Unknown','7aeed2e80f473370df40802ca57db2a540612fb0',36879),(1757,'\n\"Common sense is the collection of prejudices acquired by age \n eighteen.\" -- Albert Einstein','7d5e6660e54fec3122bc54a9fc39dc5c9f1a17a7',35941),(1758,'\n\"Is your argument that the Creator of the Universe was working \n under a deadline and His manager forced Him to rush inefficient\n designs into production?\" -- John B. Breckenridge in bpot','7d5e6660e54fec3122bc54a9fc39dc5c9f1a17a7',43599),(1759,'\n\"One man\'s magic is another man\'s engineering. Supernatural is\n a null word.\"\n -- Robert Heinlein','7d9f2b80826508a602a2b4adb20e470d5af19529',45090),(1760,'\nGinsberg\'s Theorem:\n\n   1. You can\'t win.\n   2. You can\'t break even.\n   3. You can\'t even quit the game.','7d9f2b80826508a602a2b4adb20e470d5af19529',36879),(1761,'\n\"It does me no injury for my neighbor to say there are twenty\n gods, or no God. It neither picks my pocket nor breaks my leg.\"\n -- Thomas Jefferson','7dcd5ff96b80f1bb263084ecb01e7696484613fd',64),(1762,'\n\"Who are you going to believe, me or your own eyes?\"\n -- Groucho Marx','7dcd5ff96b80f1bb263084ecb01e7696484613fd',43346),(1763,'\n\"Having the source code is the difference between buying a house \n and renting an apartment.\" -- Behlendorf','812cd8837314e6595fcb0208c63461945db91d06',36757),(1764,'\n\"A treatise upon human nature: It is not contrary to reason to\n prefer the destruction of the whole world to the scratching of\n my finger.\"\n -- David Hume','812cd8837314e6595fcb0208c63461945db91d06',39809),(1765,'\n\"God, I must be crazy.\"\n- Unknown','81d51c78e6380c53c0310e296eabbeef5ffaae5f',39809),(1766,'\n\"Chaos Theory is a new theory invented by scientists panicked \n by the thought that the public were beginning to understand \n the old ones.\" -- Mike Barfield.','81d51c78e6380c53c0310e296eabbeef5ffaae5f',44403),(1767,'\n\"The establishment of Christianity arrested the normal\n development of the physical sciences for over fifteen hundred\n year