.\"\n -- Kurt Bruner','89c48c47268eee4dcf7c4d1629c9876f49285cfb',44127),(1777,'\n\"Don\'t speak unless you can improve on the silence.\"\n -- Spanish proverb','89c48c47268eee4dcf7c4d1629c9876f49285cfb',43080),(1778,'\n\"Politics is war without bloodshed while war is politics with\n bloodshed.\"\n -- Mao Tse Tung\n	\n When a stupid man is doing something he is ashamed of, he\n always declares that it is his duty.\"\n -- George Bernard Shaw','89da3d8a3c24dbd3e5e96f7f3896866f5e5eb878',36757),(1779,'\n\"Everybody sooner or later, sits down to a banquet of\n consequences.\"\n -- Robert Louis Stevenson','89da3d8a3c24dbd3e5e96f7f3896866f5e5eb878',34631),(1780,'\n\"The artist is nothing without the gift, but the gift is nothing \n without work.\" -- Emile Zola (1840-1902)','89f549b2a5341a05a7e4afeb364599158a03a47f',44403),(1781,'\n\"There is no housing shortage in Lincoln today - just a \n rumour that is put about by people who have nowhere to\n live.\" -- G.L. Murfin, Mayor of Lincoln','89f549b2a5341a05a7e4afeb364599158a03a47f',36757),(1782,'\n\"Civil disobedience, that\'s not our problem. Our problem is\n that people are obedient all over the world in the face of\n poverty and starvation and stupidity, and war, and cruelty. Our\n problem is that people are obedient while the jails are full of\n petty thieves, and all the while the grand thieves are running\n the country. That\'s our problem.\"\n -- Howard Zinn','8cc981aa1ecd37ee3376cacc031a214e24416c28',36757),(1783,'\n\"Generosity is not giving me that which I need more than you\n do, but it is giving me that which you need more than I do.\"\n -- Kahlil Gibran','8cc981aa1ecd37ee3376cacc031a214e24416c28',31909),(1784,'\n\"Don\'t speak unless you can improve on the silence.\"\n -- Spanish proverb','8d163d76c569f509002af1a489436be60492eb8e',33738),(1785,'\n\"There are two ways of constructing a software design; one way is \n to make it so simple that there are obviously no deficiencies, \n and the other way is to make it so complicated that there are no \n obvious deficiencies. The first method is far more difficult.\" \n -- C. A. R. Hoare','8d163d76c569f509002af1a489436be60492eb8e',44281),(1786,'\n\"When you run there are no mistakes, only lessons. The art and\nscience of ultrarunning is a process of trial, error and\nexperimentation. The failed experiments are as much a part of the\nprocess as the combination that ultimately works.\"\n- Keith Pippin','90b9305857ade3ea2021a4dd2723ccd54b46cf57',45253),(1787,'\n\"Just because the standard provides a cliff in front of you, \n you are not necessarily required to jump off it.\" \n -- Norman Diamond','90b9305857ade3ea2021a4dd2723ccd54b46cf57',35950),(1788,'\n\"Stick a fork in me, I\'m done.\"\n- Unknown','929545a027825daea55353fab18e4dd87fd8c581',43080),(1789,'\n\"The artist is nothing without the gift, but the gift is nothing \n without work.\" -- Emile Zola (1840-1902)','929545a027825daea55353fab18e4dd87fd8c581',31913),(1790,'\n\"This monkey mythology of Darwin is the cause of\n permissiveness, promiscuity, prophylactics, perversions,\n pregnancies, abortions, porno-therapy, pollution, poisoning and\n proliferation of crimes of all types.\"\n -- Judge Braswell Dean','9335809622570e8aeb98a74c24d3281e4191bf13',32929),(1791,'\n\"You get what anyone gets; you get a lifetime.\"\n -- Death, Neil Gaiman Comic Sandman','9335809622570e8aeb98a74c24d3281e4191bf13',36757),(1792,'\n\"The whole problem with the world is that fools and fanatics are\n always so certain of themselves, but wiser people so full of \n doubts.\" -- Bertrand Russell','93acc66a6e5f774385d481147f4c00e167992708',31913),(1793,'\n\"Each of us is confined to a world of our own making.\"\n -- Shawn Mikula','93acc66a6e5f774385d481147f4c00e167992708',64),(1794,'\n\"Naturally we feel that mentally ill people are not what we are\n looking for when we hire programmers - although there is no\n empirical data to support or contradict that view... Is it\n appropriate to give tests for mental illness to anyone applying\n for any kind of job?\" \n -- Weinberg The Psychology of Computer Programming','9486dd60074058ff0fb315c5185d182479035c69',31913),(1795,'\n\"Science is the great antidote to the poison of enthusiasm and\n superstition.\"\n -- Adam Smith','9486dd60074058ff0fb315c5185d182479035c69',35952),(1796,'\n\"Power is the ability to control things, moral authority is the\n ability to change things\" -- Jim Wallis','95ba225d2fecda66129fea8e09e4ef3ef67967a2',45883),(1797,'\nThe Law Of The Too Solid Goof: In any collection of data, the \nfigures that are obviously correct beyond all need of checking \ncontain the errors.\n\nCorollary 1: No one you ask for help will see the error either.\n\nCorollary 2: Any nagging intruder, who stops by with unsought \nadvice, will spot it immediately.','95ba225d2fecda66129fea8e09e4ef3ef67967a2',45561),(1798,'\n\"How the teacher reacts when something goes wrong tells the class\n what\'s important.\" -- Bruce Hamilton','96086e4f73c9e38874b64c0b6f1777396309956e',45883),(1799,'\n\"Once you\'ve written TBicycle, you never forget how.\"\n -- Oliver Townshend in b.p.d.n-t. ','96086e4f73c9e38874b64c0b6f1777396309956e',31913),(1800,'\nDeadline-Dan\'s Demo Demonstration: The higher the \"higher-ups\" \nare who\'ve come to see your demo, the lower your chances are of \ngiving a successful one.','967d1c50af49565e3ab37a33780edf8a1d2d43ea',35950),(1801,'\n\"I love talking about the Kennedy assassination. The reason I\n do is because I\'m fascinated by it. I\'m fascinated that our\n government could lie to us so blatantly, so obviously for so\n long, and we do absolutely nothing about it.\"\n -- Bill Hicks','967d1c50af49565e3ab37a33780edf8a1d2d43ea',45449),(1802,'\n\"I told my wife that I had a living will: I do not wish to be fed\n liquids from a bottle and hooked to a machine. So she turned off \n the TV and threw away the beer.\" -- Bob Hipsley','96e388c0b3b7fd874b48621e850335a8f06ca58d',35950),(1803,'\n\"The worst barbarity of war is that it forces men collectively\n to commit acts against which individually they would revolt with\n their whole being.\" -- Ellen Key','96e388c0b3b7fd874b48621e850335a8f06ca58d',45883),(1804,'\n\"Our government has kept us in a perpetual state of fear - kept\n us in a continuous stampede of patriotic fervor - with the cry\n of grave national emergency.\" -- General Douglas MacArthur','991e279c936f9745f8efaedcf46a7e25c14bb8df',43080),(1805,'\n\"Grasshopper, look beyond the game, as you look beneath the\n surface of the pool to see its depths.\"\n -- Master Po','991e279c936f9745f8efaedcf46a7e25c14bb8df',33738),(1806,'\n\"Eternal nothingness is fine if you happen to be dressed for it.\"\n -- Woody Allen.','999bda026be38397da36b3a974e7ba9f40275f69',31909),(1807,'\n\"Men have become the tools of their tools.\"\n -- Henry David Thoreau (1817-1862)','999bda026be38397da36b3a974e7ba9f40275f69',43599),(1808,'\n\"In ancient times cats were worshipped as gods; they have not \n forgotten this.\"\n -- Terry Pratchett','9b41f9c0d7bce732d9af75c3b13bd58e9ce2a1e1',45881),(1809,'\n\"This monkey mythology of Darwin is the cause of\n permissiveness, promiscuity, prophylactics, perversions,\n pregnancies, abortions, porno-therapy, pollution, poisoning and\n proliferation of crimes of all types.\"\n -- Judge Braswell Dean','9b41f9c0d7bce732d9af75c3b13bd58e9ce2a1e1',45449),(1810,'\n\"Enjoy the training and memories of race day, endure the race.\"\n- Shapiro','9d00089c4194a6c21c2d95f432a2777dac29d24e',43080),(1811,'\n\"The secret of success is to know something nobody else knows.\"\n -- Aristotle Onassis (1906-1975)','9d00089c4194a6c21c2d95f432a2777dac29d24e',44127),(1812,'\n\"Programming today is a race between software engineers striving \n to build bigger and better idiot-proof programs, and the Universe\n trying to produce bigger and better idiots. So far, the Universe \n is winning.\" -- Rich Cook.','a0308ad7144dc96e564746d6109ec1939e897137',33738),(1813,'\n\"If you were my husband, I\'d give you poison.\" \n -- Lady Astor to Churchill\n \n\"If you were my wife, I\'d take it.\"\n  -- Curchill to Lady Astor','a0308ad7144dc96e564746d6109ec1939e897137',45881),(1814,'\n\"If you can\'t get rid of the skeleton in your closet, you\'d best \n teach it to dance.\" -- George Bernard Shaw (1856-1950)','a071f3cf900d868205b8cc4c7e6aa7885cac3643',43346),(1815,'\n\"When you philosophically oppose an entire power elite, you\n cannot help but sound like a conspiracy theorist. Social power\n is by nature a conspiracy.\"\n -- Tom N','a071f3cf900d868205b8cc4c7e6aa7885cac3643',31909),(1816,'\n\"Beware of bugs in the above code; I have only proved it correct,\n not tried it.\" -- Donald Knuth','a1496d4ad0a359b6fe93d819e4a2141bd9d9ac35',43080),(1817,'\n\"I think there is a world market for maybe five computers.\"\n -- Thomas Watson (1874-1956), Chairman of IBM, 1943','a1496d4ad0a359b6fe93d819e4a2141bd9d9ac35',36757),(1818,'\n\"University politics are vicious precisely because the stakes \n are so small.\" -- Henry Kissinger (1923-)','a4fc566c789cd0998efce12dbd3513e79eb93bbc',64),(1819,'\nBowie\'s Theorem: If an experiment works, you must be using the \nwrong equipment.','a4fc566c789cd0998efce12dbd3513e79eb93bbc',45561),(1820,'\n\"That which does not kill us, cripples us for life\"\n- Fred Shufflebarger','a51c55ccd92d606a8027eb583e6cba25eb786891',36757),(1821,'\n\"Wherever there is great property, there is great inequality,\n for one very rich man; there must be at least five hundred\n poor.\"\n -- Adam Smith','a51c55ccd92d606a8027eb583e6cba25eb786891',43080),(1822,'\n\"In modern war there is no such thing as victor and \n vanquished... There is only a loser, and the loser is \n mankind.\" -- U Thant, Burmese UN Secretary General','a8833c7535d845800e2f2def1ca24a26e4c8a831',42471),(1823,'\n\"Do you program in Assembly ?\" she asked. \"NOP,\" he said.','a8833c7535d845800e2f2def1ca24a26e4c8a831',35952),(1824,'\n\"More computing sins are committed in the name of efficiency\n (without necessarily achieving it) than for any other single\n reason - including blind stupidity.\" -- W.A. Wulf','aa2dcf3d29d072a67b5602eb70a22b35ae79c3e4',35658),(1825,'\n\"The best conditioned athlete is a long distance runner\".\n- John Thompson of the Georgetown Hoyas, submitted by Charlie Hesse','aa2dcf3d29d072a67b5602eb70a22b35ae79c3e4',31909),(1826,'\n\"How the teacher reacts when something goes wrong tells the class\n what\'s important.\" -- Bruce Hamilton','ab71032b46410c97eefb49af7d10d8a10796db6a',45449),(1827,'\n\"If the bone\'s not showin\', just keep goin\'!\"\n- Joan Risse at Angeles Crest, 9/95','ab71032b46410c97eefb49af7d10d8a10796db6a',39809),(1828,'\n\"Not everything that can be counted counts, and not everything \n that counts can be counted.\" -- Albert Einstein ','acb033af040717d5654d64ccbf68de6e89ef23f5',43346),(1829,'\n\"There was a time when I believed in the story and the scheme\n of salvation, so far as I could understand it, just as I\n believed there was a Devil. Suddenly the light broke through to\n me and I saw a silly story, and each generation nowadays\n swallows it with greater difficulty. Why do people go on\n pretending about this Christianity?\"\n -- H. G. Wells','acca5b51d1713598f4e5a9e2c571e22bffbc235f',35952),(1830,'\n\"There is always a certain meanness in the argument of\n conservatism, joined with a certain superiority in its fact.\"\n -- Ralph Waldo Emerson','acca5b51d1713598f4e5a9e2c571e22bffbc235f',33738),(1831,'\n\"Religion is what keeps the poor from murdering the rich.\"\n -- Napoleon','b1b986990332a28a0a8011eb538f1ded941bb5ad',45561),(1832,'\n\"Good code is its own best documentation. As you\'re about to add\n a comment, ask yourself, \'How can I improve the code so that\n this comment isn\'t needed?\' Improve the code and then document\n it to make it even clearer.\" -- Steve McConnell Code Complete','b1b986990332a28a0a8011eb538f1ded941bb5ad',43599),(1833,'\n\"Theology is never any help; it is searching in a dark cellar\n at midnight for a black cat that isn\'t there. Theologians can\n persuade themselves of anything.\"\n -- Robert Heinlein','b3be0e5932b8baa2c9dd9c33206c31b95f78be2f',44127),(1834,'\n\"The trouble with the world is that the stupid are cocksure and\n the intelligent are full of doubt.\" -- Bertrand Russell','b3be0e5932b8baa2c9dd9c33206c31b95f78be2f',39809),(1835,'\n\"A dozen extra steps becomes a tremendous aggravation when you are\npushing your edge out hour after hour.\"\n- Shapiro','b3bf2140cfa214f15ab2fa9fa0d4817cb7dca3ac',44127),(1836,'\n\"If we do not like the world the way it is, then it is because\n we are not okay the way we are.\"\n -- deeshan','b3bf2140cfa214f15ab2fa9fa0d4817cb7dca3ac',35941),(1837,'\n\"I\'m living so far beyond my income that we may almost be said \n to be living apart.\" -- e e cummings (1894-1962)','b63c6a708fdbc915f27e637f1fb6bc411ffa0052',45449),(1838,'\n\"The company doesn\'t tell me what to say, and I don\'t tell them\nwhere to stick it.\" -- Unknown','b63c6a708fdbc915f27e637f1fb6bc411ffa0052',43080),(1839,'\n\"If we knew what it was we were doing, it would not be called \n research, would it?\" -- Albert Einstein','b70158055ed1d6180d8028abe679b0c239c372c5',43080),(1840,'\n\"Rules of Optimization:\"\n Rule 1: Don\'t do it.\n Rule 2 (for experts only): Don\'t do it yet.\" \n -- M.A. Jackson','b70158055ed1d6180d8028abe679b0c239c372c5',32929),(1841,'\n\"I don\'t believe in the after life, although I am bringing a\n change of underwear.\" -- Woody Allen.','bb3612a0cf3e7e69f1be97829008c1c0cf943363',43346),(1842,'\n\"There is no satisfaction without a struggle first.\"\n- Marty Liquori','bb3612a0cf3e7e69f1be97829008c1c0cf943363',45561),(1843,'\n\"You will get through the tired times, don\'t give up. There is lots of\ntime.  Walk and in a while you will be running again.\"\n- Rolly Portelance','bcdb6b3045cff6247e2db382d5006d8fb8434230',31913),(1844,'\n\"They show you how detergents take out bloodstains. I think if \n you\'ve