e who keep on\nrunning.\"\n- Unknown','64784bedd53258d0152783e812438f26f69da48c',44944),(2124,'\n\"Human beings, who are almost unique in having the ability to learn from the\nexperience of others, are also remarkable for their apparent disinclination\nto do so.\"\n- Douglas Adams','662791b56c06d86d3c0cb16e8163662dd014fd9f',43599),(2125,'\n\"If you\'re sick and tired of the politics of cynicism and polls \n and principles, come and join this campaign.\" -- George W. Bush','662791b56c06d86d3c0cb16e8163662dd014fd9f',34631),(2126,'\n\"A good bookshop is just a genteel Black Hole that knows \n how to read.\"\n -- Terry Pratchett (Guards! Guards!) ','685df181be80ff8d2018d3ff7c61f12c471005d2',31909),(2127,'\n\"I am amazed how many people on this planet are happy and free\n and never even saw the US constitution.\"\n -- <Reason>','685df181be80ff8d2018d3ff7c61f12c471005d2',43346),(2128,'\n\"To jaw-jaw is always better than to war-war.\" \n -- Winston Churchill','6896ddc64ef4051e872b1e3b3b37d25e74f3c335',43599),(2129,'\n\"Because I can.\" (when asked \"Why do you run 100 mile races?\")\n- Tom Johnson','6896ddc64ef4051e872b1e3b3b37d25e74f3c335',35658),(2130,'\n\"I don\'t know anything about music. In my line you don\'t have \n to.\" -- Elvis Presley (1935-1977)','69981d3a5bbf8a2ba25db9541830318a04450ec5',36757),(2131,'\n\"Heck, I don\'t age in my mind - people around me just keep\n getting younger.  :^)\"\n -- Van Swofford in e.p.delphi.non-technical','69981d3a5bbf8a2ba25db9541830318a04450ec5',43346),(2132,'\n\"If pigs could vote, the man with the slop bucket would be\n elected swineherd every time, no matter how much slaughtering\n he did on the side.\"\n -- Orson Scott Card','6a08d626bc555a03f727670d5b358610a093cfb5',31913),(2133,'\n\"I had a lover\'s quarrel with the world.\"\n -- Robert Frost','6a08d626bc555a03f727670d5b358610a093cfb5',45449),(2134,'\n\"Where are we going, and why am I in this handbasket?\"\n -- Bumper Sticker','6ab9e3dd3a09945b25c4ab04a708c23b087fe7e6',3