ays got there first, and is waiting for it.\"\n -- Terry Pratchett (Reaper Man) ','dff17a997c0881052e744e1a816ecde7332018a3',35952),(2292,'\n\"We\'re going to turn this team around 360 degrees.\"\n -- Jason Kidd, upon his drafting to the Dallas Mavericks','dff17a997c0881052e744e1a816ecde7332018a3',31909),(2293,'\n\"When you hear hoofbeats, think of horses, not zebras.\"\n-- Old saying','e0837d45b42d05c84938a39fde34641ff3bc328d',44403),(2294,'\nGoebel\'s Theorem Of Software Schedules: Always multiply a \nsoftware schedule by pi.  This is because you think you\'re going \nin a straight line but always end up going full circle.','e0837d45b42d05c84938a39fde34641ff3bc328d',44281),(2295,'\n\"The 10-K is a race. The marathon is an experience. The ultra is an\nadventure.\"\n- Bryan Hacker','e0f05ed4fd4ffb1af17b55948173bfe2900cefb4',36879),(2296,'\n\"Early to rise, Early to bed, Makes a man healthy but socially \n dead.\" -- The Warner Brothers (Animaniacs)','e0f05ed4fd4ffb1af17b55948173bfe2900cefb4',39809),(2297,'\n\"I\'m very proud of my gold pocket watch. My grandfather, on his\n deathbed, sold me this watch.\" -- Woody Allen','e194ee413805ba5a6aabf4d34db2066149dc0369',45881),(2298,'\n\"We have a political system that awards office to the most\n ruthless, cunning, and selfish of mortals, then act surprised\n when those willing to do anything to win power are equally\n willing to do anything with it.\"\n -- Michael Rivero','e194ee413805ba5a6aabf4d34db2066149dc0369',44403),(2299,'\n\"If a man would follow, today, the teachings of the Old\n Testament, he would be a criminal. If he would follow strictly\n the teachings of the New, he would be insane.\"\n -- Robert G. Ingersoll','e3cbba8883fe746c6e35783c9404b4bc0c7ee9eb',44127),(2300,'\n\"New programmers are drawn to multithreading like moths to flame,\n with similar results.\" -- Tweet by Danny Thorpe','e3cbba8883fe746c6e35783c9404b4bc0c7ee9eb',35950),(2301,'\n\"It is curious that physical courage should be so common in the\n