"\n -- Joe Louis.','22a366e578fc19525be71b6b3013ef8cc5cb1a74',45883),(2384,'\n\"Mit der Dummheit kmpfen Gtter selbst vergebens\"\n\"Against stupidity the (very) gods themselves contend in vain\"\n -- Friedrich von Schiller','22a366e578fc19525be71b6b3013ef8cc5cb1a74',43346),(2385,'\n\"Everybody\'s worried about stopping terrorism. Well, there\'s a\n really easy way: stop participating in it.\" -- Noam Chomsky','23b36ea4f70670ae377a591fdc03d36a9bebb481',43346),(2386,'\n\"Nothing exists except atoms and empty space; everything else\n is opinion.\"\n -- Democritus','23b36ea4f70670ae377a591fdc03d36a9bebb481',45561),(2387,'\n\"There is a rumour going around that I have found God. I think \n this is unlikely because I have enough difficulty finding my \n keys, and there is empirical evidence that they exist.\"\n -- Terry Pratchett','26ced0b5ea2b6f3c8b1e5090a6cdbdfae5a6f853',33738),(2388,'\n\"The great error of nearly all studies of war... has been to \n consider war as an episode in foreign policies, when it is an \n act of interior politics...\" -- Simone Weil','26ced0b5ea2b6f3c8b1e5090a6cdbdfae5a6f853',33738),(2389,'\n\"The Quitter\"\nWhen you\'re lost on the trail with the speed of a snail\nAnd defeat looks you straight in the eye\nAnd you\'re needing to sit, your whole being says quit\nYou\'re certain it\'s your time to die.\nBut the code of the trail is \"move forward don\'t fail\"\nThough your knees and ego are scarred.\nAll the swelling and pain is just part of the game\nIn the long run it\'s quitting that\'s hard!','297beb01dd21c5a2aad009da6abb91d4bc0fdc6d',44127),(2390,'\n\"The harder the conflict, the more glorious the triumph. What we\nobtain too cheap, we esteem too lightly; it is dearness only that\ngives everything its value. I love the man that can smile in trouble,\nthat can gather strength from distress and grow brave by reflection.\"\n- Thomas Paine','297beb01dd21c5a2aad009da6abb91d4bc0fdc6d',45449),(2391,'\n\"The world is too dangerous to live in, not because of the\n people who do evil, but because of the people who sit and let\n it happen.\"\n -- Albert Einstein','29f4d7bd70c46fd3b021272cb02151499cc6fda1',44403),(2392,'\n\"They couldn\'t hit an elephant at this dist--\" \n -- John B. Sedwick, general, dying words, 1864','29f4d7bd70c46fd3b021272cb02151499cc6fda1',44281),(2393,'\n\"Would you like to liberate yourself from the lower realms of\n life? Would you like to save the world from the degradation and\n destruction it seems destined for? Then step away from shallow\n mass movements and quietly go to work on your own\n self-awareness.\"\n -- Lao tzu','2a94b50a655ce6b38f78ca33a4b95e39f0521b89',39809),(2394,'\n\"No Sane man will dance.\" -- Cicero (106-43 B.C.)','2a94b50a655ce6b38f78ca33a4b95e39f0521b89',35950),(2395,'\n\"The first principle is that you must not fool yourself - and you\n are the easiest person to fool.\" -- Richard Feynman','2b80090196fbbd61985ea7f2fc5c2f6aa4e1f134',35950),(2396,'\n\"Humor is the great thing, the saving thing. The minute it crops \n up, all our irritations and resentments slip away and a sunny \n spirit takes their place.\" -- Mark Twain (1835-1910)','2b80090196fbbd61985ea7f2fc5c2f6aa4e1f134',36879),(2397,'\n\"It is my conviction that killing under the cloak of war is\n nothing but an act of murder.\"\n -- Albert Einstein','2b8c5c3d26a90dd3ae49b5001f6c2d3139bb6fc8',45883),(2398,'\n\"Nothing beats experience.\"\n- Unknown','2b8c5c3d26a90dd3ae49b5001f6c2d3139bb6fc8',42471),(2399,'\n\"Religion is excellent stuff for keeping common people quiet.\"\n -- Napoleon','2ba733e086e7c2f98b3a193782146ad21060c051',35941),(2400,'\n\"Silence is one of the hardest arguments to refute.\"\n -- Josh Billings','2ba733e086e7c2f98b3a193782146ad21060c051',39809),(2401,'\n\"Authoritarian government required to speak, is silent.\n Representative government required to speak, lies with\n impunity.\"\n -- Napoleon','2c61422714bcb5935215adf442a8f5b1d80ffc54',44281),(2402,'\n\"I told my wife that I had a living will: I do not wish to be fed\n liquids from a bottle and hooked to a machine. So she turned off \n the TV and threw away the beer.\" -- Bob Hipsley','2c61422714bcb5935215adf442a8f5b1d80ffc54',45561),(2403,'\n\"If we\'d been born where they were born and taught what they\n were taught, we would believe what they believe.\"\n -- A church sign in Northern Ireland','2d97d80f5af467caf6a638d16c539634e7b1b7a1',45561),(2404,'\n\"Am I lightheaded because I\'m not dead or because I\'m still \n alive?\" -- Heidi Sandige.','2d97d80f5af467caf6a638d16c539634e7b1b7a1',43599),(2405,'\n\"The mind learns the body can go at least a bit farther even though it\nfeels increasingly uncomfortable.\"\n- Pritikin','301f839b74b67350b1bdc01050369aec1f36e0d2',45883),(2406,'\nPeer\'s Law: The solution to a problem changes the problem.','301f839b74b67350b1bdc01050369aec1f36e0d2',43346),(2407,'\n\"If you haven\'t got anything nice to say about anybody, come sit \n next to me.\" -- Alice Roosevelt Longworth (1884-1980)','316b44139a9742cfca5f9c640c47f008f6b73c1b',31909),(2408,'\n\"No brain, no pain\"\n- Unknown','316b44139a9742cfca5f9c640c47f008f6b73c1b',35658),(2409,'\n\"If you start to feel good during an Ultra, don\'t worry - you\'ll get\nover it.\"\n- Gene Thibeault','34c643598eab0fe1bc1726e196c36057904dda13',45253),(2410,'\n\"Democracy used to be a good thing, but now it has gotten into\n the wrong hands.\"\n -- Jessie Helms','34c643598eab0fe1bc1726e196c36057904dda13',45449),(2411,'\n\"In order to learn, one must change one\'s mind.\"\n -- Orson Scott Card','36dff9576bef9ee98bab32687c12cc9dc6536114',43348),(2412,'\n\"No one rules if no one obeys.\"\n -- <TaoDo>','36dff9576bef9ee98bab32687c12cc9dc6536114',31913),(2413,'\n\"Science has done more for the development of western\n civilization in one hundred years than Christianity did in\n eighteen hundred years.\"\n -- Jeff Burroughs','3744112af469898c7603fbe21d80b5b5640a34b5',35941),(2414,'\nEstridge\'s Law: No matter how large and standardiz