uments to refute.\"\n -- Josh Billings','7f8ee84f4cf599be71dc87a7eecacf740c7f12b7',45253),(2537,'\n\"I\'m Jewish. I don\'t work out. If God had wanted us to bend over, \n He would have put diamonds on the floor.\" -- Joan Rivers.','7f8ee84f4cf599be71dc87a7eecacf740c7f12b7',44403),(2538,'\n\"There are worse things in life than death. Have you ever spent\n an evening with an insurance salesman?\" -- Woody Allen','7fcdb7ba6de74b6e007efe1079540e0228817d26',32929),(2539,'\n\"This isn\'t life in the fast lane, it\'s life in the oncoming traffic.\"\n -- Terry Pratchett','7fcdb7ba6de74b6e007efe1079540e0228817d26',31909),(2540,'\n\"You run an ultra largely on concentration ... not letting your form\ndrag and continuing to run. Your body quits and the mind takes over.\nIt\'s not like a marathon where you think, maybe I can gut it out.\"\n- Georgs Kolesnikovs','80658c64f144849de7740bf64d7ca5a88ef951b6',32929),(2541,'\n\"Fashion is something barbarous, for it produces innovation\n without reason and imitation without benefit.\" \n -- George Santayana','80658c64f144849de7740bf64d7ca5a88ef951b6',31913),(2542,'\n\"Enjoy the training and memories of race day, endure the race.\"\n- Shapiro','8322f586c69aaaec73b86b416ab8cbb4ef1f1ff2',33738),(2543,'\n\"Over breakfast coffee we read of 40,000 American dead in\n Vietnam. Instead of vomiting, we reach for the toast. Our\n morning rush through crowded streets is not to cry murder but\n to hit that trough before somebody else gobbles our share.\"\n -- Dalton Trumbo','8322f586c69aaaec73b86b416ab8cbb4ef1f1ff2',45090),(2544,'\n\"A notation is important for what it leaves out.\" \n -- Joseph Stoy','8334918da76533b5c14f235f374e327c95035aa3',35950),(2545,'\n\"Knowing others is intelligence; knowing yourself is true\n wisdom. Mastering others is strength; mastering yourself is\n true power.\"\n -- Lao Tzu','8334918da76533b5c14f235f374e327c95035aa3',31913),(2546,'\n\"I am not a communist and neither is the revolutionary\n movement.\"\n -- Fidel Ca