uth nor falsehood.\"\n -- Thomas Hobbes','87a58831a3f052f220a9e6dff87a7cad0d1052ab',31909),(2559,'\n\"Barabsi\'s Law of Programming: Program development ends when the \n program does what you expect it to do - whether it is correct or\n not.\" -- Albert-Lszl Barabsi','87a58831a3f052f220a9e6dff87a7cad0d1052ab',35950),(2560,'\n\"Man has no right to kill his brother. It is no excuse that he\n does so in uniform: he only adds the infamy of servitude to\n the crime of murder.\" -- Percy Bysshe Shelley','88308d640f3031b16b0e9c4663716c0cb7169e50',45561),(2561,'\n\"Wisdom is knowing what to do next. Virtue is doing it.\"\n -- David Starr Jordan','88308d640f3031b16b0e9c4663716c0cb7169e50',45449),(2562,'\nCarlson\'s Consolation: Nothing is ever a complete failure; it can \nalways serve as a bad example.','898d99d62e92c4485fff43391cec7c59e4fe7d12',45561),(2563,'\n\"Whoever controls the media, the images, controls the culture.\"\n -- Allen Ginsberg','898d99d62e92c4485fff43391cec7c59e4fe7d12',31909),(2564,'\n\"It\'s not the beginning or the end of a race that counts, It\'s what\nhappens in between.\"\n- Unknown','89ca91e6c9b28bdcfb629b12758f955d21072594',44127),(2565,'\n\"If everyone demanded peace instead of another television set,\n then there\'d be peace.\"\n -- John Lennon','89ca91e6c9b28bdcfb629b12758f955d21072594',34631),(2566,'\n\"All natural institutions of churches, whether Jewish,\n Christian, or Turkish, appear to me no other than human\n inventions, set up to terrify and enslave mankind, and\n monopolize power and profit.\"\n -- Thomas Paine','8c12d571138fce48a15ab55d1234f359312ea78f',43346),(2567,'\n\"It is preoccupation with possessions, more than anything else,\n that prevents us from living freely and nobly.\"\n -- Bertrand Russell','8c12d571138fce48a15ab55d1234f359312ea78f',44403),(2568,'\n\"I have yet to meet a C compiler that is more friendly and easier \n to use than eating soup with a knife.\" -- unknown','8cc9fcd9fdbef641b5d23f4a80588138107a1f1b',33738),(2569,'\nFinagle\'s Laws:\n\n   1. Once a job is fouled up, anything done to improve it makes \n      it worse.\n   2. No matter what results are expected, someone is always \n      willing to fake it.\n   3. No matter what the result, someone is always eager to \n      misinterpret it.\n   4. No matter what occurs, someone believes it happened \n      according to his pet theory.','8cc9fcd9fdbef641b5d23f4a80588138107a1f1b',35658),(2570,'\n\"Do you program in Assembly ?\" she asked. \"NOP,\" he said.','8ce2f7cdc27d512a28746db1e8895650f9355602',45090),(2571,'\n\"The fear of death is the most unjustified of all fears, for \n there\'s no risk of accident for someone who\'s dead.\" \n -- Albert Einstein.','8ce2f7cdc27d512a28746db1e8895650f9355602',45253),(2572,'\n\"I criticize by creation - not by finding fault.\" \n -- Cicero (106-43 B.C.)','8dad097d5f7a5d13b0723f5465cbef6fe2a2f244',44944),(2573,'\nMencken\'s Law: There is always an easy answer to every human \nproblem -- neat, plausible, and wrong.','8dad097d5f7a5d13b0723f5465cbef6fe2a2f244',32929),(2574,'\n\"A man can\'t be too careful in the choice of his enemies.\"\n -- Oscar Wilde (1854-1900)','8f723119a7842320b2bc984b04d2a76808e8ebd7',39809),(2575,'\n\"The United States is in no sense founded upon the Christian\n doctrine.\"\n -- George Washington Administration Treaty','8f723119a7842320b2bc984b04d2a76808e8ebd7',32929),(2576,'\n\"The de facto role of the US armed forces will be to keep the\n world safe for our economy and open to our cultural assault.\"\n -- Major Ralph Peters, US Military','906063f00d2555893e5c32e9249ae185ae689a7b',44944),(2577,'\n\"Men have become the tools of their tools.\"\n -- Henry David Thoreau (1817-1862)','906063f00d2555893e5c32e9249ae185ae689a7b',43348),(2578,'\nNolan\'s Placebo: An ounce of image is worth a pound of \nperformance.','9147343d9851d9a4727fab30d6594b416109e55a',45561),(2579,'\n\"He is one of those people who would be enormously improved by \n death.\" -- H. H. Munro (Saki) (1