403),(2623,'\n\"Nothing beats experience.\"\n- Unknown','b1d2e166d988e74123924d7bff9cd30a63aff067',39809),(2624,'\n\"The use of COBOL cripples the mind; its teaching should, \n therefore, be regarded as a criminal offense.\"\n -- Edsger Dijkstra','b3ad32a369754ee7acf23c5370ccf5b401604a78',45883),(2625,'\n\"Computers are useless. They can only give you answers.\"\n -- Pablo Picasso','b3ad32a369754ee7acf23c5370ccf5b401604a78',35950),(2626,'\n\"There must be more to life than having everything.\"\n -- Maurice Sendak','b5507c7ca8cfa4c51b7c97843e5e4525ed1ad06d',35941),(2627,'\n\"A man\'s only as old as the woman he feels.\"\n -- Groucho Marx','b5507c7ca8cfa4c51b7c97843e5e4525ed1ad06d',35658),(2628,'\n\"... slowed my pace to the point that I could have been rear-ended by a\nsleepy snail.\"\n- Dave Olney','b615fddf029f3e87e4d1f314a489ddca0cbf50de',45090),(2629,'\n\"What you do speaks so loud that I cannot hear what you say.\"\n -- Ralph Waldo Emerson','b615fddf029f3e87e4d1f314a489ddca0cbf50de',44281),(2630,'\n\"It is difficult to produce a television documentary that is\n both incisive and probing when every twelve minutes one is\n interrupted by twelve dancing rabbits singing about toilet\n paper.\"\n -- Rod Serling','b74e9cad775d997fc742b45e1ba7bd5295d63d13',35952),(2631,'\nGoebel\'s Second Law Of Useless Difficulty: The fastest way to get \nsomething done is to determine that it isn\'t worth doing.','b74e9cad775d997fc742b45e1ba7bd5295d63d13',45561),(2632,'\n\"If you put tomfoolery into a computer, nothing comes out of it \n but tomfoolery. But this tomfoolery, having passed through a \n very expensive machine, is somehow enobled and no-one dares \n criticize it.\" -- Pierre Gallois.','baf253b20f891347a7f8122930309b27db1e3835',43080),(2633,'\n\"I sometimes think that God in creating man somewhat\n overestimated his ability.\"\n -- Oscar Wilde','baf253b20f891347a7f8122930309b27db1e3835',31913),(2634,'\n\"You hear about how runnin\' ultras is all mental; well, I sure wish\