rt, she always yielded \n easily.\" -- Charles, Count Talleyrand','c11226c53fc4c8033c2bf2eda91a1fb4029365dc',44403),(2646,'\n\"There must be more to life than having everything.\"\n -- Maurice Sendak','c1401c9a808e0d25cd8afa853c36032ffaca83cb',34631),(2647,'\n\"I told my wife that I had a living will: I do not wish to be fed\n liquids from a bottle and hooked to a machine. So she turned off \n the TV and threw away the beer.\" -- Bob Hipsley','c1401c9a808e0d25cd8afa853c36032ffaca83cb',43080),(2648,'\nConway\'s Law: In any organization there will always be one person \nwho knows what is going on.  This person must be fired.','c18557ded94f94dc63cbcec520f2feeb823c4e3d',42471),(2649,'\n\"Albert grunted. \'Do you know what happens to lads who ask too \n many questions?\'\n Mort thought for a moment.\n \'No,\' he said eventually, \'what?\'\n There was silence.\n Then Albert straightened up and said, \'Damned if I know. Probably \n they get answers, and serve \'em right.\'\"\n -- Terry Pratchett (Mort) ','c18557ded94f94dc63cbcec520f2feeb823c4e3d',39809),(2650,'\n\"Either he\'s dead or my watch has stopped.\"\n -- Groucho Marx','c28dc1fe18f79267567f68702332aceb8a847953',33738),(2651,'\n\"Pain is certain, suffering is optional.\"\n -- Buddha','c28dc1fe18f79267567f68702332aceb8a847953',34631),(2652,'\n\"Plato was a bore.\"\n -- Friedrich Nietzsche (1844-1900)','c30635fb61378918ac1a7c5feb2a819a5a6bcfac',35941),(2653,'\n\"The Quitter\"\nWhen you\'re lost on the trail with the speed of a snail\nAnd defeat looks you straight in the eye\nAnd you\'re needing to sit, your whole being says quit\nYou\'re certain it\'s your time to die.\nBut the code of the trail is \"move forward don\'t fail\"\nThough your knees and ego are scarred.\nAll the swelling and pain is just part of the game\nIn the long run it\'s quitting that\'s hard!','c30635fb61378918ac1a7c5feb2a819a5a6bcfac',35658),(2654,'\n\"Kill a man, and you are an assassin. Kill millions of men, and\n you are a conqueror. Kill everyone, and you are a god.\"\n -- Jean Rostand','c348c1794df04a0473a11234389e74a236833822',43348),(2655,'\n\"Early to rise, Early to bed, Makes a man healthy but socially \n dead.\" -- The Warner Brothers (Animaniacs)','c348c1794df04a0473a11234389e74a236833822',44944),(2656,'\n\"Naturally we feel that mentally ill people are not what we are\n looking for when we hire programmers - although there is no\n empirical data to support or contradict that view... Is it\n appropriate to give tests for mental illness to anyone applying\n for any kind of job?\" \n -- Weinberg The Psychology of Computer Programming','c5c15732584ed2820db3720243a42ca22f624d80',35658),(2657,'\n\"If you are required to kill someone today, on the promise of a\n political leader that someone else shall live in peace\n tomorrow, believe me, you are not only a double murderer, you\n are a suicide, too.\"\n -- Katherine Anne Porter','c5c15732584ed2820db3720243a42ca22f624d80',44281),(2658,'\n\"Written laws are like spider\'s webs; they will catch, it is\n true, the weak and poor, but would be torn in pieces by the\n rich and powerful.\"\n -- Anacharsis','c60d81f35d8be966fa0437e43f1feff777c6e121',35941),(2659,'\n\"Probably no nation is rich enough to pay for both war and\n education.\"\n -- Braham Flexner','c60d81f35d8be966fa0437e43f1feff777c6e121',43599),(2660,'\n\"There are clubs you can\'t belong to, Neighborhoods you can\'t\nlive in, Schools you can\'t get into, But the roads are always open.\"\n- Unknown','c6944467da0c65a08c39bb5a0314cc143936eaa3',43599),(2661,'\n\"Why would anyone want to do this a second time?\"\n- Sue Haupt','c6944467da0c65a08c39bb5a0314cc143936eaa3',33738),(2662,'\n\"The body is given out on loan - don\'t waste it and expect to use it\ntomorrow.\"\n- Shapiro','cc6f6ede7b271915dba0f43119e441804a648724',36879),(2663,'\n\"You can get more with a kind word and a gun than you can with a \n kind word alone.\" -- Al Capone (1899-1947)','cc6f6ede7b271915dba0f43119e441804a648724',31913),(2664,'\n\"When I am dead, I hope it may be said: \'His sins were scarlet \n but his books were read.\" -- Hillaire Belloc.','cc7b8755a2a153285a26a7568c30b88a27217f0f',64),(2665,'\nLieberman\'s Law: Everybody lies; but it doesn\'t matter, since \nnobody listens.','cc7b8755a2a153285a26a7568c30b88a27217f0f',35941),(2666,'\n\"The Brush Dance is a Yurok healing ritual where being true to\n yourself means give your best to a person in need. Being true\n to yourself is the one and only Yurok Indian Law.\"\n -- Brush Dance Journal','cccfd063b99f899232d571d89d3f832308c0d0bc',44403),(2667,'\n\"It is dangerous to be right when the government is wrong.\"\n -- Voltaire','cccfd063b99f899232d571d89d3f832308c0d0bc',35658),(2668,'\n\"Thank you for sending me a copy of your book - I\'ll waste no \n time reading it.\" -- Moses Hadas (1900-1966)','d0a54d25d6d76d15daa175979eda75cd9fd411b3',35941),(2669,'\n\"That\'s not writing; That\'s typing.\" \n -- Truman Capote on Jack Kerouac','d0a54d25d6d76d15daa175979eda75cd9fd411b3',34631),(2670,'\n\"If you have enough book space, I don\'t want to talk to you.\"\n -- Terry Pratchett','d3eff7c2f16a30f8d386687baae68065fe019b6a',36757),(2671,'\n\"Before you speak, ask yourself is it kind, is it necessary, is\n it true, does it improve on the silence?\"\n -- Shirdi Sai Bab','d3eff7c2f16a30f8d386687baae68065fe019b6a',45561),(2672,'\n\"A clever man commits no minor blunders.\"\n -- Goethe (1749-1832)','d4e1aca5dd0e4965a2a66e1256e5b25a346a759b',64),(2673,'\n\"Nothing overshadows truth so much as authority.\"\n -- Leon Battista Alberti','d4e1aca5dd0e4965a2a66e1256e5b25a346a759b',39809),(2674,'\n\"It is not what we do, but also what we do not do, for which we\n are accountable.\"\n -- Moliere','d6a9450dc08555d6ecfaf7162e5267f401e6dd9a',45090),(2675,'\n\"When I am working on a problem I never think about beauty. I \n only think about how to solve the problem. But when I have \n finished, if the solution is not beautiful, I know it is wrong.\"\n -- Buckminste