ert Einstein','e59277abb9129d7f9d5a1990c49e7d29654a857e',42471),(2688,'\nGummidges\'s Law: The amount of expertise varies in inverse \nproportion to the number of statements understood by the general \npublic.','e6602176f26dd0c5fb721fded265ec8570f686e7',42471),(2689,'\n\"There are two ways of constructing a software design; one way is \n to make it so simple that there are obviously no deficiencies, \n and the other way is to make it so complicated that there are no \n obvious deficiencies. The first method is far more difficult.\" \n -- C. A. R. Hoare','e6602176f26dd0c5fb721fded265ec8570f686e7',44127),(2690,'\n\"No one rules if no one obeys.\"\n -- <TaoDo>','e816958259e39339ddc56994e959aa56ef874f92',64),(2691,'\n\"Foreign aid is when the poor people of a rich country give\n money to the rich people of a poor country.\"\n -- Gary Hart, BC Comic Strip','e816958259e39339ddc56994e959aa56ef874f92',45883),(2692,'\nBible, Dijkstra 5:15\n\"and the clueless shall spend their time reinventing the wheel \n while the elite merely use the Wordstar key mappings\" \n -- Ed Mulroy','e90e88c880e48e96024e634381ba1ad4888e72e0',35941),(2693,'\n\"If you can see the light coming out of the other ear, you\'re an Ultra runner.\n- Unknown','e90e88c880e48e96024e634381ba1ad4888e72e0',34631),(2694,'\n\"A man\'s ethical behavior should be based effectually on\n sympathy, education, and social ties and needs; no religious\n basis is necessary. Man would indeed be in a poor way if he had\n to be restrained by fear of punishment and hope of reward after\n death.\"\n -- Albert Einstein','eba90709ed04eb27e4a042727d7dd308e44389e4',39809),(2695,'\n\"Even if you\'re on the right track, you\'ll get run over if you\n just sit there.\" -- Will Rogers','eba90709ed04eb27e4a042727d7dd308e44389e4',44281),(2696,'\n\"God favors no group. Only religions do that.\"\n -- Bumper Sticker','ed6938a0e411bb8e626dd202a335ef167a382a6c',45253),(2697,'\n\"ARRRGH -- what in God\'s name ever possessed me to think this would be a\ngood thing to do?\"\n- Charles N. Steele','ed6938a0e411bb8e626dd202a335ef167a382a6c',31913),(2698,'\n\"The best way to predict the future is to invent it.\" \n -- Alan Kay','ed9f6e93628b252a0175477aeffa3c7508338438',33738),(2699,'\n\"Every gun that is made, every warship launched, every rocket\n fired signifies in the final sense, a theft from those who\n hunger and are not fed, those who are cold and are not clothed.\n This world in arms is not spending money alone. It is spending\n the sweat of its laborers, the genius of its scientists, the\n hopes of its children. This is not a way of life at all in any\n true sense. Under the clouds of war, it is humanity hanging on\n a cross of iron.\"\n -- Dwight D. Eisenhower','ed9f6e93628b252a0175477aeffa3c7508338438',33738),(2700,'\n\"Knowing others is intelligence; knowing yourself is true\n wisdom. Mastering others is strength; mastering yourself is\n true power.\"\n -- Lao Tzu','ee3ef93429aba64bd0e6f7a0af8299e6416ceea4',34631),(2701,'\n\"All religions are founded on the fear of the many and the\n cleverness of the few.\"\n -- Stendhal','ee3ef93429aba64bd0e6f7a0af8299e6416ceea4',31913),(2702,'\n\"Pain is good.  Extreme Pain is Extremely Good ...\"\n- Navy Seals','f148ceee33a52e839b0dfea3393bf0a507d46855',35941),(2703,'\n\"Two things are infinite: the universe and human stupidity; and I\'m\n not sure about the universe.\" -- Albert Einstein','f148ceee33a52e839b0dfea3393bf0a507d46855',31909),(2704,'\n\"Teeth extracted by the latest methodists.\"\n -- Hong Kong dental advertisement','f29fa043b3ea6e599c8a224b6e6a13ce3c9c9191',45090),(2705,'\n\"A poem is never finished, only abandoned.\"\n -- Paul Valery (1871-1945)','f29fa043b3ea6e599c8a224b6e6a13ce3c9c9191',45253),(2706,'\n\"If we don\'t believe in freedom of expression for people we\n despise, we don\'t believe in it at all.\"\n -- Noam Chomsky','f3341dbcdda605b1601524b0d01655750cc60e0d',45253),(2707,'\n\"Tact is the ability to tell a man he has an open mind when he