reat thing, the saving thing. The minute it crops \n up, all our irritations and resentments slip away and a sunny \n spirit takes their place.\" -- Mark Twain (1835-1910)','5f89685f47c1d42eff25dd4ed40967b36b1a9c30',45881),(2888,'\n\"Sterling\'s Corollary to Clarke\'s Law: Any sufficiently advanced\n garbage is indistinguishable from magic.\"','60a171842aba075b01813e69a7c065db36cdae6f',45561),(2889,'\n\"Reality is merely an illusion, albeit a very persistent one.\"  \n -- Albert Einstein ','60a171842aba075b01813e69a7c065db36cdae6f',44403),(2890,'\n\"There\'s no sense being exact about something if you don\'t even\n know what you\'re talking about.\" -- John von Neumann','6124feb79623c94ce6ed9edd1595cfe9a90b470c',43348),(2891,'\n\"Do you program in Assembly ?\" she asked. \"NOP,\" he said.','6124feb79623c94ce6ed9edd1595cfe9a90b470c',45090),(2892,'\n\"You can\'t rush good cooking, you can\'t rush babies out, and you \n can\'t rush software development\". -- Unknown','62634625ada7c706b0be053ed4469260300d5658',39809),(2893,'\n\"I don\'t know that atheists should be considered citizens, nor\n should they be considered patriots. This is one nation under\n God.\"\n -- President George Bush, August 27, 1988','62634625ada7c706b0be053ed4469260300d5658',45449),(2894,'\n\"Finish with a smile on your face.\"\n- Joe Trask','62f6479a5eca39725798b1ee300bd8d5de3a4ae3',45090),(2895,'\n\"Whenever I hear anyone arguing for slavery, I feel a strong\n impulse to see it tried on him personally.\"\n -- Abraham Lincoln','62f6479a5eca39725798b1ee300bd8d5de3a4ae3',35952),(2896,'\n\"The purpose of law is to prevent the strong from always having\n their way.\"\n -- Ovid','632047e5b2a712a7707f6b28ac722b1e706f1589',36879),(2897,'\n\"All natural institutions of churches, whether Jewish,\n Christian, or Turkish, appear to me no other than human\n inventions, set up to terrify and enslave mankind, and\n monopolize power and profit.\"\n -- Thomas Paine','632047e5b2a712a7707f6b28ac722b1e706f1589',3595