herents.\"\n -- George Orwell','77bf3f680d135c03c5a0f017e13016d0a4785bb9',43080),(2932,'\n\"True and false are attributes of speech, not of things. And\n where speech is not, there is neither truth nor falsehood.\"\n -- Thomas Hobbes','7801beec42debaaec0d7be9359c61e8a766bd071',39809),(2933,'\n\"Millions long for immortality who do not know what to do with\n themselves on a rainy Sunday afternoon.\" -- Susan Ertz','7801beec42debaaec0d7be9359c61e8a766bd071',45253),(2934,'\n\"In all the disputes, which have excited Christians against\n each other, Rome has invariably decided in favor of that\n opinion which tended most towards the suppression of the human\n intellect and the annihilation of the reasoning powers.\"\n -- Voltaire','7841fb1f92b99194ca818d410cb09430731b6285',35941),(2935,'\n\"So far as I can remember, there is not one word in the Gospels\n in praise of intelligence.\"\n -- Bertrand Russel','7841fb1f92b99194ca818d410cb09430731b6285',44281),(2936,'\n\"In Germany they first came for the Communists, \n and I didn\'t speak up because I wasn\'t a Communist. \n Then they came for the Jews, \n and I didn\'t speak up because I wasn\'t a Jew. \n Then they came for the trade unionists, \n and I didn\'t speak up because I wasn\'t a trade unionist. \n Then they came for the Catholics, \n and I didn\'t speak up because I was a Protestant. \n Then they came for me - \n and by that time no one was left to speak up.\" \n -- Pastor Martin Niemller','7bf016f5b104573db99f54a0715d7f0fdf7705f4',32929),(2937,'\n\"A good sermon should be like a woman\'s skirt: short enough to \n arouse interest but long enough to cover the essentials.\" \n -- Ronald Knox.','7bf016f5b104573db99f54a0715d7f0fdf7705f4',35941),(2938,'\n\"Once that distance had been passed in training, an important physical\nand psychological threshold had been crossed. It was no longer a\nquestion of *if* it could be done.  Rather, it became a question of\n*how fast* it could be done.\"\n- Mike Plant (about Dave Scott)','7c753b72486156bc11e7416305a9c87ada24439e',35952),(2939,'\n\"The perfect computer has been developed. You just feed in your\n problems and they never come out again.\" -- Al Goodman.','7c753b72486156bc11e7416305a9c87ada24439e',45090),(2940,'\n\"Terrorism is the war of the poor, and war is the terrorism of \n the rich.\" -- Sir Peter Ustinov','7c8d848f32fa1c53815556ee08aa8ee5994c5a51',42471),(2941,'\n\"Religion is the end of love and honesty, the beginning of\n confusion; faith is a colorful hope or fear, the origin of\n folly.\"\n -- Tao Te Ching','7c8d848f32fa1c53815556ee08aa8ee5994c5a51',44403),(2942,'\n\"Invisible Pink Unicorns are beings of awesome mystical power.\n We know this because they manage to be invisible and pink at\n the same time. Like all religions, the Faith of the Invisible\n Pink Unicorns is based upon both logic and faith. We have faith\n that they are pink; we logically know that they are invisible\n because we can\'t see them.\"\n -- Steve Eley','810bd2adca8109e71a0fa4995bb7a965fd8d905a',45090),(2943,'\n\"The quickest way of ending a war is to lose it.\"\n -- George Orwell','810bd2adca8109e71a0fa4995bb7a965fd8d905a',42471),(2944,'\nAMAZING BUT TRUE ...\nThere is so much sand in Northern Africa that if it were spread\nout it would completely cover the Sahara Desert.','818307e00b8ddd4f8f671d975f099a1adf3b6149',35941),(2945,'\n\"True and false are attributes of speech, not of things. And\n where speech is not, there is neither truth nor falsehood.\"\n -- Thomas Hobbes','818307e00b8ddd4f8f671d975f099a1adf3b6149',45881),(2946,'\n\"There are perhaps 5% of the population that simply *can\'t* think.\n There are another 5% who *can*, and *do*.\n The remaining 90% *can* think, but *don\'t*.\" -- Robert A. Heinlein','81887888a933d677e0835125eff02194202ae6b8',32929),(2947,'\n\"The road to excess leads to the place of wisdom, for we can\nnever know what is enough until we have experienced too much.\"\n- William Blake','81887888a933d677e0835125eff0219420