ee that your theory is crazy, but is it crazy enough?\"\n -- Niels Bohr (1885-1962)','87b2eb969f96afe3b467215f279262e98c868d27',43080),(2960,'\n\"All men are created equal. They are endowed by their Creator\n with certain unalienable rights, among these are life, liberty\n and the pursuit of happiness.\"\n -- Ho Chi Minh, 1945, as the Democratic Republic of Vietnam\n    was created','8959169251e7394bcf4b9004326f83e266a06bfb',44281),(2961,'\n\"Lying is done with words and also with silence.\"\n -- Adrienne Rich','8959169251e7394bcf4b9004326f83e266a06bfb',39809),(2962,'\n\"The greatest pleasure in life is doing what people say you cannot do.\"\n- Bagehot','89606b3e6179739f7ed413b20dd9583b33fa9e75',45449),(2963,'\n\"Familiarity breeds children.\"','89606b3e6179739f7ed413b20dd9583b33fa9e75',45449),(2964,'\n\"The endurance athlete is the ultimate realist.\"\n- Marty Liquori','896c6bf7832944df18c8d5db55b839de023073c5',64),(2965,'\n\"Always remember you are a totally unique individual; just like\n everyone else.\"\n -- Unknown','896c6bf7832944df18c8d5db55b839de023073c5',31913),(2966,'\n\"The truth is that there is nothing noble in being superior to\n somebody else. The only real nobility is in being superior to\n your former self.\"\n -- Whitney Young','8b4078f9f76081a0c3ce5db983aa4f340ecd7531',44403),(2967,'\n\"Usually when people are sad, they don\'t do anything. They just\n cry over their condition. But when they get angry, they bring\n about a change.\"\n -- Malcolm X','8b4078f9f76081a0c3ce5db983aa4f340ecd7531',32929),(2968,'\n\"Why couldn\'t Pheiddipedes have died at 20 miles?.\"\n- Frank Shorter, 1970','8babd6f75e605848d34c8fef353c14b64b502e6a',43346),(2969,'\n\"There are two ways of constructing a software design. One way\n is to make it so simple that there are obviously no deficiencies.\n And the other way is to make it so complicated that there are no\n obvious deficiencies.\" -- C.A.R. Hoare','8babd6f75e605848d34c8fef353c14b64b502e6a',32929),(2970,'\n\"Each problem that I solved became a rule which served afterwards \n to solve other problems.\"\n -- Rene Descartes (1596-1650), \"Discours de la Methode\"','8caef7cfd1f24143d5b7f7048b4c1301a29ec767',36879),(2971,'\n\"No one can earn a million dollars honestly.\"\n -- William Jennings Bryan (1860-1925)','8caef7cfd1f24143d5b7f7048b4c1301a29ec767',45449),(2972,'\n\"Our government has kept us in a perpetual state of fear - kept\n us in a continuous stampede of patriotic fervor - with the cry\n of grave national emergency.\" -- General Douglas MacArthur','8d93c9b0486a80bc7b6909df5440d0c190eccd4e',34631),(2973,'\n\"Two things are infinite: the universe and human stupidity; and I\'m\n not sure about the universe.\" -- Albert Einstein','8d93c9b0486a80bc7b6909df5440d0c190eccd4e',45883),(2974,'\n\"If people are good only because they fear punishment, and hope for \n reward, then we are a sorry lot indeed.\" -- Albert Einstein','8e3c07a198efa67e51a01f3ab800663a57ea6e50',36757),(2975,'\n\"Happiness is good health and a bad memory.\"\n -- Ingrid Bergman (1917-1982)','8e3c07a198efa67e51a01f3ab800663a57ea6e50',43346),(2976,'\n\"Someday man will imprison the power of the sun, release atomic\n power, and harness the rise and fall of the tides. I am proud\n of the fact that I never invented weapons to kill.\"\n -- Thomas Edison','8eac9d03673ad3fa86c1c815275470ec81580e0a',45881),(2977,'\n\"Distrust all in whom the impulse to punish is powerful.\"\n -- Nietzsche','8eac9d03673ad3fa86c1c815275470ec81580e0a',31913),(2978,'\n\"The Six Phases of a Project:\"\n   o Enthusiasm\n   o Disillusionment\n   o Panic\n   o Search for the Guilty\n   o Punishment of the Innocent\n   o Praise for non-participants\"','929d4b9dcc22eaa58c8e7d9895b5ac0e901a220c',35950),(2979,'\n\"The police are not here to create disorder. They\'re here to\n preserve disorder.\"\n -- Ex-Chicago Mayor Daley during the 1968 riots','929d4b9dcc22eaa58c8e7d9895b5ac0e901a220c',33738),(2980,'\nCann\'s (or Allen\'s) Axiom: When all else fails, read the \ninstructions.','9449672fef19ba0f9e744f5e7355c5e1400b5504',44403),(2981,'\n\"Always enjoy yourself.  Never give up.  Don\'t think of being tired.\nKeep on going until you cross the finish line.  Don\'t be upset if you\ndon\'t win.\"\n- Unknown','9449672fef19ba0f9e744f5e7355c5e1400b5504',42471),(2982,'\n\"What difference does it make how much you have? What you do\n not have amounts to much more.\"\n -- Seneca','9492dfa1e0a89d7e4fab574112c048faf6ef87b3',43599),(2983,'\n\"O\'Toole\'s Corollary of Finagle\'s Law: The perversity of the \n Universe tends towards a maximum.\"','9492dfa1e0a89d7e4fab574112c048faf6ef87b3',35952),(2984,'\n\"TV is called a medium because it is neither rare nor well\n done.\"','95b6b92a51dfce3be7bf3bd8f8bc90e70445d645',43348),(2985,'\n\"Never explain, your friends do not need it and your enemies\n will not believe you anyway.\"\n -- Elbert Hubbard','95b6b92a51dfce3be7bf3bd8f8bc90e70445d645',31909),(2986,'\n\"I like your Christ; I do not like your Christians. Your\n Christians are so unlike your Christ.\"\n -- Mohandas Gandhi','9a6aa8b8b6919d3b97d0f40c9eda85f5523c7dd2',43346),(2987,'\n\"Never be deceived that the rich will allow you to vote away\n their wealth.\"\n -- Lucy Parsons','9a6aa8b8b6919d3b97d0f40c9eda85f5523c7dd2',31913),(2988,'\n\"I do not read advertisements. I would spend all of my time\n wanting things.\"\n -- Franz Kafka','9bc8d5789d9a97e335bc3a1700b281325cb59f12',43346),(2989,'\n\"To the Honourable Member opposite I say, when he goes home \n tonight, may his mother run out from under the porch and bark at \n him\" -- John G. Diefenbaker','9bc8d5789d9a97e335bc3a1700b281325cb59f12',35950),(2990,'\n\"It is better to be feared than loved, if you cannot be both.\"\n -- Niccolo Machiavelli','9d3e25533e3322d6248f322cc879f8307421807f',44281),(2991,'\n\"In this war - as in others - I am less interested in honoring\n the dead than in preventing the dead.\" -- Butler Shaffer','9d3e25533e3322d6248f322cc879f8307421807f',45090),(2992,'\n\"If a person is to get to the meaning of life, he must learn to\n like the facts about himself, ugly as they may seem to his\n sentimental vanity, before he can learn the truth behind the\n facts. And the truth is never ugly.\"\n -- Eugene O\'Neill','9e0a916215d99196f44821dfc348c2843ee5b5a7',45881),(2993,'\n\"Rules of Optimization:\"\n Rule 1: Don\'t do it.\n Rule 2 (for experts only): Don\'t do it yet.\" \n -- M.A. Jackson','9e0a916215d99196f44821dfc348c2843ee5b5a7',45881),(2994,'\n\"Grizzly bears eat people without the benefit of music.\"\n- Don Kardong','9ebd73c45a1f7ac5c0cc48cd226748fc95464ed1',45561),(2995,'\n\"Any fool can criticize, condemn, and complain - and most \n fools do.\" -- Dale Carnegie','9ebd73c45a1f7ac5c0cc48cd226748fc95464ed1',44403),(2996,'\n\"We\'ll tell you when to start and we\'ll tell you when to stop. In between, don\'t\nthink, just keep running.\"\n- Ken Chlouber at Leadville','9f7f230b6748530889d6d498ff5f5e2934fdbe69',43346),(2997,'\n\"Heaven is under our feet as well as over our heads.\"\n- Thoreau','9f7f230b6748530889d6d498ff5f5e2934fdbe69',36757),(2998,'\n\"Some humans would do anything to see if it was possible to do it.\n If you put a large switch in some cave somewhere, with a sign on \n it saying \'End-of-the-World Switch. PLEASE DO NOT TOUCH\', the \n paint wouldn\'t even have time to dry.\"\n -- Terry Pratchett (Thief of Time)','a0e3eab3c80118379cb2e1d7b163f82494430e03',44127),(2999,'\n\"The best is the enemy of the good.\" -- Voltaire','a0e3eab3c80118379cb2e1d7b163f82494430e03',31913),(3000,'\n\"We who think we are about to die will laugh at anything.\"\n -- Terry Pratchett (Night Watch) ','a4a9258269029f3e083c5992498f66e8df216b50',43348),(3001,'\n\"If a man would follow, today, the teachings of the Old\n Testament, he would be a criminal. If he would follow strictly\n the teachings of the New, he would be insane.\"\n -- Robert G. Ingersoll','a4a9258269029f3e083c5992498f66e8df216b50',33738),(3002,'\n\"I have read your book and much like it.\"\n -- Moses Hadas (1900-1966)','a575bcefdc7a11dec7302ce66652db242e7931ea',36879),(3003,'\nHanlon\'s Razor: Never attribute to malice that which is \nadequately explained by stupidity.','a575bcefdc7a11dec7302ce66652db242e7931ea',32929),(3004,'\n\"I refuse to tip-toe through life only to arrive at death safely.\"\n- Submitted by Scott Weber','a7d3048f93d82e2e3dd337ea701ef07704939a3b',35950),(3005,'\n\"Albert grunted. \'Do you know what happens to lads who ask too \n many questions?\'\n Mort thought for a moment.\n \'No,\' he said eventually, \'what?\'\n There was silence.\n Then Albert straightened up and said, \'Damned if I know. Probably \n they get answers, and serve \'em right.\'\"\n -- Terry Pratchett (Mort) ','a7d3048f93d82e2e3dd337ea701ef07704939a3b',44403),(3006,'\n\"Assassins!\"\n-- Arturo Toscanini (1867-1957) to his orchestra','a7ddd391b75ebf78821c49f97dec245d2f39d816',44944),(3007,'\n\"They always say time changes things, but you actually have to\n change them yourself.\" -- Andy Warhol','a7ddd391b75ebf78821c49f97dec245d2f39d816',35941),(3008,'\n\"Power is the ability to control things, moral authority is the\n ability to change things\" -- Jim Wallis','a7e22a900323a761815e81b9b310ba8652841557',43348),(3009,'\n\"The trouble with the world is that the stupid are cocksure and\n the intelligent are full of doubt.\"\n -- Bertrand Russell','a7e22a900323a761815e81b9b310ba8652841557',44403),(3010,'\n\"The second 50 is done with the mind.\"\n- Unknown','a867de00c711504a6b5e881693b5c34e9f0599c5',43080),(3011,'\n\"I love talking about the Kennedy assassination. The reason I\n do is because I\'m fascinated by it. I\'m fascinated that our\n government could lie to us so blatantly, so obviously for so\n long, and we do absolutely nothing about it.\"\n -- Bill Hicks','a867de00c711504a6b5e881693b5c34e9f0599c5',44944),(3012,'\n\"Learning is not compulsory. Neither is survival.\" \n -- W. Edwards Deming','ad896e3ecf46771003093f24b88cd72af2225023',39809),(3013,'\n\"I\'ve had a wonderful time, but this wasn\'t it.\"\n -- Groucho Marx (1895-1977)','ad896e3ecf46771003093f24b88cd72af2225023',45883),(3014,'\n\"A closed mouth gathers no foot.\"','aff60c26ab00f0ad980af68c68a926fa11795ef9',43346),(3015,'\n\"Maybe her popularity stems from the fact that watching her is\n sometimes like watching a train wreck.\"\n -- John McCain\'s daughter Meghan about Ann Coulter','aff60c26ab00f0ad980af68c68a926fa11795ef9',44281),(3016,'\n\"No Sane man will dance.\" -- Cicero (106-43 B.C.)','b0eab7a122205823e6a462917b0b2ff48d77c1c5',45561),(3017,'\n\"There must be more to life than having everything.\"\n -- Maurice Sendak','b0eab7a122205823e6a462917b0b2ff48d77c1c5',43599),(3018,'\n\"Man is the best computer we can put aboard a spacecraft... and \n the only one that can be mass produced with unskilled labor.\"\n -- Wernher von Braun ','b35c0cd294cd10748019833cafa625fc33487065',35950),(3019,'\n\"I do not believe that any type of religion should ever be\n introduced into the public schools of the United States.\"\n -- Thomas Edison','b35c0cd294cd10748019833cafa625fc33487065',43599),(3020,'\n\"The Church says that the earth is flat, but I know that it is\n round, for I have seen its shadow on the moon, and I have more\n faith in a shadow than in the Church.\"\n -- Ferdinand Magellan - (disputed)','b43f3811ec0a7d607f7e654ec866167acb42336b',33738),(3021,'\n\"The race continued as I hammered up the trail, passing rocks and trees\nas if they were standing still.\"\n- Red Fisher, Wasatch \'86','b43f3811ec0a7d607f7e654ec866167acb42336b',45883),(3022,'\n\"No brain, no pain\"\n- Unknown','b4a28ddbae199fa52875d0ae24fcc43da1506407',43348),(3023,'\n\"As God once said, and I think rightly...\" -- Margaret Thatcher.','b4a28ddbae199fa52875d0ae24fcc43da1506407',36757),(3024,'\n\"Never forget that everything Hitler did in Germany was legal.\"\n -- Martin Luther King, Jr.','b54681f4b90af40d60f07266f34978535f8ca8c2',64),(3025,'\n\"Incompetents invariably make trouble for people other than\n themselves.\" -- Larry McMurtry','b54681f4b90af40d60f07266f34978535f8ca8c2',45561),(3026,'\n\"Just remember this: No one ever won the olive wreath with an\nimpressive training diary.\"\n- Marty Liquori','b5883dc5a6e6b2ff4594aa6ca86cf5739a5ab5e2',45090),(3027,'\n\"I\'d give my right arm to be ambidextrous.\" -- Brian Kernighan','b5883dc5a6e6b2ff4594aa6ca86cf5739a5ab5e2',45449),(3028,'\n\"The best way to predict the future is to invent it.\" \n -- Alan Kay','b72d0c4cbff9cfa94406481206390e0c4326ffe4',31913),(3029,'\n\"A lie gets halfway around the world before the truth has a \n chance to get its pants on.\"\n -- Sir Winston Churchill (1874-1965)','b72d0c4cbff9cfa94406481206390e0c4326ffe4',36879),(3030,'\n\"A man can\'t get rich if he takes proper care of his family.\" \n - Navaho saying.','b8509b02cc4c001875e9fcb20f3c7c0df970b5a0',45881),(3031,'\n\"Computers are useless. They can only give you answers.\" \n -- Pablo Picasso','b8509b02cc4c001875e9fcb20f3c7c0df970b5a0',64),(3032,'\n\"I do not consider it an insult, but rather a compliment to be \n called an agnostic. I do not pretend to know where many ignorant \n men are sure -- that is all that agnosticism means.\"\n -- Clarence Darrow, Scopes trial, 1925.','b957056dd8ad16f1f46ca090727df5828d933758',42471),(3033,'\n\"A man who is afraid will do anything.\"\n -- Jawaharlal Nehru','b957056dd8ad16f1f46ca090727df5828d933758',36879),(3034,'\n\"The problem with people who have no vices is that \n generally you can be pretty sure they\'re going to \n have some pretty annoying virtues.\"          \n -- Elizabeth Taylor','b9add70531519c256186579d20bc7cec509b4bd3',36879),(3035,'\n\"I\'d rather be a climbing ape than a falling angel.\"\n -- Terry Pratchett','b9add70531519c256186579d20bc7cec509b4bd3',43348),(3036,'\n\"Don\'t speak unless you can improve on the silence.\"\n -- Spanish proverb','b9b31b56d8b82c95acf0f300853d587c81b0ebc0',44127),(3037,'\n\"Free speech is the right to yell \"Theater!\" in a crowded\n fire...\" -- Abbie Hoffman','b9b31b56d8b82c95acf0f300853d587c81b0ebc0',31913),(3038,'\n\"Only a free and unrestrained press can effectively expose\n deception in government.\" \n -- Hugo Black, Supreme Court Justice','ba2e8aa59e4161ee5807078f7226c405fde751a6',42471),(3039,'\n\"If builders built buildings the way programmers wrote programs,\n then the first woodpecker that came along would destroy\n civilisation.\" -- Gerald Weinberg','ba2e8aa59e4161ee5807078f7226c405fde751a6',43080),(3040,'\n\"It\'s clearly a budget. It\'s got a lot of numbers in it.\"\n -- George W. Bush','bb7e0878197e923c50408c8cccedb73e9630a7f8',45253),(3041,'\n\"If you don\'t know where you\'re going, any road will get you\n there.\"\n -- Ancient Chinese Proverb','bb7e0878197e923c50408c8cccedb73e9630a7f8',35952),(3042,'\n\"I don\'t pray because I don\'t want to bore God.\" -- Orson Welles.','bcceeba1e77189d6a3938f29437de543a18024fb',45090),(3043,'\n\"The body is given out on loan - don\'t waste it and expect to use it\ntomorrow.\"\n- Shapiro','bcceeba1e77189d6a3938f29437de543a18024fb',31909),(3044,'\n\"Minsky\'s Second Law: Don\'t just do something. Stand there.\"\n-- Marvin Minsky','bd19c901c9edbb4009e66d9d0671450a524a4c78',31909),(3045,'\n\"He managed to stupid himself right into the White House.\"\n -- Charles Appel about George W. Bush','c04038a9efd402b01f5733a5df5e0248d29a1ad8',36879),(3046,'\n\"What is the use of a house if you haven\'t got a tolerable\n planet to put it on?\"\n -- Henry David Thoreau','c04038a9efd402b01f5733a5df5e0248d29a1ad8',36757),(3047,'\n\"Quotation confesses inferiority.\" -- Ralph Waldo Emerson ','c0f00c7e9572eb3f65756c0d2214d3e6192a8f83',45561),(3048,'\n\"The runner need not break four minutes in the mile or four hours in the\nmarathon. It is only neccessary that he runs and runs and sometimes\nsuffers. Then one day he will wake up and discover that somewhere along the\nthe way he has begun to see the order and law and love and truth that makes\nmen free.\"\n- George Sheehan','c0f00c7e9572eb3f65756c0d2214d3e6192a8f83',43599),(3049,'\n\"All truth passes through three stages. First, it is ridiculed.\n Second, it is violently opposed. Third, it is accepted as being\n self-evident.\"\n -- Arthur Schopenhauer','c1183f16ab610230ebe8a9bcb331d2d6f7ebbf66',43080),(3050,'\n\"If someone says, \'Hey, I ran 100 miles this week.  How far did you\nrun?\' ignore him!  What the hell difference does it make? ...\nThe magic is in the man, not the 100 miles.\"\n- Bill Bowerman','c1183f16ab610230ebe8a9bcb331d2d6f7ebbf66',44281),(3051,'\n\"It\'s not that I\'m afraid to die, I just don\'t want to be there\n when it happens.\" -- Woody Allen, From \'Death\' 1975.','c2760ee848bba2ea6d6bb779057fb2545f7a0825',31909),(3052,'\n\"Theory is when you know something, but it doesn\'t work. Practice \n is when something works, but you don\'t know why. Programmers combine \n theory and practice: Nothing works and they don\'t know why.\"','c2760ee848bba2ea6d6bb779057fb2545f7a0825',35941),(3053,'\n\"The difference between what the most and the least learned \n people know is inexpressibly trivial in relation to that which \n is unknown.\"  -- Albert Einstein','c46908d2d41f34d665e249864e018badd8be32fd',44127),(3054,'\n\"Debugging is twice as hard as writing the code in the first place.\n Therefore, if you write the code as cleverly as possible, you are,\n by definition, not smart enough to debug it.\"\n -- Brian Kernighan','c46908d2d41f34d665e249864e018badd8be32fd',31913),(3055,'\n\"Yes, my friends, I too am prepared to die for a cause, but\n there is no cause for which I am prepared to kill.\"\n --Mohandas Gandhi','c718aa30a6ff882b7087ce4f1567e335ea77186e',36757),(3056,'\n\"Everybody sooner or later, sits down to a banquet of\n consequences.\"\n -- Robert Louis Stevenson','c718aa30a6ff882b7087ce4f1567e335ea77186e',35950),(3057,'\n\"If we don\'t believe in freedom of expression for people we\n despise, we don\'t believe in it at all.\"\n -- Noam Chomsky','c78296aa3aa7f4083d9c41486953aded522a1f26',44403),(3058,'\n\"Why don\'t you write books people can read?\"\n -- Nora Joyce to her husband James (1882-1941)','c78296aa3aa7f4083d9c41486953aded522a1f26',31909),(3059,'\n\"The citizen who sees his society\'s democratic clothes being\n worn out and does not cry it out, is not a patriot, but a\n traitor.\"\n -- Mark Twain','c8ec393b52a33555bfca80d15909f59f2d09d0cb',45090),(3060,'\n\"My doctor told me that jogging could add years to my life.  I think he was\nright.  I feel ten years older already.\"\n- Milton Berle','c8ec393b52a33555bfca80d15909f59f2d09d0cb',45253),(3061,'\n\"Once that distance had been passed in training, an important physical\nand psychological threshold had been crossed. It was no longer a\nquestion of *if* it could be done.  Rather, it became a question of\n*how fast* it could be done.\"\n- Mike Plant (about Dave Scott)','ca9e263d07340b8b04eea95e4172ccb3800e773a',44944),(3062,'\n\"It is hard, I submit, to loathe bloodshed, including war, more\n than I do, but it is still harder to exceed my loathing of the\n very nature of totalitarian states in which massacre is only an\n administrative detail.\"\n -- Vladimir Nabokov','ca9e263d07340b8b04eea95e4172ccb3800e773a',32929),(3063,'\n\"If child molestation is actually your concern, how come we\n don\'t see Bradley tanks knocking down Catholic churches?\"\n -- Bill Hicks, 1993, referencing the Waco siege','cebf555886eaf921b47b20ad0acb32e85273e624',39809),(3064,'\n\"There Ought to be Limits to Freedom!\" \n -- George W. Bush, commenting on gwbush.com (05/21/1999)','cebf555886eaf921b47b20ad0acb32e85273e624',45090),(3065,'\n\"Sufficiently advanced incompetence is indistinguishable from malice.\"','cf39da87bbef9b83a039ae289a2dcb8a93bf1814',36879),(3066,'\n\"Politics is the art of looking for trouble, finding it \n everywhere, diagnosing it incorrectly, and applying the wrong \n remedies.\" -- Groucho Marx','cf39da87bbef9b83a039ae289a2dcb8a93bf1814',44281),(3067,'\n\"Measuring programming progress by lines of code is like measuring\n aircraft building progress by weight.\" -- Bill Gates','cf9e834770ba6c82d76e63220ee31818c4752951',43346),(3068,'\n\"Studies have shown that an ant can carry one hundred times its\n own weight, but there is no known limit to the lifting power of\n the average tiny eighty-year-old Spanish peasant grandmother.\"\n -- Terry Pratchett (Reaper Man) ','cf9e834770ba6c82d76e63220ee31818c4752951',36757),(3069,'\n\"It is practically impossible to teach good programming style to \n students that have had prior exposure to Basic; as potential \n programmers they are mentally mutilated beyond hope of \n regeneration.\" -- Edsger Dijkstra','d05785002742a30502dde3731b28883334e46040',45449),(3070,'\nDow\'s Law: In a hierarchical organization, the higher the level, \nthe greater the confusion.','d05785002742a30502dde3731b28883334e46040',42471),(3071,'\n\"Patriotism is the last refuge of a scoundrel.\"\n -- Samuel Johnson, English lexicographer, to which Ambrose\n Bierce replied: \'I beg to submit that it is the first.\'','d077ba37b8c977b50b81aeb238f7aa4d7d5a8646',31913),(3072,'\n\"The shepherd always tries to persuade the sheep that their\n interests and his own are the same.\" -- Marie Beyle','d077ba37b8c977b50b81aeb238f7aa4d7d5a8646',32929),(3073,'\nConway\'s Law: In any organization there will always be one person \nwho knows what is going on.  This person must be fired.','d2fce7d4fae7323ea1b94f177e0a41a42fe0dd09',31913),(3074,'\n\"A hen is only an egg\'s way of making another egg.\" \n -- Samuel Butler','d2fce7d4fae7323ea1b94f177e0a41a42fe0dd09',42471),(3075,'\n\"One man\'s magic is another man\'s engineering. Supernatural is\n a null word.\"\n -- Robert Heinlein','d69729e9779952a73e8ef1e71858b08a92a0fa8b',36757),(3076,'\n\"A man can\'t be too careful in the choice of his enemies.\"\n -- Oscar Wilde (1854-1900)','d69729e9779952a73e8ef1e71858b08a92a0fa8b',44403),(3077,'\n\"Unformed people delight in the gaudy and in novelty. Cooked\n people delight in the ordinary.\" -- Erik Naggum','db8dc2b7a3bb754178d96fe9b4e434d0c017825b',42471),(3078,'\n\"Beware of the man whose god is in the skies.\"\n -- George Bernard Shaw','db8dc2b7a3bb754178d96fe9b4e434d0c017825b',45561),(3079,'\n\"Did you ever walk in a room and forget why you walked in? I think\n that\'s how dogs spend their lives.\" -- Sue Murphy.','dd68e246ab85c71494243afefd589d2abb6e6d62',35950),(3080,'\n\"Because I do it with one small ship, I am called a terrorist\n(pirate?). You do it with a whole fleet and are called an\n emperor.\"\n -- St. Augustine','dd68e246ab85c71494243afefd589d2abb6e6d62',35952),(3081,'\n\"A woman is an occasional pleasure but a cigar is always a smoke.\"\n -- Groucho Marx','e3ed3963c28fe4011dd0b237997fb0214a0fb8d5',45253),(3082,'\n\"... so as we walked along the river toward Rucky Chucky, I said the\nwords that most men say to a pretty woman as they walk along the river\nunder a starry night on their first date: \"If you were a real hardass,\nyou\'d stick your finger down your throat and clear your stomach and if\nyou won\'t do it, I will.\"\n- Stan Jensen, pacing Sarah Lowell at WS\'97','e3ed3963c28fe4011dd0b237997fb0214a0fb8d5',31913),(3083,'\n\"If there is no Hell, a good many preachers are obtaining money \n under false pretences.\" -- William Sunday.','e4b5a2b01ee1b51b2d17a165855b43c142d822c4',45883),(3084,'\n\"I\'m so poor I can\'t even pay attention.\" -- Unknown','e4b5a2b01ee1b51b2d17a165855b43c142d822c4',35658),(3085,'\n\"All truth passes through three stages. First, it is ridiculed. \n Second, it is violently opposed. Third, it is accepted as being \n self-evident.\"\n -- Arthur Schopenhauer (1788-1860)','e5cb99e93e3a3839e702691c45d6cc28ffcabf9e',42471),(3086,'\n\"Every morning in Africa, a gazelle wakes up.  It knows it must\noutrun the fastest lion or it will be killed.  Every morning in\nAfrica, a lion wakes up.  It knows it must run faster than the\nslowest gazelle, or it will starve.  It doesn\'t matter whether\nyou\'re a lion or a gazelle - when the sun comes up, you\'d better\nbe running.\"\n- Unknown','e5cb99e93e3a3839e702691c45d6cc28ffcabf9e',43346),(3087,'\n\"To be wronged is nothing unless you continue to remember it.\"\n -- Confucius','e6cfa8e4a054b888d7a80898d1a7092aa631a302',44944),(3088,'\n\"Know all and you will pardon all.\"\n -- Thomas  Kempis','e6cfa8e4a054b888d7a80898d1a7092aa631a302',42471),(3089,'\n\"They said I was the greatest pitcher they ever saw; I couldn\'t\n understand why they couldn\'t give me no justice.\"\n -- Satchel Paige','e74f0f1f0934fe0ab10af864e8ea13c69913a897',44127),(3090,'\n\"Fill the unforgiving minute with sixty seconds worth of \n distance run.\" -- Rudyard Kipling (1865-1936)','e74f0f1f0934fe0ab10af864e8ea13c69913a897',36757),(3091,'\n\"When you give food to the poor, they call you a saint. When\n you ask why the poor have no food, they call you a communist.\"\n -- Archbishop Helder Camara','e918c0b5ec0d3599cc2bbda9dc7bbbdf23816ce0',32929),(3092,'\n\"Complexity kills. It sucks the life out of developers, it makes\n products difficult to plan, build and test, it introduces\n security challenges and it causes end-user and administrator\n frustration.\" -- Ray Ozzie','e918c0b5ec0d3599cc2bbda9dc7bbbdf23816ce0',35941),(3093,'\nRobert E. Lee\'s Truce: Judgement comes from experience; \nexperience comes from poor judgement.','e9c340478ebb17ed024e217d7013275de0fabf8a',64),(3094,'\n\"Can anything be stupider than that a man has the right to kill\n me because he lives on the other side of a river and his ruler\n has a quarrel with mine, though I have not quarreled with him?\"\n -- Blaise Pascal','e9c340478ebb17ed024e217d7013275de0fabf8a',35952),(3095,'\n\"For animals, the entire universe has been neatly divided into \n things to (a) mate with, (b) eat, (c) run away from, and (d) \n rocks.\"\n -- Terry Pratchett (Equal Rites)','e9f98fd4d7497768938df13d71e28986e24b7e91',44127),(3096,'\n\"Sufficiently advanced incompetence is indistinguishable from malice.\"','e9f98fd4d7497768938df13d71e28986e24b7e91',34631),(3097,'\n\"A man can\'t get rich if he takes proper care of his family.\" \n - Navaho saying.','ea2cc4f43528792dd726473df61a0a9ddb13952f',39809),(3098,'\n\"Let\'s be very honest about what this is about. It\'s not about\n bashing Democrats, it\'s not about taxes, they have no idea what\n the Boston tea party was about, they don\'t know their history\n at all. This is about hating a black man in the White House.\n This is racism straight up.\" -- Janeane Garofalo ','ea2cc4f43528792dd726473df61a0a9ddb13952f',36879),(3099,'\n\"I don\'t feel good.\" -- Luther Burbank, dying words','ecbc54904eb7fe332c5764cbefeee200527ff160',44281),(3100,'\n\"The graveyards are full of indispensable men.\"\n -- Charles de Gaulle (1890-1970)','ecbc54904eb7fe332c5764cbefeee200527ff160',31909),(3101,'\n\"Computers are good at following instructions, but not at reading\n your mind.\" -- Donald Knuth','ee02c29275e85aedd7d971820672ce0454733b81',31909),(3102,'\n\"Technology is dominated by two types of people: Those who\n understand what they do not manage. Those who manage what they\n do not understand.\" -- Putt\'s Law','ee02c29275e85aedd7d971820672ce0454733b81',35658),(3103,'\n\"It\'s the quitting that really is hard.\"\n- Gene Thibeault','ee176776f84a8e7eb91c3560943535558748ab9e',35950),(3104,'\n\"Prohibition goes beyond reason in that it attempts to control\n a man\'s appetite through legislation. A prohibition law strikes\n a blow at the very principles this country was founded upon.\"\n -- Abraham Lincoln','ee176776f84a8e7eb91c3560943535558748ab9e',45883),(3105,'\n\"Fill the unforgiving minute with sixty seconds worth of \n distance run.\" -- Rudyard Kipling (1865-1936)','f19483c6a9fbacfebff05eb372439d8c0403745f',42471),(3106,'\n\"Never raise your hands to your kids. It leaves your\n groin unprotected.\" -- Red Button','f19483c6a9fbacfebff05eb372439d8c0403745f',36879),(3107,'\n\"The gu