ific disciplines are \n examples of giants standing on the shoulders of other giants. \n It has also been said that the software industry is an example\n of midgets standing on the toes of other midgets.\" \n -- Alan Cooper About Face','fcd8b5b9ecb89e65d56504f6f6cfe82eed26887e',43348),(3118,'\n\"So far as I can remember, there is not one word in the Gospels\n in praise of intelligence.\"\n -- Bertrand Russel','fcd8b5b9ecb89e65d56504f6f6cfe82eed26887e',34631),(3119,'\n\"How can you make a revolution without executions?\"\n -- Lenin on hearing that the death penalty had been abolished\n by the Soviet','fe286d02f80118de47f2226c2fce9f7be0bc04f0',43599),(3120,'\nGordon\'s First Law: If a research project is not worth doing at \nall, it is not worth doing well.','fe286d02f80118de47f2226c2fce9f7be0bc04f0',35941),(3121,'\n\"You must do the thing you think you cannot do.\"\n- Eleanor Roosevelt','fe5fe4af3281ec07715498f052a7350c26c151c0',35950),(3122,'\n\"The compulsion to do good is an innate American trait. Only\n North Americans seem to believe that they always should, may,\n and actually can choose somebody with whom to share their\n blessings. Ultimately this attitude leads to bombing people\n into the acceptance of gifts.\"\n -- Ivan Illich','fe5fe4af3281ec07715498f052a7350c26c151c0',36879),(3123,'\n\"Assassins!\"\n-- Arturo Toscanini (1867-1957) to his orchestra','feef930093fe07af383a9b8a7c02d0547d6f3f1e',45881),(3124,'\n\"You get what anyone gets; you get a lifetime.\"\n -- Death, Neil Gaiman Comic Sandman','feef930093fe07af383a9b8a7c02d0547d6f3f1e',34631),(3125,'\n\"Convictions are more dangerous foes of truth than lies.\"\n -- Nietzsche','ff3d3275e74dcbac2d970eea9ad779212cadda17',44403),(3126,'\n\"It is preoccupation with possessions, more than anything else,\n that prevents us from living freely and nobly.\"\n -- Bertrand Russell','ff3d3275e74dcbac2d970eea9ad779212cadda17',31913),(3127,'\n\"If one were to take the bible seriously one would go mad. But\n to take the bible seriously, one must be already mad.\"\n -- Aleister Crowley','0012e4f1dc0e5920644dc5eed874ce6baa7e25d7',31909),(3128,'\n\"A hen is only an egg\'s way of making another egg.\" \n -- Samuel Butler','0012e4f1dc0e5920644dc5eed874ce6baa7e25d7',44127),(3129,'\n\"Emulate your heros, but don\'t carry it too far.  Especially \n if they are dead.\"','037880d210451b590c3a5229ea350645724e7e15',33738),(3130,'\n\"I wasn\'t a truly genuine trail ultrarunner until March 7, 1992 at the\nWild Oak 50 near Harrisonburg, Virginia.  It was a rainy day and\nsimultaneously, while I was piddling on the run, chewing on an energy\nbar and washing it down with Mountain Dew, my nose was dripping and I\nfarted.  That was the ultimate defining moment in my trail running\ncareer, if not my entire life.\"\n- Bob Boeder','037880d210451b590c3a5229ea350645724e7e15',35950),(3131,'\n\"It is lamentable, that to be a good patriot one must become\n the enemy of the rest of mankind.\"\n -- Voltaire','05c059570f32bd7b35cbb165072162cda319f63a',36757),(3132,'\n\"A lie gets halfway around the world before the truth has a \n chance to get its pants on.\"\n -- Sir Winston Churchill (1874-1965)','05c059570f32bd7b35cbb165072162cda319f63a',35658),(3133,'\n\"No brain, no pain\"\n- Unknown','060c7c9aea07bd061c43b93a8d51cc043855d7a3',36879),(3134,'\n\"I plan to live forever. So far so good.\" \n  -- Rob C. Claffie in borland.public.off-topic','060c7c9aea07bd061c43b93a8d51cc043855d7a3',43348),(3135,'\n\"Speed is sex ... distance is love.\"\n- David Blaikie','0c16bf9fb72d49c26219b06182a15e919948ef06',45449),(3136,'\n\"Organizations which design systems are constrained to produce\n designs which are copies of the communication structures of these\n organizations. (For example, if you have four groups working on\n a compiler, you\'ll get a 4-pass compiler)\" -- Conway\'s Law','0c16bf9fb72d49c26219b06182a15e919948ef06',45090),(3137,'\n\"The compulsion to do good is an innate American trait. Only\n North Americans see