ou must\n do it this way. A virtual function says you have to do this,\n but you don\'t have to do it this way. That\'s their fundamental\n difference.\" -- Scott Meyers','f27cac1218484bcb9d75a88232c544bfb19fa9a3',36757),(3502,'\n\"A jury consists of twelve persons chosen to decide who has the\n better lawyer.\"\n -- Robert Frost','f6c851b89dddaf2314c44b0b0fd3f7f70784fcbb',35950),(3503,'\n\"Most software today is very much like an Egyptian pyramid with\n millions of bricks piled on top of each other, with no \n structural integrity, but just done by brute force and thousands\n of slaves.\" -- Alan Kay','f6c851b89dddaf2314c44b0b0fd3f7f70784fcbb',43348),(3504,'\n\"From the moment I picked your book up until I laid it down I \n was convulsed with laughter. Some day I intend reading it.\"\n -- Groucho Marx (1895-1977)','f754e904dfc75ae544977f3f441a1d1b486392cc',44127),(3505,'\n\"I have never let my schooling interfere with my education.\"\n -- Mark Twain (1835-1910)','f754e904dfc75ae544977f3f441a1d1b486392cc',45090),(3506,'\n\"C++ tries to guard against Murphy, not Machiavelli.\" \n -- Damian Conway','f7b4fcd1404631ab5502b8a9ddc8081637865056',36757),(3507,'\n\"I wouldn\'t mind dying - it\'s the business of having to stay \n dead that scares the shit out of me.\" -- R. Geis.','f7b4fcd1404631ab5502b8a9ddc8081637865056',45561),(3508,'\n\"Do not worry about your difficulties in mathematics. I can assure\n you that mine are still greater.\" -- Albert Einstein','f9afc47c733ed36985aa2e66cf879bd48b20e40f',44127),(3509,'\n\"The gods too are fond of a joke.\" -- Aristotle (384-322 B.C.)','f9afc47c733ed36985aa2e66cf879bd48b20e40f',35952),(3510,'\n\"Exceptions relieve the programmer of tedious writing\n boilerplate code -- without removing the semantics of said\n code -- and they allow the programmer to arrange the code so\n that error handling code is more separate from the main program\n logic.\" \n -- Herb Sutter','fc1d7734529e84f8deb77cd00aa8cd80fb71e5e4',35941),(3511,'\n\"Unfo