one applying\n for any kind of job?\" \n -- Weinberg The Psychology of Computer Programming','0f8eabfc55ec13950d6abb0e03e8f539eb8d0629',43599),(3546,'\n\"The gulf between what we feel we are doing and what others perceive us\nto be doing will remain the most ultra of all distances, one that no\namount of miles or words can finally bridge.\"\n- Hart','129629539ae5981a45a62f44189fdd13df871bb4',31913),(3547,'\n\"If a man does his best, what else is there?\"\n-- General George S. Patton (1885-1945)','129629539ae5981a45a62f44189fdd13df871bb4',31909),(3548,'\n\"A distributed system is one in which the failure of a computer\n you didn\'t even know existed can render your own computer\n unusable.\" -- Leslie Lamport','1337657643fd0d52ac5e7876743a129134fb40a7',36757),(3549,'\n\"Reality is merely an illusion, albeit a very persistent one.\"\n -- Albert Einstein (1879-1955)','1337657643fd0d52ac5e7876743a129134fb40a7',43348),(3550,'\n\"First they ignore you, then they laugh at you, then they fight \n you, then you win.\" -- Mahatma Gandhi (1869-1948)','143df602a55fa43b4454d778d1fe8555f9d162d0',35658),(3551,'\n\"Say what you will about the Ten Commandments, you must always\n come back to the pleasant fact that there are only ten of them.\"\n -- H. L. Mencken','143df602a55fa43b4454d778d1fe8555f9d162d0',45090),(3552,'\n\"The years of peak mental activity are undoubtedly between \nthe ages of four and eighteen.  At four we know all the \nquestions, at eighteen all the answers.\" -- unknown','176b1b0ef1b284f707225ced782648f4d0025ac9',36757),(3553,'\nMurphy\'s Law Of Thermodynamics: Things get worse under pressure.','176b1b0ef1b284f707225ced782648f4d0025ac9',34631),(3554,'\n\"The best thing about a boolean is even if you are wrong, you \n are only off by a bit.\"','18c85e8f2c6d60773372ef600c979ff3874a91db',42471),(3555,'\n\"Sufficiently advanced incompetence is indistinguishable from malice.\"','18c85e8f2c6d60773372ef600c979ff3874a91db',31909),(3556,'\n\"Every man is guilty of all the good he didn\'t do.\"\n -- Voltaire','1b268018fe7300ce41c5413e41dd1a18b7726bf4',45253),(3557,'\n\"When ideas fail, words come in very handy.\" -- Goethe (1749-1832)','1b268018fe7300ce41c5413e41dd1a18b7726bf4',45881),(3558,'\n\"Religion, comprises a system of wishful illusions together\n with a disavowal of reality, such as we find in an isolated\n form nowhere else but in amentia, in a state of blissful\n hallucinatory confusion.\"\n -- Sigmund Freud','1ba3277e3f03964bfbeb6a7b99a7d2667f3a1d94',43346),(3559,'\n\"You know your god is man-made when he hates all the same\n people you do.\"\n -- [Usenet]','1ba3277e3f03964bfbeb6a7b99a7d2667f3a1d94',31913),(3560,'\n\"Not only do you continue to babble nonsense, you can\'t even \n correctly remember the nonsense you babbled just minutes ago.\" \n -- Rob Graham','1d8548bc79bcb5dd8cc9f56646c0e952227ddd07',35658),(3561,'\nThe Last One\'s Law Of Program Generators: A program generator \ncreates programs that are more \"buggy\" than the program \ngenerator.','1d8548bc79bcb5dd8cc9f56646c0e952227ddd07',45090),(3562,'\n\"... Somehow we find it hard to sell our values, namely that\n the rich should plunder the poor.\"\n -- John Foster Dulles','1db74d1e7956e5f896cc6754bb2bda796eecf09c',33738),(3563,'\n\"War is not the continuation of politics with different means, \n it is the greatest mass-crime perpetrated on the community of \n man.\" -- Alfred Adler','1db74d1e7956e5f896cc6754bb2bda796eecf09c',44127),(3564,'\n\"I criticize by creation - not by finding fault.\" \n -- Cicero (106-43 B.C.)','1f927f440f0d4981ebc6b80725f69a0fcd4bd15c',43080),(3565,'\n\"Why do grandparents and grandchildren get along so well?  They \n have the same enemy -- the mother.\" -- Claudette Colbert.','1f927f440f0d4981ebc6b80725f69a0fcd4bd15c',44127),(3566,'\n\"I love talking about the Kennedy assassination. The reason I\n do is because I\'m fascinated by it. I\'m fascinated that our\n government could lie to us so blatantly, so obviously for so\n long, and we do absolutely nothing about it.\"\n -- Bill Hicks','1fb27bde2342b682a95981e272e3c0ab3e759d1f',43348),(3567,'\n\"God is real unless declared integer\" -- david ','1fb27bde2342b682a95981e272e3c0ab3e759d1f',32929),(3568,'\n\"I do not believe that any type of religion should ever be\n introduced into the public schools of the United States.\"\n -- Thomas Edison','208113e77ca03938c765671f38ff9b84c06c9473',32929),(3569,'\n\"If you think your management doesn\'t know what it\'s doing or\n that your organisation turns out low-quality software crap that\n embarrasses you, then leave.\" \n -- Edward Yourdon Rise and Resurrection of the American \n    Programmer','208113e77ca03938c765671f38ff9b84c06c9473',44127),(3570,'\n\"Either God wants to abolish evil, and cannot; or he can, but\n does not want to. If he wants to, but cannot, he is impotent.\n If he can, but does not want to, he is wicked. If, as they say,\n God can abolish evil, and God really wants to do it, why is\n there evil in the world?\"\n -- Epicurus','2105578f30afd2a04f4265ef60c31ced74807bd2',45090),(3571,'\n\"Heaven is an American salary, a Chinese cook, an English house, \n and a Japanese wife. Hell is defined as having a Chinese salary,\n an English cook, a Japanese house, and an American wife.\"\n -- James H. Kabbler III.','2105578f30afd2a04f4265ef60c31ced74807bd2',43346),(3572,'\n\"Laurel and Hardy, that\'s John and Yoko. And we stand a better\n chance under that guise because all the serious people like\n Martin Luther King, Jr. and Kennedy and Gandhi got shot.\"\n -- John Lennon','23c1b78afe8d17b64e5572d7af014b17e6189b52',32929),(3573,'\n\"The minority, the ruling class at present, has the schools and\n press, usually the Church as well under its thumb. This enables\n it to organize and sway the emotions of the masses, and make\n its tool of them.\"\n -- Albert Einstein','23c1b78afe8d17b64e5572d7af014b17e6189b52',32929),(3574,'\n\"Form no covetous desire, so that the demon of greediness may\n not deceive