e useful, or it can just get in the way.\"\n- Karl King','458b8e1374ad25cd206027d912827671180f8306',44127),(3627,'\n\"Science has done more for the development of western\n civilization in one hundred years than Christianity did in\n eighteen hundred years.\"\n -- Jeff Burroughs','47645afb7b2eb5d062ac3c73b57ddad7bc3a7541',43348),(3628,'\n\"Fill the unforgiving minute with sixty seconds worth of \n distance run.\" -- Rudyard Kipling (1865-1936)','47645afb7b2eb5d062ac3c73b57ddad7bc3a7541',45449),(3629,'\n\"Getting an education was a bit like a communicable sexual disease. \n It made you unsuitable for a lot of jobs and then you had the urge\n to pass it on.\" -- Terry Pratchett, Hogfather','4aa83fb5be976b39ee8c5d84991e20a9343c33d2',45449),(3630,'\n\"Computers make it easier to do a lot of things, but most of the \n things they make it easier to do don\'t need to be done.\" \n -- Andy Rooney.','4aa83fb5be976b39ee8c5d84991e20a9343c33d2',45561),(3631,'\n\"... slowed my pace to the point that I could have been rear-ended by a\nsleepy snail.\"\n- Dave Olney','4ad4b85c23b825eafbeec5dcf84ff9b11c3b1c78',44944),(3632,'\n\"> > > Goodbye to all! Thanks for years of great fun and good \n > > > business!\n > > Suicide or MS C++?\n > Is there a difference?\n Suicide hurts only once...\"\n -- Conversation on borland.public.delphi.non-technical','4ad4b85c23b825eafbeec5dcf84ff9b11c3b1c78',36757),(3633,'\n\"It is far easier to make war than peace.\" -- Georges Clemenceau','4adb6ea83ff196924462448c6608080afc1e6b5a',32929),(3634,'\n\"It is time I stepped aside for a less experienced and less able \n man.\" -- Professor Scott Elledge on his retirement from Cornell','4adb6ea83ff196924462448c6608080afc1e6b5a',44944),(3635,'\n\"If Klingons were runners, they would be Ultrarunners.\"\n- Bryan Hacker','4d4163643b19f6e4ae350328277ee35f26cdb1d5',45449),(3636,'\n\"The shepherd always tries to persuade the sheep that their\n interests and his own are the same.\" -- Marie Beyle','4d4163643b19f6e4ae