umor is part of the art of leadership, of getting \n along with people, of getting things done.\" \n -- Dwight D. Eisenhower (1890-1969)','52e39965d37749903ced91c49d41d01e5f292fbb',64),(3648,'\n\"Come on, you sons of bitches - do you want to live forever\"\n- Gunnery Sergeant Dan Daly, USMC, Belleau Wood, June 1918','52e39965d37749903ced91c49d41d01e5f292fbb',44281),(3649,'\n\"Fear, like pain, may only be God\'s way ... of hurting us.\"\n- Unknown','53a6593ea063a3cda52a0e5ef1ec89326dd75176',43348),(3650,'\n\"If there\'s one thing I know it\'s God does love a good joke.\"\n -- Hugh Elliott, Standing Room Only weblog, 05-01-04','53a6593ea063a3cda52a0e5ef1ec89326dd75176',35950),(3651,'\n\"His philosophy was a mixture of three famous schools -- the Cynics,\n the Stoics and the Epicureans -- and summed up all three of them in\n his famous phrase, \'You can\'t trust any bugger further than you can\n throw him, and there\'s nothing you can do about it, so let\'s have a \n drink.\'\"\n -- Terry Pratchett (Small Gods) ','567a54aeb7f8987bfc2607b7f3723cba99163cb5',33738),(3652,'\n\"Pardon him, Theodotus; he is a barbarian, and thinks that the \n customs of his tribe and island are the laws of nature.\" \n -- George Bernard Shaw','567a54aeb7f8987bfc2607b7f3723cba99163cb5',43346),(3653,'\n\"In Germany they first came for the Communists, \n and I didn\'t speak up because I wasn\'t a Communist. \n Then they came for the Jews, \n and I didn\'t speak up because I wasn\'t a Jew. \n Then they came for the trade unionists, \n and I didn\'t speak up because I wasn\'t a trade unionist. \n Then they came for the Catholics, \n and I didn\'t speak up because I was a Protestant. \n Then they came for me - \n and by that time no one was left to speak up.\" \n -- Pastor Martin Niemller','57ba76ddd1da04b1179360950a68dc5d43be71fc',32929),(3654,'\n\"Being deeply loved by someone gives you strength; loving\n someone deeply gives you courage.\"\n -- Lao tzu','57ba76ddd1da04b1179360950a68dc5d43be71fc