1aa8564b280c',43348),(4043,'\n\"Hanlon\'s Razor: Never attribute to malice that which can be \n adequately explained by stupidity.\"','5ca4045f83677d68114a72586591727fefe7b0c2',45561),(4044,'\n\"How good bad music and bad reasons sound when we march against\n an enemy!\"\n -- Nietzsche','5ca4045f83677d68114a72586591727fefe7b0c2',45090),(4045,'\nBrook\'s Law: Adding manpower to a late software project makes it \nlater.','5ef872a9fa7fcff0677696457dd869535d547e45',31909),(4046,'\n\"A printer consists of three main parts: the case, the jammed \n paper tray and the blinking red light\" -- unknown','5ef872a9fa7fcff0677696457dd869535d547e45',31913),(4047,'\n\"You have to stay in shape.  My grandmother, she started walking \n five miles a day when she was 60.  She\'s 97 today and we don\'t \n know where she is!\" -- Ellen DeGeneres.','612d9ec34bddce122042db4c143e86dca655bc15',44127),(4048,'\n\"The degree of one\'s emotion varies inversely with one\'s\n knowledge of the facts. The less you know, the hotter you get.\"\n -- Bertrand Russel','612d9ec34bddce122042db4c143e86dca655bc15',43346),(4049,'\n\"The difference between pornography and erotica is lighting.\"\n -- Gloria Leonard','643fec50e79c69bc6bbb7616afd3904acf40867c',43348),(4050,'\n\"I\'d rather be a climbing ape than a falling angel.\"\n -- Terry Pratchett','643fec50e79c69bc6bbb7616afd3904acf40867c',45883),(4051,'\n\"There is no sincerer love than the love of food.\"\n -- George Bernard Shaw (1856-1950)','64ccc7533460801b124e476834ea5802fd29109b',35941),(4052,'\n\"We live in our desires rather than in our achievements.\"\n -- George Moore','64ccc7533460801b124e476834ea5802fd29109b',35658),(4053,'\n\"There is only one nature - the division into science and \n engineering is a human imposition, not a natural one. Indeed, \n the division is a human failure; it reflects our limited \n capacity to comprehend the whole.\" -- Bill Wulf','64e0cfdcb9cb9a94dabbe7806d529ae6b808d7d6',43346),(4054,'\n\"It is practically imposible to teach good programming to \n students that have had a prior exposure to BASIC: as potential \n programmers they are mentally mutilated beyond hope of \n regeneration.\" -- Edsger Dijkstra','64e0cfdcb9cb9a94dabbe7806d529ae6b808d7d6',35952),(4055,'\n\"If at first you don\'t succeed, you can always become an\nultramarathoner.\"\n- Bruce Fordyce','667e624fb37408ba37177b3807fafa63c5a8332a',32929),(4056,'\n\"There is nothing more difficult to carry out, nor more doubtful\n of success, nor more dangerous to handle, than to initiate a\n new order of things. For the reformer has enemies in all those\n who profit by the old order, and only lukewarm defenders in all\n those who would profit by the new...\" \n -- Niccolo Macchiavelli, The Prince','667e624fb37408ba37177b3807fafa63c5a8332a',45561),(4057,'\n\"The more of us that do it, the harder it is for them to dismiss us\nas just a bunch of really weird people.  Especially when we otherwise\nappear so normal.\"\n- Dan Hawthorne','66efd9eefecf45dd64eff8e5cb2d13e005041925',33738),(4058,'\n\"I am tired of fighting, our chiefs are killed...it is cold and\n we have no blankets. The little children are freezing to\n death...hear me, my chiefs, I am tired: my heart is sick and\n sad. From where the sun now stands...I will fight no more\n forever...\"\n -- Chief Joseph, before his tribe was slaughtered','66efd9eefecf45dd64eff8e5cb2d13e005041925',39809),(4059,'\n\"Every war when it comes, or before it comes, is represented\n not as a war but as an act of self-defense against a homicidal\n maniac.\"\n -- George Orwell','676465d91aad816c4bdd02e1441eaa303aeb6b0e',45883),(4060,'\nGoebel\'s Observation On Utopia: If everyone believed in Peace \nthey would immediately begin fighting over the best way to \nachieve it.','676465d91aad816c4bdd02e1441eaa303aeb6b0e',45253),(4061,'\n\"Invisible Pink Unicorns are beings of awesome mystical power.\n We know this because they manage to be invisible and pink at\n the same time. Like all religions, the Faith of the Invisible\n Pink Unicorns is based upon both logic and faith. We have faith\n that they are pink; we logically know that they are invisible\n because we can\'t see them.\"\n -- Steve Eley','67f5b2d414d3cc4e9b5fcded1d75f39ec270323b',31909),(4062,'\n\"90% of ultrarunning is 100% mental.\"\n- Unknown','67f5b2d414d3cc4e9b5fcded1d75f39ec270323b',32929),(4063,'\n\"Criticism is prejudice made plausible.\" \n -- Henry Louis Mencken (1880-1956)','70e8084f6e917fd2851398cb2a71225f398190e8',43599),(4064,'\n\"This country, with its institutions, belongs to the people who\n inhabit it. Whenever they shall grow weary of the existing\n government, they can exercise their constitutional right of\n amending it, or exercise their revolutionary right to overthrow\n it.\"\n -- Abraham Lincoln','70e8084f6e917fd2851398cb2a71225f398190e8',43346),(4065,'\n\"One doesn\'t have a sense of humor. It has you.\" -- Larry Gelbart','7263d678abae47b211a7de6693c9df3ca96d228c',31913),(4066,'\n\"It\'s not the races you enter that count. It\'s your runs in training\nand sticking with it. It\'s how you adjust to injury and how you recover\nthat makes you a good runner.\"\n- Dave Hladysh','7263d678abae47b211a7de6693c9df3ca96d228c',43080),(4067,'\n\"How the teacher reacts when something goes wrong tells the class\n what\'s important.\" -- Bruce Hamilton','739adce0f32494bfabaacc0bafd3db60b82a3397',33738),(4068,'\n\"The pain is temporary, The pride lasts forever.\"\n- Unknown','739adce0f32494bfabaacc0bafd3db60b82a3397',44127),(4069,'\n\"The optimist proclaims that we live in the best of all\n possible worlds; and the pessimist fears this is true.\"\n -- James Branch Cabell','745b713580e90e3eed014594fdd55124a250d868',64),(4070,'\n\"Education is a progressive discovery of our own ignorance.\"\n -- Will Durant','745b713580e90e3eed014594fdd55124a250d868',45883),(4071,'\n\"No matter how well you know the course, no matter how well you may\nhave done in a given race in the past, you never know for 