apacity for\n not even hearing about them.\"\n -- George Orwell','7eab03474ef222ca582105938fd0b07ec95e64ce',42471),(4094,'\n\"I have come to believe that the whole world is an enigma, a \n harmless enigma that is made terrible by our own mad attempt to \n interpret it as though it had an underlying truth.\"\n -- Umberto Eco','7eab03474ef222ca582105938fd0b07ec95e64ce',45253),(4095,'\n\"There are only two ways to live your life. One is as though \n nothing is a miracle. The other is as though everything is a \n miracle.\" -- Albert Einstein (1879-1955)','82915e4377961685decc9c25797c3eff222ea570',31909),(4096,'\n\"Never was anything great achieved without danger.\"\n -- Niccolo Machiavelli','82915e4377961685decc9c25797c3eff222ea570',31913),(4097,'\n\"One morning I shot a bear in my pajamas. How it got into my\n pajamas I\'ll never know.\"\n -- Groucho Marx','8336e40ea16b97a960be85fc496a66921cd296cc',43348),(4098,'\n\"Government is actually the worst failure of civilized man.\n There has never been a really good one, and even those that are\n most tolerable are arbitrary, cruel, grasping and\n unintelligent.\"\n -- H. L. Mencken','8336e40ea16b97a960be85fc496a66921cd296cc',35950),(4099,'\n\"Life is pleasant. Death is peaceful. It\'s the transition that\'s \n troublesome.\" -- Isaac Asimov','85568b20c3315286c4dfebb330b25146f92bed66',44403),(4100,'\n\"A doctor can bury his mistakes but an architect can only advise \n his clients to plant vines.\"\n -- Frank Lloyd Wright (1868-1959)','85568b20c3315286c4dfebb330b25146f92bed66',32929),(4101,'\n\"Whether you think that you can, or that you can\'t, you are \n usually right.\" -- Henry Ford (1863-1947)','86ca4b94b6838eba758fcdd9da31a4c5cc384526',44281),(4102,'\n\"Despite what seems like the extraordinary nature of these events, in the\nend, they make you even more human.\n- Joel McNamara','86ca4b94b6838eba758fcdd9da31a4c5cc384526',45253),(4103,'\n\"Religion is not merely the opium of the masses; it\'s the\n cyanide.\"\n -- Tom R