rst stage, an\n intolerable one.\"\n -- Thomas Paine','a62b0adc61c5087854bd2fa235311f0bc025d244',34631),(4156,'\n\"If you run hard, there\'s the pain -- and you\'ve got to work your way through\nthe pain ...  You know, lately it seems all you hear is \'Don\'t overdo it\' and\n\'Don\'t push yourself.\' Well, I think that\'s a lot of bull.  If you push the\nhuman body, it will respond.\"\n-Bob Clarke, NHL Hall of Famer','a62b0adc61c5087854bd2fa235311f0bc025d244',44127),(4157,'\n\"The best way to accelerate a Macintosh is at 9.8 m/sec/sec.\"\n -- Marcus Dolengo','a8229923f9654788a1b8fd175278f5bfdb45b571',43348),(4158,'\n\"I do not consider it an insult, but rather a compliment to be \n called an agnostic. I do not pretend to know where many ignorant \n men are sure -- that is all that agnosticism means.\"\n -- Clarence Darrow, Scopes trial, 1925.','a8229923f9654788a1b8fd175278f5bfdb45b571',35952),(4159,'\n\"The pessimist complains about the wind; the optimist expects it\n to change; the realist adjusts the sails.\" \n -- William Arthur Ward','a8c97ea909919d6c4c818c1460fb9349eed14423',44403),(4160,'\n\"When you are 99 miles into a 100-mile running race, your brain is not\nthe same brain you started with\".\n- Paul Huddle','a8c97ea909919d6c4c818c1460fb9349eed14423',35950),(4161,'\n\"Reality is merely an illusion, albeit a very persistent one.\"\n -- Albert Einstein (1879-1955)','a93cf93db3ae6d491e1b4fc8c4e1d869daa36a33',44281),(4162,'\n\"Everyone laughs and cries in the same language.\"\n -- dreamslaughter','a93cf93db3ae6d491e1b4fc8c4e1d869daa36a33',43080),(4163,'\n\"If quantum physics doesn\'t confuse you then you don\'t \n understand it.\" -- Niels Bohr  ','a9f64d35f7e0c6e6daed4ced7dbcc972bec70f9c',33738),(4164,'\n\"Why tell me that a man is a fine speaker, if it is not the\n truth that he is speaking?\"\n -- Thomas Carlyle','a9f64d35f7e0c6e6daed4ced7dbcc972bec70f9c',39809),(4165,'\n\"When a government lasts a long while, it deteriorates by\n insensible degrees. Republics end through luxury, monarchies\n through poverty.\"\n -- Montesquieu','aa23f7c48a6074023875b7c69a7f4873243ebd36',31913),(4166,'\n\"I was thrown out of college for cheating on the metaphysics \n exam; I looked into the soul of the boy next to me.\" \n -- Woody Allen.','aa23f7c48a6074023875b7c69a7f4873243ebd36',43348),(4167,'\n\"Science is the great antidote to the poison of enthusiasm and\n superstition.\"\n -- Adam Smith','aa9127e356148e16d787c08fa75d8bff98884eb9',33738),(4168,'\n\"It is practically impossible to teach good programming style to \n students that have had prior exposure to Basic; as potential \n programmers they are mentally mutilated beyond hope of \n regeneration.\" -- Edsger Dijkstra','aa9127e356148e16d787c08fa75d8bff98884eb9',33738),(4169,'\n\"Twenty years from now you will be more disappointed by the\n things that you didn\'t do than by the ones you did do.\"\n -- Samuel Clemens','aaabd03646d9f42fdbbe7e1f215f23b85116abfe',42471),(4170,'\n\"The best way to accelerate a Macintosh is at 9.8 m/sec/sec.\"\n -- Marcus Dolengo','aaabd03646d9f42fdbbe7e1f215f23b85116abfe',45881),(4171,'\n\"He can compress the most words into the smallest idea of any man \n I know.\" -- Abraham Lincoln','ab165cb90d19598f610a669dfe4798f4cd049a6a',36757),(4172,'\n\"Every gun that is made, every warship launched, every rocket\n fired signifies in the final sense, a theft from those who\n hunger and are not fed, those who are cold and are not clothed.\n This world in arms is not spending money alone. It is spending\n the sweat of its laborers, the genius of its scientists, the\n hopes of its children. This is not a way of life at all in any\n true sense. Under the clouds of war, it is humanity hanging on\n a cross of iron.\"\n -- Dwight D. Eisenhower','ab39c54239118a4b086b878b7878100f769dd197',45881),(4173,'\n\"Blessed is the man, who having nothing to say, abstains from \n giving wordy evidence of the fact.\"\n -- George Eliot (1819-1880)','ab39c54239118a4b086b878b7878100