ce under that guise because all the serious people like\n Martin Luther King, Jr. and Kennedy and Gandhi got shot.\"\n -- John Lennon','e3d9d95962c452f35e4ce7166b8d584f7b43adf0',45090),(4253,'\n\"Two men were examining the output of the new computer in their \n department. After an hour or so of analyzing the data, one of them\n remarked: \'Do you realize it would take 400 men at least 250\n years to make a mistake this big ?\'\"','e3d9d95962c452f35e4ce7166b8d584f7b43adf0',35952),(4254,'\n\"You can sleep when you die.\"\n- Roger Rehwald (seen on a T-shirt)','e411a490148911bb6ee16beaa6f794a437b3bc9d',45253),(4255,'\n\"As far as the laws of mathematics refer to reality, they are\n not certain, and as far as they are certain, they do not refer\n to reality.\"\n -- Albert Einstein','e411a490148911bb6ee16beaa6f794a437b3bc9d',45090),(4256,'\n\"This is not a novel to be tossed aside lightly. It should be \n thrown with great force.\" -- Book review by Dorothy Parker','e4d3d3f0fce651d09aee5480ec5e58268ccc2409',35658),(4257,'\n\"Yes, I\'m fat, but you\'re ugly and I can go on a diet.\" \n -- bumper sticker','e4d3d3f0fce651d09aee5480ec5e58268ccc2409',33738),(4258,'\n\"The covers of this book are too far apart.\"\n -- Ambrose Bierce (1842-1914)','e4e36b42fb2f69eedbf971c15d8a672dd4bc36aa',43080),(4259,'\n\"Ow.\"\n- Stan Jensen at 1995 AC100','e4e36b42fb2f69eedbf971c15d8a672dd4bc36aa',33738),(4260,'\n\"Philosophers have merely interpreted the world. The point is\n to change it.\"\n -- Karl Marx','e575dccc71140754dd85beda5965b6a358150309',43599),(4261,'\n\"Now comes the mystery\" \n -- Henry Ward Beecher, dying words, March 8, 1887','e575dccc71140754dd85beda5965b6a358150309',43080),(4262,'\n\"If you understand everything, you must be misinformed.\"\n -- Japanese Proverb','e651d1b3c25e90fb16c3c6cc0ffc88b56eaff0f7',44403),(4263,'\n\"What I am against is quotas. I am against hard quotas, quotas \n they basically delineate based upon whatever. However they \n delineate, quotas, I thi