es to let them \n see what Hell is like, during their lives.\" -- PhR','02cbcb76348e2688dc6bddf8007fa8b871eafb30',36879),(4296,'\n\"Men and nations behave wisely once they have exhausted all the \n other alternatives.\" -- Abba Eban (1915-2002)','02cbcb76348e2688dc6bddf8007fa8b871eafb30',45561),(4297,'\n\"The only way to get rid of a temptation is to yield to it.\"\n -- Oscar Wilde (1854-1900)','02dcd8a9de05665b1652b02268173a8ec9ff62c0',35950),(4298,'\n\"When you start off by telling those who disagree with you that\n they are not merely in error but in sin, how much of a dialogue\n do you expect ?\"\" -- Thomas Sowell','02dcd8a9de05665b1652b02268173a8ec9ff62c0',43348),(4299,'\n\"No Sane man will dance.\" -- Cicero (106-43 B.C.)','04e5009b4e4a32ffe7fceca119ea2d939b3ad7d0',43346),(4300,'\n\"Humor is a rubber sword - it allows you to make a point without \n drawing blood.\" -- Mary Hirsch','04e5009b4e4a32ffe7fceca119ea2d939b3ad7d0',64),(4301,'\n\"How many days does it take to run a hundred miles?\"\n- Skip Eastman','053f7d6e260d62b35b0154ac51a5b63a4c4a4932',45883),(4302,'\n\"Don\'t join the book burners.\"\n -- Dwight D. Eisenhower','053f7d6e260d62b35b0154ac51a5b63a4c4a4932',43599),(4303,'\n\"Defining and analyzing humor is a pastime of humorless people.\"\n -- Robert Benchley (1889 - 1945)','0581e7c94c284870d30659a6c0e449a9a7ab4ed1',34631),(4304,'\n\"When you are 99 miles into a 100-mile running race, your brain is not\nthe same brain you started with\".\n- Paul Huddle','0581e7c94c284870d30659a6c0e449a9a7ab4ed1',35952),(4305,'\n\"Pain is certain, suffering is optional.\"\n -- Buddha','07c095a2817a8d939988f170b5817c054c4ddba7',35950),(4306,'\n\"I did say something along the lines of \'C makes it easy to\n shoot yourself in the foot; C++ makes it harder, but when you\n do, it blows your whole leg off.\'\" -- Bjarne Stroustrup','07c095a2817a8d939988f170b5817c054c4ddba7',31913),(4307,'\n\"Humor is always based on a modicum of truth. Have you ever heard \n a joke about a father-in-law?\" -- Dick Clark','07cef16b46a72f33f6a597a473845b1e89e0278e',44127),(4308,'\n\"Forgive your enemies, but never forget their names.\"\n -- John F. Kennedy (1917-1963)','07cef16b46a72f33f6a597a473845b1e89e0278e',33738),(4309,'\nMason\'s First Law Of Synergism: The one day you\'d sell you soul \nfor something, souls are a glut.','08a792dc40c68126b100f35c9ea81fc80a477fbb',35952),(4310,'\n\"Many a man will have the courage to die gallantly, but will\n not have the courage to say, or even to think, that the cause\n for which he is asked to die is an unworthy one.\"\n -- Bertrand Russell','08a792dc40c68126b100f35c9ea81fc80a477fbb',42471),(4311,'\n\"The actions of men are the best interpreters of their\n thoughts.\"\n --John Locke','0a42d6a0116693dd7d630e68988002c9b0b98617',44281),(4312,'\n\"The greatest pleasure in life is doing what people say you cannot do.\"\n- Bagehot','0a42d6a0116693dd7d630e68988002c9b0b98617',45090),(4313,'\n\"Many people, meeting Aziraphale for the first time, formed three \n impressions: that he was English, that he was intelligent, and that\n he was gayer than a treeful of monkeys on nitrous oxide.\"\n -- Terry Pratchett (Good Omens) ','0aa4bbc6beec37006c96175063f2858351468274',44127),(4314,'\n\"The years of peak mental activity are undoubtedly between \nthe ages of four and eighteen.  At four we know all the \nquestions, at eighteen all the answers.\" -- unknown','0aa4bbc6beec37006c96175063f2858351468274',42471),(4315,'\n\"You don\'t have to brush your teeth - just the ones you want\n to keep.\" -- Unknown','0ad0144e12526132b8bd147b23f0b12e971796f6',31909),(4316,'\nBove\'s Theorem: The remaining work to finish in order to reach \nyour goal increases as the deadline approaches.','0ad0144e12526132b8bd147b23f0b12e971796f6',42471),(4317,'\n\"Kindness is more important than wisdom, and the recognition of\n this is the beginning of wisdom.\"\n -- Theodore Isaac Rubin','0cccfeabe70a0a074082c2b1740f7661cdb7202b',43599),(4318,'\n\"We should 