ne who\'s never run it is\nlike trying to explain color to someone who was born blind.\"\n- Jerome Drayton','13ee964ffdf6e8d6e40d041d06f6ef2812ab64bb',32929),(4329,'\n\"To use the term blind faith, is to use an adjective\n needlessly.\"\n -- Julian Ruck','14e890c7e8cbf06a1c0fd5168a1bb2d87276a6a5',45561),(4330,'\n\"The right things to do are those that keep our violence in\n abeyance; the wrong things are those that bring it to the\n fore.\"\n -- Robert J. Sawyer','14e890c7e8cbf06a1c0fd5168a1bb2d87276a6a5',42471),(4331,'\n\"My last cow just died, so I won\'t need your bull anymore.\"','15c94516bd535d2a40fd1d6128545d1300b18b88',44944),(4332,'\n\"You can\'t step twice into the same river.\"\n -- Heraclitus','15c94516bd535d2a40fd1d6128545d1300b18b88',36879),(4333,'\n\"Reality is merely an illusion, albeit a very persistent one.\"\n -- Albert Einstein (1879-1955)','1a532553c8771a765adaeead52ffd5e07541b9a4',42471),(4334,'\n\"Fascism is capitalism in decay.\"\n -- Vladimir Ilyich Lenin','1a532553c8771a765adaeead52ffd5e07541b9a4',43346),(4335,'\n\"When the water starts boiling it is foolish to turn off the\n heat.\"\n -- Nelson Mandela','1b5d2e049536b8308bc22bfa58de5a159178d3cc',45253),(4336,'\n\"A jury consists of twelve persons chosen to decide who has the\n better lawyer.\"\n -- Robert Frost','1b5d2e049536b8308bc22bfa58de5a159178d3cc',45881),(4337,'\n\"If a person is to get to the meaning of life, he must learn to\n like the facts about himself, ugly as they may seem to his\n sentimental vanity, before he can learn the truth behind the\n facts. And the truth is never ugly.\"\n -- Eugene O\'Neill','1de27063b1a52baba933b41f71c67ae668f38c8b',42471),(4338,'\nBrilliant\'s Law Of Limited Ambition: If you can\'t learn how to do \nit well, learn how to enjoy doing it poorly.','1de27063b1a52baba933b41f71c67ae668f38c8b',45883),(4339,'\n\"A foolish consistency is the hobgoblin of little minds, adored\n by little statesmen and philosophers and divines.\"\n -- Ralph Waldo Emerson','1