ed up, anything done to improve it makes \n      it worse.\n   2. No matter what results are expected, someone is always \n      willing to fake it.\n   3. No matter what the result, someone is always eager to \n      misinterpret it.\n   4. No matter what occurs, someone believes it happened \n      according to his pet theory.','371914c41dd25765874de81199b15f9f74e8ac95',45881),(4380,'\n\"Never explain, your friends do not need it and your enemies\n will not believe you anyway.\"\n -- Elbert Hubbard','37481c2fb0a5d6d7d1e1f969754c9967c752da4d',33738),(4381,'\n\"Far too many development shops are run by fools who succeed \n despite their many failings.\" -- Brion L. Webster','37481c2fb0a5d6d7d1e1f969754c9967c752da4d',31909),(4382,'\n\"May your fondest wish be granted.\"\n -- Traditional Chinese curse','376f27bdfa56b76f921803fd5fe04de69939d9f8',64),(4383,'\n\"Terrorism is the war of the poor, and war is the terrorism of \n the rich.\" -- Sir Peter Ustinov','376f27bdfa56b76f921803fd5fe04de69939d9f8',39809),(4384,'\n\"There are two ways of disliking poetry; one way is to \n dislike it, the other is to read Pope.\"\n -- Oscar Wilde on Alexander Pope','38b6d27b9c7411e5a264c8e4f5b9d6966dc656cf',35941),(4385,'\n\"Logic is in the eye of the logician.\"\n -- Gloria Steinem','38b6d27b9c7411e5a264c8e4f5b9d6966dc656cf',44944),(4386,'\n\"When you do the common things in life in an uncommon way, you \n will command the attention of the world.\"\n -- George Washington Carver (1864-1943)','390a452ac5b4655b709df89c9d284929225d4e2a',35952),(4387,'\n\"Would you like to liberate yourself from the lower realms of\n life? Would you like to save the world from the degradation and\n destruction it seems destined for? Then step away from shallow\n mass movements and quietly go to work on your own\n self-awareness.\"\n -- Lao tzu','390a452ac5b4655b709df89c9d284929225d4e2a',36757),(4388,'\n\"We didn\'t lose the game; we just ran out of time.\"\n    - Vince Lombardi','39b0e488d262e736e180d2debc