 it\'s bad it\'s still pretty good.\" \n -- G. Marsaglia ','484f172c279d01e292b11d06b94ad12772058b31',45561),(4411,'\n\"Those who say it can\'t be done are usually interrupted by others doing\nit.\"\n- Unknown','484f172c279d01e292b11d06b94ad12772058b31',39809),(4412,'\n\"Finish with a smile on your face.\"\n- Joe Trask','4a4ebbf31d6a54aea312295bc1f265cb8c1401f9',45561),(4413,'\n\"... so as we walked along the river toward Rucky Chucky, I said the\nwords that most men say to a pretty woman as they walk along the river\nunder a starry night on their first date: \"If you were a real hardass,\nyou\'d stick your finger down your throat and clear your stomach and if\nyou won\'t do it, I will.\"\n- Stan Jensen, pacing Sarah Lowell at WS\'97','4a5b94151967c0bb1e6ca8c9a825dafc1dbeecd2',35658),(4414,'\n\"The only thing necessary for the triumph of evil is for good \n men to do nothing.\"\n -- Edmund Burke (1729-1797)','4a5b94151967c0bb1e6ca8c9a825dafc1dbeecd2',36757),(4415,'\n\"To travel is to discover that everyone is wrong about other\n countries.\"\n -- Aldous Huxley','4afad81da6487f5d7761d3f18712eead1cfc55e9',45253),(4416,'\nRyan\'s Law: Make three correct guesses consecutively and you will \nestablish yourself as an expert.','4afad81da6487f5d7761d3f18712eead1cfc55e9',45253),(4417,'\nPeer\'s Law: The solution to a problem changes the problem.','4beedc9599de3b640b782837fec9f69cc4926ea8',44944),(4418,'\n\"We\'ve got to pause and ask ourselves, how much clean air do we\n need?\"\n -- Lee Iacocca','4beedc9599de3b640b782837fec9f69cc4926ea8',43348),(4419,'\n\"I am become death, shatterer of worlds.\"\n -- Robert J. Oppenheimer (1904-1967) (citing from the \n    Bhagavad Gita, after witnessing the world\'s first nuclear \n    explosion)','4cd468b1d7f769c8ac8216b624e455c741e0aaf7',35658),(4420,'\n\"The keenest sorrow is to recognize ourselves as the sole cause\n of all our adversities.\"\n -- Sophocles','4cd468b1d7f769c8ac8216b624e455c741e0aaf7',35658),(4421,'\n\"Write injuries in sand, kindnesses in marble.\"\n -- French proverb','4dc36912b7f591ac9325d87571088bcb7536d6dc',35941),(4422,'\n\"The man who does not read good books has no advantage over the \n man who cannot read them.\"\n -- Mark Twain (1835-1910)','4dc36912b7f591ac9325d87571088bcb7536d6dc',45449),(4423,'\n\"If you live long enough, you\'ll see that every victory turns \n into a defeat.\" -- Simone de Beauvoir','4fa67f1265d138de3a014db126293aac7cfe8805',45881),(4424,'\n\"Fascism is capitalism in decay.\"\n -- Vladimir Ilyich Lenin','4fa67f1265d138de3a014db126293aac7cfe8805',44281),(4425,'\n\"Don\'t work towards freedom; let the work be the freedom.\"\n- Dogen Roshi, philosopher','507ccf1d683cee3ba79bbc61648f431badea4635',36757),(4426,'\n\"I am ready to meet my Maker. Whether my Maker is prepared for \n the great ordeal of meeting me is another matter.\" \n -- Winston Churchill.','507ccf1d683cee3ba79bbc61648f431badea4635',31909),(4427,'\n\"Democracy is where you can say what you think even if you don\'t \n think.\"','5173e941960d0a3fa26c06dc9d550adb5f16dcf8',31913),(4428,'\nGoebel\'s Law Of Product Introductions: A future product release \ndate does NOT say when a product will be introduced.  All it says \nit that you don\'t have a chance in HELL of seeing it before that \ntime.','5173e941960d0a3fa26c06dc9d550adb5f16dcf8',32929),(4429,'\n\"Never attribute to malice that which is adequately explained\n by stupidity.\" -- Hanlon\'s razor','521a04f995a04cd8fc7e4e06e39e7af1281b0d04',39809),(4430,'\n\"Running is a four weather sport.\"\n- Unknown','521a04f995a04cd8fc7e4e06e39e7af1281b0d04',34631),(4431,'\n\"Some problems are so complex that you have to be highly\n intelligent and well informed just to be undecided about them.\"\n -- Laurence J. Peter','52c88b165a3a614a5e3ceac0074bad92d5bb1c0a',35952),(4432,'\n\"War is an instrument entirely insufficient toward redressing\n wrong; and multiplies, instead of indemnifying losses.\"\n -- Thomas Jefferson','52c88b165a3a614a5e3ceac0074bad9