 other than\n themselves.\" -- Larry McMurtry','5963f5b45919a815eb139134b57efb530fe7f634',32929),(4442,'\n\"Intellectuals solve problems; geniuses prevent them.\"\n -- Albert Einstein','5963f5b45919a815eb139134b57efb530fe7f634',64),(4443,'\n\"Real computer scientists despise the idea of actual hardware. \n Hardware has limitations, software doesn\'t. It\'s a real shame that \n Turing machines are so poor at I/O.\"','5b1d6dc017e823108cf73adebe3f519e20021340',43599),(4444,'\n\"I love running cross-country ... You come up a hill and see two deer going:\n\'What the hell is he doing?\' On a track, I feel like a hamster.\"\n- Robin Williams, film star/comic/runner','5b1d6dc017e823108cf73adebe3f519e20021340',36879),(4445,'\n\"Why is propaganda so much more successful when it stirs up\n hatred than when it tries to stir up friendly feeling?\"\n -- Bertrand Russell','5e70acbf3b135175635ff38fa1f6ee04107f05b8',44127),(4446,'\n\"It\'s the pain of the consequences that\'s all out of proportion.\"\n- Kenny Moore','5e70acbf3b135175635ff38fa1f6ee04107f05b8',45883),(4447,'\nCustomer: \"I\'m running Windows \'95.\"\nTech:     \"Yes.\"\nCustomer: \"My computer isn\'t working now.\"\nTech:     \"Yes, you said that.\"','5ec475005d2a5e68419080231b038c154aefaeed',45883),(4448,'\n\"I don\'t remember this bit\"\n- Ross Walker (while scaling a cliff about 25K into an \"easy\" 20K trail run)','5ec475005d2a5e68419080231b038c154aefaeed',33738),(4449,'\nThyme\'s Law: Everything goes wrong at once.','5f23700d7850a4cbb7b31addb53e98f376432008',45449),(4450,'\n\"I don\'t know why we are here, but I\'m pretty sure that it is \n not in order to enjoy ourselves.\"\n -- Ludwig Wittgenstein (1889-1951)','5f23700d7850a4cbb7b31addb53e98f376432008',35658),(4451,'\n\"The finishing line isn\'t given; it is earned.\"\n- Unknown','5f95559ce118ad7a90ccf147c25ef96e06ace831',45253),(4452,'\n\"I hate those men who would send into war youth to fight and \n die for them; the pride and cowardice of those old men, making\n their wars that boys must die.\" -- Mary Roberts Rinehart','5f95559ce118ad7a90ccf147c25ef96e06ace831',36879),(4453,'\n\"The purpose of training is to stress the body, so when you rest it will\ngrow stronger and more tolerant of the demands of distant running.\"\n- David Costill','5fd057a6ff9dc7a124fa5c814765a498e5aa024a',43080),(4454,'\n\"Horatio stops by to say really obvious things slowly.\"\n -- From IMDb Synopsis for \"CSI: Miami - Won\'t Get Fueled Again\" ','5fd057a6ff9dc7a124fa5c814765a498e5aa024a',36757),(4455,'\n\"The secret of a good sermon is to have a good beginning and a \n good ending, then having the two as close together as possible.\"\n -- George Burns.','656178bcd875725daa7308e458436739fee21b7a',43599),(4456,'\n\"The Quitter\"\nWhen you\'re lost on the trail with the speed of a snail\nAnd defeat looks you straight in the eye\nAnd you\'re needing to sit, your whole being says quit\nYou\'re certain it\'s your time to die.\nBut the code of the trail is \"move forward don\'t fail\"\nThough your knees and ego are scarred.\nAll the swelling and pain is just part of the game\nIn the long run it\'s quitting that\'s hard!','656178bcd875725daa7308e458436739fee21b7a',45090),(4457,'\n\"Whether you think that you can, or that you can\'t, you are \n usually right.\" -- Henry Ford (1863-1947)','6676af747694cbe50670b00c6dc17ae72c14d098',35950),(4458,'\n\"It all comes down to knowing how to handle situations that are thrown at you in\nan ultra.\"\n- Kevin Setnes','6676af747694cbe50670b00c6dc17ae72c14d098',43348),(4459,'\n\"The harder the conflict, the more glorious the triumph. What we\nobtain too cheap, we esteem too lightly; it is dearness only that\ngives everything its value. I love the man that can smile in trouble,\nthat can gather strength from distress and grow brave by reflection.\"\n- Thomas Paine','67143f248952cfb2a2e41a3b4b8f775fe3a01da2',43599),(4460,'\n\"The difference between our decadence and the Russians\' is that\n while theirs is brutal, ours is apathetic.\"\n -- James Thurber','67143f248952cfb2a2e41a3b4b8f775fe3a01da2',45883),(4461,'\n\"Beware the man of one book.\"\n -- Saint Thomas Aquinas','6ec4d1b66f18a9da05ced5ce5a7eda849e304766',35941),(4462,'\n\"My occupation now, I suppose, is jail inmate.\"\n -- Unibomber Theodore Kaczynski, when asked in court what his \n    current profession was','6ec4d1b66f18a9da05ced5ce5a7eda849e304766',34631),(4463,'\n\"Look at you in war. There has never been a just one, never\n an honorable one, on the part of the instigator of the war.\"\n -- Mark Twain','6f5067fe0753b2f35f4e33ac9119d61c0e3f215d',43346),(4464,'\n\"Descended from the apes? Let us hope that it is not true. But \n if it is, let us pray that it may not become generally known.\"\n -- FA Montagu.','6f5067fe0753b2f35f4e33ac9119d61c0e3f215d',35941),(4465,'\n\"So far as I can remember, there is not one word in the Gospels\n in praise of intelligence.\"\n -- Bertrand Russel','6f93dce77a5a5f9cbeff97fcec4e046e9d344086',42471),(4466,'\n\"Convictions are more dangerous foes of truth than lies.\"\n -- Nietzsche','6f93dce77a5a5f9cbeff97fcec4e046e9d344086',43080),(4467,'\n\"Friends may come and go, but enemies accumulate.\"\n -- Thomas Jones','708e9b376da845a1476ae14889f7e79d3d656a1c',43080),(4468,'\n\"By trying we can easily learn to endure adversity; another\n man\'s, I mean.\"\n -- Mark Twain','708e9b376da845a1476ae14889f7e79d3d656a1c',31913),(4469,'\n\"They always say time changes things, but you actually have to\n change them yourself.\" -- Andy Warhol','71942625febf9aa13b56f19e0bc5c34c4039f1a7',43080),(4470,'\n\"When you\'re afraid of failure you\'re more likely to do it.\"\n- Gordy Ainsleigh','71942625febf9aa13b56f19e0bc5c34c4039f1a7',44281),(4471,'\n\"He\'d noticed that sex bore some resemblance to cookery: it \n fascinated people, they sometimes bought books full of \n complicated recipes and interesting pictures, and sometimes when \n they were really hungry they created vast banquets in their \n imagination - but at the end of the day they\'d settle quite \n happily for egg and chips. If it was well done and maybe had a \n slice of tomato.\"\n -- Terry Pratchett (The Fifth Elephant) ','73952dc0d4ba4a1d7be27cfef678db24fb763763',45449),(4472,'\n\"A foolish consistency is the hobgoblin of little minds, adored by\n little statesmen and philosophers and divines.\" \n -- Ralph Waldo Emerson','73952dc0d4ba4a1d7be27cfef678db24fb763763',35941),(4473,'\n\"A most important, but also most elusive, aspect of any tool is\n its influence on the habits of those who train themselves in its\n use. If the tool is a programming language this influence is, \n whether we like it or not, an influence on our thinking habits.\" \n -- Edsger Dijkstra','77d859e3542c9bc559e36973b7017c78811d3186',45561),(4474,'\n\"And the users exclaimed with a laugh and a taunt: \'It\'s just what \n we asked for but not what we want.\'\"','77d859e3542c9bc559e36973b7017c78811d3186',45449),(4475,'\n\"How can you make a revolution without executions?\"\n -- Lenin on hearing that the death penalty had been abolished\n by the Soviet','7939d77c5f0b439628d26abbcbf1cbcf90412b31',35952),(4476,'\n\"A lot of these people who keep a gun at home for safety are the\n same ones who refuse to wear a seat belt.\" -- George Carlin','7939d77c5f0b439628d26abbcbf1cbcf90412b31',32929),(4477,'\n\"Once you\'ve written TBicycle, you never forget how.\"\n -- Oliver Townshend in b.p.d.n-t. ','7a3673352434418a2371b63e704acf83e13e2ad5',43080),(4478,'\n\"I\'m not going to have some reporters pawing through our papers. \n We are the president.\" -- Hillary Clinton.','7a3673352434418a2371b63e704acf83e13e2ad5',45883),(4479,'\n\"If I can\'t go faster I\'ll go longer.\"\n- Doug Barber','7bcca97b64e5efb74adae0b8aba45bbbde39f8ca',45561),(4480,'\n\"I was under medication when I made the decision to burn the\n tapes.\"\n -- Richard Nixon','7bcca97b64e5efb74adae0b8aba45bbbde39f8ca',44127),(4481,'\n\"Go on, get out.  Last words are for fools who haven\'t said \n enough.\" -- Karl Marx, dying words to his housekeeper.','7d41e3a531b6613e764e16dd68d588b2b2b75469',43599),(4482,'\n\"Knowing others is intelligence; knowing yourself is true\n wisdom. Mastering others is strength; mastering yourself is\n true power.\"\n -- Lao Tzu','7d41e3a531b6613e764e16dd68d588b2b2b75469',44127),(4483,'\n\"In Germany they first came for the Communists, \n and I didn\'t speak up because I wasn\'t a Communist. \n Then they came for the Jews, \n and I didn\'t speak up because I wasn\'t a Jew. \n Then they came for the trade unionists, \n and I didn\'t speak up because I wasn\'t a trade unionist. \n Then they came for the Catholics, \n and I didn\'t speak up because I was a Protestant. \n Then they came for me - \n and by that time no one was left to speak up.\" \n -- Pastor Martin Niemller','7e107de3fa1437e84bc766bf7c84641bcd258a7c',35952),(4484,'\n\"War is fear cloaked in courage.\" -- General William Westmoreland','7e107de3fa1437e84bc766bf7c84641bcd258a7c',39809),(4485,'\n\"When you\'re afraid of failure you\'re more likely to do it.\"\n- Gordy Ainsleigh','7f07483d084ff6b27c515ebeea7bf187041d4c91',31913),(4486,'\n\"It is unbecoming for young men to utter maxims.\"\n -- Aristotle (384-322 B.C.)','7f07483d084ff6b27c515ebeea7bf187041d4c91',35941),(4487,'\n\"I do not have a body, I am a body.\" -- Unknown','81eff785d55afeb889189ba6d382f249771c4b1a',39809),(4488,'\n\"Any intelligent fool can make things bigger, more complex, and\n more violent. It takes a touch of genius, and a lot of courage\n to move in the opposite direction.\"\n -- Albert Einstein','81eff785d55afeb889189ba6d382f249771c4b1a',39809),(4489,'\n\"As the poet said, \'Only God can make a tree,\' probably because \n it\'s so hard to figure out how to get the bark on.\" \n -- Woody Allen.','8393e8e13cf2a84516f7146cc2f58dbc8f771a3b',31909),(4490,'\n\"My occupation now, I suppose, is jail inmate.\"\n -- Unibomber Theodore Kaczynski, when asked in court what his \n    current profession was','8393e8e13cf2a84516f7146cc2f58dbc8f771a3b',43346),(4491,'\n\"A fast word about oral contraception. I asked a girl to go to \n bed with me, she said \'no\'.\" -- Woody Allen','83e6d84bd1181d61c202289b2055bc6cfacd19a4',44281),(4492,'\n\"It is better to have a permanent income than to be fascinating.\"\n -- Oscar Wilde (1854-1900)','83e6d84bd1181d61c202289b2055bc6cfacd19a4',64),(4493,'\n\"God, please save me from your followers!\"\n -- Bumper Sticker','8479315e5f0a64098994c2cc3e28e3d18ff94a3a',31913),(4494,'\n\"When choosing between two evils, I always like to try the one \n I\'ve never tried before.\" -- Mae West (1892-1980)','8479315e5f0a64098994c2cc3e28e3d18ff94a3a',35950),(4495,'\n\"I wouldn\'t mind dying - it\'s the business of having to stay \n dead that scares the shit out of me.\" -- R. Geis.','878ffa15449903c143f9ab9dae71b690de612e7b',33738),(4496,'\n\"The three rules of the Librarians of Time and Space are: \n 1) Silence; \n 2) Books must be returned by no later than the date shown; and \n 3) Do not interfere with the nature of causality.\"\n -- Terry Pratchett (Guards! Guards!) ','878ffa15449903c143f9ab9dae71b690de612e7b',31913),(4497,'\n\"Moral indignation is jealousy with a halo.\"\n-- H. G. Wells (1866-1946)','8958171c5c116a235506f9fbd2a39a3d38c8e2f8',36879),(4498,'\n\"This is not a novel to be tossed aside lightly. It should be \n thrown with great force.\" -- Book review by Dorothy Parker','8958171c5c116a235506f9fbd2a39a3d38c8e2f8',31913),(4499,'\n\"All our knowledge merely helps us to die a more painful death \n than animals that know nothing.\" -- Maurice Maeterlinck.','89c0b00889ee34633a5448446e5a56e7aea47223',43599),(4500,'\n\"If toast always lands butter-side down, and cats always land on\n their feet, what happens if you strap toast on the back of a cat\n and drop it?\" -- Steven Wright.','89c0b00889ee34633a5448446e5a56e7aea47223',42471),(4501,'\n\"The music business is a cruel and shallow money trench, a long\n plastic hallway where thieves and pimps run free, and good men\n die like dogs. There\'s also a negative side\". \n -- Hunter S. Thompson','89d4fb2873cccc17b83d5d2cc69c22fc703690c3',43080),(4502,'\n\"The Six Phases of a Project:\"\n   o Enthusiasm\n   o Disillusionment\n   o Panic\n   o Search for the Guilty\n   o Punishment of the Innocent\n   o Praise for non-participants\"','89d4fb2873cccc17b83d5d2cc69c22fc703690c3',44944),(4503,'\n\"A 50K on trails is easier than a marathon on the road.\"\n- Unknown','89db695bb2cc996e3f9672e109b79789906e6af4',43348),(4504,'\n\"I\'m fed up to the ears with old men dreaming up wars for \nyoung men to die in.\" -- George McGovern','89db695bb2cc996e3f9672e109b79789906e6af4',43080),(4505,'\n\"I\'ll be more enthusiastic about encouraging thinking outside the\n box when there\'s evidence of any thinking going on inside it.\"\n -- Terry Pratchett','89f5d5fd2400d9df9568976be5b43721c9d90a1b',45449),(4506,'\n\"The artist is nothing without the gift, but the gift is nothing \n without work.\" -- Emile Zola (1840-1902)','89f5d5fd2400d9df9568976be5b43721c9d90a1b',42471),(4507,'\n\"Every morning in Africa, a gazelle wakes up.  It knows it must\noutrun the fastest lion or it will be killed.  Every morning in\nAfrica, a lion wakes up.  It knows it must run faster than the\nslowest gazelle, or it will starve.  It doesn\'t matter whether\nyou\'re a lion or a gazelle - when the sun comes up, you\'d better\nbe running.\"\n- Unknown','8a70d7574c3cfa9d42d37825c61dcaa80cd2dbb3',32929),(4508,'\n\"I doubt, therefore I might be.\" -- Unknown','8a70d7574c3cfa9d42d37825c61dcaa80cd2dbb3',44127),(4509,'\n\"Lohr\'s Law: The future is merely the past with a twist - and \n better tools.\" -- Steve Lohr','8c93ce1d07259934298ea47da504510529a423a4',45561),(4510,'\n\"Few people are capable of expressing with equanimity opinions\n which differ from the prejudices of their social environment.\n Most people are even incapable of forming such opinions.\"\n -- Albert Einstein','8c93ce1d07259934298ea47da504510529a423a4',44281),(4511,'\n\"How long would authority ... exist, if not for the willingness\n of the mass to become soldiers, policemen, jailers, and\n hangmen.\"\n -- Emma Goldman','8ef17f1c7e0a95ca709f520536f4ecffef1883e3',31913),(4512,'\n\"The process of preparing programs for a digital computer is\n especially attractive, not only because it can be economically\n and scientifically rewarding, but also because it can be an\n aesthetic experience much like composing poetry or music.\" \n -- Donald Knuth','8ef17f1c7e0a95ca709f520536f4ecffef1883e3',36757),(4513,'\n\"Where are we going, and why am I in this handbasket?\"\n -- Bumper Sticker','9366fd51e17e65e8d9a6aae9f08e1553e1b8170e',43080),(4514,'\n\"Except as its clown and jester, society does not encourage\n individuality, and the State abhors it.\"\n -- Bernard Berenson','9366fd51e17e65e8d9a6aae9f08e1553e1b8170e',45090),(4515,'\n\"Diplomacy is the art of saying \'Nice doggie!\'... \'til you can \n find a rock.\" -- bumper sticker                             ','940ba86618c4d231993c846b98af0a49d9d6163a',43346),(4516,'\nWoodward\'s Law: A theory is better than its explanation.','940ba86618c4d231993c846b98af0a49d9d6163a',32929),(4517,'\n\"If I can see it, I can run to it.\"\n- Randi Bromka Young','97f43a955a6f161878c64f2eb632d1e703c3f31a',64),(4518,'\n\"In every country and every age, the priest has been hostile to\n liberty.\"\n -- Thomas Jefferson','97f43a955a6f161878c64f2eb632d1e703c3f31a',45561),(4519,'\n\"I think there is a world market for maybe five computers.\"\n -- Thomas Watson (1874-1956), Chairman of IBM, 1943','9f4f3b9f0726852ad2f73fb4f7754a7623dbb549',36757),(4520,'\n\"There is a country in Europe where multiple-choice tests are \n illegal.\" -- Sigfried Hulzer','9f4f3b9f0726852ad2f73fb4f7754a7623dbb549',44403),(4521,'\n\"In order to learn, one must change one\'s mind.\"\n -- Orson Scott Card','9f5b0793b0cbfcf25d48605c3e80c19203d2b414',31913),(4522,'\n\"Happiness is an imaginary condition, formerly attributed by\n the living to the dead, now usually attributed by adults to\n children, and by children to adults.\"\n -- Thomas Szasz','9f5b0793b0cbfcf25d48605c3e80c19203d2b414',33738),(4523,'\n\"Start slow, then taper off\".\n- Walt Stack','a002f2f44c4eb97169796e571751a450aa506770',31909),(4524,'\n\"All my humor is based upon destruction and despair. If the\n whole world were tranquil, without disease and violence, I\'d be\n standing on the breadline right in back of J. Edgar Hoover.\"\n -- Lenny Bruce','a002f2f44c4eb97169796e571751a450aa506770',34631),(4525,'\n\"Distrust all in whom the impulse to punish is powerful.\"\n -- Nietzsche','a11e499ed0f91399988fc7b98c460cdb2769d0bb',43599),(4526,'\n\"The world is divided into people who think they are right.\"\n -- Unknown','a11e499ed0f91399988fc7b98c460cdb2769d0bb',35658),(4527,'\n\"I am an expert of electricity. My father occupied the chair of\n applied electricity at the state prison.\" -- WC Fields.','a4a15d15b6e6fdf9c95a4de9b40896e3f89bee1e',45090),(4528,'\n\"Don\'t work towards freedom; let the work be the freedom.\"\n- Dogen Roshi, philosopher','a4a15d15b6e6fdf9c95a4de9b40896e3f89bee1e',64),(4529,'\n\"We could have saved the Earth but we were too damned cheap.\"\n -- Kurt Vonnegut','a6e30b2e057ef7205fde876d0be2f643aa74c0cb',44403),(4530,'\n\"Real Programmers always confuse Christmas and Halloween because\n Oct31 == Dec25 !\" -- Andrew Rutherford ','a6e30b2e057ef7205fde876d0be2f643aa74c0cb',45449),(4531,'\n\"Oh man! They should just put me out to stud!\"\n- Len Kuentzm just after finishing his first 50-miler','a7d3d768fe1c49c394cdf0ea8e9b0a280240ace5',36757),(4532,'\n\"In ultrarunning, the pain is inevitable, but the suffering is\noptional.\"\n- Al Bogenhuber','a7d3d768fe1c49c394cdf0ea8e9b0a280240ace5',45561),(4533,'\n\"I have always wished that my computer would be as easy to use\n as my telephone. My wish has come true. I no longer know how\n to use my telephone.\" -- Bjarne Stroustrup','a88e851588bccffa88e13a9447b5a5cd1cf1304f',44127),(4534,'\n\"Self-destructive is doing something to hurt yourself. It is doing\npermanent damage to yourself. I have done neither. As for being\nobsessive, I am. I love to run.\"\n- John Barltrop','a88e851588bccffa88e13a9447b5a5cd1cf1304f',45881),(4535,'\n\"Necessity is the plea for every infringement of human freedom. \n It is the argument of tyrants; it is the creed of slaves.\"\n -- William Pitt','a8ea727efa91da5f634e7aeca47e4bb862432c39',42471),(4536,'\n\"Science is what people understand well enough to explain to a \n computer. All else is art.\" -- Donald Knuth','a8ea727efa91da5f634e7aeca47e4bb862432c39',43080),(4537,'\n\"So long as the deceit ran along quiet and monotonous, all of \n us let ourselves be deceived, abetting it unawares or maybe \n through cowardice...\" -- William Faulkner','a90159cc1a7228e57680670297b8c7b575b9db3f',44403),(4538,'\n\"We\'ll tell you when to start and we\'ll tell you when to stop. In between, don\'t\nthink, just keep running.\"\n- Ken Chlouber at Leadville','a90159cc1a7228e57680670297b8c7b575b9db3f',32929),(4539,'\n\"Anybody running beats anybody walking, and anybody walking beats anybody\nsitting.\"\n- Tom Bunk','a9d8fbe9698c8454770ce0b4b33c9651573ccb81',42471),(4540,'\n\"90% of ultrarunning is 100% mental.\"\n- Unknown','a9d8fbe9698c8454770ce0b4b33c9651573ccb81',45253),(4541,'\n\"Two attitudes are all that is needed; do not harm anything,\n say and do things that make others happy.\"\n -- dreamslaughter','aaccb8bb2b4c442a7c16a9b209c9ff448c6c5f35',35950),(4542,'\n\"Some tortures are physical\n And some are mental,\n But the one that is both\n Is dental.\"\n -- Ogden Nash','aaccb8bb2b4c442a7c16a9b209c9ff448c6c5f35',35950),(4543,'\n\"I ain\'t got no quarrel with the Vietcong ...\n No Vietcong ever called me nigger.\"\n -- Muhammad Ali, stripped of boxing title, convicted of a\n felony for refusing to serve during the Vietnam War','ab6ad881e7d1e78559ff2f9cb718f888bcd4d596',43346),(4544,'\n\"Women should be obscene and not heard.\"\n -- Groucho Marx','ab6ad881e7d1e78559ff2f9cb718f888bcd4d596',35658),(4545,'\n\"If you speak the truth, have one foot in the stirrup.\"\n -- Turkish proverb','ac282f85d8a2df517f522328df90442718faec10',43346),(4546,'\n\"All my humor is based upon destruction and despair. If the\n whole world were tranquil, without disease and violence, I\'d be\n standing on the breadline right in back of J. Edgar Hoover.\"\n -- Lenny Bruce','ac282f85d8a2df517f522328df90442718faec10',31909),(4547,'\n\"I invented the term Object-Oriented, and I can tell you I did \n not have C++ in mind.\" -- Alan Kay','ad03acdbc8424b19ed0d8ca4b9db2de80d300c01',39809),(4548,'\n\"I\'ll be more enthusiastic about encouraging thinking outside the\n box when there\'s evidence of any thinking going on inside it.\"\n -- Terry Pratchett','ad03acdbc8424b19ed0d8ca4b9db2de80d300c01',42471),(4549,'\n\"Properly read, the Bible is the most potent force for atheism\n ever conceived.\" -- Isaac Asimov','ae19e7d59819c9c43b9b60a464107ab34124efb9',43599),(4550,'\n\"Talent hits a target no one else can hit; Genius hits a target\n no one else can see.\"\n -- Arthur Schopenhauer','ae19e7d59819c9c43b9b60a464107ab34124efb9',45883),(4551,'\n\"Louis Pasteur\'s theory of germs is ridiculous fiction.\"\n -- Pierre Pachet, Professor of Physiology at Toulouse, 1872','ae528b1a3af1e4459fae31a40a36af24c97ff653',44944),(4552,'\n\"Two attitudes are all that is needed; do not harm anything,\n say and do things that make others happy.\"\n -- dreamslaughter','ae528b1a3af1e4459fae31a40a36af24c97ff653',35952),(4553,'\nFirst Rule Of History: History doesn\'t repeat itself --\nhistorians merely repeat each other.','afb8a88e311f9498cf7b89c4b54db8280e1f9955',43080),(4554,'\n\"Start slow, then taper off\".\n- Walt Stack','afb8a88e311f9498cf7b89c4b54db8280e1f9955',33738),(4555,'\n\"I am become death, shatterer of worlds.\"\n -- Robert J. Oppenheimer (1904-1967) (citing from the \n    Bhagavad Gita, after witnessing the world\'s first nuclear \n    explosion)','b14de54732679e9a21e028626b71ede6b884a6b1',34631),(4556,'\nHarp\'s Corollary To Estridge\'s Law: Your \"IBM PC-compatible\" \ncomputer grows more incompatible with every passing moment.','b14de54732679e9a21e028626b71ede6b884a6b1',34631),(4557,'\n\"The history of liberty is a history of resistance. The history\n of liberty is a history of limitations of governmental power,\n not the increase of it.\"\n -- Woodrow Wilson','b2d788c31f49e1601f12eed77581cc6efa2e9b52',44281),(4558,'\n\"The gods too are fond of a joke.\" -- Aristotle (384-322 B.C.)','b4e131670a970c281e7740526950c0285e9d9fdf',45883),(4559,'\n\"Everything has been figured out, except how to live.\"\n -- Jean Paul Sartre','b4e131670a970c281e7740526950c0285e9d9fdf',35941),(4560,'\n\"One out of every three Americans is suffering from some form of\n mental illness. Think of two of your best friends. If they are \n OK, then it must be you.\" -- George Carlin','b72c09eae1de4d78d2dc52ec99ecaed96f973644',35658),(4561,'\n\"Look Mabel, here comes one who\'s running!\"\n- Unknown','b72c09eae1de4d78d2dc52ec99ecaed96f973644',45881),(4562,'\n\"Respect the distance or it won\'t respect you.\"\n- Unknown','bb0d03aedf17d3014ed22818c328ad33bc134b84',42471),(4563,'\n\"Democracy does not guarantee equality of conditions - it only \n guarantees equality of opportunity.\" -- Irving Kristol','bb0d03aedf17d3014ed22818c328ad33bc134b84',35658),(4564,'\n\"Religion is not merely the opium of the masses; it\'s the\n cyanide.\"\n -- Tom Robbins','bb56c52b96fa088c982b4553ff8fde34f0a30eed',44403),(4565,'\n\"Copy from one, it\'s plagiarism; copy from two, it\'s research.\"\n -- Wilson Mizner (1876-1933)','bb56c52b96fa088c982b4553ff8fde34f0a30eed',36757),(4566,'\n\"Theology is never any help; it is searching in a dark cellar\n at midnight for a black cat that isn\'t there. Theologians can\n persuade themselves of anything.\"\n -- Robert Heinlein','beab76da6766b1876a3c54e25e8df53142485962',44403),(4567,'\n\"It is unbecoming for young men to utter maxims.\"\n -- Aristotle (384-322 B.C.)','beab76da6766b1876a3c54e25e8df53142485962',44281),(4568,'\n\"The worst barbarity of war is that it forces men collectively\n to commit acts against which individually they would revolt with\n their whole being.\" -- Ellen Key','befe497a740c8f4aabb635c06f07549336d5360d',39809),(4569,'\n\"If god created us in his image we have certainly returned the\n compliment.\"\n -- Voltaire','befe497a740c8f4aabb635c06f07549336d5360d',31909),(4570,'\n\"Freedom is not something that anybody can be given, freedom is\n something people take.\"\n -- James Baldwin','bfe85e868bf388f462fde22765c8879f9e6bfc73',36757),(4571,'\n\"From the moment I picked your book up until I laid it down I \n was convulsed with laughter. Some day I intend reading it.\"\n -- Groucho Marx (1895-1977)','bfe85e868bf388f462fde22765c8879f9e6bfc73',35950),(4572,'\n\"He has no enemies, but is intensely disliked by his friends.\" \n -- Oscar Wilde','c076cfc485c8ba2f77ebc74a81dcd94bc3eb540d',31913),(4573,'\n\"He managed to stupid himself right into the White House.\"\n -- Charles Appel about George W. Bush','c076cfc485c8ba2f77ebc74a81dcd94bc3eb540d',35658),(4574,'\n\"Life\'s under no obligation to give us what we expect.\"\n -- Margaret Mitchell','c255e4e00d1e8081e3b3e0e0f1a6682fb90811f6',39809),(4575,'\n\"The modern conservative is engaged in one man\'s oldest\n exercises in moral philosophy; that is the search for a\n superior moral justification for selfishness.\"\n -- John K. Galbraith','c255e4e00d1e8081e3b3e0e0f1a6682fb90811f6',64),(4576,'\n\"We are faced with an insurmountable opportunity.\" -- W. Kelley','c3780f1bf13c6a9506ae61d45f775ef2a2a515c4',35941),(4577,'\n\"Once a new technology starts rolling, if you\'re not part of the\n steamroller, you\'re part of the road.\" -- Stewart Brand','c3780f1bf13c6a9506ae61d45f775ef2a2a515c4',35941),(4578,'\n\"Women should be obscene and not heard.\"\n -- Groucho Marx','c38b4bbe