),(4598,'\n\"Reports are sketchy, but we have heard that in the first \n heart transplant operation in Belgium, both patient and \n donor are doing fine.\" -- Radio news announcer','d1c2fc6828b03a590a5298569f9bd616af775020',42471),(4599,'\n\"It is poverty to decide that a child must die so that you may\n live as you wish.\"\n -- Mother Teresa','d1c9ed9d612efb1fa4ff16afdd8c06fc00ff13e5',44127),(4600,'\n\"Why do grandparents and grandchildren get along so well?  They \n have the same enemy -- the mother.\" -- Claudette Colbert.','d2f75e8204fedf2eacd261e2461b2964e3bfd5be',32929),(4601,'\n\"I just bought a Mac to help me design the next Cray.\"\n -- Seymoure Cray (1925-1996) when was informed that Apple Inc. \n    had recently bought a Cray supercomputer to help them design \n    the next Mac.','d374889a5c228feef85e4f7263f7edc4aaa3417b',44127),(4602,'\nRhode\'s Corollary To Hoare\'s Law: Inside every complex and \nunworkable program is a useful routine struggling to be free.','d374889a5c228feef85e4f7263f7edc4aaa3417b',45090),(4603,'\n\"You can pretend to be serious; you can\'t pretend to be witty.\"\n -- Sacha Guitry','d869b04564bc4b4c6adcf3ad6f00e45c1150bc41',45253),(4604,'\n\"It\'s not what you don\'t know that hurts you. It\'s what you\n know that just isn\'t so.\"\n -- Satchel Paige','d869b04564bc4b4c6adcf3ad6f00e45c1150bc41',45883),(4605,'\n\"Mit der Dummheit kmpfen Gtter selbst vergebens\"\n\"Against stupidity the (very) gods themselves contend in vain\"\n -- Friedrich von Schiller','d9e8cdc75ad12149198cbfb2458e83efc106ede4',45561),(4606,'\n\"There are worse things in life than death. Have you ever spent\n an evening with an insurance salesman?\" -- Woody Allen','d9e8cdc75ad12149198cbfb2458e83efc106ede4',64),(4607,'\n\"I have met my hero, and he is me.\"\n- George Sheehan','da45dba05679ecb35ac4ece16786e6a8e1bf621b',35941),(4608,'\n\"Five exclamation marks, the sure sign of an insane mind.\"\n -- Terry Pratchett (Reaper Man) ','da45dba05679ecb35ac4ece16786e6a8e1bf6