e, but not simpler.\"\n -- Albert Einstein (1879-1955)','df977a48f2a8bd3b1f399855135dc28faaaf09be',31913),(4620,'\n\"To iterate is human, to recurse divine.\" -- L. Peter Deutsch','df977a48f2a8bd3b1f399855135dc28faaaf09be',31913),(4621,'\n\"We\'re going to turn this team around 360 degrees.\"\n -- Jason Kidd, upon his drafting to the Dallas Mavericks','dff48911e003ebe49473a85a4ad490b1d9a85111',36757),(4622,'\n\"I want to thank the rest of you for making me look normal.\"\n- Gordon Ainsleigh','dff48911e003ebe49473a85a4ad490b1d9a85111',45090),(4623,'\n\"Running is a four weather sport.\"\n- Unknown','e06e3567cc751d965cd221bee9cd943abb0bc851',43080),(4624,'\n\"Philosophers have merely interpreted the world. The point is\n to change it.\"\n -- Karl Marx','e06e3567cc751d965cd221bee9cd943abb0bc851',36879),(4625,'\n\"If Klingons were runners, they would be Ultrarunners.\"\n- Bryan Hacker','e2a1a159b8fb42a1fd874f5edcbb08707df02a92',44944),(4626,'\nHanlon\'s Razor: Never attribute to malice that which is \nadequately explained by stupidity.','e2a1a159b8fb42a1fd874f5edcbb08707df02a92',42471),(4627,'\n\"I didn\'t attend the funeral, but I sent a nice letter saying I \n approved of it.\" -- Mark Twain','e6402ee50e78b6141db94c840ca7903762665732',35658),(4628,'\n\"The three rules of the Librarians of Time and Space are: \n 1) Silence; \n 2) Books must be returned by no later than the date shown; and \n 3) Do not interfere with the nature of causality.\"\n -- Terry Pratchett (Guards! Guards!) ','e6402ee50e78b6141db94c840ca7903762665732',44403),(4629,'\n\"So I was getting into my car, and this bloke says to me \"Can you\n give me a lift?\" I said \"Sure, you look great, the world\'s your\n oyster, go for it.\'\" -- Tommy Cooper','e6ef267498a05d4261dbb35febb36e611f2bb2b2',45090),(4630,'\n\"The city\'s central computer told you?  R2D2, you know better than\n to trust a strange computer!\" -- C3PO','e78e1c8a184b06b3cfaaf828461fb13f7de798a6',45253),(4631,'\n\"They never open their mout