hink the WS trail is one of the most beautiful places that\nI have vomited.\"\n- Mary Gorski, 1999 WS attemptee and 2001 finisher','8f6dd7f20b5b462c73891d9bec1614fdf113ad74',45253),(4889,'\n\"Learning is what most adults will do for a living in the 21st \n century.\" -- Perelman','9058ef171b8c63928e3da0af09a2d63eceb4d974',39809),(4890,'\n\"If you see a fork in the road, take it!\"\n- Yogi Berra','9058ef171b8c63928e3da0af09a2d63eceb4d974',43080),(4891,'\n\"Happiness is your dentist telling you it won\'t hurt and then\n having him catch his hand in the drill.\" -- Johnny Carson','905a8f8b48955bdeb27a1b6ad626ffde782f624a',44403),(4892,'\n\"As long as you keep making RFM (Relentless Forward Motion), you will\nfinish.\"\n- Stacey Page','905a8f8b48955bdeb27a1b6ad626ffde782f624a',44944),(4893,'\n\"Sometimes, the best answer is a more interesting question\"\n -- Terry Pratchett ','90fe9b9cb22c3a40422ca16382613e0c61f728b6',44944),(4894,'\n\"I am convinced that I am acting as the agent of our Creator.\n By fighting off the Jews, I am doing the Lord\'s work.\"\n -- Adolf Hitler','90fe9b9cb22c3a40422ca16382613e0c61f728b6',35658),(4895,'\n\"And God said, \'Let there be light\' and there was light, but the\n Electricity Board said He would have to wait until Thursday to be\n connected.\" -- Spike Milligan.','939a84d0dff4de53ab7a179dd39d2d969f533652',31913),(4896,'\n\"May your fondest wish be granted.\"\n -- Traditional Chinese curse','939a84d0dff4de53ab7a179dd39d2d969f533652',35941),(4897,'\n\"Pascal /n./ A programming language named after a man who would \n turn over in his grave if he knew about it.\" \n -- From the Jargon File','93af2d29fceaaff90391bae9bfb5b4f18a50b2c9',35950),(4898,'\n\"If you think you won\'t finish, you won\'t.\"\n- Dick Collins','93af2d29fceaaff90391bae9bfb5b4f18a50b2c9',44944),(4899,'\n\"Once is happenstance. Twice is coincidence. Three times is \n enemy action.\" -- Auric Goldfinger, in \"Goldfinger\" by \n                   Ian L. Fleming (1908-1964)','