ever open their mouths without subtracting from the \n sum of human knowledge.\" -- Thomas Brackett Reed','13aa97a178fc365ca109ef8746f4b2cfd7f299c2',64),(5098,'\n\"The great error of nearly all studies of war... has been to \n consider war as an episode in foreign policies, when it is an \n act of interior politics...\" -- Simone Weil','13aa97a178fc365ca109ef8746f4b2cfd7f299c2',45881),(5099,'\n\"Never be deceived that the rich will allow you to vote away\n their wealth.\"\n -- Lucy Parsons','1534f3d84cd1311630648981189b44fa9cf80785',39809),(5100,'\n\"The purpose of training is to stress the body, so when you rest it will\ngrow stronger and more tolerant of the demands of distant running.\"\n- David Costill','1534f3d84cd1311630648981189b44fa9cf80785',45090),(5101,'\n\"No one rules if no one obeys.\"\n -- <TaoDo>','1749e00b294522e5a35f798a614395d417b46ba6',44127),(5102,'\n\"Wisdom comes from experience. Experience is often a result of\n lack of wisdom.\"\n -- Terry Pratchett','1749e00b294522e5a35f798a614395d417b46ba6',45881),(5103,'\n\"Nothing unites the English like war. Nothing divides them like\n Picasso.\"\n -- Hugh Mills','1832b2d0aadad73c8bc765ca176ca2cdcaa78374',44944),(5104,'\n\"The cry has been that when war is declared, all opposition\n should be hushed. A sentiment more unworthy of a free country\n could hardly be propagated.\" -- William Ellery Channing','1832b2d0aadad73c8bc765ca176ca2cdcaa78374',44127),(5105,'\n\"I have always wished that my computer would be as easy to use\n as my telephone. My wish has come true. I no longer know how\n to use my telephone.\" -- Bjarne Stroustrup','189dfab3335a729ceec7f86495df5620235b5882',35952),(5106,'\n\"Imagine if every Thursday your shoes exploded if you tied them\n the usual way. This happens to us all the time with computers,\n and nobody thinks of complaining.\" -- Jeff Raskin','189dfab3335a729ceec7f86495df5620235b5882',35950),(5107,'\n\"That\'s not a lie, it\'s a terminological inexactitude.\"\n -- Alexander Hai