o die gallantly, but will\n not have the courage to say, or even to think, that the cause\n for which he is asked to die is an unworthy one.\"\n -- Bertrand Russell','3e2feb47655ed2eb9623395ebfa3b54bdc7d2b7d',64),(5171,'\n\"Turn over the pages of history and read the damning record of\n the church\'s opposition to every advance in every field of\n science.\"\n -- Upton Sinclair','400d6f2f655a60900de82d5e9401c16d1df2a4a5',36879),(5172,'\n\"You\'re bound to be unhappy if you optimize everything.\" \n -- Donald Knuth','400d6f2f655a60900de82d5e9401c16d1df2a4a5',45883),(5173,'\n\"I\'m desperately trying to figure out why kamikaze pilots wore\n helmets.\" -- Dave Edison.','40768740413e9acb1f991c3c1f26111b63f0fe08',43080),(5174,'\n\"So long as the deceit ran along quiet and monotonous, all of \n us let ourselves be deceived, abetting it unawares or maybe \n through cowardice...\" -- William Faulkner','40768740413e9acb1f991c3c1f26111b63f0fe08',45090),(5175,'\n\"It is said that your life flashes before your eyes just before\n you die. That is true, it\'s called Life.\"\n -- Terry Pratchett (The Last Continent) ','427196883bf369bcff8701008d5b26662e64d3fb',36757),(5176,'\n\"I am ready to meet my Maker. Whether my Maker is prepared for \n the great ordeal of meeting me is another matter.\"\n -- Sir Winston Churchill (1874-1965)','427196883bf369bcff8701008d5b26662e64d3fb',43599),(5177,'\n\"Christians are supposed not merely to endure change, nor even\n to profit by it, but to cause it.\"\n -- Harry Emerson Fosdick','4286e9c7cc9e2cd29bfca3b079055a325ec21a33',42471),(5178,'\nJohnson-Laird\'s Law: Toothache tends to start on Saturday night.','4286e9c7cc9e2cd29bfca3b079055a325ec21a33',43346),(5179,'\n\"The only difference between me and a madman is that I\'m not mad.\"\n -- Salvador Dali (1904-1989)','43e2c7a71c61bbadca1d46be8db5efc21cbadaff',45561),(5180,'\n\"Without requirements or design, programming is the art of\n adding bugs to an empty text file.\" -- Louis Srygley','43e2c7a7