use it tends\n to suppress any hereditary propensity toward fanaticism.\"\n -- Carl Sagan','50ce41dc05c4888b3cb778b060c044741b100565',64),(5204,'\n\"For there was never yet philosopher\n That could endure the toothache patiently.\n -- William Shakespeare, Much Ado About Nothing','5137305f9eb91061561d052d1da02795172903e4',36879),(5205,'\n\"Pity the warrior that kills all his foe.\"\n -- Star Trek','5137305f9eb91061561d052d1da02795172903e4',44127),(5206,'\n\"The optimist proclaims that we live in the best of all possible \n worlds, and the pessimist fears this is true.\"\n -- James Branch Cabell','535b58b6f0d309b567c637d3b61997efbefd6dd4',45449),(5207,'\n\"You\'ve got to be a little bored to be doing really good training.\"\n- Marty Liquori','535b58b6f0d309b567c637d3b61997efbefd6dd4',44127),(5208,'\n\"Experience is what you get when you were expecting something\n else.\"','541e1ca1ba795f8e006cdb4392dae898e5678fda',32929),(5209,'\n\"To love oneself is the beginning of a lifelong romance\"\n -- Oscar Wilde (1854-1900)','541e1ca1ba795f8e006cdb4392dae898e5678fda',44281),(5210,'\n\"Knowledge, idea, belief stands in the way of wisdom.\"\n -- J. Krishnamurthi','54b121bc8275dda53553ee3c336ea2a782ac5393',43080),(5211,'\n\"Education is a progressive discovery of our own ignorance.\"\n -- Will Durant','54b121bc8275dda53553ee3c336ea2a782ac5393',45090),(5212,'\n\"That\'s not writing; That\'s typing.\" \n -- Truman Capote on Jack Kerouac','54d1aa74410843184452dd6640fcb7bf85e8205d',42471),(5213,'\n\"Genius may have its limitations, but stupidity is not thus \n handicapped.\" -- Elbert Hubbard','54d1aa74410843184452dd6640fcb7bf85e8205d',43080),(5214,'\nFirst Rule Of History: History doesn\'t repeat itself --\nhistorians merely repeat each other.','55d886ab5dcf01be6332eb7542cdeb329cc5ecb0',44403),(5215,'\n\"Do you love your Creator? Love your fellow beings first.\"\n -- Prophet Muhammad','55d886ab5dcf01be6332eb7542cdeb329cc5ecb0',31913),(5216,'\n\"The only way to define your limits is by going beyond them.\"\n- Arthur Clarke','591cb27f37ca779ba564350d59a0ca2138905a71',43346),(5217,'\n\"When his life was ruined, his family killed, his farm \n destroyed, Job knelt down on the ground and yelled up to the \n heavens, \'Why god? Why me?\' and the thundering voice of God \n answered, \'There\'s just something about you that pisses me \n off.\'\" -- Stephen King.','591cb27f37ca779ba564350d59a0ca2138905a71',44281),(5218,'\n\"Just remember this: No one ever won the olive wreath with an\nimpressive training diary.\"\n- Marty Liquori','5c46489bec06fb161c255fbb3f09e836b23b08dc',35952),(5219,'\n\"Whoever imagines himself a favorite with God holds others in\n contempt.\"\n -- Robert G. Ingersoll','5c46489bec06fb161c255fbb3f09e836b23b08dc',36757),(5220,'\n\"I am an expert of electricity. My father occupied the chair of\n applied electricity at the state prison.\" -- WC Fields.','5ccc46df48e0e29adb850efb4fc9bad910fefbe2',44403),(5221,'\n\"I complained that I had no shoes until I met a man who had no\n feet.\"\n -- Persian proverb','5ccc46df48e0e29adb850efb4fc9bad910fefbe2',45883),(5222,'\n\"Too many of today\'s children have straight teeth and crooked\n morals.\" -- Unknown high school principal','5d17fd19490538517917e53daa91d76ca198a330',42471),(5223,'\n\"The number of miles I have run since I was a toddler would have\ntaken me around the world several times, and I still cannot define\nprecisely my joy in running.  There is no sacrifice in it.  I lead\nwhat I regard a normal life.  In my case, I thoroughly enjoy\nrunning 100-odd miles a week.  If I didn\'t I wouldn\'t do it.  Who\ncan define happiness? To some, happiness is a warm puppy or a glass\nof cold beer.  To me, happiness is running in the hills with my\nmates around me.\" \n- Ron Clarke','5d17fd19490538517917e53daa91d76ca198a330',31913),(5224,'\n\"A computer is like an Old Testament god, with a lot of rules and\n no mercy\" -- Joseph Campbell','5ea2a167caa5bec58b16800303350173e3dd0946',43599),(5225,'\n\"Luck is the residue of design.\"\n -- Branch Rickey - former owner of the Brooklyn Dodger Baseball \n    Team','5ea2a167caa5bec58b16800303350173e3dd0946',44944),(5226,'\n\"If you don\'t know where you\'re going, any road will get you\n there.\"\n -- Ancient Chinese Proverb','5eb6f63039d452e50d36d6bbd07a3fd5aec0d58c',45883),(5227,'\n\"It is lamentable, that to be a good patriot one must become\n the enemy of the rest of mankind.\"\n -- Voltaire','5eb6f63039d452e50d36d6bbd07a3fd5aec0d58c',43348),(5228,'\n\"If you can count your money, you don\'t have a billion dollars.\"\n -- J. Paul Getty (1892-1976)','5f27b32f0a79043e7eed83c6b89fe642a3cff758',35952),(5229,'\n\"Obstacles are those frightful things you see when you take your \n eyes off your goal.\" -- Henry Ford (1863-1947)','5f27b32f0a79043e7eed83c6b89fe642a3cff758',35658),(5230,'\n\"If there has to be a blood bath, let\'s get it over with.\"\n --Ronald Reagan, Vietnam','5f53beb5579ddb5c9fe382cc21e9c7c9c2e0b47d',36879),(5231,'\n\"Reality is merely an illusion, albeit a very persistent one.\"\n -- Albert Einstein (1879-1955)','6102ac29778c0e0242e8298650e38535b90d42ac',43080),(5232,'\n\"My mother said to me, \"If you are a soldier, you will become a \n general. If you are a monk, you will become the Pope.\" Instead,\n I was a painter, and became Picasso.\" -- Pablo Picasso.','6102ac29778c0e0242e8298650e38535b90d42ac',35950),(5233,'\n\"Stick a fork in me, I\'m done.\"\n- Unknown','616e1ddcd46dee355135a8e5c9bc013270351af4',32929),(5234,'\n\"Where are we going, and why am I in this handbasket?\"\n -- Bumper Sticker','616e1ddcd46dee355135a8e5c9bc013270351af4',32929),(5235,'\n\"I do not feel obliged to believe that the same God who has \n endowed us with sense, reason, and intellect has intended us \n to forgo their use.\" -- Galileo Galilei','6272cce8c0f7338217ab049f7406babaa0b2c1cc',44281),(5236,'\n\"If you were plowing a field, which would you rather use? Two \n strong oxen or 1024 chickens?\"\n -- Seymour Cray (1925-1996), father of supercomputing','6272cce8c0f7338217ab049f7406babaa0b2c1cc',45883),(5237,'\n\"One man\'s magic is another man\'s engineering. Supernatural is\n a null word.\"\n -- Robert Heinlein','62928c5d98429dcdd38d5f9ef2227c74fadf11e7',36757),(5238,'\n\"It has been said that the great scientific disciplines are \n examples of giants standing on the shoulders of other giants. \n It has also been said that the software industry is an example\n of midgets standing on the toes of other midgets.\" \n -- Alan Cooper About Face','62928c5d98429dcdd38d5f9ef2227c74fadf11e7',32929),(5239,'\n\"The belief in the possibility of a short decisive war appears to\n be one of the most ancient and dangerous of human illusions.\"\n -- Robert Lynd','6676319c523479160a1952182ce1f8ce29b48b65',32929),(5240,'\n\"Gods prefer simple, vicious games, where you Do Not Achieve \n Transcendence but Go Straight To Oblivion; a key to the \n understanding of all religion is that a god\'s idea of amusement \n is Snakes and Ladders with greased rungs.\"\n -- Terry Pratchett (Wyrd Sisters) ','6676319c523479160a1952182ce1f8ce29b48b65',45253),(5241,'\n\"You can know the name of a bird in all the languages of the \n world, but when you\'re finished, you\'ll know absolutely nothing\n whatever about the bird... So let\'s look at the bird and see\n what it\'s doing -- that\'s what counts. I learned very early \n the difference between knowing the name of something and knowing\n something.\" -- Richard Feynman','67468cb18559db0000a450d7dafd7c4f18e82e74',34631),(5242,'\nDenniston\'s Law: Virtue is its own punishment.','67468cb18559db0000a450d7dafd7c4f18e82e74',45090),(5243,'\n\"Any fool can make a rule, and any fool will mind it.\"\n -- Henry David Thoreau','6822cc28f97f30d8b3b85b3cf3a20719cbd597ec',34631),(5244,'\n\"New programmers are drawn to multithreading like moths to flame,\n with similar results.\" -- Tweet by Danny Thorpe','6822cc28f97f30d8b3b85b3cf3a20719cbd597ec',45561),(5245,'\n\"The best conditioned athlete is a long distance runner\".\n- John Thompson of the Georgetown Hoyas, submitted by Charlie Hesse','686375a4a3a3810f09b740c79cf130390fe51e36',32929),(5246,'\n\"Anything that is too stupid to be spoken is sung.\"\n -- Voltaire (1694-1778)','686375a4a3a3810f09b740c79cf130390fe51e36',43348),(5247,'\n\"None are more hopelessly enslaved than those who falsely\n believe they are free.\"\n -- Johann Wolfgang von Goethe','6ae71ab65cfa51cf880b7e6ddfc53163c46e359d',45090),(5248,'\n\"Trying to get into the details seems to be a religious issue -- \n nearly everybody is convinced that every style but their own is\n ugly and unreadable. Leave out the \"but their own\" and they\'re\n probably right...\" -- Jerry Coffin on indentation','6ae71ab65cfa51cf880b7e6ddfc53163c46e359d',43080),(5249,'\n\"It\'s dangerous to underestimate the intelligence of a customer\n who grew a business that\'s successful enough to require a large\n and complex set of software\" -- Grady Booch','6b889c330f46dc311cc666b585f113a1460792a3',43346),(5250,'\n\"If there\'s one thing worse than a program that doesn\'t work \n when it should, it\'s a program that does work when it shouldn\'t.\" \n -- Bob Archer','6b889c330f46dc311cc666b585f113a1460792a3',45883),(5251,'\n\"First they ignore you, then they laugh at you, then they fight \n you, then you win.\" -- Mahatma Gandhi (1869-1948)','6be7996f0ee0b877cad0afc2235c193b6bdceb0b',33738),(5252,'\n\"Someday man will imprison the power of the sun, release atomic\n power, and harness the rise and fall of the tides. I am proud\n of the fact that I never invented weapons to kill.\"\n -- Thomas Edison','6be7996f0ee0b877cad0afc2235c193b6bdceb0b',45090),(5253,'\n\"Rules of Optimization:\"\n Rule 1: Don\'t do it.\n Rule 2 (for experts only): Don\'t do it yet.\" \n -- M.A. Jackson','6c49656cdda47ed32abb63b389cd47a50fd804e6',31913),(5254,'\n\"War is an instrument entirely insufficient toward redressing\n wrong; and multiplies, instead of indemnifying losses.\"\n -- Thomas Jefferson','6c49656cdda47ed32abb63b389cd47a50fd804e6',43599),(5255,'\n\"If you ever drop your keys into a river of molten lava, let\n\'em go, because, man, they\'re gone.\"\n -- Jack Handey','6cbc5f743253477feb0b4583230340adf99d15a7',35658),(5256,'\n\"The dangerous patriot ... is a defender of militarism and its\n ideals of war and glory.\"\n -- Colonel James A. Donovan, Marine Corps','6cbc5f743253477feb0b4583230340adf99d15a7',42471),(5257,'\n\"A man loses his illusions first, his teeth second, and his\n follies last.\" -- Helen Rowland','6cee08486d23bd9fef73560b5e8cc5aed1777fe2',45090),(5258,'\n\"I don\'t care to belong to a club that accepts people like me as\n members.\" -- Groucho Marx','6cee08486d23bd9fef73560b5e8cc5aed1777fe2',43080),(5259,'\n\"Always do right- this will gratify some and astonish the rest.\"\n -- Mark Twain (1835-1910)','6fc7fddca9fe859ab7cefd7fb6ec22a2b0973f01',44281),(5260,'\n\"If the automobile had followed the same development cycle as \n the computer, a Rolls-Royce would today cost $100, get a \n million miles per gallon, and explode once a year, killing \n everyone inside.\" -- Robert X. Cringely.','6fc7fddca9fe859ab7cefd7fb6ec22a2b0973f01',43346),(5261,'\n\"We should leave our minds open, but not so open that our brains \n fall out.\" -- Alan Ross Anderson','719440cbffe1cb93c1241b8abdb3fae42fdefb49',42471),(5262,'\n\"An inconvenience is only an adventure wrongly considered; an \n adventure is an inconvenience rightly considered.\"\n -- Gilbert Keith Chesterton (1874-1936)','719440cbffe1cb93c1241b8abdb3fae42fdefb49',45883),(5263,'\n\"When I am dead, I hope it may be said: \'His sins were scarlet \n but his books were read.\" -- Hillaire Belloc.','7196c833e21b0e98823c5b03d6044d4059115afb',64),(5264,'\n\"Yes, I\'m fat, but you\'re ugly and I can go on a diet.\" \n -- bumper sticker','7196c833e21b0e98823c5b03d6044d4059115afb',44127),(5265,'\n\"If the United Nations once admits that international disputes \n can be settled by using force, then we will have destroyed the \n foundation of the organization and our best hope of establishing \n a world order.\" -- Dwight D. Eisenhower ','723cbf5c6f107d56fa3dd6462f8f568f12a658dd',31913),(5266,'\n\"I\'m always amazed to hear of air crash victims so badly\n mutilated that they have to be identified by their dental\n records.  What I can\'t understand is, if they don\'t know who\n you are, how do they know who your dentist is?\"\n -- Paul Merton','723cbf5c6f107d56fa3dd6462f8f568f12a658dd',31913),(5267,'\n\"There was a time when I believed in the story and the scheme\n of salvation, so far as I could understand it, just as I\n believed there was a Devil. Suddenly the light broke through to\n me and I saw a silly story, and each generation nowadays\n swallows it with greater difficulty. Why do people go on\n pretending about this Christianity?\"\n -- H. G. Wells','7254c5c586965242421b63b36a7de500af435d18',31909),(5268,'\n\"War: first, one hopes to win; then one expects the enemy to\n lose; then, one is satisfied that he too is suffering; in the\n end, one is surprised that everyone has lost.\"\n -- Karl Kraus','7254c5c586965242421b63b36a7de500af435d18',45881),(5269,'\n\"To sit alone with my conscience will be judgment enough for me.\"\n -- Charles William Stubbs','73b2353baa5a8ea3871936cb40e2994f518ae05e',45090),(5270,'\n\"Nature does not hurry, yet everything is accomplished.\"\n -- Lao tzu','73b2353baa5a8ea3871936cb40e2994f518ae05e',43346),(5271,'\n\"A good sermon should be like a woman\'s skirt: short enough to \n arouse interest but long enough to cover the essentials.\" \n -- Ronald Knox.','7611d833c08ebf32071f1b0d050edefbeea50cab',35952),(5272,'\n\"In every country and every age, the priest has been hostile to\n liberty.\"\n -- Thomas Jefferson','7611d833c08ebf32071f1b0d050edefbeea50cab',45561),(5273,'\n\"Do, or do not. There is no \'try\'.\"\n -- Yoda (\'The Empire Strikes Back\')','7969dc00956d339734564618b8a71b3652ac0483',45881),(5274,'\n\"Fear, like pain, may only be God\'s way ... of hurting us.\"\n- Unknown','7969dc00956d339734564618b8a71b3652ac0483',44403),(5275,'\n\"If quantum physics doesn\'t confuse you then you don\'t \n understand it.\" -- Niels Bohr  ','804b1a3fb40cdad2188c037e95ef1a2415495221',44281),(5276,'\nJohnson-Laird\'s Law: Toothache tends to start on Saturday night.','804b1a3fb40cdad2188c037e95ef1a2415495221',35950),(5277,'\n\"Life is like a game of cards. The hand that is dealt you\n represents determinism; the way you play it is free will.\"\n -- Jawaharlal Nehru','805e2fd392641a438663e36860f9879792ba4cb4',45881),(5278,'\n\"The true measure of a man is how he treats someone who can do \n him absolutely no good.\" -- Samuel Johnson (1709-1784)','874662c69f110a90da1066f0235e8643c245726b',32929),(5279,'\n\"Now comes the mystery\" \n -- Henry Ward Beecher, dying words, March 8, 1887','874662c69f110a90da1066f0235e8643c245726b',42471),(5280,'\n\"In law a man is guilty when he violates the rights of another.\n In ethics he is guilty if he only thinks of doing so.\"\n -- Immanuel Kant','88197b09866a12813af0460c3abd113989862c6d',43599),(5281,'\nGoebel\'s Law Of Computer Support: Troubleshooting a computer over \nthe telephone is like having sex through a hole in a board fence. \nIt can be done but it is neither EASY nor PLEASANT.','88197b09866a12813af0460c3abd113989862c6d',44127),(5282,'\n\"MOST things in moderation\"\n- Unknown','882c9d3db6863a7b2eef31460600daf3037d17cf',32929),(5283,'\n\"The same people that wrote the bible thought the world was\n flat.\"\n -- Unknown - (disputed)','882c9d3db6863a7b2eef31460600daf3037d17cf',36879),(5284,'\n\"A computer is like an Old Testament god, with a lot of rules and\n no mercy\" -- Joseph Campbell','8b1e80abca15b33ca7bf105e31725bfaa007c5f3',42471),(5285,'\n\"Enjoy the training and memories of race day, endure the race.\"\n- Shapiro','8b1e80abca15b33ca7bf105e31725bfaa007c5f3',31909),(5286,'\n\"Guard against the impostures of pretended patriotism.\"\n -- George Washington','8b32237f6906db4dafcf1f046dbce2cfe9ea3f21',36879),(5287,'\n\"You have a cough?  Go home tonight, eat a whole box of Ex-Lax \n -- tomorrow you\'ll be afraid to cough.\" -- Pearl Williams.','8b6dde8d346ae0eafac5973ee539f039055b38cd',43599),(5288,'\n\"I\'ve just learned about his illness. Let\'s hope it\'s nothing \n trivial.\" -- Irvin S. Cobb','8b6dde8d346ae0eafac5973ee539f039055b38cd',45449),(5289,'\n\"It is wrong always, everywhere, and for anyone, to believe\n anything upon insufficient evidence.\"\n -- William Kingdon Clifford','8cd64781c2534d80953532be0b0f6a02bc7ca9aa',64),(5290,'\n\"The harder the conflict, the more glorious the triumph. What we\nobtain too cheap, we esteem too lightly; it is dearness only that\ngives everything its value. I love the man that can smile in trouble,\nthat can gather strength from distress and grow brave by reflection.\"\n- Thomas Paine','8cd64781c2534d80953532be0b0f6a02bc7ca9aa',36879),(5291,'\n\"[War] might be avoidable were more emphasis placed on the\n training to social interest, less on the attainment of\n egotistical grandeur.\" -- Lydia Sicher','8dcdc70073f5f199abcac0cc093d5fa8d5438616',36757),(5292,'\n\"Few people are capable of expressing with equanimity opinions\n which differ from the prejudices of their social environment.\n Most people are even incapable of forming such opinions.\"\n -- Albert Einstein','8dcdc70073f5f199abcac0cc093d5fa8d5438616',33738),(5293,'\n\"If god created us in his image we have certainly returned the\n compliment.\"\n -- Voltaire','8eceef4ed8056e15bada60715b2cba3b2bbf724c',64),(5294,'\n\"In all large corporations, there is a pervasive fear that \n someone, somewhere is having fun with a computer on company time. \n Networks help alleviate that fear.\" -- John C. Dvorak.','8eceef4ed8056e15bada60715b2cba3b2bbf724c',43080),(5295,'\n\"Smoking is one of the leading causes of statistics.\"\n -- Fletcher Knebel','8fcc76bff33b4703d65084dcda10fab6d127b878',45883),(5296,'\n\"Hofstadter\'s Law: It always takes longer than you expect, even \n when you take into account Hofstadter\'s Law.\" ','8fcc76bff33b4703d65084dcda10fab6d127b878',45883),(5297,'\n\"I knew I was an unwanted baby when I saw that my bath toys\n were a toaster and a radio.\" -- Joan Rivers','92478578ea3b5ff51120bba9153fa3997f603cdb',45253),(5298,'\nGlyme\'s Formula For Success: The secret of success is sincerity. \nOnce you can fake that, you\'ve got it made.','92478578ea3b5ff51120bba9153fa3997f603cdb',31909),(5299,'\n\"The ability to simplify means to eliminate the unnecessary so\n that the necessary may speak.\" -- Hans Hoffmann','93aeee8c1ad46e038c3e3ff8461b9a914eb84cdb',44944),(5300,'\n\"I run distance because I want to be in good shape when I die.\"\n- Unknown','93aeee8c1ad46e038c3e3ff8461b9a914eb84cdb',45883),(5301,'\n\"The primary duty of an exception handler is to get the error\n out of the lap of the programmer and into the surprised face of\n the user. Provided you keep this cardinal rule in mind, you\n can\'t go far wrong.\" -- Verity Stob','97a87ed2c91a57dd43737791aa1168ed84a1007c',45253),(5302,'\n\"We always obeyed the law. Isn\'t that what you do in America?\n Even if you don\'t agree with a law personally, you still obey\n it. Otherwise life would be chaos.\"\n -- Gertrude Scholtz-Klink, explaining Nazi policy','97a87ed2c91a57dd43737791aa1168ed84a1007c',45883),(5303,'\n\"Elegance is not a dispensable luxury but a factor that decides \n between success and failure.\" -- Edsger Dijkstra ','9b612fc1988467b9fef7ba7650b5bf52d166f5fb',45561),(5304,'\n\"When you give food to the poor, they call you a saint. When\n you ask why the poor have no food, they call you a communist.\"\n -- Archbishop Helder Camara','9b612fc1988467b9fef7ba7650b5bf52d166f5fb',34631),(5305,'\n\"All truth passes through three stages. First, it is ridiculed.\n Second, it is violently opposed. Third, it is accepted as being\n self-evident.\"\n -- Arthur Schopenhauer','a133e693a5e73c64a5c82f9a26f03d2deeb2965b',33738),(5306,'\n\"Give me a museum and I\'ll fill it.\"\n-- Pablo Picasso (1881-1973)','a133e693a5e73c64a5c82f9a26f03d2deeb2965b',43348),(5307,'\n\"Teeth extracted by the latest methodists.\"\n -- Hong Kong dental advertisement','a8edf27436789a61107ab64a9138ba23d0312912',45253),(5308,'\n\"A dozen extra steps becomes a tremendous aggravation when you are\npushing your edge out hour after hour.\"\n- Shapiro','a8edf27436789a61107ab64a9138ba23d0312912',45090),(5309,'\n\"If we could read the secret history of our enemies, we should\n find in each man\'s life sorrow and suffering enough to disarm\n all hostility.\"\n -- Henry Wadsworth Longfellow','a9009019ed3887cb9e7fe24aaa5e72cc20af81a4',34631),(5310,'\n\"Each time you run you will receive lessons. You have enrolled in\nthe school of ultrarunning. You may like the lessons or think them\nirrelevant and stupid. What you think makes no difference; the\nlessons will be presented until they are learned.\"\n- Keith Pippin','a9009019ed3887cb9e7fe24aaa5e72cc20af81a4',35941),(5311,'\n\"So I was in my car, and I was driving along, and my boss rang up\n and he said \'You\'ve been promoted\'. And I swerved.\n And then he rang up a second time and said \'You\'ve been promoted\n again\'. And I swerved again.\n He rang up a third time and said \'You\'re managing director.\' \n And I went into a tree.\n And a policeman came up and said \'What happened to you?\'\n And I Said \'I careered off the road.\'\" -- Tommy Cooper','a9412422c11252f60268edc332c9efaf8a40f6e7',43599),(5312,'\n\"When did I realize I was God? Well, I was praying and I\n suddenly realized I was talking to myself.\"\n -- Jack Gurney - \"The Ruling Class\"','a9412422c11252f60268edc332c9efaf8a40f6e7',35952),(5313,'\n\"How the teacher reacts when something goes wrong tells the class\n what\'s important.\" -- Bruce Hamilton','a97c4e0742620fef6c6303195a4d1c0d4e93a9d3',45561),(5314,'\n\"A nation is a society united by a delusion about its ancestry\n and by common hatred of its neighbors.\"\n -- William R. Inge','aa1b96d9fdd1919ff51ed474c99202cdb9719d3d',31913),(5315,'\n\"Only those who will risk going too far can possibly find out how far\nthey can go.\"\n- T.S. Eliot','aa1b96d9fdd1919ff51ed474c99202cdb9719d3d',31909),(5316,'\n\"We should forget about small efficiencies, say about 97% of the \n time: premature optimization is the root of all evil.\"\n -- Donald Knuth','abfee686ac890cd929a65776485e327276b36371',35941),(5317,'\n\"Organizations which design systems are constrained to produce\n designs which are copies of the communication structures of these\n organizations. (For example, if you have four groups working on\n a compiler, you\'ll get a 4-pass compiler)\" -- Conway\'s Law','abfee686ac890cd929a65776485e327276b36371',42471),(5318,'\n\"Because I do it with one small ship, I am called a terrorist. \n You do it with a whole fleet and are called an emperor.\"\n -- A pirate, from St. Augustine\'s \"City of God\"','ad9cc617b225fe9ab1fde05c0d513df81ef161f2',34631),(5319,'\n\"Minsky\'s Second Law: Don\'t just do something. Stand there.\"\n-- Marvin Minsky','ad9cc617b225fe9ab1fde05c0d513df81ef161f2',44403),(5320,'\n\"An inconvenience is only an adventure wrongly considered; an \n adventure is an inconvenience rightly considered.\"\n -- Gilbert Keith Chesterton (1874-1936)','ae52cbcb5a6202aeec8bb7850b8113e41c8cec1a',35952),(5321,'\n\"Behind every successful man is a woman, behind her is his wife.\"\n -- Groucho Marx','ae52cbcb5a6202aeec8bb7850b8113e41c8cec1a',42471),(5322,'\n\"There are only two ways to live your life. One is as though \n nothing is a miracle. The other is as though everything is a \n miracle.\" -- Albert Einstein (1879-1955)','af1335dbf4b385abbc89fa77b818700ccccaece9',33738),(5323,'\n\"Twenty years from now you will be more disappointed by the\n things that you didn\'t do than by the ones you did do.\"\n -- Samuel Clemens','af1335dbf4b385abbc89fa77b818700ccccaece9',36757),(5324,'\n\"I ain\'t got no quarrel with