oman, shave on a Saturday night and, most especially, \n never to shave a Gentile woman on a Saturday night.\" \n -- Woody Allen.','3d2d45d4b3f9c8fcd7d9417d5d99a1b5a894ec42',44944),(5549,'\n\"I was married by a judge. I should have asked for a jury.\"\n -- Groucho Marx','3d2d45d4b3f9c8fcd7d9417d5d99a1b5a894ec42',34631),(5550,'\n\"Jesus may love you, but I think you\'re garbage wrapped in skin.\"\n -- Michael O\'Donohugh','3e65f84cccbd3f2d10608292edf324b7966126ba',32929),(5551,'\n\"To eat well in England, you should have breakfast three times \n a day.\" -- W. Somerset Maugham, 1925','3e65f84cccbd3f2d10608292edf324b7966126ba',35941),(5552,'\n\"All murderers are punished unless they kill in large numbers \n and to the sound of trumpets.\" -- Voltaire','3e999333e4d5bbec834f19761ae4fa91489ec617',33738),(5553,'\n\"Every war when it comes, or before it comes, is represented\n not as a war but as an act of self-defense against a homicidal\n maniac.\"\n -- George Orwell','3e999333e4d5bbec834f19761ae4fa91489ec617',45881),(5554,'\n\"Computer dating is fine, if you\'re a computer.\"\n -- Rita May Brown.','3ec6dcd6481723d78945c1f551efb555973e7181',43080),(5555,'\n\"The de facto role of the US armed forces will be to keep the\n world safe for our economy and open to our cultural assault.\"\n -- Major Ralph Peters, US Military','3ec6dcd6481723d78945c1f551efb555973e7181',44281),(5556,'\n\"The difference between what the most and the least learned \n people know is inexpressibly trivial in relation to that which \n is unknown.\"  -- Albert Einstein','3ec8b3ecdfd2d67027ee1f257b8fa61dbc016e57',43348),(5557,'\n\"No one rules if no one obeys.\"\n -- <TaoDo>','3ec8b3ecdfd2d67027ee1f257b8fa61dbc016e57',44944),(5558,'\n\"The difference between what the most and the least learned \n people know is inexpressibly trivial in relation to that which \n is unknown.\"  -- Albert Einstein','40caafd2834c465b59493ee8fccdcc609c2de4e2',42471),(5559,'\nPudder\'s Law: Anything that begins well will end 