INSERT INTO `COMENTARIO` VALUES (5562,'\n\"Believe those who are seeking the truth; doubt those who find\n it.\"\n -- Andre Gide','412085c129e3538bc20644116c05ed7fc4c33aa0',45449),(5563,'\n\"... Somehow we find it hard to sell our values, namely that\n the rich should plunder the poor.\"\n -- John Foster Dulles','42271387fd9aeff9e75d653d2f08c7da3e3d8ec6',45253),(5564,'\n\"Don\'t try to teach a pig to sing, it can\'t be done and it only\n ticks off the pig.\"\n -- Robert Heinlein','42271387fd9aeff9e75d653d2f08c7da3e3d8ec6',44403),(5565,'\n\"You run an ultra largely on concentration ... not letting your form\ndrag and continuing to run. Your body quits and the mind takes over.\nIt\'s not like a marathon where you think, maybe I can gut it out.\"\n- Georgs Kolesnikovs','42704f6c73679f11b3d8dee5a6b4a647de266c45',35950),(5566,'\nMurphy\'s Laws:\n   1. If anything can go wrong, it will (and at the worst \n      possible moment).\n   2. Nothing is as easy as it looks.\n   3. Everything takes longer than you think it will.','42704f6c73679f11b3d8dee5a6b4a647de266c45',33738),(5567,'\n\"The spirit of resistance to government is so valuable on\n certain occasions that I wish it to be always kept alive.\"\n -- Thomas Jefferson','453c8bc1d6d194607d592e9b6f162b1fe56cd295',45883),(5568,'\n\"You\'ll have no trouble keeping up. Remember, I\'m a 35 minute miler.\"\n(when discussing a training run)\n- Mark Williams, first of 253 people to finish Barkley 100','453c8bc1d6d194607d592e9b6f162b1fe56cd295',36879),(5569,'\nClarke\'s Third Law: Any sufficiently advanced technology is \nindistinguishable from magic.','464cdd91c81952d73c2501ec3c9f04c7cfdbeb5f',45449),(5570,'\n\"My advice to you is get married: if you find a good wife you\'ll \n be happy; if not, you\'ll become a philosopher.\" -- Socrates.','464cdd91c81952d73c2501ec3c9f04c7cfdbeb5f',43346),(5571,'\n\"Maybe there is no actual place called hell. Maybe hell is just \n having to listen to our grandparents breathe through their noses