n, but not so open that our brains \n fall out.\" -- Alan Ross Anderson','6527e6efa0be17a1de9f27b287b1cc04b445fc8a',43346),(5625,'\n\"The perfect project plan is possible if one first documents a\n list of all the unknowns.\" -- Bill Langley','66d5d06e4ffd42ac6765baafb597a3c6bc5b53c3',43080),(5626,'\n\"Criticism in a time of war is essential to the maintenance of \n any kind of democratic government.\" \n -- Sen. Robert Taft, (R) Ohio','66d5d06e4ffd42ac6765baafb597a3c6bc5b53c3',39809),(5627,'\n\"The most important single aspect of software development is to\n be clear about what you are trying to build.\" \n -- Bjarne Stroustrup','6f3e9570882cb90a4bb15947d628ebffee05bdb3',35952),(5628,'\n\"How can I believe in God when just last week I got my tongue \n caught in the roller of an electric typewriter?\" -- Woody Allen.','6f3e9570882cb90a4bb15947d628ebffee05bdb3',45883),(5629,'\n\"Distrust any enterprise that requires new clothes.\"\n -- Henry David Thoreau (1817-1862)','71234cad473b27f89915f4ce7cacfb4a91bb7f53',45561),(5630,'\n\"A radioactive cat has eighteen half-lives.\" -- Unknown','71234cad473b27f89915f4ce7cacfb4a91bb7f53',44944),(5631,'\n\"I would have made a good pope.\"\n -- Richard Nixon','722ac236bf7a70965a76cea769740ee588fc2fcc',35952),(5632,'\n\"Exceptions relieve the programmer of tedious writing\n boilerplate code -- without removing the semantics of said\n code -- and they allow the programmer to arrange the code so\n that error handling code is more separate from the main program\n logic.\" \n -- Herb Sutter','722ac236bf7a70965a76cea769740ee588fc2fcc',35952),(5633,'\n\"I have had a perfectly wonderful evening, but this wasn\'t it.\"\n -- Groucho Marx','7240a8ae76d16e2890f58e7fe413eb6d7c55edc4',34631),(5634,'\n\"Everywhere I go I\'m asked if I think the university stifles \n writers. My opinion is that they don\'t stifle enough of them.\"\n -- Flannery O\'Connor (1925-1964)','7240a8ae76d16e2890f58e7fe413eb6d7c55edc4',36757),(5635,'\n\"They say such nice 