especially engineer-humans) perceive beauty is intimately\n related to our ability to process and understand complexity.\n A language that makes it hard to write elegant code makes it\n hard to write good code.\" -- Eric S. Raymond','795ea5cadaa829b1f37d3eb5b17e1e33fc8368fc',36757),(5645,'\n\"The man who accumulates, whether money or knowledge, can never\n be free.\"\n -- J. Krishnamurthi','798a64f7e4115b0af4cc5f226e0ec1cc17008d79',45883),(5646,'\n\"The trouble with the world is that the stupid are cocksure and\n the intelligent are full of doubt.\"\n -- Bertrand Russell','7b04a4565f37a07f1c2ee54be8286017de6c56df',45561),(5647,'\n\"The supreme art of war is to subdue the enemy without\n fighting.\"\n -- Sun tzu','7b04a4565f37a07f1c2ee54be8286017de6c56df',45883),(5648,'\nFinagle\'s Law Of Government Contracting: Dealing with the \ngovernment is like kicking a 300-pound sponge.','7bb1cb9865c151582d401104cdac51bd140734b2',45253),(5649,'\n\"More computing sins are committed in the name of efficiency\n (without necessarily achieving it) than for any other single\n reason - including blind stupidity.\" -- W.A. Wulf','7bb1cb9865c151582d401104cdac51bd140734b2',45561),(5650,'\n\"26 miles 385 yards is where racing ends and ludicrous extremes begin.\"\n- from \"Runner\'s World\"','7d77d02be34628a523f9356ed29ec6be03816270',36879),(5651,'\n\"A scholar who cherishes the love of comfort is not fit to be \n deemed a scholar.\" -- Lao-Tzu (570?-490? BC)','7d77d02be34628a523f9356ed29ec6be03816270',45090),(5652,'\n\"The duration of an athletic contest is relatively short, while the\ntraining for it may take many weeks of arduous work and continuous\nexercise of self-effort.  The real value of sport is not the actual\ngame played in the limelight of applause but the hours of dogged\ndetermination and self-discipline carried out alone, imposed and\nsupervised by an exacting conscience.  The applause soon dies away, the\nprize is left behind, but the character you build is yours forever.\"\n- Unknown','802e3f8209166abf8be5d54be8e47aadc4b20d19',31909),(5653,'\n\"They never open their mouths without subtracting from the \n sum of human knowledge.\" -- Thomas Brackett Reed','802e3f8209166abf8be5d54be8e47aadc4b20d19',35950),(5654,'\n\"Moral indignation is jealousy with a halo.\"\n-- H. G. Wells (1866-1946)','81208260a5bfa15d22a8a159f8610ccce1bc8f45',35950),(5655,'\n\"So I was in my car, and I was driving along, and my boss rang up\n and he said \'You\'ve been promoted\'. And I swerved.\n And then he rang up a second time and said \'You\'ve been promoted\n again\'. And I swerved again.\n He rang up a third time and said \'You\'re managing director.\' \n And I went into a tree.\n And a policeman came up and said \'What happened to you?\'\n And I Said \'I careered off the road.\'\" -- Tommy Cooper','81208260a5bfa15d22a8a159f8610ccce1bc8f45',44281),(5656,'\n\"Quoting Coulter is kind of like quoting Joe McCarthy; no doubt\n it does well when you\'re pandering to a group of like-minded hate \n mongerers, but it earns you a well-deserved reputation as a\n vicious, mean-spirited airhead and intellectual lightweight in\n more analytical and dispassionate circles.\"\n -- Mark Vaughan in borland.public.off-topic','827905cfdf507d19fd1622a61d56c8dccf0a95b5',35941),(5657,'\n\"Everything has been figured out, except how to live.\"\n -- Jean-Paul Sartre (1905-1980)','827905cfdf507d19fd1622a61d56c8dccf0a95b5',43348),(5658,'\n\"The second 50 is done with the mind.\"\n- Unknown','8304c52b0c2b67372d5dcbe998ee4e04271275d6',43080),(5659,'\n\"Anything worth doing is worth doing to the extreme.\"\n- Bruce Wise','8304c52b0c2b67372d5dcbe998ee4e04271275d6',42471),(5660,'\n\"Beyond its entertainment value, Baywatch has enriched and,\n in many cases, helped save lives. I\'m looking forward to\n the opportunity to continue with a project which has has\n such a significance for so many.\" \n -- David Hasselhoff, Actor','830f5e197f478355fc8a004a02c907acea514b96',43599),(5661,'\n\"It 