bigger glass!\"\n -- Terry Pratchett, (The Truth)','91a7bc9deaeeb18d77904dce1ed85ab89013e06f',36757),(5684,'\n\"A terrorist is someone who has a bomb, but doesn\'t have an\n air force.\" -- William Blum','91a8151db31376f10da45a9c038747c0b4f595b6',64),(5685,'\n\"There is a tragic clash between truth and the world. Pure\n undistorted truth burns up the world.\"\n -- Nikolay Berdyayev','91a8151db31376f10da45a9c038747c0b4f595b6',43599),(5686,'\n\"There are very few monsters who warrant the fear we have of\n them.\"\n -- Andre Gide','9270ef04bcf46fd89b1a3fc6622dae8f87858e55',36757),(5687,'\n\"I never advocated war except as a means of peace.\"\n -- Ulysses S. Grant','9270ef04bcf46fd89b1a3fc6622dae8f87858e55',33738),(5688,'\n\"If you believe in telekinesis, raise my hand.\" -- Unknown','92d94c724c886ec82354ab787965e5def36e98a6',45883),(5689,'\n\"The government of the United States does not, in its policies,\n express the decency of its people.\"\n -- Jerry Fresia','92d94c724c886ec82354ab787965e5def36e98a6',45090),(5690,'\n\"I never would have agreed to the formulation of the Central\n Intelligence Agency back in forty-seven, if I had known it\n would become the American Gestapo.\"\n -- Harry S Truman, 1961','933f5957c21d5177549ba583a8fc31f5cac00e5d',36879),(5691,'\n\"Either God wants to abolish evil, and cannot; or he can, but\n does not want to. If he wants to, but cannot, he is impotent.\n If he can, but does not want to, he is wicked. If, as they say,\n God can abolish evil, and God really wants to do it, why is\n there evil in the world?\"\n -- Epicurus','933f5957c21d5177549ba583a8fc31f5cac00e5d',45883),(5692,'\n\"I have never let my schooling interfere with my education.\"\n -- Mark Twain (1835-1910)','95798facd61a46a1df244fa324f6c17c233fbfb5',35941),(5693,'\n\"If absolute power corrupts absolutely, where does that leave \n God?\" -- George Deacon.','95798facd61a46a1df244fa324f6c17c233fbfb5',44281),(5694,'\n\"Violence is the last refuge of the incompetent.\" -- Issac Asimov','958fe0b12065656a7e51b4131c3b6a8a0533572b',36879),(5695,'\n\"The difference between me and Rick Hogan is that I always leave the\nrattlesnake for the next guy.\"\n- Andy Petterson at Old Dominion, referring to a snake killed by Rick\n  near the Peach Orchard aid station','958fe0b12065656a7e51b4131c3b6a8a0533572b',45449),(5696,'\n\"I have spoken many a word, therefore, it is fact.\"\n -- Eric the Verbose','96598b53c417351edc1833139e77626d2117cf72',45883),(5697,'\n\"I did say something along the lines of \'C makes it easy to\n shoot yourself in the foot; C++ makes it harder, but when you\n do, it blows your whole leg off.\'\" -- Bjarne Stroustrup','96598b53c417351edc1833139e77626d2117cf72',44281),(5698,'\n\"I have read your book and much like it.\"\n -- Moses Hadas (1900-1966)','979014556ab8cdd13048702896fb99fcc40fe793',34631),(5699,'\n\"Experience is what you get when you were expecting something\n else.\"','979014556ab8cdd13048702896fb99fcc40fe793',35658),(5700,'\n\"Earth provides enough to satisfy every man\'s need, but not\n every man\'s greed.\"\n --Mohandas Gandhi','98a4760ee296bfed020d6e2da742a44e7368f0ea',43346),(5701,'\n\"Someday man will imprison the power of the sun, release atomic\n power, and harness the rise and fall of the tides. I am proud\n of the fact that I never invented weapons to kill.\"\n -- Thomas Edison','98a4760ee296bfed020d6e2da742a44e7368f0ea',35952),(5702,'\n\"The only function of economic forecasting is to make astrology \n look respectable.\" -- John Kenneth Galbraith','98db8330845a23b876020e9c9cd38926610cd58f',45449),(5703,'\n\"Hearing nuns\' confessions is like being stoned to death with \n popcorn.\" -- Fulton Sheen.','98db8330845a23b876020e9c9cd38926610cd58f',45253),(5704,'\n\"Everything starts somewhere, though many physicists disagree. \n But people have always been dimly aware of the problem with the \n start of things. They wonder how the snowplough driver gets to \n work, or how the makers of dictionaries look up the spelling of \n words.\"\n -- Terry Pratchett (Hogfather)','98f84f30eb40d50691c968cb71dcaa1225c1dced',44403),(5705,'\n\"They said I was the greatest pitcher they ever saw; I couldn\'t\n understand why they couldn\'t give me no justice.\"\n -- Satchel Paige','98f84f30eb40d50691c968cb71dcaa1225c1dced',43348),(5706,'\n\"Diplomacy is the art of saying \'Nice doggie!\'... \'til you can \n find a rock.\" -- bumper sticker                             ','9989190094e077edacfbde7d42a307ac8c0a62a1',31909),(5707,'\n\"Climb the mountains and get their good tidings.  The winds will blow\ntheir freshness into you, and the storms, their energy.  Your cares\nand tensions will drop away like the leaves of autumn.\"\n- John Muir','9989190094e077edacfbde7d42a307ac8c0a62a1',45883),(5708,'\n\"You must ask your neighbor if you shall live in peace.\"\n -- John Clark','9cc8ab92fd0685c523f2c81a1b7af67931664e95',44944),(5709,'\n\"It\'s dangerous to underestimate the intelligence of a customer\n who grew a business that\'s successful enough to require a large\n and complex set of software\" -- Grady Booch','9cc8ab92fd0685c523f2c81a1b7af67931664e95',34631),(5710,'\n\"I must say Bernard Shaw is greatly improved by music.\"\n -- T.S. Elliot referring to \'My Fair Lady\'','a0a9980a2b2b56651a64cd98df83af7670010128',43346),(5711,'\n\"Your biggest challenge isn\'t someone else.  It\'s the ache in your lungs\nand the burning in your legs, and the voice inside you that yells\n\'CAN\'T\", but you don\'t listen.  You just push harder.  And then you hear\nthe voice whisper \'can\'.  And you discover that the person you thought\nyou were is no match for the one you really are.\"\n- Unknown','a0a9980a2b2b56651a64cd98df83af7670010128',35952),(5712,'\n\"Without censorship, things can get terribly confused in the\n public mind.\"\n -- General William Westmoreland','a1646b6caf7e2d8d0520f0fd6b7a4c0af274759c',43599),(5713,'\n\"You can\'t get lost on this course!\"\n- Joe Dabes','a1646b6caf7e2d8d0520f0fd6b7a4c0af2747