is frequently called cynicism \n by those who don\'t have it.\"\n -- George Bernard Shaw (1856-1950)','a70ce4f4eab0034a9278ed60542b044ef932ef3d',31913),(5726,'\n\"Did you ever walk in a room and forget why you walked in? I think\n that\'s how dogs spend their lives.\" -- Sue Murphy.','a71ebcef59d927386148b4d85a1207ab1bfa0c2c',32929),(5727,'\n\"Gigerenzer\'s Law of Indispensable Ignorance: The world cannot \n function without partially ignorant people.\" -- Gerd Gigerenzer','a71ebcef59d927386148b4d85a1207ab1bfa0c2c',45881),(5728,'\n\"I admire the Pope. I have a lot of respect for anyone who can \n tour without an album.\" -- Rita Rudner.','a725ba7793dcf98a84da8a88d5554a14625ff410',44944),(5729,'\n\"You can never run a hill too hard, you will collapse before hurting it.\"\n- Submitted by Adam Born','a99ba72eaa3bc91aba6511f2510aa2032c8abd89',64),(5730,'\n\"Believe those who are seeking the truth. Doubt those who find \n it.\" -- Andr Gide','a99ba72eaa3bc91aba6511f2510aa2032c8abd89',44281),(5731,'\n\"Power is the ability to control things, moral authority is the\n ability to change things\" -- Jim Wallis','aec0f8f62c9a2434e6aaea6d069047b6de20ca73',43599),(5732,'\n\"I wouldn\'t mind dying - it\'s the business of having to stay \n dead that scares the shit out of me.\" -- R. Geis.','aec0f8f62c9a2434e6aaea6d069047b6de20ca73',35952),(5733,'\n\"You\'ve got to be a little bored to be doing really good training.\"\n- Marty Liquori','aeec47a28f23c0e68f7d5ea9b33e64aafc3c8850',33738),(5734,'\n\"Strange is our situation here upon Earth.\"\n -- Albert Einstein','aeec47a28f23c0e68f7d5ea9b33e64aafc3c8850',45883),(5735,'\n\"In ultrarunning, the pain is inevitable, but the suffering is\noptional.\"\n- Al Bogenhuber','b0458b356240d1d1f4c2f005e7442205064151bc',44127),(5736,'\n\"Death is a low chemical trick played on everybody except sequoia\n trees.\" -- JJ Furnas.','b0458b356240d1d1f4c2f005e7442205064151bc',35950),(5737,'\n\"Maybe there is no actual place called hell. Maybe hell is just \n having to listen to our grandparents breathe through their noses\n when they\'re eating sandwiches.\" -- Jim Carrey.','b05e04908505f530a6b70ca64ca05a42ddb1d208',43599),(5738,'\n\"All murderers are punished unless they kill in large numbers \n and to the sound of trumpets.\" -- Voltaire','b05e04908505f530a6b70ca64ca05a42ddb1d208',43346),(5739,'\nBrilliant\'s Law Of Limited Ambition: If you can\'t learn how to do \nit well, learn how to enjoy doing it poorly.','b3757e73b4bfb806a01e23d01fc2149b99a21b9e',45883),(5740,'\n\"We don\'t like their sound, and guitar music is on the way out.\"\n -- Decca Recording Co. rejecting the Beatles, 1962','b3757e73b4bfb806a01e23d01fc2149b99a21b9e',36879),(5741,'\n\"The Quitter\"\nWhen you\'re lost on the trail with the speed of a snail\nAnd defeat looks you straight in the eye\nAnd you\'re needing to sit, your whole being says quit\nYou\'re certain it\'s your time to die.\nBut the code of the trail is \"move forward don\'t fail\"\nThough your knees and ego are scarred.\nAll the swelling and pain is just part of the game\nIn the long run it\'s quitting that\'s hard!','b609afd886ee8710228d193433a2393491aee9b1',44127),(5742,'\n\"Friends may come and go, but enemies accumulate.\"\n -- Thomas Jones','b609afd886ee8710228d193433a2393491aee9b1',42471),(5743,'\n\"Disobedience, in the eyes of anyone who has read history, is\n man\'s original virtue. It is through disobedience that progress\n has been made, through disobedience and through rebellion.\"\n -- Oscar Wilde','b91b385f4db774cb7146a05912e89a58569f681f',45881),(5744,'\n\"And the users exclaimed with a laugh and a taunt: \'It\'s just what \n we asked for but not what we want.\'\"','b91b385f4db774cb7146a05912e89a58569f681f',43599),(5745,'\n\"A husband is what is left of the lover after the nerve has been \n extracted.\"\n -- Helen Rowland (1876-1950)','b9457789d30c7145bf74012bfb674185f0ef3a75',64),(5746,'\n\"He\'d noticed that sex bore some resemblance to cookery: it \n fascinated people, they sometimes bought books full of \n complicated recipes and interesting pictures, and sometimes when \n they were really hungry they created vast banquets in their \n imagination - but at the end of the day they\'d settle quite \n happily for egg and chips. If it was well done and maybe had a \n slice of tomato.\"\n -- Terry Pratchett (The Fifth Elephant) ','b9457789d30c7145bf74012bfb674185f0ef3a75',31913),(5747,'\n\"When I was a kid I used to pray every night for a new bicycle. \n Then I realised that the Lord doesn\'t work that way so I stole \n one and asked Him to forgive me.\" -- Emo Philips.','b97f63cdb32dbbaef957da68bb7639d3129df174',44403),(5748,'\n\"If computers get too powerful, we can organize them into a\n committee - that will do them in.\"','b97f63cdb32dbbaef957da68bb7639d3129df174',45883),(5749,'\n\"Assassins!\"\n-- Arturo Toscanini (1867-1957) to his orchestra','bb14cc27e8a4f5bdfd63c72250b87f69ec7d9d24',39809),(5750,'\n\"You can pretend to be serious; you can\'t pretend to be witty.\"\n -- Sacha Guitry','bb14cc27e8a4f5bdfd63c72250b87f69ec7d9d24',34631),(5751,'\n\"If you were plowing a field, which would you rather use? Two \n strong oxen or 1024 chickens?\"\n -- Seymour Cray (1925-1996), father of supercomputing','bb979a33849ad72fa65bb94815dd92e08da9f2f1',64),(5752,'\n\"Life would be so much easier if we could just see the source \n code.\" -- unknown','bb979a33849ad72fa65bb94815dd92e08da9f2f1',43080),(5753,'\n\"In order to be an immaculate member of a flock of sheep, one\n must above all be a sheep oneself.\"\n -- Albert Einstein','bd1be4f71a543a9e1dae235ce98ff9494f2ff369',44944),(5754,'\n\"I am amazed how many people on this planet are happy and free\n and never even saw the US constitution.\"\n -- <Reason>','bd1be4f71a543a9e1dae235ce98ff9494f2ff369',45449),(5755,'\n\"Your Highness, I have no need of this hypothesis.\"\n -- Pierre Laplace (1749-1827), to Napoleon on why his works on \n    celestial mechanics make no mention of God.','be2c0b697ab549dac1122bc76c3ec9c98cf4c1f3',31913),(5756,'\n\"I hear Glenn Hoddle has found God. That must have been one hell\n of a pass.\" -- Bob Davies.','be2c0b697ab549dac1122bc76c3ec9c98cf4c1f3',43346),(5757,'\n\"I am amazed how many people on this planet are happy and free\n and never even saw the US constitution.\"\n -- <Reason>','bf5d4e7c8a1af61855b5227279a6744c3bde8a8a',43599),(5758,'\n\"Everybody\'s worried about stopping terrorism. Well, there\'s a\n really easy way; stop participating in it.\"\n -- Noam Chomsky','bf64e500ca8ff5f34f830084c9f7db87d7a7092b',45561),(5759,'\n\"He can compress the most words into the smallest idea of any man \n I know.\" -- Abraham Lincoln','bf64e500ca8ff5f34f830084c9f7db87d7a7092b',35658),(5760,'\n\"A computer is like an Old Testament god, with a lot of rules and\n no mercy\" -- Joseph Campbell','c1795f7a8734de8e1e83b4e47e566238c3e75acb',35950),(5761,'\n\"Exceptions relieve the programmer of tedious writing\n boilerplate code -- without removing the semantics of said\n code -- and they allow the programmer to arrange the code so\n that error handling code is more separate from the main program\n logic.\" \n -- Herb Sutter','c1795f7a8734de8e1e83b4e47e566238c3e75acb',35941),(5762,'\n\"TeX has found at least one bug in every Pascal compiler it\'s \n been run on, I think, and at least two in every C compiler.\" \n -- Donald Knuth','c2f228e7e2baf57a537893f20f0615908410ad15',35950),(5763,'\nCanada Bill Jones\' Motto: It\'s morally wrong to allow naive end \nusers to keep their money.','c2f228e7e2baf57a537893f20f0615908410ad15',42471),(5764,'\n\"The Barkley, of course.  It was 20 hours longer\".\n- Mark Williams, when asked whether Hardrock or Barkley was harder','c3077f350f9aff932e72261a46ce6a250b1e85f4',39809),(5765,'\nFinagle\'s Rules:\n\n   1. To study an application best, understand it thoroughly \n      before you start.\n   2. Always keep a record of data. It indicates you\'ve been \n      working.\n   3. Always draw your curves, then plot the reading.\n   4. In case of doubt, make it sound convincing.\n   5. Program results should always be reproducible. They should \n      all fail in the same way.\n   6. Do not believe in miracles. Rely on them.','c3077f350f9aff932e72261a46ce6a250b1e85f4',45883),(5766,'\n\"What I am against is quotas. I am against hard quotas, quotas \n they basically delineate based upon whatever. However they \n delineate, quotas, I think, vulcanize society. So I don\'t know \n how that fits into what everybody else is saying, their relative \n positions, but that\'s my position.\" -- George W. Bush','c351bee66a8db1316e2c277d444fd19c8b7210f8',45883),(5767,'\n\"As we said in the preface to the first edition, C \'wears well\n as one\'s experience with it grows.\' With a decade more \n experience, we still feel that way.\" \n -- Brian Kernighan and Dennis Ritchie','c351bee66a8db1316e2c277d444fd19c8b7210f8',43346),(5768,'\n\"Ow.\"\n- Stan Jensen at 1995 AC100','c5262fa6fb9e715e7d2cfaf3da63faacd55da1a9',44281),(5769,'\n\"Silence is one of the hardest arguments to refute.\"\n -- Josh Billings','c5262fa6fb9e715e7d2cfaf3da63faacd55da1a9',39809),(5770,'\n\"Just remember this: No one ever won the olive wreath with an\nimpressive training diary.\"\n- Marty Liquori','c54515459d02d43144208e18f4c8acd73e3aa144',35950),(5771,'\n\"The only way to define your limits is by going beyond them.\"\n- Arthur Clarke','c54515459d02d43144208e18f4c8acd73e3aa144',42471),(5772,'\n\"When you philosophically oppose an entire power elite, you\n cannot help but sound like a conspiracy theorist. Social power\n is by nature a conspiracy.\"\n -- Tom N','c65e5f685ddd3613ba2346a443527dd7aa82857f',43348),(5773,'\n\"It is much more comfortable to be mad and know it, than to be \n sane and have one\'s doubts.\" -- G. B. Burgin','c65e5f685ddd3613ba2346a443527dd7aa82857f',31913),(5774,'\n\"If McDonalds were run like a software company, one out of every\n hundred Big Macs would give you food poisoning, and the response\n would be, \'We\'re sorry, here\'s a coupon for two more.\'\"\n -- Mark Minasi ','c7b3f6f6411d271ebab2b3b0e90d317acc95d9a8',44403),(5775,'\n\"Enjoy your pain, you earned it!\"\n- Pauli Kiriu','c7b3f6f6411d271ebab2b3b0e90d317acc95d9a8',43346),(5776,'\n\"There is a rumour going around that I have found God. I think \n this is unlikely because I have enough difficulty finding my \n keys, and there is empirical evidence that they exist.\"\n -- Terry Pratchett','c803fa77ee10b52cd3d73c6af89cab266d2515a2',44403),(5777,'\n\"Just drive down that road, until you get blown up.\"\n -- General George Patton, reconnaissance troops','c803fa77ee10b52cd3d73c6af89cab266d2515a2',36879),(5778,'\n\"Humor is always based on a modicum of truth. Have you ever heard \n a joke about a father-in-law?\" -- Dick Clark','cba43e8664ea95b3086b6cf41446c3add3b7807c',44127),(5779,'\n\"Behind every great fortune there is a crime.\"\n -- Honore de Balzac (1799-1850)','cba43e8664ea95b3086b6cf41446c3add3b7807c',43599),(5780,'\n\"Nothing except a battle lost can be half as melancholy as a\n battle won.\"\n -- Duke of Wellington','cddfd7ff18cf7401e9dda44f13f25063a105aca5',35952),(5781,'\n\"Never interrupt your enemy when he is making a mistake.\"\n -- Napoleon','cddfd7ff18cf7401e9dda44f13f25063a105aca5',45561),(5782,'\n\"Democracy used to be a good thing, but now it has gotten into\n the wrong hands.\"\n -- Jessie Helms','cde06ed09d69b48dac7fbecb51e1907083c0fba1',36879),(5783,'\n\"Do illiterate people get the full effect of alphabet soup?\" \n -- John Mendoza','cde06ed09d69b48dac7fbecb51e1907083c0fba1',45881),(5784,'\n\"Wisdom comes from experience. Experience is often a result of\n lack of wisdom.\"\n -- Terry Pratchett','d003833f9f38f2c93f587610988cbbb761e0e3bd',43080),(5785,'\n\"Military glory -- that attractive rainbow, that rises in showers\n of blood -- that serpent\'s eye, that charms to destroy...\"\n -- Abraham Lincoln','d003833f9f38f2c93f587610988cbbb761e0e3bd',33738),(5786,'\n\"Probably no nation is rich enough to pay for both war and\n education.\"\n -- Braham Flexner','d0311227f8fc75d1e8b06680a866d770f62786a4',43080),(5787,'\n\"Necessity never made a good bargain.\"\n -- Ben Franklin','d0311227f8fc75d1e8b06680a866d770f62786a4',32929),(5788,'\n\"You exist only in what you do.\"\n -- Federico Fellini','d14de7595123c9f3108691a39f677135685f88c5',43599),(5789,'\n\"You can\'t say civilizations don\'t advance, because they kill\n you in a new way in each war.\"\n -- Will Rogers','d14de7595123c9f3108691a39f677135685f88c5',44127),(5790,'\n\"Our government has kept us in a perpetual state of fear - kept\n us in a continuous stampede of patriotic fervor - with the cry\n of grave national emergency.\" -- General Douglas MacArthur','d4bcf1aece9d1aa3dda31b19fef7dc0a1e56c461',45883),(5791,'\n\"A language is a dialect with an army and a navy.\"\n -- Max Weinreich','d4bcf1aece9d1aa3dda31b19fef7dc0a1e56c461',43080),(5792,'\n\"It is better to be generous than just. It is sometimes better\n to sympathize instead of trying to understand.\"\n -- Pierre Lecompte de Nouy','d6cf95f640fff6e9912a1ee27539e0423daab74c',35952),(5793,'\n\"Under capitalism, man exploits man. Under communism, it\'s just\n the opposite.\"\n -- John Kenneth Galbraith','d6cf95f640fff6e9912a1ee27539e0423daab74c',39809),(5794,'\n\"Blessed is the man, who having nothing to say, abstains from \n giving wordy evidence of the fact.\"\n -- George Eliot (1819-1880)','d8fd4a140ee61a241d078da8d7a96f10c172a6bd',35950),(5795,'\n\"Politics is the art of looking for trouble, finding it \n everywhere, diagnosing it incorrectly, and applying the wrong \n remedies.\" -- Groucho Marx','d8fd4a140ee61a241d078da8d7a96f10c172a6bd',43348),(5796,'\n\"Good judgement comes from experience, and experience comes from\n bad judgement.\" -- Fred Brooks','d9dbf1da845ffc9f4e9682137f334ba522fe987c',32929),(5797,'\n\"Every man is guilty of all the good he didn\'t do.\"\n -- Voltaire','d9dbf1da845ffc9f4e9682137f334ba522fe987c',45449),(5