ou that\'s ok because you\'ll be a mile away \n from him and you\'ll have his shoes.\" -- Unknown','653d2c04df0cea5b29d4affb2507b483a6edb426',45881),(6002,'\n\"Computers are good at following instructions, but not at reading\n your mind.\" -- Donald Knuth','658b2bc48b8df2dfa64c5caef9eee4e59fe07ac1',31913),(6003,'\n\"The first 90% of the code accounts for the first 90% of the\n development time. The remaining 10% of the code accounts for\n the other 90% of the development time.\" -- Tom Cargill','658b2bc48b8df2dfa64c5caef9eee4e59fe07ac1',32929),(6004,'\n\"You can pretend to be serious; you can\'t pretend to be witty.\"\n -- Sacha Guitry (1885-1957)','6590318a70806f5b81e1bab1d862f20e621bc1fd',44127),(6005,'\n\"Men and nations behave wisely once they have exhausted all the \n other alternatives.\" -- Abba Eban (1915-2002)','6590318a70806f5b81e1bab1d862f20e621bc1fd',45449),(6006,'\n\"Paramount among the responsibilities of a free press is the duty\n to prevent any part of the government from deceiving the \n people.\" -- Hugo Black, Supreme Court Justice','68ffefb56efac74ed366759a0f5436076ce7f2d9',34631),(6007,'\n\"Ultras, where the athlete pays and the spectator gets in free.\"\n\"Keep the rubber side down.\"\n\"Don\'t out-run your stomach.\"\n\"Those of us who finish near the back make the rest of you look good.\"\n- Submitted by Tom Kaisersatt','68ffefb56efac74ed366759a0f5436076ce7f2d9',36757),(6008,'\n\"I know that there are people in this world who do not love \n their fellow human beings, and I hate people like that.\" \n -- Tom Lehrer','6e36e2f524958c1692d27664c2f5607a99fd2bbd',35941),(6009,'\n\"Real life is that big, high-res, high-color screen saver behind\n all the windows.\" -- anonymous','6e36e2f524958c1692d27664c2f5607a99fd2bbd',31909),(6010,'\nMencken\'s Law: There is always an easy answer to every human \nproblem -- neat, plausible, and wrong.','705d14908f1731e360bdc3f9fef6401c9b3d3a65',44944),(6011,'\n\"If one could run without getting tired I don\'t think one would often\nwant to do anything else.\"\n- C.S. Lewis','705d14908f1731e360bdc3f9fef6401c9b3d3a65',43346),(6012,'\n\"Copy and paste is a design error\" -- David Parnas','709856dc7110a396f029231e8fc2ce686254fe44',45883),(6013,'\n\"The corporation is a true Frankenstein\'s monster, an\n artificial person run amok, responsible only to its own\n soulless self.\"\n -- William Dugger','709856dc7110a396f029231e8fc2ce686254fe44',31909),(6014,'\n\"If you have enough book space, I don\'t want to talk to you.\"\n -- Terry Pratchett','71c0186acf3f622ff5df4a828f0adc5b2e9ba9f4',34631),(6015,'\n\"The Quitter\"\nWhen you\'re lost on the trail with the speed of a snail\nAnd defeat looks you straight in the eye\nAnd you\'re needing to sit, your whole being says quit\nYou\'re certain it\'s your time to die.\nBut the code of the trail is \"move forward don\'t fail\"\nThough your knees and ego are scarred.\nAll the swelling and pain is just part of the game\nIn the long run it\'s quitting that\'s hard!','71c0186acf3f622ff5df4a828f0adc5b2e9ba9f4',32929),(6016,'\n\"There are only two industries that refer to their customers as\n \'users\'.\" -- Edward Tufte','72fad23df48f54abdf674cd2c3b08b936ae42c35',39809),(6017,'\n\"If you haven\'t got anything nice to say about anybody, come sit \n next to me.\" -- Alice Roosevelt Longworth (1884-1980)','72fad23df48f54abdf674cd2c3b08b936ae42c35',33738),(6018,'\n\"I have always wished that my computer would be as easy to use\n as my telephone. My wish has come true. I no longer know how\n to use my telephone.\" -- Bjarne Stroustrup','7449bf78181ea24fde9f9b7e6f3dea4e43d79806',45881),(6019,'\n\"Death is one of the few things that can be done as easily lying \n down. The difference between sex and death is that with death \n you can do it alone and no one is going to make fun of you.\" \n -- Woody Allen.','7449bf78181ea24fde9f9b7e6f3dea4e43d79806',45561),(6020,'\n\"Conservative politics is about simple solutions to complex problems,\nwhich usually i