ed. See that women are maintained\n in the rights attributed to them.\"\n -- Prophet Muhammed','7b5d15db9f3aa7bcb19ec97278d1b41d9e041b75',45253),(6032,'\n\"... one of the main causes of the fall of the Roman Empire was \n that, lacking zero, they had no way to indicate successful \n termination of their C programs.\" -- Robert Firth','7bd56dbda41d30f8e7340e8934f18724b57f6350',39809),(6033,'\n\"\'Abstinence-only sex education\' is a little like saying \n \'Just-hold-it potty training\'.\" -- Roy Zimmerman','7bd56dbda41d30f8e7340e8934f18724b57f6350',43080),(6034,'\n\"The optimist proclaims that we live in the best of all\n possible worlds; and the pessimist fears this is true.\"\n -- James Branch Cabell','7d7a2c34894627cba4510150ce7b8592761b5bce',35952),(6035,'\n\"Don\'t fear moving slowly forward ... fear standing still.\"\n- Kathleen Harris at KUTS \'03','7d7a2c34894627cba4510150ce7b8592761b5bce',34631),(6036,'\n\"Happiness is your dentist telling you it won\'t hurt and then\n having him catch his hand in the drill.\" -- Johnny Carson','80c06016b31ffa3b0d157bef344a5fe03cc7fd75',35950),(6037,'\n\"Not bad for an old guy.\"\n- Unknown','80c06016b31ffa3b0d157bef344a5fe03cc7fd75',44127),(6038,'\n\"Luck is the residue of design.\"\n -- Branch Rickey - former owner of the Brooklyn Dodger Baseball \n    Team','8129f5699e465fc75eec94a17c21efbfe7618ed0',43599),(6039,'\n\"No one rules if no one obeys.\"\n -- <TaoDo>','8129f5699e465fc75eec94a17c21efbfe7618ed0',35950),(6040,'\n\"He who knows nothing is closer to the truth than he whose mind\n is filled with falsehoods and errors.\"\n -- Thomas Jefferson','831a25e12bbf4d8382f12b045dd40e4c8ddd699a',36879),(6041,'\n\"The fascist state is the corporate state.\"\n -- Benito Mussolini','831a25e12bbf4d8382f12b045dd40e4c8ddd699a',35658),(6042,'\n\"Secular schools can never be tolerated because such schools\n have no religious instruction, and a general moral instruction\n without a religious foundation is built on air; consequently,\n a