r eyes against a painful truth.... For my\n part, I am willing to know the whole truth; to know the worst;\n and to provide for it.\" -- Patrick Henry','1aa978f42b32757fccd3de1996d3f3939bd4a93a',43599),(6280,'\n\"How many days does it take to run a hundred miles?\"\n- Skip Eastman','1aa978f42b32757fccd3de1996d3f3939bd4a93a',33738),(6281,'\n\"Liberty and democracy become unholy when their hands are dyed\n red with innocent blood.\" -- Mahatma Gandhi','1b251f64571dbb68522f1a08d3fffde0e855a306',43348),(6282,'\n\"Gods prefer simple, vicious games, where you Do Not Achieve \n Transcendence but Go Straight To Oblivion; a key to the \n understanding of all religion is that a god\'s idea of amusement \n is Snakes and Ladders with greased rungs.\"\n -- Terry Pratchett (Wyrd Sisters) ','1b251f64571dbb68522f1a08d3fffde0e855a306',45561),(6283,'\n\"Look Mabel, here comes one who\'s running!\"\n- Unknown','1b2c2dc9eb61c9282312f5913f7d839abf564604',45561),(6284,'\n\"To iterate is human, to recurse divine.\" -- L. Peter Deutsch','1b2c2dc9eb61c9282312f5913f7d839abf564604',43599),(6285,'\n\"If the United Nations once admits that international disputes \n can be settled by using force, then we will have destroyed the \n foundation of the organization and our best hope of establishing \n a world order.\" -- Dwight D. Eisenhower ','1cef2967275a0eb79e453adc9d955d1e2d5c347b',44281),(6286,'\n\"I never forget a face, but in your case I\'ll be glad to make an \n exception.\" -- Groucho Marx','1cef2967275a0eb79e453adc9d955d1e2d5c347b',44403),(6287,'\n\"A non-virtual function says, you have to do this and you must\n do it this way. A virtual function says you have to do this,\n but you don\'t have to do it this way. That\'s their fundamental\n difference.\" -- Scott Meyers','1d3f0c101015d3955231da017db281a73188aa6f',34631),(6288,'\n\"Don\'t speak unless you can improve on the silence.\"\n -- Spanish proverb','1d3f0c101015d3955231da017db281a73188aa6f',39809),(6289,'\n\"No Sane man will dance.\" -- Cicero (106-43 B.C.)','1e9f8443e77bed522f7c378e5102178c70a9674e',43599),(6290,'\n\"Properly read, the Bible is the most potent force for atheism\n ever conceived.\" -- Isaac Asimov','1e9f8443e77bed522f7c378e5102178c70a9674e',35950),(6291,'\n\"Make everything as simple as possible, but not simpler.\"\n -- Albert Einstein (1879-1955)','2140ccc1214c388e59928773d3d584bba66dab47',43348),(6292,'\n\"Those who hate and fight must stop themselves; otherwise it is\n not stopped.\"\n -- Spock, Day of the Dove','2140ccc1214c388e59928773d3d584bba66dab47',45090),(6293,'\n\"I\'ll sleep when I\'m dead.\" -- Warren Zevon','2145c3e7ce74ef291f7254708749ad33403111fc',42471),(6294,'\n\"Never look back, someone might be gaining on you\"\n- Satchel Paige','2145c3e7ce74ef291f7254708749ad33403111fc',44281),(6295,'\n\"We who think we are about to die will laugh at anything.\"\n -- Terry Pratchett (Night Watch) ','236d00876b4372632c6032e06d7dc4764600fece',35658),(6296,'\n\"If it\'s there     and you can see it   - it\'s real.\n If it\'s not there and you can see it   - it\'s virtual.\n If it\'s there     and you can\'t see it - it\'s transparent.\n If it\'s not there and you can\'t see it - you erased it!\"\n - Scott Hammer (an old IBM VM statement)','236d00876b4372632c6032e06d7dc4764600fece',43080),(6297,'\n\"If you haven\'t got anything nice to say about anybody, come sit \n next to me.\" -- Alice Roosevelt Longworth (1884-1980)','24cd63144a915209ec5d4f0270802326e3212121',45561),(6298,'\n\"He who hesitates is a damned fool.\" -- Mae West (1892-1980)','24cd63144a915209ec5d4f0270802326e3212121',43346),(6299,'\n\"Yes, my friends, I too am prepared to die for a cause, but\n there is no cause for which I am prepared to kill.\"\n --Mohandas Gandhi','26f72c285563a85ddb036701c7521db796306e92',34631),(6300,'\n\"Long May You Run\"\n- Neil Young','26f72c285563a85ddb036701c7521db796306e92',35658),(6301,'\n\"I ain\'t got no quarrel with the Vietcong ...\n No Vietcong ever called me nigger.\"\n -- Muhammad Ali, stripped of boxing title, convicted of a\n felony for refusing to serve during the Vietnam War','28f80763d5314f188e54e4172fa2f6f42efe44ce',35950),(6302,'\n\"Computers make it easier to do a lot of things, but most of the \n things they make it easier to do don\'t need to be done.\" \n -- Andy Rooney.','28f80763d5314f188e54e4172fa2f6f42efe44ce',43080),(6303,'\n\"The only way to get rid of a temptation is to yield to it.\"\n -- Oscar Wilde (1854-1900)','290503b15d8029173276b395e07cfd09c4d12eaf',36879),(6304,'\n\"I\'m trying to see things from your point of view but I can\'t get \n my head that far up my ass.\" --- Unknown','290503b15d8029173276b395e07cfd09c4d12eaf',45253),(6305,'\n\"The thing I don\'t like about Western States is that you show up at the\nstarting line in the best shape of your life and a day later you are in\nAuburn in the worst shape of your life.\"\n- Andy Black, on Western States','2c58a48d0d651f870cc921370b693a5f4700514a',45090),(6306,'\n\"A foolish consistency is the hobgoblin of little minds, adored by\n little statesmen and philosophers and divines.\" \n -- Ralph Waldo Emerson','2c58a48d0d651f870cc921370b693a5f4700514a',35941),(6307,'\n\"A belligerent state permits itself every such misdeed, every \n such act of violence, as would disgrace the individual.\"\n -- Sigmund Freud','2dc0c690d3726aed41ab1c89d2ed65c9f01e4337',39809),(6308,'\n\"In all large corporations, there is a pervasive fear that \n someone, somewhere is having fun with a computer on company time. \n Networks help alleviate that fear.\" -- John C. Dvorak.','2dc0c690d3726aed41ab1c89d2ed65c9f01e4337',39809),(6309,'\n\"No matter what hurts at the beginning, by the end of the race\nsomething else will hurt worse.\"\n- Bob O\'Connor','2dd7939d675f664ebc671a9c7c09a2fea1e2dc8b',45883),(6310,'\n\"Nobody should ever run a race where they are lapped by the sun.\"\n- friend of Alex Swenson, referring to 100 mile races','2dd7939d675f664ebc671a9c7c09a2fea1e2dc8b',35658),(6311,'\n\"If the bone\'s not showin\', just keep goin\'!\"\n- Joan Risse at Angeles Crest, 9/95','2f1dbc42f02c71cf2a7495138fd5abc55b333687',44127),(6312,'\n\"Civil disobedience, that\'s not our problem. Our problem is\n that people are obedient all over the world in the face of\n poverty and starvation and stupidity, and war, and cruelty. Our\n problem is that people are obedient while the jails are full of\n petty thieves, and all the while the grand thieves are running\n the country. That\'s our problem.\"\n -- Howard Zinn','2f1dbc42f02c71cf2a7495138fd5abc55b333687',43346),(6313,'\n\"A verbal contract is not worth the paper it\'s written on.\"\n -- Samuel Goldwyn','2f80f558a93cf3619d9c96e77922af52f72aaca1',35950),(6314,'\n\"Every war when it comes, or before it comes, is represented\n not as a war but as an act of self-defense against a homicidal\n maniac.\"\n -- George Orwell','2f80f558a93cf3619d9c96e77922af52f72aaca1',45561),(6315,'\n\"Patriotism is the last refuge of a scoundrel.\"\n -- Samuel Johnson, English lexicographer, to which Ambrose\n Bierce replied: \'I beg to submit that it is the first.\'','34db7faa732a578f5efd47c9f114d9d964a73738',32929),(6316,'\n\"The cry has been that when war is declared, all opposition\n should be hushed. A sentiment more unworthy of a free country\n could hardly be propagated.\" -- William Ellery Channing','34db7faa732a578f5efd47c9f114d9d964a73738',36879),(6317,'\n\"Distrust any enterprise that requires new clothes.\"\n -- Henry David Thoreau (1817-1862)','34eae97f9cb0567369fcb5e1f782f58ae2b30b69',35950),(6318,'\n\"Cholesterol is your natural defence against excessive \n circulation of blood, which can carry venoms, poisons and other \n toxins around your body.\" -- Michael Warner, in bpot','34eae97f9cb0567369fcb5e1f782f58ae2b30b69',33738),(6319,'\n\"A charlatan makes obscure what is clear; a thinker makes clear\n what is obscure.\" -- Hugh Kingsmill','3631973aa9983d5b2b56beffd439024f767bbf0d',33738),(6320,'\n\"You can\'t have great software without a great team, and most\n software teams behave like dysfunctional families.\" -- Jim McCarthy','3631973aa9983d5b2b56beffd439024f767bbf0d',42471),(6321,'\n\"Heaven is under our feet as well as over our heads.\"\n- Thoreau','3ec68a3c08610930feb71ba1a91a6130ef5e285a',43080),(6322,'\n\"If you can\'t run fast, run far.\"\n- Unknown','3ec68a3c08610930feb71ba1a91a6130ef5e285a',44403),(6323,'\n\"Ask her to wait a moment - I am almost done.\"\n -- Carl Friedrich Gauss (1777-1855), while working, when \n    informed that his wife is dying','405383332147fc14817496fdabb30bf2db5d12ad',45253),(6324,'\n\"I like those people. They are calmer and cooler, I think. Personality-\nwise, they are rich. An ultra runner is not somebody who is normally\ngoing to wish you bad. On the contrary if you are down an ultra runner\nwill help you.\"\n- Michel Careau','405383332147fc14817496fdabb30bf2db5d12ad',64),(6325,'\n\"The competent programmer is fully aware of the strictly limited\n size of his own skull; therefore he approaches the programming\n task in full humility, and among other things he avoids clever\n tricks like the plague.\" -- Edsger Dijkstra','40cb34661bfc1c51137a6edb6fedb4a36fe6e477',43348),(6326,'\n\"When a thing has been said and said well, have no scruple.\n Take it and copy it.\"\n -- Anatole France','40cb34661bfc1c51137a6edb6fedb4a36fe6e477',45090),(6327,'\n\"Many a man will have the courage to die gallantly, but will\n not have the courage to say, or even to think, that the cause\n for which he is asked to die is an unworthy one.\"\n -- Bertrand Russell','41bc5b30b638b6a7812291b3ff7830195b6a5915',35941),(6328,'\n\"Testing proves the presence, not the absence, of bugs.\"\n -- Edsger Dijkstra','41bc5b30b638b6a7812291b3ff7830195b6a5915',45090),(6329,'\n\"There is no sport in hate when all the rage is on one side.\"\n -- Percy B. Shelley','422fd5bfa7b8612b767003817191880edbbae3b2',35658),(6330,'\n\"You can pretend to be serious; you can\'t pretend to be witty.\"\n -- Sacha Guitry','422fd5bfa7b8612b767003817191880edbbae3b2',45090),(6331,'\n\"If you need more than five lines to prove something, then you \n are on the wrong track\" \n -- Edgser W. Dijkstra\'s mother [ibid, p. 55]','43acf5939bbb1c5ebc69fe9c0bdf9e60804a19ea',45253),(6332,'\n\"Computers are useless. They can only give you answers.\"\n -- Pablo Picasso','43acf5939bbb1c5ebc69fe9c0bdf9e60804a19ea',44944),(6333,'\n\"A celibate clergy is an especially good idea, because it tends\n to suppress any hereditary propensity toward fanaticism.\"\n -- Carl Sagan','43ebc8eb20ada4a273c146172a53df03623910b6',35941),(6334,'\n\"My humble friend, we know not how to live this life which is\n so short yet seek one that never ends.\"\n -- Anatole France','43ebc8eb20ada4a273c146172a53df03623910b6',33738),(6335,'\n\"A mind all logic is like a knife all blade. It makes the hand \n bleed that uses it.\" -- Rabindranath Tagore','441347c4713b6effb668e5f8ff591c90d287ccbb',42471),(6336,'\n\"Computers make it easier to do a lot of things, but most of the \n things they make it easier to do don\'t need to be done.\" \n -- Andy Rooney.','441347c4713b6effb668e5f8ff591c90d287ccbb',43599),(6337,'\n\"Any fool can make a rule, and any fool will mind it.\"\n -- Henry David Thoreau','453c4ef6c6367eeaf55e07aa78e53967b96d7be6',45883),(6338,'\n\"He has all the virtues I dislike and none of the vices I \n admire.\" -- Winston Churchill','453c4ef6c6367eeaf55e07aa78e53967b96d7be6',35952),(6339,'\n\"Give to every other human being every right you claim for\n yourself.\"\n -- Robert G. Ingersoll','45d054cba06f055820ca4ab1b164d78bcdf2115c',44403),(6340,'\n\"If there was anything that depressed him more than his own \n cynicism, it was that quite often it still wasn\'t as cynical as \n real life.\"\n -- Terry Pratchett (Guards! Guards!) ','45d054cba06f055820ca4ab1b164d78bcdf2115c',34631),(6341,'\n\"If you under-train, you may not finish, but if you over-train, you may not start.\"\n- Tom DuBos credits Stan Jensen with this one','4602ed8ba66c1df84a638300e7d1ef2a697435f2',34631),(6342,'\n\"I still live.\" -- Daniel Webster, dying words','4602ed8ba66c1df84a638300e7d1ef2a697435f2',36879),(6343,'\n\"Devlin\'s First Law - Buyer beware: in the hands of a charlatan, \n mathematics can be used to make a vacuous argument look \n impressive.\n Devlin\'s Second Law - So can PowerPoint.\" -- Keith Devlin','4882c64a3bfba2a2d92f5a7c7000b0adb79fb450',44281),(6344,'\n\"Adam and Eve had many advantages, but the principal one was\n that they escaped teething.\" -- Mark Twain','4882c64a3bfba2a2d92f5a7c7000b0adb79fb450',43080),(6345,'\n\"So I was getting into my car, and this bloke says to me \"Can you\n give me a lift?\" I said \"Sure, you look great, the world\'s your\n oyster, go for it.\'\" -- Tommy Cooper','49b85de05943327733d6c16c2c33817944aa6d9e',44281),(6346,'\n\"... one of the main causes of the fall of the Roman Empire was \n that, lacking zero, they had no way to indicate successful \n termination of their C programs.\" -- Robert Firth','49b85de05943327733d6c16c2c33817944aa6d9e',43599),(6347,'\n\"I do not feel obliged to believe that the same God who has\n endowed us with sense, reason, and intellect has intended us to\n forgo their use.\"\n -- Galileo Galilei','4c27a57dce667a0156a99cf4d327c6ddbfec7cb5',34631),(6348,'\n\"A computer once beat me at chess, but it was no match for me at\n kick boxing.\" -- Emo Philips','4c27a57dce667a0156a99cf4d327c6ddbfec7cb5',43599),(6349,'\n\"By trying we can easily learn to endure adversity; another\n man\'s, I mean.\"\n -- Mark Twain','4c9c486c8b4e113ec98886f8a42fa423777ed2c2',43599),(6350,'\n\"Wisdom is knowing what to do next. Virtue is doing it.\"\n -- David Starr Jordan','4c9c486c8b4e113ec98886f8a42fa423777ed2c2',45449),(6351,'\n\"Sterling\'s Corollary to Clarke\'s Law: Any sufficiently advanced\n garbage is indistinguishable from magic.\"','4e9c4cea0f1539bb8a7c29e15bd74e6083d49af9',44944),(6352,'\n\"Great spirits often encounter violent opposition from mediocre minds.\"\n- Albert Einstein','4e9c4cea0f1539bb8a7c29e15bd74e6083d49af9',44944),(6353,'\n\"Talk sense to a fool and he calls you foolish.\"\n -- Euripides','5023a214790a3c658c36e93372cd7feb7546d279',45883),(6354,'\n\"Democracy is not an incident that happens overnight, nor a gift \n that America can give to the world. It is a culture which needs \n peace to evolve.\" -- Shirin Ebadi, Nobel Peace Laureate of Iran','5023a214790a3c658c36e93372cd7feb7546d279',35658),(6355,'\n\"Come on, you sons of bitches - do you want to live forever\"\n- Gunnery Sergeant Dan Daly, USMC, Belleau Wood, June 1918','513e87994733a43a8330555c372e72d80a8ee524',44403),(6356,'\n\"C combines all the power of assembly language with the ease of \n use of assembly language\" -- trad','513e87994733a43a8330555c372e72d80a8ee524',45449),(6357,'\n\"We should forget about small efficiencies, say about 97% of the \n time: premature optimization is the root of all evil.\"\n -- Donald Knuth','51e57c94bfd5c81b11e8c48dc8002b1162f4cd84',35658),(6358,'\n\"To err is human -- and to blame it on a computer is even more \n so.\" -- Robert Orben.','51e57c94bfd5c81b11e8c48dc8002b1162f4cd84',45881),(6359,'\n\"Sex is like a Chinese dinner. It isn\'t over until everyone gets\n their cookies.\" -- from the movie \"Outside Providence\"','53f655b191e6b163adadf8e7e4c6a77bfd9fa06d',45883),(6360,'\n\"Guns make us powerful; butter will only make us fat.\"\n -- Nazi Hermann Goering','53f655b191e6b163adadf8e7e4c6a77bfd9fa06d',44127),(6361,'\n\"Java, the best argument for Smalltalk since C++.\" -- unknown','560853cd73c393576fd36aed2dd5bd9ab48ab003',44281),(6362,'\n\"Nietzsche was stupid and abnormal.\"\n -- Leo Tolstoy (1828-1910)','560853cd73c393576fd36aed2dd5bd9ab48ab003',31909),(6363,'\n\"He\'d been wrong, there was a light at the end of the tunnel, \n and it was a flamethrower.\"\n -- Terry Pratchett (Mort) ','5641a37860f7b156faceb5ee50a33d9538903f9c',43080),(6364,'\n\"I remain convinced that obstinate addi