ules comedy can tolerate are those of taste, and the \n only limitations those of libel.\" -- James Thurber (1894-1961)','b60f06186f549a8d443c605a6ed5e6283db08cf0',44281),(6519,'\n\"It was God who made me so beautiful. If I weren\'t, then I\'d be\n a teacher.\" -- Linda Evangelista.','b60f06186f549a8d443c605a6ed5e6283db08cf0',45449),(6520,'\n\"About the use of language: it is impossible to sharpen a pencil \n with a blunt axe. It is equally vain to try to do it with ten \n blunt axes instead.\" -- Edsger W. Dijkstra','b760d7d73bbf50a701dc577dd2e4820bb97040e6',45883),(6521,'\n\"In the End, we will remember not the words of our enemies, but \n the silence of our friends.\"\n -- Martin Luther King Jr. (1929-1968)','b760d7d73bbf50a701dc577dd2e4820bb97040e6',45561),(6522,'\n\"Everything is drive-through. In California, they even have a \n burial service called Jump-In-The-Box.\" -- Wil Shriner.','b7fcce49401e4b89355812894f3e8434b65581dd',35950),(6523,'\n\"The way to find what the mainstream will do tomorrow is to\n associate with the lunatic fringe today.\"\n -- Jean-Louis Gassee','b7fcce49401e4b89355812894f3e8434b65581dd',35950),(6524,'\n\"I contend that we are both atheists. I just believe in one\n fewer god than you do. When you understand why you dismiss all\n the other possible gods, you will understand why I dismiss\n yours.\"\n -- Stephen Roberts','b9ba2e4dc4732c9114cb035fea22fb41dbdbd067',45881),(6525,'\n\"It is now possible for a flight attendant to get a pilot \n pregnant.\" -- Richard J. Ferris, president of United Airlines','b9ba2e4dc4732c9114cb035fea22fb41dbdbd067',44127),(6526,'\n\"In America, anybody can be president. That\'s one of the risks \n you take.\" -- Adlai Stevenson (1900-1965)','bb8301acba0017ff2d200e03a535cb0c7d892e7a',33738),(6527,'\n\"I would much prefer a government run bureaucracy than a for \n profit bureaucracy. In the first I am at least a stakeholder. \n In the latter I\'m simply a cost.\" -- digby in her blog.','bb8301acba0017ff2d200e0