The greatest deception men suffer is from their own opinions.\"\n -- Leonardo da Vinci','c477daaf6618c98efb953d559c9efa6c015f58a6',45090),(6538,'\n\"Either God wants to abolish evil, and cannot; or he can, but\n does not want to. If he wants to, but cannot, he is impotent.\n If he can, but does not want to, he is wicked. If, as they say,\n God can abolish evil, and God really wants to do it, why is\n there evil in the world?\"\n -- Epicurus','c681a9f6a3b9d51502cc3978298feaccfa9f500b',44281),(6539,'\n\"Insanity is catching.\"\n -- Terry Pratchett (Making Money) ','c681a9f6a3b9d51502cc3978298feaccfa9f500b',44281),(6540,'\n\"One word sums up probably the responsibility of any Governor, \n and that one word is \'to be prepared\'.\" -- George W. Bush','c682bad5bf033a6fe24574c00ab59bb6f317a712',34631),(6541,'\n\"Is your argument that the Creator of the Universe was working \n under a deadline and His manager forced Him to rush inefficient\n designs into production?\" -- John B. Breckenridge in bpot','c682bad5bf033a6fe24574c00ab59bb6f317a712',33738),(6542,'\n\"A treatise upon human nature: It is not contrary to reason to\n prefer the destruction of the whole world to the scratching of\n my finger.\"\n -- David Hume','c8651cb17a0bc7af738d14e9ec49051340ea071d',44127),(6543,'\n\"I liked your opera. I think I will set it to music.\"\n -- Beethoven to a fellow composer','c8651cb17a0bc7af738d14e9ec49051340ea071d',45561),(6544,'\n\"Why did God create dentists? -- In his infinite love, he \n thought it would be charitable to His creatures to let them \n see what Hell is like, during their lives.\" -- PhR','c9397ed8f9399168690fc5bf85f1301d05c7427f',45449),(6545,'\n\"When we walk to the edge of all the light we have and take the step into the\ndarkness of the unknown, we must believe that one of two things will happen.\nThere will be something solid for us to stand on, or we will be taught to fly.\"\n- Patrick Overton','c9397ed8f9399168690fc5bf85f1301d05c7427f',35952),(6546,'\nMay\'s Law: The quality of correlation is inverely proportional to \nthe density of control. (The fewer the data points, the smoother \nthe curves.)','c950dc04dde8c9be3506a6575954d0dc9d153a6d',42471),(6547,'\n\"Opportunity is often passed up because it is disguised as hard work.\"\n- Unknown','c950dc04dde8c9be3506a6575954d0dc9d153a6d',43080),(6548,'\n\"Theory is when you know something, but it doesn\'t work. Practice \n is when something works, but you don\'t know why. Programmers combine \n theory and practice: Nothing works and they don\'t know why.\"','cbfe42b5899c620643436dbbed6ee9bb2decde69',44403),(6549,'\n\"Behind every successful man is a woman, behind her is his wife.\"\n -- Groucho Marx','cbfe42b5899c620643436dbbed6ee9bb2decde69',45883),(6550,'\n\"In all large corporations, there is a pervasive fear that \n someone, somewhere is having fun with a computer on company time. \n Networks help alleviate that fear.\" -- John C. Dvorak.','cd0d2ad152d89c488ea91d5bef32f022d590de99',34631),(6551,'\n\"The modern conservative is engaged in one man\'s oldest\n exercises in moral philosophy; that is the search for a\n superior moral justification for selfishness.\"\n -- John K. Galbraith','cd0d2ad152d89c488ea91d5bef32f022d590de99',64),(6552,'\n\"The pain is temporary, The pride lasts forever.\"\n- Unknown','cdcf0824c0d127cb6d38a2ab4382e64cd874805e',36757),(6553,'\n\"A runner\'s creed: I will win; if I cannot win, I shall be second;\nif I cannot be second, I shall be third; if I cannot place at all,\nI shall still do my best.\" \n- Ken Doherty','cdcf0824c0d127cb6d38a2ab4382e64cd874805e',31909),(6554,'\n\"Why do we kill people who are killing people to show that\n killing people is wrong?\"\n -- Holly Near','cf0b0babfc4701fb9b068f7c53c6640c48879a1b',43348),(6555,'\n\"There\'s many a bestseller that could have been prevented by a \n good teacher.\" -- Flannery O\'Connor (1925-1964)','cf0b0babfc4701fb9b068f7c53c6640c48879a1b',35952),(6556,'\n\"I will not follow where the path ma