ce as to the name of the God, since love\n is the real God of all in the world.\"\n -- Apache','e2b6a9442b559e7093a9916a165df83a5e474712',45561),(6588,'\n\"Convictions are more dangerous foes of truth than lies.\"\n -- Nietzsche','e624882b45aa0cb1a6286b974992fc6778ea30c1',43346),(6589,'\n\"It\'s the pain of the consequences that\'s all out of proportion.\"\n- Kenny Moore','e624882b45aa0cb1a6286b974992fc6778ea30c1',34631),(6590,'\n\"In general the art of government consists in taking as much\n money as possible from one class of citizens to give to the\n other.\"\n -- Voltaire','e68b31e3158a27c6dea07ef5bc63bba892e77f50',36757),(6591,'\n\"It always takes longer than you expect, even when you take into\n account Hofstadter\'s Law.\" -- Hofstadter\'s Law','e68b31e3158a27c6dea07ef5bc63bba892e77f50',34631),(6592,'\nThyme\'s Law: Everything goes wrong at once.','e6c6e48ad1b3f85be24ca852ff7965008ee0fb57',45561),(6593,'\n\"I\'ll moider da bum.\"\n -- Heavyweight boxer Tony Galento, when asked what he thought of \n    William Shakespeare','e6c6e48ad1b3f85be24ca852ff7965008ee0fb57',34631),(6594,'\n\"Not everything that can be counted counts, and not everything \n that counts can be counted.\" -- Albert Einstein ','e79fdefe1857c4a09393205dee4b5e6981ed3641',45883),(6595,'\n\"The inside of a computer is as dumb as hell but it goes like\n mad!\" -- Richard Feynman','e79fdefe1857c4a09393205dee4b5e6981ed3641',31909),(6596,'\n\"We live in our desires rather than in our achievements.\"\n -- George Moore','e7ca85eebdf1d8c4c36bc09851649db8698d2bbc',36757),(6597,'\n\"Good teaching is one-fourth preparation and three-fourths \n theater.\" -- Gail Godwin','e7ca85eebdf1d8c4c36bc09851649db8698d2bbc',31909),(6598,'\n\"These machines have no common sense; they have not yet learned\n to \'think\', and they do exactly as they are told, no more and \n no less. This fact is the hardest concept to grasp when one \n first tries to use a computer.\" -- Donald Knuth','e92a1a3e5dd9249692b228c0c4c90c2f3