ett','099852c89abee96fcee23c275504ef67203c5317',35950),(6639,'\n\"The world is too dangerous to live in, not because of the\n people who do evil, but because of the people who sit and let\n it happen.\"\n -- Albert Einstein','0c824cc7119f4287367f7b7aa9770f2339f5d2ce',31909),(6640,'\n\"The power of accurate observation is frequently called cynicism \n by those who don\'t have it.\"\n -- George Bernard Shaw (1856-1950)','0c824cc7119f4287367f7b7aa9770f2339f5d2ce',43080),(6641,'\n\"I have never let my schooling interfere with my education.\"\n -- Mark Twain (1835-1910)','104bbcc1d3a4f43a606b2cfc82e246f097cbe297',43080),(6642,'\nBove\'s Theorem: The remaining work to finish in order to reach \nyour goal increases as the deadline approaches.','104bbcc1d3a4f43a606b2cfc82e246f097cbe297',36757),(6643,'\n\"The perfect computer has been developed. You just feed in your\n problems and they never come out again.\" -- Al Goodman.','1060c58543e283a8e4836d576f3594b1a5399983',45883),(6644,'\n\"Pain is certain, suffering is optional.\"\n -- Buddha','1060c58543e283a8e4836d576f3594b1a5399983',43346),(6645,'\n\"Faith is belief without evidence in what is told by one who\n speaks without knowledge, of things without parallel.\"\n -- Ambrose Bierce','114194a80a92fd5c3048f4c95cc32cc882e22ef6',45883),(6646,'\n\"Politicians are like diapers. They should be changed often, and \n for the same reason.\" -- Anonymous','114194a80a92fd5c3048f4c95cc32cc882e22ef6',43348),(6647,'\n\"The most heinous and the cruelest crimes of which history has\n record have been committed under the cover of religion or\n equally noble motives.\"\n -- Mohandas Gandhi','11735855089715f8904ffaea771eb3daac1a845a',45090),(6648,'\n\"More computing sins are committed in the name of efficiency \n (without necessarily achieving it) than for any other single\n reason - including blind stupidity.\" -- W.A. Wulf','11735855089715f8904ffaea771eb3daac1a845a',32929),(6649,'\n\"Most people would sooner die than think; in fact, they d