-year-old Spanish peasant grandmother.\"\n -- Terry Pratchett (Reaper Man) ','65609286cc04ece831a844984a6bc9eb80450cf7',35952),(6770,'\n\"Opportunity is often passed up because it is disguised as hard work.\"\n- Unknown','667910463dddf4a5cc75d990eb9c8bc57f8b05bd',45090),(6771,'\n\"Without censorship, things can get terribly confused in the\n public mind.\"\n -- General William Westmoreland','667910463dddf4a5cc75d990eb9c8bc57f8b05bd',43599),(6772,'\n\"The biggest conspiracy of all is the claim that there are no\n conspiracies!\"\n -- Michael Rivero','68d077eb1c9f127028cb9e0a1e6c7c1e6a1a624f',45883),(6773,'\n\"Getting an education was a bit like a communicable sexual disease. \n It made you unsuitable for a lot of jobs and then you had the urge\n to pass it on.\" -- Terry Pratchett, Hogfather','6a67fd26aaa7a32244a2c025ac68174c27a45c13',45881),(6774,'\n\"True. When your hammer is C++, everything begins to look\n like a thumb.\" -- Steve Haflich, in comp.lang.c++ ','6a67fd26aaa7a32244a2c025ac68174c27a45c13',43080),(6775,'\n\"Everything secret degenerates, even the administration of \n justice.\" -- Lord Acton','6ac306e879ca9cc4550fc6a91631b5db18c68755',45881),(6776,'\n\"Until the infallibility of human judgment shall have been\n proved to me, I shall persist in demanding the abolition of the\n death penalty.\"\n -- Marquis de Lafayette','6ac306e879ca9cc4550fc6a91631b5db18c68755',43348),(6777,'\n\"Quotation confesses inferiority.\" -- Ralph Waldo Emerson ','6c9d4c93d040a158767032bb8f21db2f3e713cb2',45090),(6778,'\n\"ASCII stupid question, get a stupid ANSI !\" -- unknown','6c9d4c93d040a158767032bb8f21db2f3e713cb2',36879),(6779,'\n\"Computer /nm./: a device designed to speed and automate errors.\"\n -- From the Jargon File. ','6ec645b7e53b0ab491ade2e56342cc50d5209384',45883),(6780,'\nRyan\'s Law: Make three correct guesses consecutively and you will \nestablish yourself as an expert.','6ec645b7e53b0ab491ade2e56342cc50d5209384',44281),(6781,'\n\"I don\'t feel good.\" -- Lu