879),(6802,'\n\"Someday man will imprison the power of the sun, release atomic\n power, and harness the rise and fall of the tides. I am proud\n of the fact that I never invented weapons to kill.\"\n -- Thomas Edison','7731ea33a2c052610eefc1c76e0fc1ac3d1f0a47',43080),(6803,'\n\"Men and nations behave wisely once they have exhausted all the \n other alternatives.\" -- Abba Eban (1915-2002)','77caf4ed6d3a9c5996712d559501234aaf50fa21',44403),(6804,'\n\"Common sense is necessary ... more so than high tech.  Race to the\nfinish not race from the start, pace yourself, run your own race and\ndon\'t get sucked into someone else\'s, walk when you need too, run when\nyou can, eat, drink and be merry for tomorrow we will hurt.\"\n- Kevin Sayers','77caf4ed6d3a9c5996712d559501234aaf50fa21',44403),(6805,'\n\"Before C++ we had to code all of our bugs by hand; now we \n inherit them.\" -- unknown ','7b19b3942064a974d261602b9a2f4a5640379991',34631),(6806,'\n\"The most amazing achievement of the computer software industry\n is its continuing cancellation of the steady and staggering\n gains made by the computer hardware industry.\" -- Henry Petroski','7b19b3942064a974d261602b9a2f4a5640379991',35658),(6807,'\n\"Once you have seen certain things, you can\'t un-see them, and\n seeing nothing is as political an act as seeing something.\"\n -- Arundhati Roy','7ba637536a133844270a7e8373be58fe97a71600',35658),(6808,'\n\"Familiarity breeds children.\"','7ba637536a133844270a7e8373be58fe97a71600',43599),(6809,'\n\"I liked your opera. I think I will set it to music.\"\n -- Beethoven to a fellow composer','7d8a209751f64b7e616de77b0e519f77cdd0fc81',44944),(6810,'\n\"I begin by taking. I shall find scholars later to demonstrate \n my perfect right.\"\n -- Frederick (II) the Great','7d8a209751f64b7e616de77b0e519f77cdd0fc81',43348),(6811,'\n\"If pigs could vote, the man with the slop bucket would be\n elected swineherd every time, no matter how much slaughtering\n he did on the side.\"\n -- Orson Scott Card','7d8c2147550af2e791898135ec1920eb7c29db74',64),(6812,'\n\"A 50K on trails is easier than a marathon on the road.\"\n- Unknown','7d8c2147550af2e791898135ec1920eb7c29db74',44281),(6813,'\n\"Don\'t knock masturbation, it\'s sex with someone I love .\"\n -- Woody Allen, From \'Annie Hall\' 1977.','7da83eba75935034fc7a236603823a8b7c6774fa',31909),(6814,'\n\"We take these risks not to escape life, but to prevent life from escaping us.\"\n- Submitted by Scott Crabb','7da83eba75935034fc7a236603823a8b7c6774fa',39809),(6815,'\n\"Guard against the impostures of pretended patriotism.\"\n -- George Washington','7dee7958f02baec0162ee54962a1f7df151a89b0',35941),(6816,'\n\"The vast majority of mankind is trapped within perceptual\n prisons.\"\n -- Shawn Mikula','7dee7958f02baec0162ee54962a1f7df151a89b0',35941),(6817,'\n\"The injury we do and the one we suffer are not weighed in the\n same scale.\"\n -- Aesop','82128953f6ed3ae729dd80bb3b748e4bd34b8816',35952),(6818,'\n\"Happiness is your dentist telling you it won\'t hurt and then\n having him catch his hand in the drill.\" -- Johnny Carson','82128953f6ed3ae729dd80bb3b748e4bd34b8816',39809),(6819,'\n\"Invading Iraq after 9/11 was like invading Mexico after Pearl\n Harbor.\" -- Richard Clarke','822aba81125af0dfb36b68eb9c6f98ab4f4623af',45883),(6820,'\n\"How many days does it take to run a hundred miles?\"\n- Skip Eastman','822aba81125af0dfb36b68eb9c6f98ab4f4623af',35950),(6821,'\n\"If computers get too powerful, we can organize them into a \n committee -- that will do them in.\" -- Bradley\'s Bromide.','83ef757907ed886e6a0f02329239f08e87cb1823',43599),(6822,'\n\"Cancel the kitchen scraps for lepers and orphans! No more\n merciful beheadings! And call off Christmas!\"\n -- The Sheriff of Nottingham','83ef757907ed886e6a0f02329239f08e87cb1823',43346),(6823,'\n\"Facts are stupid things.\"\n -- Ronald Reagan, Former U.S. President','843d5dfa5e9e7105802f203d1be8f07aa9455a88',36879),(6824,'\n\"All religions are founded on the fear