ic and faith. We have faith\n that they are pink; we logically know that they are invisible\n because we can\'t see them.\"\n -- Steve Eley','8989b4ab2b11de2490047c598e9cdef01d9d33ac',45449),(6834,'\n\"Richard Nixon is a no good, lying bastard. He can lie out of \n both sides of his mouth at the same time, and if he ever caught \n himself telling the truth, he\'d lie just to keep his hand in.\"\n -- Harry S. Truman.','8e0b55d335382dd9be2e810659f59efce57c4bea',64),(6835,'\n\"If you can\'t get rid of the skeleton in your closet, you\'d best \n teach it to dance.\" -- George Bernard Shaw (1856-1950)','8e0b55d335382dd9be2e810659f59efce57c4bea',35952),(6836,'\n\"Clothes make the man.  Naked people have little or no influence\n on society.\" -- Mark Twain','8e2037bed1e5a16949efb7cda0a9271d64cfa562',35952),(6837,'\n\"The trouble with having an open mind, of course, is that people \n will insist on coming along and trying to put things in it.\"\n -- Terry Pratchett (Diggers)','8e2037bed1e5a16949efb7cda0a9271d64cfa562',31909),(6838,'\n\"You can\'t have great software without a great team, and most\n software teams behave like dysfunctional families.\" -- Jim McCarthy','8ff080f8aba1bd4557bf641b3684c8e5ec346bff',45561),(6839,'\n\"Only two things are infinite, the universe and human\n stupidity, and I\'m not sure about the former.\"\n -- Albert Einstein','8ff080f8aba1bd4557bf641b3684c8e5ec346bff',31913),(6840,'\n\"I have seldom met an intelligent person whose views were not\n narrowed and distorted by religion.\"\n -- James Buchanan','91dbcea3da3ff0c13258b53e3ced2a975b6bc9ee',45561),(6841,'\n\"Unformed people delight in the gaudy and in novelty. Cooked\n people delight in the ordinary.\" -- Erik Naggum','91dbcea3da3ff0c13258b53e3ced2a975b6bc9ee',43346),(6842,'\n\"Just because the standard provides a cliff in front of you, \n you are not necessarily required to jump off it.\" \n -- Norman Diamond','935c8a0f8f9b1e8af70c3f3cc60fdb9b83bf4f53',45253),(6843,'\n\"If there is no Hell, 