mean.\"\n -- Mark Twain','a4f08cee50e6dc532029f76203d34230f56eec95',45881),(6867,'\n\"Do you see now that your self-righteousness was nothing more\n than breeding and years of privilege? You know, we are one\n nation under a god. Yes, you were right. An angry, crack\n slinging god who decorates with bullets and spent condoms, a\n blind god whose eyes are just like yours.\"\n -- Solipsist by Henry Rollins','a4f08cee50e6dc532029f76203d34230f56eec95',33738),(6868,'\n\"How wrong it is for a woman to expect the man to build the world \n she wants, rather than to create it herself.\"\n -- Anais Nin (1903-1977)','a51a0312093b0b280af66804ff464d5003d762aa',44127),(6869,'\n\"Our scientific power has outrun our spiritual power. We have\n guided missiles and misguided men.\"\n -- Martin Luther King, Jr.','a51a0312093b0b280af66804ff464d5003d762aa',42471),(6870,'\n\"The de facto role of the US armed forces will be to keep the\n world safe for our economy and open to our cultural assault.\"\n -- Major Ralph Peters, US Military','a5a76f573f538a2b2ea90b5a86eeafd05f3d3449',45253),(6871,'\n\"I have yet to meet a C compiler that is more friendly and easier \n to use than eating soup with a knife.\" -- unknown','a5a76f573f538a2b2ea90b5a86eeafd05f3d3449',36879),(6872,'\n\"Can anything be stupider than that a man has the right to kill\n me because he lives on the other side of a river and his ruler\n has a quarrel with mine, though I have not quarreled with him?\"\n -- Blaise Pascal','a753b79cc20aaf53061b3fd2d55af85b9137f415',32929),(6873,'\n\"Rules of Optimization:\"\n Rule 1: Don\'t do it.\n Rule 2 (for experts only): Don\'t do it yet.\" \n -- M.A. Jackson','a753b79cc20aaf53061b3fd2d55af85b9137f415',35941),(6874,'\n\"Nothing overshadows truth so much as authority.\"\n -- Leon Battista Alberti','a80b0aaadca2db3f3b2038a0ab24e2d5b29e655e',43348),(6875,'\n\"The 10-K is a race. The marathon is an experience. The ultra is an\nadventure.\"\n- Bryan Hacker','a80b0aaadca2db3f3b2038a0ab24e2d5b29e655e',43348),(6876,'\n\"Even pearls are dark before the whiteness of his teeth.\"\n -- William R. Alger','add78f1598059cb2382e033ee6270ce3d88f5b6b',35950),(6877,'\n\"Free speech is the right to yell \"Theater!\" in a crowded\n fire...\" -- Abbie Hoffman','add78f1598059cb2382e033ee6270ce3d88f5b6b',45561),(6878,'\nLynch\'s Law: When the going gets tough, everyone leaves.','ae168e6ae4816a7e68163c9fc9575bc779e6bb32',43080),(6879,'\n\"It\'s not at all important to get it right the first time. It\'s\n vitally important to get it right the last time.\" \n -- Andrew Hunt and David Thomas','ae168e6ae4816a7e68163c9fc9575bc779e6bb32',45561),(6880,'\n\"A jury consists of twelve persons chosen to decide who has the\n better lawyer.\"\n -- Robert Frost','ae8f4711823a30c076d2055e4f0a2fb4a659cfd5',43080),(6881,'\n\"The trouble with the world is that the stupid are cocksure and\n the intelligent are full of doubt.\" -- Bertrand Russell','ae8f4711823a30c076d2055e4f0a2fb4a659cfd5',36879),(6882,'\n\"Nothing is more surprising than the easiness with which the\n many are governed by the few.\"\n -- David Hume','ae8fe380dd9aa5a7a956d9085fe7cf6b87d0d028',45449),(6883,'\n\"A conservative is a man who is too cowardly to fight and too\n fat to run.\"\n -- Elbert Hubbard','ae8fe380dd9aa5a7a956d9085fe7cf6b87d0d028',44127),(6884,'\n\"First you forget names, then you forget faces. Next you forget to\n pull your zipper up and finally, you forget to pull it down.\"\n -- George Burns.','b014ab04a346d2bff3d01d93ed312de2b23e5a96',35658),(6885,'\n\"All I know is that I am not a Marxist.\"\n -- Karl Marx','b014ab04a346d2bff3d01d93ed312de2b23e5a96',34631),(6886,'\n\"Think my friends! You adulate a stone as Vishnu but you cannot\n see God in a fellow man.\"\n -- Sankaracharya','b0ac3e4ef3dcc9c2a966d4b8af44f6340ce449f6',43346),(6887,'\n\"When his life was ruined, his family killed, his farm \n destroyed, Job knelt down on the ground and yelled up to the \n heavens, \'Why god? Why me?\' and the thundering voice of God \n answered, \'There\'s just something about you that pisses me \n off.\'\" -- Stephen King.','b0ac3e4ef3dcc9c2a966d4b8af44f6340ce449f6',35658),(6888,'\n\"Whenever I climb I am followed by a dog called \'Ego\'.\"\n    - Friedrich Nietzsche (1844-1900)','b17656c96367beb7e3dfa2463ec218335590db73',36757),(6889,'\n\"So I was in my car, and I was driving along, and my boss rang up\n and he said \'You\'ve been promoted\'. And I swerved.\n And then he rang up a second time and said \'You\'ve been promoted\n again\'. And I swerved again.\n He rang up a third time and said \'You\'re managing director.\' \n And I went into a tree.\n And a policeman came up and said \'What happened to you?\'\n And I Said \'I careered off the road.\'\" -- Tommy Cooper','b17656c96367beb7e3dfa2463ec218335590db73',43346),(6890,'\n\"He\'d noticed that sex bore some resemblance to cookery: it \n fascinated people, they sometimes bought books full of \n complicated recipes and interesting pictures, and sometimes when \n they were really hungry they created vast banquets in their \n imagination - but at the end of the day they\'d settle quite \n happily for egg and chips. If it was well done and maybe had a \n slice of tomato.\"\n -- Terry Pratchett (The Fifth Elephant) ','b18a8b28a8c0453af82f0ab4ee9e7ce31cbf11ac',33738),(6891,'\n\"The body is given out on loan - don\'t waste it and expect to use it\ntomorrow.\"\n- Shapiro','b18a8b28a8c0453af82f0ab4ee9e7ce31cbf11ac',35658),(6892,'\n\"There is always a certain meanness in the argument of\n conservatism, joined with a certain superiority in its fact.\"\n -- Ralph Waldo Emerson','b39530f551f451da170425ffd8ca3c1a797057a9',43080),(6893,'\n\"America ... just a nation of two hundred million used car\n salesmen with all the money we need to buy guns and no qualms\n about killing anybody else in the world who tries to make us\n uncomfortable.\"\n -- Hunter S. Thompson','b39530f551f451da170425ffd8ca3c1a797057a9',45253),(6894,'\n\"Moving parts in rubbing contact require lubrication to avoid \n excessive wear. Honorifics and formal politeness provide the\n lubrication where people rub together. Often the very young,\n the untraveled, the naive, the unsophisticated deplore these\n formalities as \"empty,\" \"meaningless,\" or \"dishonest,\" and \n scorn to use them. No matter how \"pure\" their motives, they\n thereby throw sand into machinery that does not work too well\n at best.\" -- Robert A. Heinlein','b4176bffb4cf4c4c4fcc89c1d8fbb9e88ea12448',34631),(6895,'\n\"The opposite of a correct statement is a false statement. The \n opposite of a profound truth may well be another profound truth.\"\n -- Niels Bohr (1885-1962)','b4176bffb4cf4c4c4fcc89c1d8fbb9e88ea12448',45253),(6896,'\n\"Whenever I climb I am followed by a dog called \'Ego\'.\"\n    - Friedrich Nietzsche (1844-1900)','b48ea15b32430357839a88fefc51394e75553cef',33738),(6897,'\n\"There is no such thing as bad weather, only inappropriate clothing.\"\n- Ben Zander, according to aspiring ultrarunner Sophia Lewis','b48ea15b32430357839a88fefc51394e75553cef',31909),(6898,'\n\"The Christian resolution to find the world ugly and bad has\n made the world ugly and bad.\"\n -- Nietzsche','b74721f0cd0cd21b1ce967f427280881fe9132fb',45881),(6899,'\n\"\'Uncle Cosmo, why do they call this a word processor?\'\n \'It\'s simple, Skyler. You\'ve seen what food processors do to \n  food, right?\" -- MacNelley, in \"Shoe\"','b74721f0cd0cd21b1ce967f427280881fe9132fb',45561),(6900,'\n\"Life would be so much easier if we could just see the source \n code.\" -- unknown','b9c1d2de39fe832a29a1d22c32b7edfda6e1ce81',32929),(6901,'\n\"You have a cough?  Go home tonight, eat a whole box of Ex-Lax \n -- tomorrow you\'ll be afraid to cough.\" -- Pearl Williams.','ba42347b3fd300dc9636788b2da5ce32ccb010d2',34631),(6902,'\n\"Reality is merely an illusion, albeit a very persistent one.\"  \n -- Albert Einstein ','ba42347b3fd300dc9636788b2da5ce32ccb010d2',64),(6903,'\n\"Necessity never made a good bargain.\"\n -- Ben Franklin','bbf4889e253924ac30c7637f0c26d73f8c747398',43080),(6904,'\nOsborn\'s Law: Variables won\'t, constants aren\'t.','bbf4889e253924ac30c7637f0c26d73f8c747398',35950),(6905,'\n\"I am convinced that I am acting as the agent of our Creator.\n By fighting off the Jews, I am doing the Lord\'s work.\"\n -- Adolf Hitler','bc1e42ee571dae9e1572f21f1753f0aa823dec50',31913),(6906,'\n\"Tragedy is when I cut my finger. Comedy is when you walk into \n an open sewer and die.\" -- Mel Brooks','bc1e42ee571dae9e1572f21f1753f0aa823dec50',45449),(6907,'\n\"Properly read, the Bible is the most potent force for atheism\n ever conceived.\" -- Isaac Asimov','bce6b6f96bca720142feed15638464f17b4df11a',35941),(6908,'\n\"We choose our joys and sorrows long before we experience\n them.\"\n -- Kahlil Gibran','bce6b6f96bca720142feed15638464f17b4df11a',39809),(6909,'\n\"Most people would sooner die than think; in fact, they do so.\"\n -- Bertrand Russell (1872-1970)','bdc76ca87f1e4164a3c5a8c8da5c353997bbcd44',35952),(6910,'\n\"A pessimist sees the difficulty in every opportunity; an \n optimist sees the opportunity in every difficulty.\"\n -- Sir Winston Churchill (1874-1965)','bdc76ca87f1e4164a3c5a8c8da5c353997bbcd44',45449),(6911,'\nGoebel\'s Second Law Of Useless Difficulty: The fastest way to get \nsomething done is to determine that it isn\'t worth doing.','bfb6be800e9e6dd26ea03396046b7b3d011eff6c',36757),(6912,'\n\"Every tooth in a man\'s head is more valuable than a diamond.\"\n -- Miguel de Cervantes, Don Quixote, 1605','bfb6be800e9e6dd26ea03396046b7b3d011eff6c',33738),(6913,'\n\"I don\'t believe in the after life, although I am bringing a\n change of underwear.\" -- Woody Allen.','c092406ce48e489d338ef5ff665680d5ef318a08',44944),(6914,'\n\"There is a tragic clash between truth and the world. Pure\n undistorted truth burns up the world.\"\n -- Nikolay Berdyayev','c092406ce48e489d338ef5ff665680d5ef318a08',33738),(6915,'\n\"To err is human, but to really foul