tribute to malice that which is \nadequately explained by stupidity.','c3ca77f80b7aa2d697a716e6991b683b084d8f56',45881),(6924,'\n\"Human history becomes more and more a race between education \n and catastrophe.\" -- H. G. Wells (1866-1946)','c3ca77f80b7aa2d697a716e6991b683b084d8f56',45449),(6925,'\n\"Any fool can use a computer. Many do.\" -- Ted Nelson','c50a0276dcc0ee65ebe715d54f1d9db3b8c55a6f',43080),(6926,'\nMencken\'s Law: There is always an easy answer to every human \nproblem -- neat, plausible, and wrong.','c50a0276dcc0ee65ebe715d54f1d9db3b8c55a6f',45449),(6927,'\n\"A computer is like an Old Testament god, with a lot of rules and\n no mercy\" -- Joseph Campbell','c55c508614dd2a3e2ca2a00250dc33fb924a7244',64),(6928,'\n\"Well done is better than well said.\" \n -- Benjamin Franklin (1706-1790)','c55c508614dd2a3e2ca2a00250dc33fb924a7244',43599),(6929,'\nLarkinson\'s Law: All laws are basically false.','c5f52cf080e5f04f7824fcf100b38e95a6cb77cf',43346),(6930,'\nSausage Principle: People who love sausage and respect the law \nshould never watch either one being made.','c5f52cf080e5f04f7824fcf100b38e95a6cb77cf',45090),(6931,'\n\"The best way to make children good is to make them happy.\"\n -- Oscar Wilde','c66af2489fdee561cbd6db7cdcb976e31378079f',45881),(6932,'\n\"Why is propaganda so much more successful when it stirs up\n hatred than when it tries to stir up friendly feeling?\"\n -- Bertrand Russell','c66af2489fdee561cbd6db7cdcb976e31378079f',35950),(6933,'\n\"People who think they know everything greatly annoy those of\n us who do.\"','c6ebc79b8a9b900866c484fb526122e86419856e',34631),(6934,'\n\"He uses statistics as a drunken man uses lamp-posts... \n for support rather than illumination.\" \n -- Andrew Lang (1844-1912)','c6ebc79b8a9b900866c484fb526122e86419856e',44281),(6935,'\n\"Argue for your limitations, and sure enough they\'re yours.\"\n -- Richard Bach','c743011448323c186aab87ac2d80965b86f30cfd',45883),(6936,'\n\"Too much is better than not enough.\"\n- Kyle Rothweiler','c743011448323c186aab87ac2d80965b86f30cfd',45883),(6937,'\n\"The years of peak mental activity are undoubtedly between \nthe ages of four and eighteen.  At four we know all the \nquestions, at eighteen all the answers.\" -- unknown','c8758556729fdbf86befe648779c0413ec38f10c',31909),(6938,'\n\"Truth is for the minority.\"\n -- Baltasar Gracin','c8758556729fdbf86befe648779c0413ec38f10c',36879),(6939,'\n\"A closed mouth gathers no foot.\"','c8a9547df4d62d21d5e40201f70441d8f2a1a70c',43080),(6940,'\n\"Today it is fashionable to talk about the poor. Unfortunately,\n it is not fashionable to talk with them.\"\n -- Mother Teresa','c8a9547df4d62d21d5e40201f70441d8f2a1a70c',36879),(6941,'\n\"An organisation that treats its programmers as morons will soon\n have programmers that are willing and able to act like morons\n only.\" -- Bjarne Stroustrup','cae0599226660a55c27116d92a4e3ae9cc69c26b',39809),(6942,'\n\"As the poet said, \'Only God can make a tree,\' probably because \n it\'s so hard to figure out how to get the bark on.\" \n -- Woody Allen.','cae0599226660a55c27116d92a4e3ae9cc69c26b',31909),(6943,'\n\"The longer I live the more I see that I am never wrong about \n anything, and that all the pains that I have so humbly taken \n to verify my notions have only wasted my time.\"\n -- George Bernard Shaw (1856-1950)','cf5788c7b45d5abd05fb1682e454b5f3e45a4e0d',31913),(6944,'\nEstridge\'s Law: No matter how large and standardized the \nmarketplace is, IBM can redefine it.','cf5788c7b45d5abd05fb1682e454b5f3e45a4e0d',42471),(6945,'\n\"I was under medication when I made the decision to burn the\n tapes.\"\n -- Richard Nixon','d0d9d29f2e4b1f5cbcd2018298f74bd3121ba49a',45881),(6946,'\nBoren\'s First Law: When in doubt, mumble.','d0d9d29f2e4b1f5cbcd2018298f74bd3121ba49a',45449),(6947,'\n\"Running is a four weather sport.\"\n- Unknown','d219df5d5575e19e567ec1be682babf726a3baca',45090),(6948,'\n\"Missionaries are perfect nuisances and leave every place worse\n than they found it.\"\n -- Charles Dickens','d219df5d5575e19e567ec1be682babf726a3baca',43348),(6949,'\n\"Everything has been figured out, except how to live.\"\n -- Jean Paul Sartre','d30c97fec8e99b50fc5e6b2d36197137cc93ee09',43346),(6950,'\n\"Violence is the last refuge of the incompetent.\" -- Issac Asimov','d7b9e40e0388ed17c5d4e9c758d1516226c03b4f',31909),(6951,'\n\"If we could read the secret history of our enemies, we should\n find in each man\'s life sorrow and suffering enough to disarm\n all hostility.\"\n -- Henry Wadsworth Longfellow','d7b9e40e0388ed17c5d4e9c758d1516226c03b4f',34631),(6952,'\n\"\'Uncle Cosmo, why do they call this a word processor?\'\n \'It\'s simple, Skyler. You\'ve seen what food processors do to \n  food, right?\" -- MacNelley, in \"Shoe\"','d8c61d3ce833b5e48b7d18a0dca5af34174f3f50',44944),(6953,'\n\"I did not know how to say goodbye. It was harder still, when I\n refused to say it.\"\n -- Native American saying','d8c61d3ce833b5e48b7d18a0dca5af34174f3f50',36879),(6954,'\n\"That\'s the thing about people who think they hate computers. \n What they really hate is lousy programmers.\" \n -- Larry Niven and Jerry Pournelle Oath of Fealty','db7f327b43b0013dc2a6ac2b734a1a7eb3b2b308',36757),(6955,'\n\"To iterate is human, to recurse divine.\" -- L. Peter Deutsch','db7f327b43b0013dc2a6ac2b734a1a7eb3b2b308',39809),(6956,'\n\"There are three truths: my truth, your truth, and the truth.\"\n -- Chinese proverb','dc2caaad045226aa7bfd10cf40c999c3d66ad6d0',35950),(6957,'\n\"The illegal we do immediately. The unconstitutional takes a\n bit longer.\"\n -- Henry Kissinger','dc2caaad045226aa7bfd10cf40c999c3d66ad6d0',43080),(6958,'\nLieberman\'s Law: Everybody lies; but it doesn\'t matter, since \nnobody listens.','dc6e4a95c12a8a4cf3d90f3a3a5fb3cd384252ef',33738),(6959,'\n\"Life is like an overlong drama through which we sit being\n nagged by the vague memories of having read the reviews.\"\n -- John Updike','dc6e4a95c12a8a4cf3d90f3a3a5fb3cd384252ef',36879),(696