e depths of hell.\"\n- Peter Bakwin (from Andrea Feucht)','74ddf50e58c9070ac3d6871be59a3cd6db6efe3d',43348),(7209,'\n\"Any fool can use a computer. Many do.\" -- Ted Nelson','752dce478b2119163d588c861384927c6194ec37',35658),(7210,'\n\"Fear, like pain, may only be God\'s way ... of hurting us.\"\n- Unknown','752dce478b2119163d588c861384927c6194ec37',45883),(7211,'\n\"Do the thing and have the power\"\n- Ralph Waldo Emerson','769c924dda383a378a63ab2433f72be8e17a0190',44281),(7212,'\n\"In this war - as in others - I am less interested in honoring\n the dead than in preventing the dead.\" -- Butler Shaffer','769c924dda383a378a63ab2433f72be8e17a0190',31909),(7213,'\n\"Good people do not need laws to tell them to act responsibly, \n while bad people will find a way around the laws.\"\n -- Plato (427-347 B.C.)','7808b90456a7f71eee497350f26f7ce2fece9526',45561),(7214,'\n\"You can\'t die from a stomach ache.  The worst that can happen is that\nyou\'ll throw up.  Then you can eat some more and start running again.\"\n- Jack Bristol','7808b90456a7f71eee497350f26f7ce2fece9526',42471),(7215,'\n\"I have read your book and much like it.\"\n -- Moses Hadas (1900-1966)','798a912d82f4b01e96a6489663985c6052e89de3',64),(7216,'\n\"That which does not kill us, cripples us for life\"\n- Fred Shufflebarger','798a912d82f4b01e96a6489663985c6052e89de3',44944),(7217,'\n\"TV is called a medium because it is neither rare nor well\n done.\"','7ba156961b5439f13e09a453919f5cf60003c964',39809),(7218,'\n\"Frank Hanson promises nothing in his runs, and by God he delivers.\"\n- Unknown','7ba156961b5439f13e09a453919f5cf60003c964',44281),(7219,'\n\"I\'m not a member of any organized political party, I\'m a \n Democrat!\" -- Will Rogers (1879-1935)','7e7fdfb3e3a8cea3ec08ad5e03ed49c9f7f0c2b0',36757),(7220,'\n\"The cry has been that when war is declared, all opposition \n should be hushed. A sentiment more unworthy of a free country \n could hardly be propagated.\" -- William Ellery Channing','7e7fdfb3e3a8c