e ones you did do.\"\n -- Samuel Clemens','99ef7eebfcedca0e81c870e0d340e94d16cb302f',35952),(7253,'\n\"Sex is like a Chinese dinner. It isn\'t over until everyone gets\n their cookies.\" -- from the movie \"Outside Providence\"','9aedcf7848d4d66ac35193431068819811c992cf',36879),(7254,'\n\"Never was anything great achieved without danger.\"\n -- Niccolo Machiavelli','9aedcf7848d4d66ac35193431068819811c992cf',44403),(7255,'\n\"There is a rumour going around that I have found God. I think \n this is unlikely because I have enough difficulty finding my \n keys, and there is empirical evidence that they exist.\"\n -- Terry Pratchett','9b11f0de60fcfabf4a4a75359cb7b7d48cc5462b',35950),(7256,'\n\"How many days does it take to run a hundred miles?\"\n- Skip Eastman','9b11f0de60fcfabf4a4a75359cb7b7d48cc5462b',36879),(7257,'\n\"The history of liberty is a history of resistance. The history\n of liberty is a history of limitations of governmental power,\n not the increase of it.\"\n -- Woodrow Wilson','9cefc2aeb4a4d1cf1a9e582d02b1a8293906df0d',44281),(7258,'\n\"Don\'t drive me crazy -- it\'s within walking distance.\"','9cefc2aeb4a4d1cf1a9e582d02b1a8293906df0d',43348),(7259,'\n\"When did I realize I was God? Well, I was praying and I suddenly\n realized I was talking to myself.\"\n -- Peter O\'Toole.','a032026bdfd2e887a8502c8c3e9a06354ccff932',44281),(7260,'\n\"Despite what seems like the extraordinary nature of these events, in the\nend, they make you even more human.\n- Joel McNamara','a032026bdfd2e887a8502c8c3e9a06354ccff932',45449),(7261,'\n\"The nice thing about egotists is that they don\'t talk about \n other people.\" -- Lucille S. Harper','a03469112e55fc0f8f420aa53926537a0254e0e1',44944),(7262,'\n\"A terrorist is someone who has a bomb, but doesn\'t have an\n air force.\" -- William Blum','a03469112e55fc0f8f420aa53926537a0254e0e1',43348),(7263,'\n\"The difference between fiction and reality? Fiction has to make \n sense.\" -- Tom Clancy','a1805c1d24e78f77b61181d0d64561e