he beginning or the end of a race that counts, It\'s what\nhappens in between.\"\n- Unknown','ab996296bc6e5e88950c4bed0da0feec7aef6914',36879),(7276,'\n\"A model is done when nothing else can be taken out.\" -- Dyson ','ab996296bc6e5e88950c4bed0da0feec7aef6914',45253),(7277,'\n\"I failed to make the chess team because of my height.\" \n -- Woody Allen','abc97ffff99e82ffaa5729902f0fac3f95bc6ab1',34631),(7278,'\n\"Stick a fork in me, I\'m done.\"\n- Unknown','abc97ffff99e82ffaa5729902f0fac3f95bc6ab1',45090),(7279,'\n\"A sure cure for seasickness is to sit under a tree.\" \n -- Spike Milligan.','ac200c387a7efa8ef0c6301725df0dce8b9285fa',45449),(7280,'\n\"Debugging is twice as hard as writing the code in the first place.\n Therefore, if you write the code as cleverly as possible, you are,\n by definition, not smart enough to debug it.\"\n -- Brian Kernighan','ac200c387a7efa8ef0c6301725df0dce8b9285fa',36879),(7281,'\n\"Every war when it comes, or before it comes, is represented\n not as a war but as an act of self-defense against a homicidal\n maniac.\"\n -- George Orwell','acfa9d2d3090d16c63aef6fe2b4f931511eb5bf3',44281),(7282,'\n\"In a time of universal deceit, telling the truth is a\n revolutionary act.\"\n -- George Orwell','acfa9d2d3090d16c63aef6fe2b4f931511eb5bf3',44403),(7283,'\n\"If you can\'t learn anything from losing, don\'t lose.\"\n- Unknown','aff1d574272e517bd5b9f5deff8d4da955ad45a6',31909),(7284,'\n\"Don\'t stay in bed, unless you can make money in bed.\"\n -- George Burns (1896-1996)','aff1d574272e517bd5b9f5deff8d4da955ad45a6',36757),(7285,'\n\"When one is postulating correlations or causations extant in\n reality, one should always remember that the human brain is\n mainly a pattern recognition engine. And it is such a\n persistent pattern recognition engine that it often perceives\n patterns where none exist.\" -- Jeff Walther','b14d0f68cf3c6c2da2c753d2e92e3cffa6b5fb1c',31909),(7286,'\n\"If I can\'t dance, I don\'t want to be part of your revolution.\"\