95,'\n\"You have a cough?  Go home tonight, eat a whole box of Ex-Lax \n -- tomorrow you\'ll be afraid to cough.\" -- Pearl Williams.','b958e3ab460bf2cfde71203fbcbe7698fea9a480',42471),(7296,'\n\"Save the whales! Collect the whole set!\"','b958e3ab460bf2cfde71203fbcbe7698fea9a480',31913),(7297,'\n\"It\'s so easy to become mesmerized by the immediacy of a result\n that you don\'t question its validity.\" -- Naomi Karten','bb3e29ac93b725f6eefbfcf1bf0bee67783cd519',44403),(7298,'\n\"If you run 100 miles a week, you can eat anything you want - Why?\nBecause: (a) you\'ll burn all the calories you consume; (b) you deserve\nit; and (c) you\'ll be injured soon and back on a restricted diet anyway.\"\n- Don Kardong','bb3e29ac93b725f6eefbfcf1bf0bee67783cd519',33738),(7299,'\n\"I hit him to get his attention. I shot him to calm him down. I\n killed him to reason with him.\"\n -- Henry Rollins','bd3731a2cfe718ae5364995de293b4e52bd23aeb',45449),(7300,'\n\"The way to find what the mainstream will do tomorrow is to\n associate with the lunatic fringe today.\"\n -- Jean-Louis Gassee','bd3731a2cfe718ae5364995de293b4e52bd23aeb',35950),(7301,'\n\"Let\'s not bring age into this discussion. I will not let \n my opponent\'s youth and inexperience become an issue.\"\n -- Ronald Reagan on Walter Mondale','be98fef84ca4e0d638f2511d975ba3962fdaecdb',64),(7302,'\n\"Art is dangerous. It is one of the attractions: when it ceases\n to be dangerous, you don\'t want it.\"\n -- Duke Ellington','be98fef84ca4e0d638f2511d975ba3962fdaecdb',44944),(7303,'\n\"Well, dear, I hope you know what you\'re doing.\"\n- Unknown','bea4375116fd66ffa36fe6c73eaa3d6936e95f07',36879),(7304,'\n\"Humor is the great thing, the saving thing. The minute it crops \n up, all our irritations and resentments slip away and a sunny \n spirit takes their place.\" -- Mark Twain (1835-1910)','bea4375116fd66ffa36fe6c73eaa3d6936e95f07',31909),(7305,'\n\"If you can\'t learn anything from losing, don\'t lose.\"\n- Unknown','c1af44fdd5fad14eba26292e64a9c65d6dc25613',44403),(7306,'\n\"There are some experiences in life which should not be demanded \n twice from any man, and one of them is listening to the Brahms \n Requiem.\"\n -- George Bernard Shaw (1856-1950)','c1af44fdd5fad14eba26292e64a9c65d6dc25613',35941),(7307,'\n\"There is no real wealth but the labor of man. Where the\n mountains are of gold and the valleys of silver, the world\n would not be one grain of corn the richer; not one comfort\n would be added to the human race.\"\n -- Percy B. Shelley','c23c5badf1c4547755cb4a1b98a2b87c57e3dacd',45881),(7308,'\n\"The best time I ever had with Joan Crawford was when I pushed \n her down the stairs in \'Whatever Happened to Baby Jane?\'\"\n -- Bette Davis','c23c5badf1c4547755cb4a1b98a2b87c57e3dacd',36757),(7309,'\n\"For animals, the entire universe has been neatly divided into \n things to (a) mate with, (b) eat, (c) run away from, and (d) \n rocks.\"\n -- Terry Pratchett (Equal Rites)','c392995fdf7084551e578bee14bda929abb8e4b5',45883),(7310,'\n\"If you put tomfoolery into a computer, nothing comes out of it \n but tomfoolery. But this tomfoolery, having passed through a \n very expensive machine, is somehow enobled and no-one dares \n criticize it.\" -- Pierre Gallois.','c392995fdf7084551e578bee14bda929abb8e4b5',43348),(7311,'\nMurphy\'s Laws:\n   1. If anything can go wrong, it will (and at the worst \n      possible moment).\n   2. Nothing is as easy as it looks.\n   3. Everything takes longer than you think it will.','c464a6a0a28073fb8e4a26db2da76d13c53c0dea',43599),(7312,'\n\"I don\'t care if it works on your machine! We are not shipping\n your machine!\" -- Vidiu Platon','c464a6a0a28073fb8e4a26db2da76d13c53c0dea',32929),(7313,'\n\"Cole\'s Law: Thinly sliced cabbage.\"','c47ab2c905092f40e9ab88c4f01437566acb9fc2',45561),(7314,'\n\"How can I lose to such an idiot?\"\n -- A shout from chessmaster Aaron Nimzovich (1886-1935)','c47ab2c905092f40e9ab88c4f01437566acb9fc2',45881),(7315,'\n\"The finishing line isn\'t given; it is earned.\"\n- Unknown','c53f4f71ccaac85cc79fbe278c2871e58f8759f7',35658),(7316,'\n\"Blessed is the man, who having nothing to say, abstains from \n giving wordy evidence of the fact.\"\n -- George Eliot (1819-1880)','c53f4f71ccaac85cc79fbe278c2871e58f8759f7',33738),(7317,'\n\"There\'s no trick to being a humorist when you have the whole \n government working for you.\" -- Will Rogers (1879-1935)       ','c544a09191cdbec0cda96e61e55ad237aca7d2bb',32929),(7318,'\n\"To understand a man you should walk a mile in his shoes. If what \n he says still bothers you that\'s ok because you\'ll be a mile away \n from him and you\'ll have his shoes.\" -- Unknown','c544a09191cdbec0cda96e61e55ad237aca7d2bb',64),(7319,'\n\"We must question the story logic of having an all-knowing\n all-powerful God, who creates faulty humans, and then blames\n them for his own mistakes.\"\n -- Gene Roddenberry','c61b36b1f0d7d21eccaf8449fc188d5fc8c5e69e',43080),(7320,'\nSausage Principle: People who love sausage and respect the law \nshould never watch either one being made.','c61b36b1f0d7d21eccaf8449fc188d5fc8c5e69e',43599),(7321,'\n\"Everything of importance has been said before by somebody who\n did not discover it.\"\n -- Alfred North Whitehead','c6cb37781a6e435674d40d9f60f706a6d532500e',44281),(7322,'\n\"You can sleep when you die.\"\n- Roger Rehwald (seen on a T-shirt)','c6cb37781a6e435674d40d9f60f706a6d532500e',45881),(7323,'\n\"It all comes down to knowing how to handle situations that are thrown at you in\nan ultra.\"\n- Kevin Setnes','cab434a6372bfe541119c04cad810a1fe6386f6d',35658),(7324,'\n\"I don\'t feel good.\"\n -- The last words of Luther Burbank (1849-1926)','cab434a6372bfe541119c04cad810a1fe6386f6d',39809),(7325,'\n\"I took a course in speed reading and was able to read War and\n Peace in twenty minutes.  It\'s about Russia.\" -- Woody Allen','cad014acea5a26d184019851ccd84913b446de87',45253),(7326,'\n\"A conservative government is an organized hypocrisy.\"\n -- Benjamin Disraeli','cad014acea5a26d184019851ccd84913b446de87',32929),(7327,'\n\"The mistakes are all waiting to be made.\"\n -- chessmaster Savielly Grigorievitch Tartakower (1887-1956) \n    on the game\'s opening position','cbc655760122645cedde314635041e3426c143b2',32929),(7328,'\n\"You ask me if I keep a notebook to record my great ideas. I\'ve \n only ever had one.\" -- Albert Einstein.','cbc655760122645cedde314635041e3426c143b2',44127),(7329,'\n\"Last is just the slowest winner.\"\n- C. Hunter Boyd','ce19147335afb509cea545d5efbff1e3982b04eb',45881),(7330,'\n\"Running is a big question mark that\'s there each and every day.\nIt asks you, \'Are you going to be a wimp or are you going to be\nstrong today?\'\"\n- Peter Maher','ce19147335afb509cea545d5efbff1e3982b04eb',43348),(7331,'\n\"The problem with people who have no vices is that \n generally you can be pretty sure they\'re going to \n have some pretty annoying virtues.\"          \n -- Elizabeth Taylor','ce9c08972c7184ddf197e6281fcffa9ba2678b87',42471),(7332,'\n\"I\'ve made an odd discovery. Every time I talk to a savant I \n feel quite sure that happiness is no longer a possibility. \n Yet when I talk with my gardener, I\'m convinced of the \n opposite.\" -- Bertrand Russell','ce9c08972c7184ddf197e6281fcffa9ba2678b87',42471),(7333,'\n\"Man is the religious animal. He is the only religious animal.\n He is the only animal that has the True Religion, several of\n them. He is the only animal that loves his neighbor as himself\n and cuts his throat, if his theology isn\'t straight. He has\n made a graveyard of the globe in trying his honest best to\n smooth his brother\'s path to happiness and heaven.\"\n -- Mark Twain','cf1861ab4d63edf6a6a73a37d3bb7a060a4a6475',31909),(7334,'\n\"I shall be an autocrat: that\'s my trade. And the good Lord\n will forgive me: that\'s his.\"\n -- Empress Catherine the Great','cf324559d74f4a57dee581c725423aef4e7df203',33738),(7335,'\n\"Because I do it with one small ship, I am 