thing else\n is opinion.\"\n -- Democritus','137d22929d35f70072157667115aebbcd3f81530',44403),(7422,'\nMencken\'s Law: There is always an easy answer to every human \nproblem -- neat, plausible, and wrong.','13c80015875a668e8fc059517ffd124abbda63c1',45883),(7423,'\n\"There is a rumour going around that I have found God. I think \n this is unlikely because I have enough difficulty finding my \n keys, and there is empirical evidence that they exist.\"\n -- Terry Pratchett','13c80015875a668e8fc059517ffd124abbda63c1',44281),(7424,'\n\"When I am dead, I hope it may be said: \'His sins were scarlet \n but his books were read.\" -- Hillaire Belloc.','14cb32e5c8fda3639d5d9e2d1c49a27721ece658',44281),(7425,'\n\"They couldn\'t hit an elephant at this dist--\" \n -- John B. Sedwick, general, dying words, 1864','14cb32e5c8fda3639d5d9e2d1c49a27721ece658',32929),(7426,'\n\"If you gaze long into an abyss, the abyss will gaze back into \n you.\" -- Friedrich Nietzsche (1844-1900)','16d2310dc2662228e5959c7546af5d51fd967934',45090),(7427,'\n\"Most people drive thru life with the parking brake on.\"\n -- Lance Bradley','16d2310dc2662228e5959c7546af5d51fd967934',35950),(7428,'\n\"Been there, done that, don\'t need to do it again.\"\n- Unknown','1721c6c183de1b3bcd0ba5e91d1145c1d136c35b',35658),(7429,'\n\"The gulf between what we feel we are doing and what others perceive us\nto be doing will remain the most ultra of all distances, one that no\namount of miles or words can finally bridge.\"\n- Hart','1721c6c183de1b3bcd0ba5e91d1145c1d136c35b',64),(7430,'\n\"More computing sins are committed in the name of efficiency\n (without necessarily achieving it) than for any other single\n reason - including blind stupidity.\" -- W.A. Wulf','1802c45df22a85c7da5a5c377993e573befe02b7',43080),(7431,'\n\"If I can\'t dance, I don\'t want to be part of your revolution.\"\n -- Emma Goldman','1802c45df22a85c7da5a5c377993e573befe02b7',64),(7432,'\n\"I have a spelling checker,\n It came with my PC;\n It plai