 me out to stud!\"\n- Len Kuentzm just after finishing his first 50-miler','3d01c313c38258a1b78a7c1a4a662e0c10588d84',64),(7465,'\n\"Frank Hanson promises nothing in his runs, and by God he delivers.\"\n- Unknown','3d01c313c38258a1b78a7c1a4a662e0c10588d84',32929),(7466,'\n\"Total absence of humor renders life impossible.\"\n -- Colette (1873-1954), Chance Acquaintances, 1952','3d23056e864ef856d34230d42f2d00bf290973e8',31913),(7467,'\n\"Unformed people delight in the gaudy and in novelty. Cooked\n people delight in the ordinary.\" -- Erik Naggum','3d23056e864ef856d34230d42f2d00bf290973e8',34631),(7468,'\n\"Pardon him, Theodotus; he is a barbarian, and thinks that the \n customs of his tribe and island are the laws of nature.\" \n -- George Bernard Shaw','3d2a2fc683ae193020715e886ea3b22481482cd9',36879),(7469,'\n\"When a man says he approves of something in principle, it\n means he hasn\'t the slightest intention of carrying it out in\n practice.\"\n -- Otto von Bismarck','3d2a2fc683ae193020715e886ea3b22481482cd9',43080),(7470,'\n\"Some tortures are physical\n And some are mental,\n But the one that is both\n Is dental.\"\n -- Ogden Nash','3d2c898fa7e1b44a6391738a0d2a98f197ce98fa',39809),(7471,'\n\"The whole of life is just like watching a film. Only it\'s as \n though you always get in ten minutes after the big picture has\n started, and no-one will tell you the plot, so you have to work\n it out all yourself from the clues.\"\n -- Terry Pratchett (Moving Pictures) ','3f9f0a7f1107a6d1ef1b88a247657f010604fdc6',45883),(7472,'\n\"I don\'t believe in the after life, although I am bringing a\n change of underwear.\" -- Woody Allen.','3f9f0a7f1107a6d1ef1b88a247657f010604fdc6',44403),(7473,'\n\"When his life was ruined, his family killed, his farm \n destroyed, Job knelt down on the ground and yelled up to the \n heavens, \'Why god? Why me?\' and the thundering voice of God \n answered, \'There\'s just something about you that pisses me \n off.\'\" -- Stephen King.','4182c4