3ce5f236412891d46ed5ed5c4992456b6a7b3',36757),(7515,'\n\"I was thrown out of college for cheating on the metaphysics \n exam; I looked into the soul of the boy next to me.\" \n -- Woody Allen.','5383ce5f236412891d46ed5ed5c4992456b6a7b3',39809),(7516,'\n\"You don\'t elect politicians to commit crimes; you elect \n politicians to make your crimes legal.\" -- Matt Taibbi','53ced1ca67fd40d906d39285fbaf97e4f2548fad',45090),(7517,'\n\"Do not do an immoral thing for moral reasons.\"\n -- Thomas Hardy','53ced1ca67fd40d906d39285fbaf97e4f2548fad',43346),(7518,'\n\"Real programmers just throw a bunch of 1s and 0s at the computer \n to see what sticks\" -- Pete O\'Hanlon','5446569e8572251dcac168152d6c37074427eae3',45881),(7519,'\n\"I\'m Jewish. I don\'t work out. If God had wanted us to bend over, \n He would have put diamonds on the floor.\" -- Joan Rivers.','5446569e8572251dcac168152d6c37074427eae3',36879),(7520,'\n\"Java: the elegant simplicity of C++ and the blazing speed of\n Smalltalk.\" -- Roland Turner','54a734611576b0e683b676068450a54ad2c3ed2a',45881),(7521,'\n\"Good judgement comes from experience, and experience comes from\n bad judgement.\" -- Fred Brooks','54a734611576b0e683b676068450a54ad2c3ed2a',36879),(7522,'\n\"Gigerenzer\'s Law of Indispensable Ignorance: The world cannot \n function without partially ignorant people.\" -- Gerd Gigerenzer','55d0530db7078fb85c1bdb043e568ddabb9f6907',42471),(7523,'\n\"There is only one nature - the division into science and \n engineering is a human imposition, not a natural one. Indeed, \n the division is a human failure; it reflects our limited \n capacity to comprehend the whole.\" -- Bill Wulf','55d0530db7078fb85c1bdb043e568ddabb9f6907',45883),(7524,'\n\"I am become death, shatterer of worlds.\"\n -- Robert J. Oppenheimer (1904-1967) (citing from the \n    Bhagavad Gita, after witnessing the world\'s first nuclear \n    explosion)','57cc1d808cecafe7e501e09a0ad260d007b29c96',39809),(7525,'\n\"The competent programmer is fully aware of the strictly limited\n size of his own skull; therefore he approaches the programming\n task in full humility, and among other things he avoids clever\n tricks like the plague.\" -- Edsger Dijkstra','57cc1d808cecafe7e501e09a0ad260d007b29c96',45090),(7526,'\n\"The worst crimes were dared by a few, willed by more and\n tolerated by all.\" -- Tacitus','57e5e6755616a23ed83750592adacd81c8a8b15f',36757),(7527,'\n\"All religions are founded on the fear of the many and the\n cleverness of the few.\"\n -- Stendhal','57e5e6755616a23ed83750592adacd81c8a8b15f',43599),(7528,'\n\"For yesterday is but a dream,\nAnd tomorrow is only a vision,\nBut today well-lived makes\nEvery yesterday a dream of happiness,\nand every tomorrow a vision of hope.\nLook well, therefore, to this day!\nSuch is the salutation of the dawn.\"\n- from \"The Sanskrit\"','5a229d43a6d3f780cf00a6d6065aebbf8bda2125',36879),(7529,'\n\"... the designer of a new system must not only be the implementor\n and the first large-scale user; the designer should also write\n the first user manual. ... If I had not participated fully in \n all these activities, literally hundreds of improvements would\n never have been made, because I would never have thought of\n them or perceived why they were important.\" -- Donald Knuth','5a229d43a6d3f780cf00a6d6065aebbf8bda2125',43348),(7530,'\n\"Blessed is the man, who having nothing to say, abstains from \n giving wordy evidence of the fact.\"\n -- George Eliot (1819-1880)','5a5d57613a91b0a255748360c5ecda5b0e8333ae',43346),(7531,'\n\"Translate \'Allah\'.\"\n -- Bumper Sticker','5a5d57613a91b0a255748360c5ecda5b0e8333ae',45561),(7532,'\n\"You will get through the tired times, don\'t give up. There is lots of\ntime.  Walk and in a while you will be running again.\"\n- Rolly Portelance','5bf9826732439a6f56e0eb72f5df376d3f28b066',45883),(7533,'\n\"Civil disobedience, that\'s not our problem. Our problem is\n that people are obedient all over the world in the face of\n poverty and starvation and stupidity, and war, and cruelty. Our\n problem is that people are obedient while the jails are full of\n petty thieves, and all the while the grand thieves are running\n the country. That\'s our problem.\"\n -- Howard Zinn','5bf9826732439a6f56e0eb72f5df376d3f28b066',36757),(7534,'\n\"To describe the agony of a marathon to someone who\'s never run it is\nlike trying to explain color to someone who was born blind.\"\n- Jerome Drayton','6034647ba1acbbb053f8e256be634b163dc0973d',43080),(7535,'\n\"The only one listening to both sides of an argument\n is the neighbor in the next apartment\" -- unknown','6034647ba1acbbb053f8e256be634b163dc0973d',43599),(7536,'\n\"One out of every three Americans is suffering from some form of\n mental illness. Think of two of your best friends. If they are \n OK, then it must be you.\" -- George Carlin','60fbc1486c6584d80e5be72a9153098cd7f78ca8',31909),(7537,'\n\"We must question the story logic of having an all-knowing\n all-powerful God, who creates faulty humans, and then blames\n them for his own mistakes.\"\n -- Gene Roddenberry','60fbc1486c6584d80e5be72a9153098cd7f78ca8',35950),(7538,'\n\"Computers can figure out all kinds of problems, except the \n things in the world that just don\'t add up.\" -- James Magary.','60fe82d4c44b3bb12ea6eb40867c38b9edc37cb4',45449),(7539,'\n\"Road sucks!\"\n- Skip & Tracey','60fe82d4c44b3bb12ea6eb40867c38b9edc37cb4',44127),(7540,'\n\"Foreign aid is when the poor people of a rich country give\n money to the rich people of a poor country.\"\n -- Gary Hart, BC Comic Strip','655d1b5df6620635f138a71639de6a15a3708cc5',35941),(7541,'\n\"I never met a hill I couldn\'t walk.\"\n- Larry Stice','655d1b5df6620635f138a71639de6a15a3708cc5',36757),(7542,'\n\"When someone says, \'I want a programming language in which I\n need only say what I want done\', give him a lollipop.\" \n -- Alan Perlis','65956f014b307fa7f3824c57184c4118d31efaf8',44127),(7543,'\n\"Life is like an overlong drama through which we sit being\n nagged by the vague memories of having read the reviews.\"\n -- John Updike','65956f014b307fa7f3824c57184c4118d31efaf8',44281),(7544,'\n\"Kill a man, and you are an assassin. Kill millions of men, and\n you are a conqueror. Kill everyone, and you are a god.\"\n -- Jean Rostand','663b8a418c414a49f63dfe66bdc7c5a0ae0c7e60',35658),(7545,'\n\"Marry me and I\'ll never look at another horse!\"\n -- Groucho Marx','663b8a418c414a49f63dfe66bdc7c5a0ae0c7e60',34631),(7546,'\n\"I swear, I\'ll never do this again.\"\n- Unknown','6aabe286989a67d7d5a8df840d54af0feca93637',43599),(7547,'\n\"I meant,\" said Ipslore bitterly, \"what is there in this world\n that truly makes living worthwhile?\"\n Death thought about it.\n \"Cats,\" he said eventually. \"Cats are nice.\"\n -- Terry Pratchett (Sourcery)','6aabe286989a67d7d5a8df840d54af0feca93637',45881),(7548,'\n\"We are not retreating - we are advancing in another Direction.\"\n -- General Douglas MacArthur (1880-1964)','6ab70af2ada7e680ace867bbce8424e0a992d41c',45561),(7549,'\n\"Ever notice when you blow in a dog\'s face he gets mad at you, \n but when you take him in a car he sticks his head out the \n window?\" -- George Carlin','6ab70af2ada7e680ace867bbce8424e0a992d41c',31909),(7550,'\n\"If you get tired on a trail run, lie down in the middle of the trail in\nsuch a way that no one could pass you without waking you up - it will\ninsure your finish line position.\"\n- Glen Zirbel','6afe3227bdc2e95761be0b5568f72eca7eb21de9',45090),(7551,'\n\"I begin by taking. I shall find scholars later to demonstrate \n my perfect right.\"\n -- Frederick (II) the Great','6afe3227bdc2e95761be0b5568f72eca7eb21de9',34631),(7552,'\n\"I refuse to tip-toe through life only to arrive at death safely.\"\n- Submitted by Scott Weber','6b6967920b2ea38efba978d5d0b34728677ad1a5',44403),(7553,'\n\"Courage: Two cannibals having oral sex.\"','6b6967920b2ea38efba978d5d0b34728677ad1a5',34631),(7554,'\n\"I\'m always amazed to hear of air crash victims so badly \n mutilated that they have to be identified by their dental \n records. What I can\'t understand is, if they don\'t know who you \n are, how do they know who your dentist is?\" -- Paul Merton.','6bf9884dfdcd35ebd295491ab47468e1df0a0e1d',43346),(7555,'\n\"... so as we walked along the river toward Rucky Chucky, I said the\nwords that most men say to a pretty woman as they walk along the river\nunder a starry night on their first date: \"If you were a real hardass,\nyou\'d stick your finger down your throat and clear your stomach and if\nyou won\'t do it, I will.\"\n- Stan Jensen, pacing Sarah Lowell at WS\'97','6bf9884dfdcd35ebd295491ab47468e1df0a0e1d',44944),(7556,'\n\"Either God wants to abolish evil, and cannot; or he can, but\n does not want to. If he wants to, but cannot, he is impotent.\n If he can, but does not want to, he is wicked. If, as they say,\n God can abolish evil, and God really wants to do it, why is\n there evil in the world?\"\n -- Epicurus','6c276b9c09e91736fa39fab7c54c4baf2d7a1d0a',32929),(7557,'\n\"Could a being create the fifty billion galaxies, each with two\n hundred billion stars, then rejoice in the smell of burning\n goat flesh?\"\n -- Ron Patterson','6c276b9c09e91736fa39fab7c54c4baf2d7a1d0a',39809),(7558,'\n\"The graveyards are full of indispensable men.\"\n -- Charles de Gaulle (1890-1970)','6d77626b609e576e85e89fe52d4455cc5c3e3f1f',44127),(7559,'\n\"Have you ever felt worse after a run?\"\n- George Sheehan','6d77626b609e576e85e89fe52d4455cc5c3e3f1f',44127),(7560,'\n\"If god created us in his image we have certainly returned the\n compliment.\"\n -- Voltaire','6f3a4ae830d368f3ab6bda2bc6a51673c43c8452',44944),(7561,'\n\"Those who cannot remember the past are condemned to repeat it.\"\n -- George Santayana','6f3a4ae830d368f3ab6bda2bc6a51673c43c8452',34631),(7562,'\n\"Gentlemen, you can\'t fight in here! This is the War Room!\"\n -- Dr. Strangelove','72484775e7590f61959270d1d14edc6fc51df563',43348),(7563,'\nGoebel\'s Observation On Utopia: If everyone believed in Peace \nthey would immediately begin fighting over the best way to \nachieve it.','72484775e7590f61959270d1d14edc6fc51df563',35950),(7564,'\n\"Men who believe absurdities will commit atrocities.\"\n -- Voltaire','72e36f20253764e6ba59551938fff557f9f6ce4d',44127),(7565,'\n\"The trouble with the world is that the stupid are cocksure and\n the intelligent are full of doubt.\" -- Bertrand Russell','72e36f20253764e6ba59551938fff557f9f6ce4d',43080),(7566,'\nGoebel\'s Observation On Utopia: If everyone believed in Peace \nthey would immediately begin fighting over the best way to \nachieve it.','72e9b0837c5a2c2535da9b0e8fe4a0c389b04f51',31909),(7567,'\n\"If fifty million people believe a foolish thing, it is still a\n foolish thing.\"\n -- Anatole France','72e9b0837c5a2c2535da9b0e8fe4a0c389b04f51',31909),(7568,'\n\"Adopt the pace of nature; her secret is patience\"\n- Ralph Waldo Emerson','750cc3cbd79ca1d265303fb62c9542a296364ac5',45881),(7569,'\n\"Kindness is more important than wisdom, and the recognition of\n this is the beginning of wisdom.\"\n -- Theodore Isaac Rubin','750cc3cbd79ca1d265303fb62c9542a296364ac5',36757),(7570,'\n\"Now, my good man, this is no time for making enemies.\"\n -- Voltaire, deathbed, when asked to renounce Satan','78532a36aae864341242204d6cc28c926e7f3fa6',45881),(7571,'\n\"Two attitudes are all that is needed; do not harm anything,\n say and do things that make others happy.\"\n -- dreamslaughter','78532a36aae864341242204d6cc28c926e7f3fa6',39809),(7572,'\n\"ARRRGH -- what in God\'s name ever possessed me to think this would be a\ngood thing to do?\"\n- Charles N. Steele','798e35637e6388bf9aa0c15f6e1ab4158e17ac55',36879),(7573,'\n\"It is true that liberty, so precious, must be rationed.\"\n -- Nikolai Lenin','798e35637e6388bf9aa0c15f6e1ab4158e17ac55',33738),(7574,'\nAMAZING BUT TRUE ...\nThere is so much sand in Northern Africa that if it were spread\nout it would completely cover the Sahara Desert.','7a5790d8f4be0b743a420dc71a2453d0ebfc9f4d',43599),(7575,'\n\"If I could find a way to get [Saddam Hussein] out of there, even\n putting a contract out on him, ... ahh ... if the CIA still did \n that sort of thing, . . . ahh . . . assuming it ever did . . . . \n . . . I would be for it.\" -- Richard Nixon','7a5790d8f4be0b743a420dc71a2453d0ebfc9f4d',45090),(7576,'\n\"I never would have agreed to the formulation of the Central\n Intelligence Agency back in forty-seven, if I had known it\n would become the American Gestapo.\"\n -- Harry S Truman, 1961','7a69970aa1f552e3142d5294b237487bfd29cb1c',45090),(7577,'\n\"Before we blame, we should first see if we can excuse.\"\n -- G. C. Lichtenberg','7a69970aa1f552e3142d5294b237487bfd29cb1c',45883),(7578,'\n\"Real Programmers never work from 9 to 5. If any real programmer\n is around at 9 a.m., it\'s because they were up all night.\"\n -- Some Computer Geek','7c3e5ee4a039488490773796641c8f20b71c62c7',39809),(7579,'\n\"I\'m ineffably tired of pro-war ideologues moaning about how\n the anti-war folk are just \'complaining\' without \'offering\n solutions\' to global dilemmas. Peace doesn\'t need a freekin\n moral, ethical, economical, or political qualification; war\n does. Peace doesn\'t ravage, plunder, rape, or kill; war does.\n Peace does not need justification, war does.\"\n -- <|OnAir|>','7c3e5ee4a039488490773796641c8f20b71c62c7',45253),(7580,'\n\"I have an existential map; it has \'you are here\' written all \n over it.\" -- Steven Wright','7c86ae7523e8e05e8722ad2e1011878662bce335',35950),(7581,'\n\"Nature does not hurry, yet everything is accomplished.\"\n -- Lao tzu','7c86ae7523e8e05e8722ad2e1011878662bce335',35950),(7582,'\n\"What I am against is quotas. I am against hard quotas, quotas \n they basically delineate based upon whatever. However they \n delineate, quotas, I think, vulcanize society. So I don\'t know \n how that fits into what everybody else is saying, their relative \n positions, but that\'s my position.\" -- George W. Bush','7d68c1952aa83998aad2c93869a492b13265ae89',43599),(7583,'\n\"Maybe this world is another planet\'s Hell.\"\n -- Aldous Huxley (1894-1963)','7d68c1952aa83998aad2c93869a492b13265ae89',43346),(7584,'\n\"I have an existential map; it has \'you are here\' written all \n over it.\" -- Steven Wright','7e7eac9654796b2091f235367279edaf5b9d5bde',45883),(7585,'\n\"The number of miles I have run since I was a toddler would have\ntaken me around the world several times, and I still cannot define\nprecisely my joy in running.  There is no sacrifice in it.  I lead\nwhat I regard a normal life.  In my case, I thoroughly enjoy\nrunning 100-odd miles a week.  If I didn\'t I wouldn\'t do it.  Who\ncan define happiness? To some, happiness is a warm puppy or a glass\nof cold beer.  To me, happiness is running in the hills with my\nmates around me.\" \n- Ron Clarke','7e7eac9654796b2091f235367279edaf5b9d5bde',64),(7586,'\n\"Intellectuals solve problems; geniuses prevent them.\" \n -- Albert Einstein','80c48ed61ca64514690e96a5659cddd90267e8f3',33738),(7587,'\n\"I don\'t pray because I don\'t want to bore God.\" -- Orson Welles.','813e8483fc0ef23e0de7576326f2f6963586d308',35658),(7588,'\n\"I just bought a Mac to help me design the next Cray.\"\n -- Seymoure Cray (1925-1996) when was informed that Apple Inc. \n    had recently bought a Cray supercomputer to help them design \n    the next Mac.','813e8483fc0ef23e0de7576326f2f6963586d308',44944),(7589,'\n\"Why yes -- a bulletproof vest.\" \n -- James Rodges, murderer, on his final request before the \n    firing squad.','843db353dca2a41ff3ad1874ba42aaad51152324',45090),(7590,'\n\"I\'m all in favor of keeping dangerous weapons out of the hands \n of fools. Let\'s start with typewriters.\"\n-- Frank Lloyd Wright (1868-1959)','843db353dca2a41ff3ad1874ba42aaad51152324',35941),(7591,'\n\"I\'m not going to have some reporters pawing through our papers. \n We are the president.\" -- Hillary Clinton.','84b28e67dac3802a6dc50b12b3010df4a0a937b7',64),(7592,'\n\"Trying to get into the details seems to be a religious issue -- \n nearly everybody is convinced that every style but their own is\n ugly and unreadable. Leave out the \"but their own\" and they\'re\n probably right...\" -- Jerry Coffin on indentation','84b28e67dac3802a6dc50b12b3010df4a0a937b7',42471),(7593,'\n\"There was a time when I believed in the story and the scheme\n of salvation, so far as I could understand it, just as I\n believed there was a Devil. Suddenly the light broke through to\n me and I saw a silly story, and each generation nowadays\n swallows it with greater difficulty. Why do people go on\n pretending about this Christianity?\"\n -- H. G. Wells','85f150538c2e4747b532a033f15b4fa47ec8f597',35658),(7594,'\n\"It\'s the quitting that really is hard.\"\n- Gene Thibeault','85f150538c2e4747b532a033f15b4fa47ec8f597',45881),(7595,'\n\"The average person thinks he isn\'t.\" -- Father Larry Lorenzoni','85fd3f895a513880629be4101b7b6f711383ea1b',44944),(7596,'\n\"So I was in my car, and I was driving along, and my boss rang up\n and he said \'You\'ve been promoted\'. And I swerved.\n And then he rang up a second time and said \'You\'ve been promoted\n again\'. And I swerved again.\n He rang up a third time and said \'You\'re managing director.\' \n And I went into a tree.\n And a policeman came up and said \'What happened to you?\'\n And I Said \'I careered off the road.\'\" -- Tommy Cooper','85fd3f895a513880629be4101b7b6f711383ea1b',44403),(7597,'\n\"Finish with a smile on your face.\"\n- Joe Trask','86bce22a4d2805649853ac7909c4efb4dd18f255',35941),(7598,'\n\"It is better to be feared than loved, if you cannot be both.\"\n -- Niccolo Machiavelli (1469-1527), \"The Prince\"','86bce22a4d2805649853ac7909c4efb4dd18f255',32929),(7599,'\n\"The exact contrary of what is generally believed is often the\n truth.\"\n -- Jean de la Bruyre','877b6ae0c6a24489c3b575c559a8694abece57ea',43080),(7600,'\nGold\'s Law: If the shoe fits, it\'s ugly.','877b6ae0c6a24489c3b575c559a8694abece57ea',42471),(7601,'\n\"We\'ve all heard that a million monkeys banging on a million\n typewriters will eventually reproduce the entire works of \n Shakespeare. Now, thanks to the Internet, we know this is not \n true.\" -- Robert Wilensky ','87b75108d60b08bd642e0b60413c7bcf756bee99',45561),(7602,'\n\"I had a lover\'s quarrel with the world.\"\n -- Robert Frost','886a2da92ecf62a01a73e58adc2e15f1aa5c0b8e',45561),(7603,'\n\"Human history becomes more and more a race between education \n and catastrophe.\" -- H. G. Wells (1866-1946)','886a2da92ecf62a01a73e58adc2e15f1aa5c0b8e',35950),(7604,'\n\"Christianity exceeds all other faiths in its power to deform\n and finally invert the mental process.\"\n -- Ida White','897af3b3a0bf7d1326ec4b728332311a88cec6fa',45881),(7605,'\n\'What our ancestors would really be thinking, if they were alive\n today, is: \"Why is it so dark in here?\"\'\n -- Terry Pratchett, (Pyramids)','897af3b3a0bf7d1326ec4b728332311a88cec6fa',45090),(7606,'\n\"For every complex problem there is an answer that is clear,\n simple, and wrong.\" -- H L Mencken','8a485a0ef914c8f42f9d9d16c568f9bda888febd',45449),(7607,'\n\"My neighbour asked if he could use my lawnmower and I told him of\n course he could, so long as he didn\'t take it out of my garden.\"\n -- Eric Morecambe.','8a485a0ef914c8f42f9d9d16c568f9bda888febd',42471),(7608,'\n\"Pascal /n./ A programming language named after a man who would \n turn over in his grave if he knew about it.\" \n -- From the Jargon File','8ab5d9bd8cdcbc45785495fd7be28918177deec3',45883),(7609,'\n\"I have never let my schooling interfere with my education.\"\n -- Mark Twain (1835-1910)','8ab5d9bd8cdcbc45785495fd7be28918177deec3',45449),(7610,'\n\"I\'ll sleep when I\'m dead.\" -- Warren Zevon','8b270ac2c95070830a7bf0c060ae8809c4c06b1a',35658),(7611,'\n\"Until the infallibility of human judgment shall have been\n proved to me, I shall persist in demanding the abolition of the\n death penalty.\"\n -- Marquis de Lafayette','8b270ac2c95070830a7bf0c060ae8809c4c06b1a',44944),(7612,'\n\"If women didn\'t exist, all the money in the world would have no \n meaning.\" -- Aristotle Onassis (1906-1975)','8c017bbf895f15a17a1f2572646ee6769d7ba906',64),(7613,'\n\"Not even computers will replace committees, because committees \n buy computers.\" -- Unknown','8d4709a9a9cfe773fd0b5d3982f448ade4e4eded',33738),(7614,'\n\"We only acknowledge small faults in order to make it appear\n that we are free from great ones.\" -- La Rochefoucauld','8d4709a9a9cfe773fd0b5d3982f448ade4e4eded',43346),(7615,'\n\"Two things should be cut - the second act and the child\'s\n throat.\" -- Noel Coward on a dull play with an annoying \n             child star','8d93994edb3a19b686280e7cb365bacc7dca957d',32929),(7616,'\n\"If all the economists in the world were laid end-to-end, they \n would still not reach a conclusion.\" -- unknown\n\n\"If all the girls from Vassar were laid end-to-end, I wouldn\'t \n be surprised.\" -- Dorothy Parker','8d93994edb3a19b686280e7cb365bacc7dca957d',44944),(7617,'\n\"All truth passes through three stages. First, it is ridiculed. \n Second, it is violently opposed. Third, it is accepted as being \n self-evident.\"\n -- Arthur Schopenhauer (1788-1860)','8e1a0f24951ddd8451702599285b93e23acf71c5',44127),(7618,'\n\"If you gaze long into an abyss, the abyss will gaze back into \n you.\" -- Friedrich Nietzsche (1844-1900)','8e1a0f24951ddd8451702599285b93e23acf71c5',64),(7619,'\n\"It\'s clearly a budget. It\'s got a lot of numbers in it.\"\n -- George W. Bush','8fd269c0fb71ca88365d1d3a23dc6be5dc2f516a',43080),(7620,'\n\"This is not a novel to be tossed aside lightly. It should be \n thrown with great force.\" -- Book review by Dorothy Parker','8fd269c0fb71ca88365d1d3a23dc6be5dc2f516a',35952),(7621,'\n\"Rewards are on a level with the effort, and the effort is extreme.\"\n- an unidentified \"Utah runner\", from Red Fisher','905ab9811bede5cf6f3ce6b42495a8c42870f379',42471),(7622,'\n\"