oken, you are master of it; when\n once it is spoken, it is master of you.\"\n -- Arab proverb','b1c26e9347ef547ff06845ca38cc443aedc4fa86',64),(7667,'\n\"So I was in my car, and I was driving along, and my boss rang up\n and he said \'You\'ve been promoted\'. And I swerved.\n And then he rang up a second time and said \'You\'ve been promoted\n again\'. And I swerved again.\n He rang up a third time and said \'You\'re managing director.\' \n And I went into a tree.\n And a policeman came up and said \'What happened to you?\'\n And I Said \'I careered off the road.\'\" -- Tommy Cooper','b2263e6ae154ff1971890049b520699e33ed23c5',45449),(7668,'\n\"Necessity is the plea for every infringement of human freedom. \n It is the argument of tyrants; it is the creed of slaves.\"\n -- William Pitt','b2263e6ae154ff1971890049b520699e33ed23c5',45090),(7669,'\n\"Positive mental sickness.\"\n- Unknown','b3055c81f115f49a2abd9fe90ebb6bfbca01d5ef',32929),(7670,'\n\"Emulate your heros, but don\'t carry it too far.  Especially \n if they are dead.\"','b3055c81f115f49a2abd9fe90ebb6bfbca01d5ef',45883),(7671,'\n\"One out of every three Americans is suffering from some form of\n mental illness. Think of two of your best friends. If they are \n OK, then it must be you.\" -- George Carlin','b42129783ab031650a732bad2ee141342f0f1cd9',45561),(7672,'\n\"Real Programmers never work from 9 to 5. If any real programmer\n is around at 9 a.m., it\'s because they were up all night.\"\n -- Some Computer Geek','b42129783ab031650a732bad2ee141342f0f1cd9',35952),(7673,'\n\"There are two ways of constructing a software design; one way is \n to make it so simple that there are obviously no deficiencies, \n and the other way is to make it so complicated that there are no \n obvious deficiencies. The first method is far more difficult.\" \n -- C. A. R. Hoare','b6036be63c668628978612ff881c16a8e711e9db',45449),(7674,'\n\"Computers can figure out all kinds of problems, except the \n things in the world that just don\'t add up.\" -- James Magary.','b8913a5f23d9d6250275ed873d6e45d28d80cb48',36879),(7675,'\n\"If you\'re sick and tired of the politics of cynicism and polls \n and principles, come and join this campaign.\" -- George W. Bush','ba1276a5b095d08a0c0f24ed7dd48b207132c62b',45090),(7676,'\n\"One death is a tragedy. A million deaths is a statistic.\"\n -- Josef Stalin','ba1276a5b095d08a0c0f24ed7dd48b207132c62b',44127),(7677,'\n\"The establishment of Christianity arrested the normal\n development of the physical sciences for over fifteen hundred\n years.\"\n -- Andrew Dickson White','bdb0e626322c4c78420b81c3d93b1d25dfa2de9d',44944),(7678,'\n\"I did not know how to say goodbye. It was harder still, when I\n refused to say it.\"\n -- Native American saying','bdb0e626322c4c78420b81c3d93b1d25dfa2de9d',35658),(7679,'\n\"Adam and Eve had many advantages, but the principal one was\n that they escaped teething.\" -- Mark Twain','bfaa1ffd2bc76d400ac050a9be037c2b5114018d',42471),(7680,'\n\"Above all, train hard, eat light, and avoid TV and people with negative\nattitudes.\"\n- Scott Tinley','bfaa1ffd2bc76d400ac050a9be037c2b5114018d',45090),(7681,'\n\"If I held you any closer I would be on the other side of you.\"\n -- Groucho Marx','c06bda2f5288f410e1afc05cdfd4046616eae8fc',35952),(7682,'\n\"Half this game is ninety percent mental.\" -- Yogi Berra','c06bda2f5288f410e1afc05cdfd4046616eae8fc',44127),(7683,'\n\"Mr. Wagner has beautiful moments but bad quarters of an hour.\"\n    - Gioacchino Rossini (1792-1868)','c0b7c69e9b0955b86761b4871c5103a55c008ce0',43346),(7684,'\n\"Living is change; Growth is optional.\"\n -- Juan Wa Chang','c0b7c69e9b0955b86761b4871c5103a55c008ce0',45253),(7685,'\n\"1001 words say more than one picture\" -- Chinese proverb','c1c6b2314afbe15fed6227faf461a0228b5e6ea8',45449),(7686,'\n\"Look at you in war. There has never been a just one, never\n an honorable one, on the part of the instigator of the war.\"\n -- Mark Twain','c1c6b2314afbe15fed6227faf461a0228b5e6ea8