ically impossible to teach good programming style to \n students that have had prior exposure to Basic; as potential \n programmers they are mentally mutilated beyond hope of \n regeneration.\" -- Edsger Dijkstra','d7c7c35bfa3049b94a3f31d332de428a6129b3d3',45449),(7721,'\n\"That\'s the thing about people who think they hate computers. \n What they really hate is lousy programmers.\" \n -- Larry Niven and Jerry Pournelle Oath of Fealty','d7c7c35bfa3049b94a3f31d332de428a6129b3d3',45881),(7722,'\n\"Only a fool tests the depth of the water with both feet.\"\n -- African proverb','d9f028967179bf2293819f1b42f31b0e5e445126',42471),(7723,'\n\"Beware of computer programmers that carry screwdrivers.\"\n -- Leonard Brandwein.','d9f028967179bf2293819f1b42f31b0e5e445126',33738),(7724,'\n\"Any fool can use a computer. Many do.\" -- Ted Nelson','da2f846adbbee9ca8b82cf3e36d283d8c9060bdd',36879),(7725,'\n\"This isn\'t right, this isn\'t even wrong.\"\n -- Wolfgang Pauli (1900-1958), upon reading a young physicist\'s \n    paper','da2f846adbbee9ca8b82cf3e36d283d8c9060bdd',35941),(7726,'\n\"If you think it\'s simple, then you have misunderstood the \n problem.\" -- Bjarne Stroustrup [lecture at Temple U., 11/25/97]','dc01e0bb3055e8833950869b033295294c528cc1',43348),(7727,'\n\"If a person is to get to the meaning of life, he must learn to\n like the facts about himself, ugly as they may seem to his\n sentimental vanity, before he can learn the truth behind the\n facts. And the truth is never ugly.\"\n -- Eugene O\'Neill','dc01e0bb3055e8833950869b033295294c528cc1',45449),(7728,'\n\"Usually when people are sad, they don\'t do anything. They just\n cry over their condition. But when they get angry, they bring\n about a change.\"\n -- Malcolm X','dd3a575117170389f7a4185aac816f1c72068754',44944),(7729,'\n\"Whatever is begun in anger ends in shame.\"\n -- Benjamin Franklin (1706-1790)','dd3a575117170389f7a4185aac816f1c72068754',35952),(7730,'\n                ACHTUNG!  ALLES LOOKENSPEEPERS!  \n Das computermachine ist nicht fuer gefingerpoken und mittengrabben.\n Ist easy schnappen der springenwerk, blowenfusen und poppencorken\n mit spitzensparken.  Ist nicht fuer gewerken bei das dumpkopfen.\n Das rubbernecken sichtseeren keepen das cotten-pickenen hans in das\n pockets muss; relaxen und watchen das blinkenlichten.\n -- from \"THE JARGON FILE, VERSION 2.9.9, 01 APR 1992','def17c3a3a1b054b8ad8ffb938915b6800541dbd',45883),(7731,'\n\"DON\'T THINK OF IT AS DYING, said Death. JUST THINK OF IT AS \n LEAVING EARLY TO AVOID THE RUSH.\"\n -- Terry Pratchett (Good Omens) ','def17c3a3a1b054b8ad8ffb938915b6800541dbd',45449),(7732,'\n\"I\'m in shape. Round is a shape.\" -- George Carlin','df42b1a32d1c753547ef1d3b7779c5716cb36943',43346),(7733,'\n\"The first 90% of the code accounts for the first 90% of the\n development time. The remaining 10% of the code accounts for\n the other 90% of the development time.\" -- Tom Cargill','df42b1a32d1c753547ef1d3b7779c5716cb36943',45881),(7734,'\n\"I\'m not into working out.  My philosophy: No pain, no pain.\" \n -- Carol Leifer.','df4ccf660d92878bd9e419dec7018b539c63c9b5',43348),(7735,'\nCropp\'s Law: The amount of work done varies inversely with the \namount of time spent in the office.','df4ccf660d92878bd9e419dec7018b539c63c9b5',43348),(7736,'\n\"I wouldn\'t mind dying - it\'s the business of having to stay \n dead that scares the shit out of me.\" -- R. Geis.','df9dd4802b99f3208986ab8d8127cc902a72b14c',34631),(7737,'\n\"Mr. Madison, what you\'ve just said is one of the most insanely \n idiotic things I have ever heard. At no point in your rambling, \n incoherent response were you even close to anything that could \n be considered a rational thought. Everyone in this room is now \n dumber for having listened to it. I award you no points, and \n may God have mercy on your soul.\" -- from movie Billy Madison','df9dd4802b99f3208986ab8d8127cc902a72b14c',35941),(7738,'\n\"The secret to creativity is knowing how to hide your sources.\" \n -- Albert Einstein','dff281d5b39ae2a4d28fea6995b2693bfbeaf050',35941),(7739,'\n\"The difference between fiction and reality? Fiction has to make \n sense.\" -- Tom Clancy','dff281d5b39ae2a4d28fea6995b2693bfbeaf050',34631),(7740,'\n\"They couldn\'t hit an elephant at this dist--\" \n -- John B. Sedwick, general, dying words, 1864','e0fcac59e989e1bd70aff53e0392e3e379adbea7',45881),(7741,'\n\"Life would be so much easier if we could just see the source \n code.\" -- unknown','e0fcac59e989e1bd70aff53e0392e3e379adbea7',43080),(7742,'\n\"The most important thing in life is not the triumph but the struggle.\nThe essential thing is not to have conquered but to have fought well.\"\n- Pierre de Courbertin','e1ce8fe1a0eb056c0f8c17747b3c5fcec258b557',35950),(7743,'\n\"A man must love a thing very much if he not only practices it without any hope of\nfame and money, but even practices it without any hope of doing it well.\"\n- G. K. Chesterton','e5f71147e9ffb06172e7cd454ce5b5c32a47b328',35952),(7744,'\n\"It hurts up to a point and then it doesn\'t get any worse.\"\n- Ann Trason','e5f71147e9ffb06172e7cd454ce5b5c32a47b328',45253),(7745,'\n\"Think my friends! You adulate a stone as Vishnu but you cannot\n see God in a fellow man.\"\n -- Sankaracharya','e66efa7d2f1753dcba40d9cedf8360d6813cf5e0',43599),(7746,'\n\"I had a lover\'s quarrel with the world.\"\n -- Robert Frost','e66efa7d2f1753dcba40d9cedf8360d6813cf5e0',45561),(7747,'\n\"If you want a product with certain characteristics, you must\n ensure that the team has those characteristics before the\n product\'s development.\" \n -- Jim McCarthy and Michele McCarthy - Software for your Head','e8c1bea84ec9b7eb4accf9eb102de4ce16d74eb9',31913),(7748,'\n\"Because I do it with one small ship, I am called a terrorist\n(pirate?). You do it with a whole fleet and are called an\n emperor.\"\n -- St. Augustine','e8c1bea84ec9b7eb4accf9eb102de4ce16d74eb9',43346),(7749,'\n\"The city\'s central computer told you?  R2D2, you know better than\n to trust a strange computer!\" -- C3PO','e9301444226221ab499d9a832cb6c5550c6b7a81',33738),(7750,'\n\"Why couldn\'t Pheiddipedes have died at 20 miles?.\"\n- Frank Shorter, 1970','e9301444226221ab499d9a832cb6c5550c6b7a81',39809),(7751,'\n\"Human beings, who are almost unique in having the ability to learn from the\nexperience of others, are also remarkable for their apparent disinclination\nto do so.\"\n- Douglas Adams','ea5c1fa6787ae6e7e9ccefd0f33a31e032b518dc',39809),(7752,'\n\"He had decided to live forever or die in the attempt.\"\n -- Joseph Heller.','ea5c1fa6787ae6e7e9ccefd0f33a31e032b518dc',35941),(7753,'\n\"Before software can be reusable it first has to be usable.\"\n -- Ralph Johnson','eac1983619ba582de87dbbb07b7456dfe59f43df',45561),(7754,'\n\"The amount of time the body needs to recuperate is not a sign of\nweakness but a fact of life.\"\n- Unknown','eac1983619ba582de87dbbb07b7456dfe59f43df',45090),(7755,'\n\"Well done is better than well said.\" \n -- Benjamin Franklin (1706-1790)','ebfc6eb8c116191fbe4f442fc480df50856d3bc4',35950),(7756,'\n\"A [pseudo]random number generator is much like sex: when it\'s \n good it\'s wonderful, and when it\'s bad it\'s still pretty good.\" \n -- G. Marsaglia ','ebfc6eb8c116191fbe4f442fc480df50856d3bc4',64),(7757,'\n\"Monarchy degenerates into tyranny, aristocracy into oligarchy,\n and democracy into savage violence and chaos.\"\n -- Polybius','ec6423acf9750ce237393f019d270adbc18a828c',35658),(7758,'\n\"The target suffered a terminal illness before a firing squad\n in Baghdad.\"\n -- CIA officer at US Senate hearing on 1963 overthrow of Iraqi\n Prime Minister Kassem','ec6423acf9750ce237393f019d270adbc18a828c',44281),(7759,'\n\"The history of liberty is a history of resistance. The history\n of liberty is a history of limitations of governmental power,\n not the increase of it.\"\n -- Woodrow Wilson','ed7519468b49a76ebc51f5600f027c605597b41c',36757),(7760,'\n\"Spiritual maturity is a lifelong process of replacing