ust keep running.\"\n- Ken Chlouber at Leadville','4b0601b3a1742659849c735f6f88c746b968705a',43346),(7869,'\n\"Computers can figure out all kinds of problems, except the \n things in the world that just don\'t add up.\" -- James Magary.','4b0601b3a1742659849c735f6f88c746b968705a',31913),(7870,'\n\"If you are required to kill someone today, on the promise of a\n political leader that someone else shall live in peace\n tomorrow, believe me, you are not only a double murderer, you\n are a suicide, too.\"\n -- Katherine Anne Porter','4cc9d214074f0e8a09509bf88bd95b1c069b0565',64),(7871,'\n\"A sense of humor is part of the art of leadership, of getting \n along with people, of getting things done.\" \n -- Dwight D. Eisenhower (1890-1969)','4cc9d214074f0e8a09509bf88bd95b1c069b0565',43348),(7872,'\n\"Programming is like sex: one mistake and you have to support it \n for the rest of your life.\" -- Michael Sinz','4d186afe41eb80f94cb4585aabb00a931c46b439',44944),(7873,'\n\"It is better to be feared than loved, if you cannot be both.\"\n -- Niccolo Machiavelli','4d186afe41eb80f94cb4585aabb00a931c46b439',36879),(7874,'\n\"It\'s hard enough to find an error in your code when you\'re \n looking for it; it\'s even harder when you\'ve assumed your code\n is error-free.\" -- Steve McConnell Code Complete','4d40a696d79a54efc1b06cdd0ba8fea928b824a5',35941),(7875,'\n\"Grove giveth and Gates taketh away.\"\n -- Bob Metcalfe (inventor of Ethernet) on the trend of hardware\n    speedups not being able to keep up with software demands','4d40a696d79a54efc1b06cdd0ba8fea928b824a5',43348),(7876,'\n\"The first 50 miles are run with the legs, the second 50 miles with the\nmind.\"\n- Unknown','4f2824d06f8bad7ea2d88cb6a1f3215f847560aa',45883),(7877,'\n\"When you\'ve seen one non-sequitur, the price of tea in China.\"','4f2824d06f8bad7ea2d88cb6a1f3215f847560aa',36879),(7878,'\n\"We can often do more for other men by trying to correct our\n own faults than by trying to correct theirs.\"\n -- Francoi