an they found it.\"\n -- Charles Dickens','5de64d5b6c8483c5583206f9b15e620115ad7691',45090),(7902,'\n\"A dentist at work in his vocation always looks down in the\n mouth.\" -- George D. Prentice','5faa7e4e1f7c253df37d3e999be83b8d3e4e9609',45449),(7903,'\n\"One doesn\'t have a sense of humor. It has you.\" -- Larry Gelbart','5faa7e4e1f7c253df37d3e999be83b8d3e4e9609',33738),(7904,'\n\"So I was in my car, and I was driving along, and my boss rang up\n and he said \'You\'ve been promoted\'. And I swerved.\n And then he rang up a second time and said \'You\'ve been promoted\n again\'. And I swerved again.\n He rang up a third time and said \'You\'re managing director.\' \n And I went into a tree.\n And a policeman came up and said \'What happened to you?\'\n And I Said \'I careered off the road.\'\" -- Tommy Cooper','6124cb94c33db249c29395625c4b43deb8be0cb6',35658),(7905,'\n\"There is a rumour going around that I have found God. I think \n this is unlikely because I have enough difficulty finding my \n keys, and there is empirical evidence that they exist.\"\n -- Terry Pratchett','6124cb94c33db249c29395625c4b43deb8be0cb6',45090),(7906,'\nRule Of Accuracy: When working toward the solution of a problem \nit always helps you to know the answer.','619b383cc9e8e0a863e0053695ac41994b49cd29',44944),(7907,'\nLaw Of Continuity: Experiments should be reproducible.  They \nshould all fail in the same way.','619b383cc9e8e0a863e0053695ac41994b49cd29',45561),(7908,'\n\"Ask her to wait a moment - I am almost done.\"\n -- Carl Friedrich Gauss (1777-1855), while working, when \n    informed that his wife is dying','625189e3c9846108d6000dafe00202479ff36bb7',36879),(7909,'\n\"Liberty and democracy become unholy when their hands are dyed\n red with innocent blood.\" -- Mahatma Gandhi','625189e3c9846108d6000dafe00202479ff36bb7',43080),(7910,'\n\"All truth passes through three stages. First, it is ridiculed. \n Second, it is violently opposed. Third, it is accepted as being \n self-evident.\"\n -- Arthur Schopenhauer (1788-1860)','648217e9f07c6883cce281035b7c5f20eea97398',36879),(7911,'\n\"When I told the people of Northern Ireland that I was an\n atheist, a woman in the audience stood up and said, \'Yes, but\n is it the God of the Catholics or the God of the Protestants in\n whom you don\'t believe?\'\"\n -- Quentin Crisp','648217e9f07c6883cce281035b7c5f20eea97398',35658),(7912,'\n\"Without requirements or design, programming is the art of\n adding bugs to an empty text file.\" -- Louis Srygley','6771f19fca37571e48852af1573f213a8ec530ae',44944),(7913,'\n\"God, please save me from your followers!\"\n -- Bumper Sticker','6771f19fca37571e48852af1573f213a8ec530ae',42471),(7914,'\n\"Men are not disturbed by things, but the view they take of \n things.\" -- Epictetus (55-135 A.D.)\n\n\"What about things like bullets?\"\n -- Herb Kimmel, Behavioralist, Professor of Psychology, upon \n    hearing the above quote (1981)','680689e32a700cd14482c70abf62182a6eef6933',44944),(7915,'\n\"Our government has kept us in a perpetual state of fear, kept\n us in a continuous stampede of patriotic fervor, with the cry\n of grave national emergency. Always there has been some\n terrible evil at home or some monstrous foreign power that was\n going to gobble us up if we did not blindly rally behind it.\"\n -- General Douglas MacArthur','680689e32a700cd14482c70abf62182a6eef6933',45090),(7916,'\n\"It is dangerous to be right when the government is wrong.\"\n -- Voltaire','6af02fe4285827f3bb09d52875f71dfa026d21f1',44127),(7917,'\n\"Genius may have its limitations, but stupidity is not thus \n handicapped.\" -- Elbert Hubbard','6af02fe4285827f3bb09d52875f71dfa026d21f1',35941),(7918,'\n\"Experience is what you get when you were expecting something\n else.\"','6c95fbde6582435f56d7aa1f752fc5dba455ab25',31913),(7919,'\n\"Vincit qui patitur: he conquers, who endures\"\n- Percy Cerutty','6c95fbde6582435f56d7aa1f752fc5dba455ab25',43599),(7920,'\n\"Disobedience is the true foundation of liberty. The obedient\n must be slaves.\"\n -- Henry David Thoreau','6c9f0d510e20752a512fc016f67e29b7bd4e4583',35941),(7921,'\n\"Let\'s be very honest about what this is about. It\'s not about\n bashing Democrats, it\'s not about taxes, they have no idea what\n the Boston tea party was about, they don\'t know their history\n at all. This is about hating a black man in the White House.\n This is racism straight up.\" -- Janeane Garofalo ','6c9f0d510e20752a512fc016f67e29b7bd4e4583',43080),(7922,'\n\"Cast aside those who liken godliness to whimsy and who try to\n combine their greed for wealth with their desire for a happy\n afterlife.\"\n -- Kahlil Gibran','6d07214f3f2718dfb5e72a6cd0b84f0b6aa17fca',45253),(7923,'\n\"The Bible was a consolation to a fellow alone in the old cell. \n The lovely thin paper with a bit of matress stuffing in it, if \n you could get a match, was as good a smoke as I ever tasted.\" \n -- Brendan Behan.','6d07214f3f2718dfb5e72a6cd0b84f0b6aa17fca',44281),(7924,'\n\"Pardon him, Theodotus; he is a barbarian, and thinks that the \n customs of his tribe and island are the laws of nature.\" \n -- George Bernard Shaw','6d438f23010203dfe40bfec8034252e1450aa29f',39809),(7925,'\n\"Usenet is like a herd of performing elephants with diarrhea\n -- massive, difficult to redirect, awe-inspiring, entertaining, \n and a source of mind-boggling amounts of excrement when you \n least expect it.\" -- Gene Spafford','6d438f23010203dfe40bfec8034252e1450aa29f',35950),(7926,'\n\"The people that I have met are not foolish; they are aware of how\ntired and cold and hungry and frightened and hurting and discouraged\nand disoriented and how possibly injured they will become. They know\nthey will face great physical, mental, emotional, and possibly\nspiritual challenges as they make their way to the finish. This is\nwhat they are racing against. This is their challenge. This is what\nI admire.\"\n- Carolyn Erdman','6f541181bc282c67714f06143a01ab66dc16a797',42471),(7927,'\n\"If I can see it, I can run to it.\"\n- Randi Bromka Young','6f541181bc282c67714f06143a01ab66dc16a797',32929),(7928,'\n\"Copy and paste is a design error\" -- David Parnas','7072c31ed58b3a21bbf880c206802aa5221eecfb',64),(7929,'\n\"Chaos is found in greatest abundance wherever order is being\n sought. It always defeats order, because it is better organized.\"\n -- Terry Pratchett (Interesting Times) ','7072c31ed58b3a21bbf880c206802aa5221eecfb',35658),(7930,'\n\"I\'ve finally learned what \"upward compatible\" means. It means\n we get to keep all our old mistakes.\" -- Dennie van Tassel','711b588abd03a7e210db390c9b84d5dd48a76324',32929),(7931,'\n\"The Six Phases of a Project:\"\n   o Enthusiasm\n   o Disillusionment\n   o Panic\n   o Search for the Guilty\n   o Punishment of the Innocent\n   o Praise for non-participants\"','711b588abd03a7e210db390c9b84d5dd48a76324',35941),(7932,'\n\"If you need more than five lines to prove something, then you \n are on the wrong track\" \n -- Edgser W. Dijkstra\'s mother [ibid, p. 55]','750f9752773f285d684288c7a829ef559253b9dc',43599),(7933,'\n\"I have met my hero, and he is me.\"\n- George Sheehan','750f9752773f285d684288c7a829ef559253b9dc',43599),(7934,'\n\"I remain convinced that obstinate addiction to ordinary language\n in our private thoughts is one of the main obstacles to progress\n in philosophy.\" -- Bertrand Russell','75abd509ac8041846187148ea7b4047bc78d37bd',35950),(7935,'\n\"War: first, one hopes to win; then one expects the enemy to\n lose; then, one is satisfied that he too is suffering; in the\n end, one is surprised that everyone has lost.\"\n -- Karl Kraus','75abd509ac8041846187148ea7b4047bc78d37bd',45881),(7936,'\n\"The use of anthropomorphic terminology when dealing with \n computing systems is a symptom of professional immaturity.\"\n -- Edsger Dijkstra','780fe20f181a3869d0af8555517d1e6ca8e277c9',43599),(7937,'\n\"I didn\'t attend the funeral, but I sent a nice letter saying I \n approved of it.\" -- Mark Twain','780fe20f181a3869d0af8555517d1e6ca8e277c9',34631),(7938,'\n\"If it were all so simple! If only there were evil people\n somewhere insidiously committing evil deeds, and it were\n necessary only to separate them from the rest of us and destroy\n them; but the line dividing good and evil cuts through the\n heart of every human being. And who is willing to destroy a\n piece of his own heart?\"\n -- Aleksandr Solzhenitsyn','786f43a1d50ea25ab6aa9d35e5e91ba9847caa19',43599),(7939,'\n\"Victory goes to the player who makes the next-to-last mistake.\"\n-- Chessmaster Savielly Grigorievitch Tartakower (1887-1956)','786f43a1d50ea25ab6aa9d35e5e91ba9847caa19',45253),(7940,'\n\"The nice thing about egotists is that they don\'t talk about \n other people.\" -- Lucille S. Harper','79ac8f376d07e600d8519aa46a40c84133ea5f22',35658),(7941,'\nLynch\'s Law: When the going gets tough, everyone leaves.','79ac8f376d07e600d8519aa46a40c84133ea5f22',32929),(7942,'\n\"Do not seek to follow in the footsteps of the wise. Seek what\n they sought.\"\n -- Basho','7b04e24cd3560a03075d5c12b889a869cee82470',45253),(7943,'\n\"So I was in my car, and I was driving along, and my boss rang up\n and he said \'You\'ve been promoted\'. And I swerved.\n And then he rang up a second time and said \'You\'ve been promoted\n again\'. And I swerved again.\n He rang up a third time and said \'You\'re managing director.\' \n And I went into a tree.\n And a policeman came up and said \'What happened to you?\'\n And I Said \'I careered off the road.\'\" -- Tommy Cooper','7ca869dfd62c7a47cfb46be390e8b35315b74c57',35941),(7944,'\n\"If English was good enough for Jesus, it\'s good enough for\n them Mexicans.\"\n -- Texas politician, Spanish as a second language','7ca869dfd62c7a47cfb46be390e8b35315b74c57',45883),(7945,'\n\"Not everything that can be counted counts, and not everything \n that counts can be counted.\" -- Albert Einstein ','7ce4b1ceb5d18c9cef085ae199ece90f8b19d124',43599),(7946,'\n\"To eat well in England, you should have breakfast three times \n a day.\" -- W. Somerset Maugham, 1925','7ce4b1ceb5d18c9cef085ae199ece90f8b19d124',45881),(7947,'\n\"Nothing beats experience.\"\n- Unknown','7dc0aa810e80b3e4f82035e4cbfff2067cd47adb',44281),(7948,'\n\"Start slow, then taper off\".\n- Walt Stack','7dc0aa810e80b3e4f82035e4cbfff2067cd47adb',45253),(7949,'\n\"They never open their mouths without subtracting from the \n sum of human knowledge.\" -- Thomas Brackett Reed','7de11f846de57f13f1bb8576ffabf4a8a5b7cb47',45449),(7950,'\n\"The degree of one\'s emotion varies inversely with one\'s\n knowledge of the facts. The less you know, the hotter you get.\"\n -- Bertrand Russel','7de11f846de57f13f1bb8576ffabf4a8a5b7cb47',31913),(7951,'\n\"Haste is of the devil. Slowness is of God.\" -- H L Mencken','7e7eb2d6d836e02fa81b2ceeeac18ad05d1da6e8',64),(7952,'\n\"Fill what\'s empty, empty what\'s full, and scratch where it \n itches.\" -- the Duchess of Windsor, when asked what is the \n             secret of a long and happy life','7e7eb2d6d836e02fa81b2ceeeac18ad05d1da6e8',33738),(7953,'\n\"We are condemned to kill time: thus we die bit by bit.\"\n -- Octavio Paz','80cc3ab97a5b0977b051895f76c0ef8a13a3c40e',45253),(7954,'\n\"If the United Nations once admits that international disputes \n can be settled by using force, then we will have destroyed the \n foundation of the organization and our best hope of establishing \n a world order.\" -- Dwight D. Eisenhower ','80cc3ab97a5b0977b051895f76c0ef8a13a3c40e',43599),(7955,'\n\"It\'s not the beginning or the end of a race that counts, It\'s what\nhappens in between.\"\n- Unknown','83ba3544556062724da2be0f01640ed9ead4325e',45090),(7956,'\n\"Ask her to wait a moment - I am almost done.\"\n -- Carl Friedrich Gauss (1777-1855), while working, when \n    informed that his wife is dying','83ba3544556062724da2be0f01640ed9ead4325e',33738),(7957,'\n\"Guard against the impostures of pretended patriotism.\"\n -- George Washington','83f44c8e69a8eb128a552fb6a5da7945d488cf3f',43599),(7958,'\n\"Asswhole = a complete ass\" -- John McTaggart in bpot','83f44c8e69a8eb128a552fb6a5da7945d488cf3f',45449),(7959,'\n\"When you\'ve seen one non-sequitur, the price of tea in China.\"','8634355180f8ebd819b66dc59bf89118df5f8920',34631),(7960,'\n\"If a scholar aspires to the Way but is ashamed of bad clothes\n and bad food, he isn\'t ready to join the discussion yet.\"\n -- Confucius','8634355180f8ebd819b66dc59bf89118df5f8920',45253),(7961,'\n\"I read about an Eskimo hunter who asked the local missionary\n priest, \'If I did not know about God and sin, would I go to\n hell?\' \'No,\' said the priest, \'not if you did not know.\' \'Then\n why,\' asked the Eskimo earnestly, \'did you tell me?\'\"\n -- Annie Dillard','86698c2e1965bc0c2caeaf3f0b34c0bd8236ca13',44281),(7962,'\n\"The use of COBOL cripples the mind; its teaching should, \n therefore, be regarded as a criminal offense.\"\n -- Edsger Dijkstra','86698c2e1965bc0c2caeaf3f0b34c0bd8236ca13',33738),(7963,'\n\"In America everybody is of the opinion that he has no social\n superiors, since all men are equal, but he does not admit that\n he has no social inferiors, for, from the time of Jefferson\n onward, the doctrine that all men are equal applies only\n upwards, not downwards.\" -- Bertrand Russell','86a36000f42660dc4f9370e56ad207e6d725d619',43599),(7964,'\n\"No one can earn a million dollars honestly.\"\n -- William Jennings Bryan (1860-1925)','86a36000f42660dc4f9370e56ad207e6d725d619',39809),(7965,'\n\"A scholar who cherishes the love of comfort is not fit to be \n deemed a scholar.\" -- Lao-Tzu (570?-490? BC)','87d6a08ed0e53654307a44a0da13be58aadfcfd9',44944),(7966,'\n\"I must confess, I was born at a very early age.\"\n -- Groucho Marx','87d6a08ed0e53654307a44a0da13be58aadfcfd9',35658),(7967,'\nOliver\'s Law Of Location: No matter where you are, there you are.','898f25432759d32e7d34be92e72c1f71f75e3dbe',33738),(7968,'\n\"Our scientific power has outrun our spiritual power. We have\n guided missiles and misguided men.\"\n -- Martin Luther King, Jr.','898f25432759d32e7d34be92e72c1f71f75e3dbe',31909),(7969,'\n\"Perl is another example of filling a tiny, short-term need, and\n then being a real problem in the longer term.\" -- Alan Kay','8d7391e8d11a925e700a9b962c1638c081fe427d',44944),(7970,'\n\"Not even computers will replace committees, because committees \n buy computers.\" -- Unknown','8d7391e8d11a925e700a9b962c1638c081fe427d',31909),(7971,'\n\"640K ought to be enough for anybody.\"\n -- Bill Gates (1955-), in 1981','8da4b8077832992c9d4598e23b5da2ec7dfbdce2',43080),(7972,'\n\"In matters of conscience, the law of majority has no place.\"\n -- Mohandas Gandhi','8da4b8077832992c9d4598e23b5da2ec7dfbdce2',42471),(7973,'\n\"Logic is in the eye of the logician.\"\n -- Gloria Steinem','8ee2538bee2524ca5df1146cfcf8e9ab8e651151',36757),(7974,'\n\"The best time I ever had with Joan Crawford was when I pushed \n her down the stairs in \'Whatever Happened to Baby Jane?\'\"\n -- Bette Davis','8ee2538bee2524ca5df1146cfcf8e9ab8e651151',39809),(7975,'\nConway\'s Law: In any organization there will always be one person \nwho knows what is going on.  This person must be fired.','916163bf91f3934b1cec3b452e310195b598ec94',42471),(7976,'\n\"A single death is a tragedy, a million deaths is a statistic.\"\n -- Joseph Stalin.','916163bf91f3934b1cec3b452e310195b598ec94',45253),(7977,'\n\"To err is human - and to blame it on a computer is even more so.\"\n -- Robert Orben','9655d6b5c465af7ffe2143181c3537664a02e474',42471),(7978,'\n\"I have an existential map; it has \'you are here\' written all \n over it.\" -- Steven Wright','9655d6b5c465af7ffe2143181c3537664a02e474',64),(7979,'\n\"The chain reaction of evil -- wars producing more wars -- must\n be broken, or we shall be plunged into the dark abyss of \n annihilation.\" -- Martin Luther King, Jr.','989d8ff87cb16ca054d12151c04371f8b9493206',42471),(7980,'\n\"Never forget that everything Hitler did in Germany was legal.\"\n -- Martin Luther King, Jr.','989d8ff87cb16ca054d12151c04371f8b9493206',35658),(7981,'\n\"When ideas fail, words come in very handy.\" -- Goethe (1749-1832)','98e2d0dde052c9c6ae9de3ce8f5b6a543714b50f',45881),(7982,'\n\"The reasonable man adjusts himself to the world, the\n unreasonable one persists in trying to adapt the world to\n himself; therefore all progress depends on the unreasonable\n man.\"\n -- George Bernard Shaw','9b167f20d855b3d33fa8877a17dea0898be590e1',44944),(7983,'\n\"To eat well in England, you should have breakfast three times \n a day.\" -- W. Somerset Maugham, 1925','9b167f20d855b3d33fa8877a17dea0898be590e1',35941),(7984,'\n\"The best way to make children good is to make them happy.\"\n -- Oscar Wilde','9f26a7e30c11faa76d3172144c94f8d0bb891cf6',33738),(7985,'\n\"Money is better than poverty, if only for financial reasons.\"\n -- Woody Allen, From \'Without Feathers\' 1976.','9f26a7e30c11faa76d3172144c94f8d0bb891cf6',45449),(7986,'\n\"Multitasking /adj./ 3 PCs and a chair with wheels !\" -- unknown','9fcc0b7f8781c1ee989290996e08e20c84a7b80b',45883),(7987,'\n\"Don\'t stay in bed, unless you can make money in bed.\"\n -- George Burns (1896-1996)','9fcc0b7f8781c1ee989290996e08e20c84a7b80b',42471),(7988,'\n\"You can only find truth with logic if you have already found \n truth without it.\" -- Gilbert Keith Chesterton (1874-1936)','a095bdda62efcc85c40ac0da068651be98671ef8',35952),(7989,'\n\"Rules of Optimization:\n Rule 1: Don\'t do it.\n Rule 2 (for experts only): Don\'t do it yet.\"\n -- M.A. Jackson','a095bdda62efcc85c40ac0da068651be98671ef8',36879),(7990,'\nGoebel\'s Law Of Computer Support: Troubleshooting a computer over \nthe telephone is like having sex through a hole in a board fence. \nIt can be done but it is neither EASY nor PLEASANT.','a2996f06709eec814cf3d144e7c505baa7cab557',33738),(7991,'\n\"A celibate clergy is an especially good idea, because it tends\n to suppress any hereditary propensity toward fanaticism.\"\n -- Carl Sagan','a2996f06709eec814cf3d144e7c505baa7cab557',35658),(7992,'\n\"You can know the name of a bird in all the languages of the \n world, but when you\'re finished, you\'ll know absolutely nothing\n whatever about the bird... So let\'s look at the bird and see\n what it\'s doing -- that\'s what counts. I learned very early \n the difference between knowing the name of something and knowing\n something.\" -- Richard Feynman','a2ffb430dc6da035c54b7bcf1991e1f382203f7e',45881),(7993,'\n\"Moving parts in rubbing contact require lubrication to avoid \n excessive wear. Honorifics and formal politeness provide the\n lubrication where people rub together. Often the very young,\n the untraveled, the naive, the unsophisticated deplore these\n formalities as \"empty,\" \"meaningless,\" or \"dishonest,\" and \n scorn to use them. No matter how \"pure\" their motives, they\n thereby throw sand into machinery that does not work too well\n at best.\" -- Robert A. Heinlein','a2ffb430dc6da035c54b7bcf1991e1f382203f7e',45561),(7994,'\n\"You guys just shuffle from concession stand to concession stand!\"\n- Helge Zimmet, said to Karen Claire at Way Too Cool','a4c9938952fd8e330f9a6d3972c82e158997e9e6',35952),(7995,'\n\"A man\'s ethical behavior should be based effectually on\n sympathy, education, and social ties and needs; no religious\n basis is necessary. Man would indeed be in a poor way if he had\n to be restrained by fear of punishment and hope of reward after\n death.\"\n -- Albert Einstein','a4c9938952fd8e330f9a6d3972c82e158997e9e6',43599),(7996,'\n\"Last is just the slowest winner.\"\n- C. Hunter Boyd','a4d131091f450ece35bde8a49ffaa44caa76a09a',43348),(7997,'\n\"A clever man commits no minor blunders.\"\n -- Goethe (1749-1832)','a4d131091f450ece35bde8a49ffaa44caa76a09a',45883),(7998,'\n\"Absence of evidence is not evidence of absence.\"\n-- Source Unknown','a4f9accf9c91e29d8df9036160301f37dc3982c0',44127),(7999,'\n\"They said I was the greatest pitcher they ever saw; I couldn\'t\n understand why they couldn\'t give me no justice.\"\n -- Satchel Paige','a4f9accf9c91e29d8df9036160301f37dc3982c0',43348),(8000,'\n\"The concept is interesting and well-formed, but in order to \n earn better than a \'C\', the idea must be feasible.\"\n -- A Yale University management professor in response to student\n    Fred Smith\'s paper proposing reliable overnight delivery \n    service (Smith went on to found Federal Express Corp.)','a5882a0c4a35ea01edb5ab5385d552cac5e4d677',36757),(8001,'\n\"All things in moderation.\"\n- Unknown','a5882a0c4a35ea01edb5ab5385d552cac5e4d677',35952),(8002,'\n\"I distrust those people who know so well what God wants them\n to do because I notice it always coincides with their own\n desires.\"\n -- Susan B. Anthony','a64274d1f7ed85fbe10e39b3ccd4296045603da6',44403),(8003,'\n\"The total absence of humor in the Bible is one of the most\n singular things in all literature.\"\n -- Alfred North Whitehead','a64274d1f7ed85fbe10e39b3ccd4296045603da6',44944),(8004,'\n\"Whoever controls the media, the images, controls the culture.\"\n -- Allen Ginsberg','a65e6ea5b3700abb50fd9e392de5d2da7bf9d4a4',43599),(8005,'\nGordon\'s First Law: If a research project is not worth doing at \nall, it is not worth doing well.','a65e6ea5b3700abb50fd9e392de5d2da7bf9d4a4',35950),(8006,'\n\"At some point it doesn\'t get any worse.\"\n- Unknown','a72a40f955773edda5a81a0ca88c2bb0a0bfc7a3',35658),(8007,'\n\"Radioactive cats have 18 half-lives.\"','a72a40f955773edda5a81a0ca88c2bb0a0bfc7a3',42471),(8008,'\n\"If you think it\'s simple, then you have misunderstood the \n problem.\" -- Bjarne Stroustrup [lecture at Temple U., 11/25/97]','a74846639071d43091d814937584cb8fe7963192',44281),(8009,'\nHarp\'s Corollary To Estridge\'s Law: Your \"IBM PC-compatible\" \ncomputer grows more incompatible with every passing moment.','a74846639071d43091d814937584cb8fe7963192',39809),(8010,'\n\"For every complex problem there is an answer that is clear,\n simple, and wrong.\" -- H L Mencken','a79141fe15a713226c2e84697e0d6c2217172524',35950),(8011,'\n\"I\'d give my right arm to be ambidextrous.\" -- Brian Kernighan','a79141fe15a713226c2e84697e0d6c2217172524',36879),(8012,'\n\"Politics is war without bloodshed while war is politics with\n bloodshed.\"\n -- Mao Tse Tung\n	\n When a stupid man is doing something he is ashamed of, he\n always declares that it is his duty.\"\n -- George Bernard Shaw','a923fed24b4f2967debe2b9f11698e9c31980e9c',43348),(8013,'\n\"Object-oriented programming is a style of programming designed \n to teach students about stacks.\" -- Edsger Dijkstra','a923fed24b4f2967debe2b9f11698e9c31980e9c',45449),(8014,'\n\"Only a fool tests the depth of the water with both feet.\"\n -- African proverb','aab02e9c9bcf3664cebd0a9c32b633c518af7314',35952),(8015,'\n\"You ask me if I keep a notebook to record my great ideas. I\'ve \n only ever had one.\" -- Albert Einstein.','aab02e9c9bcf3664cebd0a9c32b633c518af7314',34631),(8016,'\n\"Been there, done that, don\'t need to do it again.\"\n- Unknown','aab10d229a1280f85e8176ee16023d33280e7ab7',45881),(8017,'\n\"The compulsion to do good is an innate American trait. Only\n North Americans seem to believe that they always should, may,\n and actually can choose somebody with whom to share their\n blessings. Ultimately this attitude leads to bombing people\n into the acceptance of gifts.\"\n -- Ivan Illich','aab10d229a1280f85e8176ee16023d33280e7ab7',45449),(8018,'\n\"I suppose that it takes a $1000/hour lawyer to write contracts\n that a $250/hour lawyer cannot find holes in. \n -- John Herbster in b.p.d.non-technical','abb7aaaaca1e6c3a51070ebfe1e20917728f5bf6',43346),(8019,'\n\"Maybe there is no actual place called hell. Maybe hell is just \n having to listen to our grandparents breathe through their noses\n when they\'re eating sandwiches.\" -- Jim Carrey.','abb7aaaaca1e6c3a51070ebfe1e20917728f5bf6',31913),(8020,'\n\"We must question the story logic of having an all-knowing\n all-powerful God, who creates faulty humans, and then blames\n them for his own mistakes.\"\n -- Gene Roddenberry','ac22e8aa7d428eb41cd4e03fd5bec2afa51b3b9a',64),(8021,'\n\"Pardon him, Theodotus; he is a barbarian, and thinks that the \n customs of his tribe and island are the laws of nature.\" \n -- George Bernard Shaw','ac22e8aa7d428eb41cd4e03fd5bec2afa51b3b9a',45090),(8022,'\n\"Object-oriented programming is an exceptionally bad idea which\n could only have originated in California.\" -- Edsger Dijkstra','acfd9d1c8d8474d6072d856214f118efeb2e425b',35952),(8023,'\n\"Anything that is too stupid to be spoken is sung.\"\n -- Voltaire (1694-1778)','acfd9d1c8d8474d6072d856214f118efeb2e425b',35658),(8024,'\n\"Sex is like a Chinese dinner. It isn\'t over until everyone gets\n their cookies.\" -- from the movie \"Outside Providence\"','ada27e5f9340b2c8713ce61b466bf1e422dbdf1c',35658),(8025,'\n\"One of the main causes of the fall of the Roman Empire was that, \n lacking zero, they had no way to indicate successful termination\n of their C programs.\" -- Robert Firth','ada27e5f9340b2c8713ce61b466bf1e422dbdf1c',42471),(8026,'\n\"My humble friend, we know not how to live this life which is\n so short yet seek one that never ends.\"\n -- Anatole France','ada6ca3cfb4aed0fc3a524aa108d147f4786d14e',45253),(8027,'\n\"Democracy used to be a good thing, but now it has gotten into\n the wrong hands.\"\n -- Jessie Helms','ada6ca3cfb4aed0fc3a524aa108d147f4786d14e',43599),(8028,'\n\"The world is a tragedy to those who feel, but a comedy to those\n who think.\" -- Horace Walpole (1717-1797)','adb73dae576eeb8e2819baa713cd8d99d203b140',35658),(8029,'\n\"If you live long enough, you\'ll see that every victory turns \n into a defeat.\" -- Simone de Beauvoir','adb73dae576eeb8e2819baa713cd8d99d203b140',35952),(8030,'\n\"If you want to play the game you have to train.\"\n- Unknown','ae504127be4fdbd5a07adb43505b306ec4f867dc',64),(8031,'\n\"Let\'s be very honest about what this is about. It\'s not about\n bashing Democrats, it\'s not about taxes, they have no idea what\n the Boston tea party was about, they don\'t know their history\n at all. This is about hating a black man in the White House.\n This is racism straight up.\" -- Janeane Garofalo ','ae504127be4fdbd5a07adb43505b306ec4f867dc',36757),(8032,'\n\"I hope life isn\'t a big joke ... because I don\'t get it.\" \n -- Unknown','af0e32cd5b7c1b8bb674596d11d3abdcb1333263',43346),(8033,'\n\"Battling to maintain the delicate balance between hyperfitness and physical collapse.\"\n- Megan Liberman, submitted by Mark Ryne\n\"Pain is a wonderful thing and now I was feeling wonderful, really wonderful!!!\"\n- Unknown trail runner on Mt. Baldy, submitted by Mark Ryne\n\"Is this level of athletic competition the ultimate distraction from real life?\nOr is it a form of prayer?\"\n- Norah Vincent on the Olympics, submitted by Mark Ryne','af0e32cd5b7c1b8bb674596d11d3abdcb1333263',33738),(8034,'\n\"I think it would be a good idea.\"\n -- Mahatma Gandhi (1869-1948), when asked what he thought of \n    Western civilization','af4397b920da71be269858c316f4786b3c5205fd',45449),(8035,'\n\"Computer /nm./: a device designed to speed and automate errors.\"\n -- From the Jargon File. ','af4397b920da71be269858c316f4786b3c5205fd',43346),(8036,'\n\"You guys just shuffle from concession stand to concession stand!\"\n- Helge Zimmet, said to Karen Claire at Way Too Cool','af4cf8e017a4b2dfe3ed405c789fab3c5c026b85',39809),(8037,'\n\"As nightfall does not come at once, neither does oppression. In \n both instances, there is a twilight when everything remains \n unchanged. And it is in such twilight that we all must be most\n aware of change in the air - however slight - lest we become\n unwitting victims of the darkness.\" \n -- Supreme Court Justice William O. Douglas','af4cf8e017a4b2dfe3ed405c789fab3c5c026b85',34631),(8038,'\n\"Total absence of humor renders life impossible.\"\n -- Colette (1873-1954), Chance Acquaintances, 1952','b179ca68adfd62fbd9d8956132a80f1