6',45090),(8050,'\n\"The best thing about a boolean is even if you are wrong, you \n are only off by a bit.\"','b53209f0e4d2b2335d726e4e381511d59d22a31f',32929),(8051,'\n\"Invisible Pink Unicorns are beings of awesome mystical power.\n We know this because they manage to be invisible and pink at\n the same time. Like all religions, the Faith of the Invisible\n Pink Unicorns is based upon both logic and faith. We have faith\n that they are pink; we logically know that they are invisible\n because we can\'t see them.\"\n -- Steve Eley','b53209f0e4d2b2335d726e4e381511d59d22a31f',44281),(8052,'\n\"I once heard two ladies going on and on about the pains of \n childbirth and how men don\'t seem to know what real pain is. I \n asked if either of them ever got themselves caught in a zipper.\" \n -- Emo Philips.','b5d51df3594cd812f73f77f142ef2acabb704b8d',36757),(8053,'\n\"Incorrect documentation is often worse than no documentation.\"\n -- Bertrand Meyer','b5d51df3594cd812f73f77f142ef2acabb704b8d',44944),(8054,'\n\"You never really learn to swear until you learn to drive.\"','b6f0a056211a157077866aabbf0737e3213eb6fa',43348),(8055,'\n\"Jehovah was not a moral god. He had all the vices and he\n lacked all the virtues. He generally carried out all his\n threats, but he never faithfully kept a promise.\"\n -- Robert G. Ingersoll','b6f0a056211a157077866aabbf0737e3213eb6fa',44127),(8056,'\n\"Behind every successful man is a woman, behind her is his wife.\"\n -- Groucho Marx','bb7a7707e3a8cc9ea070b8cc298766fef36b9db2',31913),(8057,'\n\"I don\'t know anything about music. In my line you don\'t have \n to.\" -- Elvis Presley (1935-1977)','bb7a7707e3a8cc9ea070b8cc298766fef36b9db2',43348),(8058,'\n\"I have often regretted my speech, never my silence.\"\n -- Xenocrates (396-314 B.C.)','bec39bfbd42867d3e7e466ca02936ee2980dd7b3',32929),(8059,'\n\"Beware the man of one book.\"\n -- Saint Thomas Aquinas','bec39bfbd42867d3e7e466ca02936ee2980dd7b3',33738),(8060,'\n\"We must question the story logic of having an all-knowing\n all-powerful God, who creates faulty humans, and then blames\n them for his own mistakes.\"\n -- Gene Roddenberry','bff768c7aea91be241e873f1e10704cf27740f19',35950),(8061,'\n\"He\'d noticed that sex bore some resemblance to cookery: it \n fascinated people, they sometimes bought books full of \n complicated recipes and interesting pictures, and sometimes when \n they were really hungry they created vast banquets in their \n imagination - but at the end of the day they\'d settle quite \n happily for egg and chips. If it was well done and maybe had a \n slice of tomato.\"\n -- Terry Pratchett (The Fifth Elephant) ','bff768c7aea91be241e873f1e10704cf27740f19',44127),(8062,'\n\"Good programmers use their brains, but good guidelines save us\n having to think out every case.\" -- Francis Glassborow','c2a9ffed2e98e1338ca4baf839efcede3422d908',35952),(8063,'\n\"There are perhaps 5% of the population that simply *can\'t* think.\n There are another 5% who *can*, and *do*.\n The remaining 90% *can* think, but *don\'t*.\" -- Robert A. Heinlein','c2a9ffed2e98e1338ca4baf839efcede3422d908',45881),(8064,'\n\"In ancient times cats were worshipped as gods; they have not \n forgotten this.\"\n -- Terry Pratchett','c2c7fa4db91139d3fa622d1a44534f6a946cdf20',35941),(8065,'\n\"In the End, we will remember not the words of our enemies, but \n the silence of our friends.\"\n -- Martin Luther King Jr. (1929-1968)','c2c7fa4db91139d3fa622d1a44534f6a946cdf20',35952),(8066,'\n\"Everyone is a genius at least once a year; a real genius has his \n original ideas closer together.\"\n -- Georg Lichtenberg (1742-1799)','c45a45509a5a8d739d145c57a9c5caf453acae1a',35950),(8067,'\n\"The cry has been that when war is declared, all opposition \n should be hushed. A sentiment more unworthy of a free country \n could hardly be propagated.\" -- William Ellery Channing','c45a45509a5a8d739d145c57a9c5caf453acae1a',33738),(8068,'\n\"Whenever I hear anyone arguing for slavery, I feel a strong\n impulse to see it tried on him personally.\"\n -- Abraham Lincoln','c8100d48da5ddda1fc7fd1b2b68da3208a5ecbc5',44127),(8069,'\n\"The chain reaction of evil -- wars producing more wars -- must\n be broken, or we shall be plunged into the dark abyss of \n annihilation.\" -- Martin Luther King, Jr.','c8100d48da5ddda1fc7fd1b2b68da3208a5ecbc5',35950),(8070,'\n\"What sane person could live in this world and not be crazy?\"\n -- Ursula K. LeGuin','c89d8ef5e8b870c3285ec4a51c732c5459bc72e8',44281),(8071,'\n\"Nine out of ten doctors agree that one out of ten doctors is \n an idiot.\"','c89d8ef5e8b870c3285ec4a51c732c5459bc72e8',45561),(8072,'\n\"The true measure of a man is how he treats someone who can do \n him absolutely no good.\" -- Samuel Johnson (1709-1784)','c8a055180587599139f8f454712dcc618cd1740e',35658),(8073,'\n\"Intellectuals solve problems; geniuses prevent them.\"\n -- Albert Einstein','c8a055180587599139f8f454712dcc618cd1740e',45449),(8074,'\n\"If there is no Hell, a good many preachers are obtaining money \n under false pretences.\" -- William Sunday.','c95ac6471fe1bd8d916a8ec79e4d14a108769a75',33738),(8075,'\n\"The fear of death is the most unjustified of all fears, for \n there\'s no risk of accident for someone who\'s dead.\" \n -- Albert Einstein.','c95ac6471fe1bd8d916a8ec79e4d14a108769a75',35952),(8076,'\n\"Man is the religious animal. He is the only religious animal.\n He is the only animal that has the True Religion, several of\n them. He is the only animal that loves his neighbor as himself\n and cuts his throat, if his theology isn\'t straight. He has\n made a graveyard of the globe in trying his honest best to\n smooth his brother\'s path to happiness and heaven.\"\n -- Mark Twain','ca02fe21eb58820de9bcc4d3162c2809d0e26ff9',45561),(8077,'\n\"I was asked to memorize what I did not understand; and, my\n memory being so good, it refused to be insulted in that\n manner.\"\n -- Aleister Crowley','ca02fe21eb58820de9bcc4d3162c2809d0e26ff9',39809),(8078,'\n\"Correctness is clearly the prime quality. If a system does not\n do what it is supposed to do, then everything else about it\n matters little.\" -- Bertrand Meyer','ca6f77a789692a03afd4a3f497cf10df168d3252',45090),(8079,'\n\"The longer I live the more I see that I am never wrong about \n anything, and that all the pains that I have so humbly taken \n to verify my notions have only wasted my time.\"\n -- George Bernard Shaw (1856-1950)','ca6f77a789692a03afd4a3f497cf10df168d3252',44127),(8080,'\n\"Someday man will imprison the power of the sun, release atomic\n power, and harness the rise and fall of the tides. I am proud\n of the fact that I never invented weapons to kill.\"\n -- Thomas Edison','cba0261d46db104901c232c86e3f77de6d6c3ea6',44127),(8081,'\n\"Tooth decay was a perennial national problem that meant a\n mouthful of silver for patients, and for dentists a pocketful\n of gold.\" -- Claudia Wallis ','cba0261d46db104901c232c86e3f77de6d6c3ea6',44127),(8082,'\n\"Runners can get through the weary and lonely hours only if they are at\npeace in themselves.\"\n- Ayers','cbf5231288281d4241e7fee67a522a404548c981',44944),(8083,'\n\"I think it would be a good idea.\"\n -- Mahatma Gandhi (1869-1948), when asked what he thought of \n    Western civilization','cbf5231288281d4241e7fee67a522a404548c981',43346),(8084,'\n\"I admire the Pope. I have a lot of respect for anyone who can \n tour without an album.\" -- Rita Rudner.','cda12b16d255dffa856cfdd01b26652a1f8e1abf',33738),(8085,'\n\"Acceptance without proof is the fundamental characteristic of\n Western religion, rejection without proof is the fundamental\n characteristic of Western science.\"\n -- Gary Zukav','cda12b16d255dffa856cfdd01b26652a1f8e1abf',31909),(8086,'\n\"Do you think we were supposed to turn back there?\"\n- Skip Eastman at Mackenzie River 50','cf95960f8e21d6967fa86c104aa69afa2c40dc97',32929),(8087,'\n\"If there was anything that depressed him more than his own \n cynicism, it was that quite often it still wasn\'t as cynical as \n real life.\"\n -- Terry Pratchett (Guards! Guards!) ','cf95960f8e21d6967fa86c104aa69afa2c40dc97',35941),(8088,'\n\"It is true that liberty, so precious, must be rationed.\"\n -- Nikolai Lenin','d1984582b6c2029154b497a7a4925ea640140894',35950),(8089,'\n\"If you pray for rain long enough, it eventually does fall. If\n you pray for floodwaters to abate, they eventually do. The same\n happens in the absence of prayers.\"\n -- Steve Allen','d1984582b6c2029154b497a7a4925ea640140894',42471),(8090,'\n\"If you give me six lines written by the hand of the most\n honest of men, I will find something in them which will hang\n him.\"\n -- Cardinal Richelieu','d27d8b762538b411484435f1a8808d44cb714146',43346),(8091,'\n\"My opinions may have changed, but not the fact that I am\n right.\"\n -- Ashleigh Brilliant','d27d8b762538b411484435f1a8808d44cb714146',45090),(8092,'\n\"In ultrarunning, the pain is inevitable, but the suffering is\noptional.\"\n- Al Bogenhuber','d29667fbb2ec302bdfa2c389db257aaaae519c25',35941),(8093,'\n\"Love: The warm feeling you get towards someone who meets your\n neurotic needs.\"','d29667fbb2ec302bdfa2c389db257aaaae519c25',32929),(8094,'\n\"Mr. Wagner has beautiful moments but bad quarters of an hour.\"\n    - Gioacchino Rossini (1792-1868)','d2b4e17be3302d20813f7079544af945d1061bd8',33738),(8095,'\n\"If cats looked like frogs we\'d realize what nasty, cruel little \n bastards they are. Style. That\'s what people remember.\"\n -- Terry Pratchett (Lords and Ladies) ','d2b4e17be3302d20813f7079544af945d1061bd8',44281),(8096,'\n\"The competent programmer is fully aware of the strictly limited\n size of his own skull; therefore he approaches the programming\n task in full humility, and among other things he avoids clever\n tricks like the plague.\" -- Edsger Dijkstra','d3aca5da8c0ca733da679a361bd364e2fef696f8',45253),(8097,'\nClarke\'s Third Law: Any sufficiently advanced technology is \nindistinguishable from magic.','d3aca5da8c0ca733da679a361bd364e2fef696f8',33738),(8098,'\n\"There are two ways of disliking poetry; one way is to \n dislike it, the other is to read Pope.\"\n -- Oscar Wilde on Alexander Pope','d56fe91441a94395b6e0c3143b75aa76c375c79e',39809),(8099,'\n\"Over the centuries, mankind has tried many ways of combating the forces\n of evil... prayer, fasting, good works and so on. Up until Doom, no one\n seemed to have thought about the double-barrel shotgun. Eat leaden\n death, demon...\"\n -- Terry Pratchett','d56fe91441a94395b6e0c3143b75aa76c375c79e',35950),(8100,'\n\"The citizen who sees his society\'s democratic clothes being\n worn out and does not cry it out, is not a patriot, but a\n traitor.\"\n -- Mark Twain','d574c24b623c1073a5b9a332b77a7ca39d4f4df4',34631),(8101,'\n\"The dangerous patriot ... is a defender of militarism and its\n ideals of war and glory.\"\n -- Colonel James A. Donovan, Marine Corps','d574c24b623c1073a5b9a332b77a7ca39d4f4df4',43346),(8102,'\n\"Most software today is very much like an Egyptian pyramid with\n millions of bricks piled on top of each other, with no \n structural integrity, but just done by brute force and thousands\n of slaves.\" -- Alan Kay','d725791f8b220c7df9749a8169d813d222e920fe',33738),(8103,'\n\"The worst crimes were dared by a few, willed by more and\n tolerated by all.\" -- Tacitus','d725791f8b220c7df9749a8169d813d222e920fe',45090),(8104,'\n\"When you hear hoofbeats, think of horses, not zebras.\"\n-- Old saying','d8826bbd80b4233b7522d1c538aeaf66c64e259a',35941),(8105,'\n\"Heaven is an American salary, a Chinese cook, an English house, \n and a Japanese wife. Hell is defined as having a Chinese salary,\n an English cook, a Japanese house, and an American wife.\"\n -- James H. Kabbler III.','d8826bbd80b4233b7522d1c538aeaf66c64e259a',36879),(8106,'\n\"An API that isn\'t comprehensible isn\'t usable.\" -- James Gosling','d8ad8dee8df9ae8428a5909e8700cdabe73ced24',31913),(8107,'\n\"Everybody\'s worried about stopping terrorism. Well, there\'s a\n really easy way; stop participating in it.\"\n -- Noam Chomsky','d8ad8dee8df9ae8428a5909e8700cdabe73ced24',36757),(8108,'\n\"So far as I can remember, there is not one word in the Gospels\n in praise of intelligence.\"\n -- Bertrand Russel','dabccf22e080c34c0d197aef7a70603f18847219',45883),(8109,'\n\"Do not seek to follow in the footsteps of the wise. Seek what\n they sought.\"\n -- Basho','db5675d9ff02708e9913aea5c52ae04ea97c3d71',35658),(8110,'\n\"UNIX is basically a simple operating system, but you have to be \n a genius to understand the simplicity.\" -- Dennis Ritchie.','db5675d9ff02708e9913aea5c52ae04ea97c3d71',35941),(8111,'\n\"When you are 99 miles into a 100-mile running race, your brain is not\nthe same brain you started with\".\n- Paul Huddle','dca2f08ff4c66b1203c8ddb32ef6477107943703',35950),(8112,'\n\"If you see a fork in the road, take it!\"\n- Yogi Berra','dca2f08ff4c66b1203c8ddb32ef6477107943703',42471),(8113,'\n\"We had gay burglars the other night. They broke in and rearranged\n the furniture.\" -- Robin Williams.','dd4caaf3e25495aceed13fb06768c4705820688a',45090),(8114,'\n\"Anyone who starts a sentence, \'With all due respect ...\'\n is about to insult you.\" -- unknown','dd4caaf3e25495aceed13fb06768c4705820688a',34631),(8115,'\n\"Men have become the tools of their tools.\"\n -- Henry David Thoreau (1817-1862)','e04483fa29ce2a62129c0e1624ac1b82fdd899e1',36757),(8116,'\n\"Military justice is to justice what military music is to music.\"\n -- Groucho Marx','e04483fa29ce2a62129c0e1624ac1b82fdd899e1',44403),(8117,'\n\"Total absence of humor renders life impossible.\"\n -- Colette (1873-1954), Chance Acquaintances, 1952','e0836e74406050605c9ed1d0fa4dc9474adc1f73',35950),(8118,'\n\"The same people that wrote the bible thought the world was\n flat.\"\n -- Unknown - (disputed)','e0836e74406050605c9ed1d0fa4dc9474adc1f73',35952),(8119,'\n\"To sit alone with my conscience will be judgment enough for me.\"\n -- Charles William Stubbs','e0b2d81c80b94799aeef126f990f48cdb5505bbc',34631),(8120,'\n\"It is a miracle that curiosity survives formal education.\" \n -- Albert Einstein','e0b2d81c80b94799aeef126f990f48cdb5505bbc',42471),(8121,'\n\"The 10-K is a race. The marathon is an experience. The ultra is an\nadventure.\"\n- Bryan Hacker','e1a89047db4bc61c961ad0424dd44a19b6d4cbe3',45253),(8122,'\n\"Once you\'ve written TBicycle, you never forget how.\"\n -- Oliver Townshend in b.p.d.n-t. ','e1a89047db4bc61c961ad0424dd44a19b6d4cbe3',44127),(8123,'\n\"It is the job of thinking people not to be on the side of the\n executioners.\" -- Albert Camus','e37a48cf1f5105f9d44f6f54baf6195ce9be8e14',43348),(8124,'\nFinagle\'s Rules:\n\n   1. To study an application best, understand it thoroughly \n      before you start.\n   2. Always keep a record of data. It indicates you\'ve been \n      working.\n   3. Always draw your curves, then plot the reading.\n   4. In case of doubt, make it sound convincing.\n   5. Program results should always be reproducible. They should \n      all fail in the same way.\n   6. Do not believe in miracles. Rely on them.','e37a48cf1f5105f9d44f6f54baf6195ce9be8e14',45449),(8125,'\nLarkinson\'s Law: All laws are basically false.','e4a4a2ffad8ff5fed730a0790aad0700ed653fda',31913),(8126,'\n\"In science one tries to tell people, in such a way as to be \n understood by everyone, something that no one ever knew before. \n But in poetry, it\'s the exact opposite.\"\n -- Paul Dirac (1902-1984)','e5ceae329a2fab85c2a598dd538b4e73f6f98f1f',45561),(8127,'\n\"Cole\'s Law: Thinly sliced cabbage.\"','e5ceae329a2fab85c2a598dd538b4e73f6f98f1f',42471),(8128,'\n\"Everywhere I go I\'m asked if I think the university stifles \n writers. My opinion is that they don\'t stifle enough of them.\"\n -- Flannery O\'Connor (1925-1964)','e67ba4e63d1642be13a4e13cc2a28e6115cdf714',35658),(8129,'\n\"God, I must be crazy.\"\n- Unknown','e67ba4e63d1642be13a4e13cc2a28e6115cdf714',43348),(8130,'\n\"All great truths begin as blasphemies.\"\n -- George Bernard Shaw','e7df733cbacaabbd29e7806c1bbdb30ea8164b63',35658),(8131,'\n\"Pontius Pilate was the first great censor, and Jesus Christ\n the first great victim of censorship.\"\n -- Ben Lindsay','e7df733cbacaabbd29e7806c1bbdb30ea8164b63',32929),(8132,'\n\"No mention of God. They keep Him up their sleeves for as long as\n they can, vicars do. They know it puts people off.\" \n -- Alan Bennett.','e932ca6c157266ef281acc7252fec2e52a4867df',33738),(8133,'\n\"Love is the answer - but while you\'re waiting for the answer sex\n raises some pretty good questions.\" -- Woody Allen','e932ca6c157266ef281acc7252fec2e52a4867df',44281),(8134,'\n\"The crimes of the U.S. throughout the world have been\n systematic, constant, clinical, remorseless, and fully\n documented but nobody cares to talk about them.\"\n -- Harold Pinter','e95666ac68e82ea44cf6b1b7882c8d519e6e5c14',45883),(8135,'\n\"83.7% of all statistics are made up\" - Stephen Wright','e95666ac68e82ea44cf6b1b7882c8d519e6e5c14',42471),(8136,'\n\"Java: the elegant simplicity of C++ and the blazing speed of\n Smalltalk.\" -- Roland Turner','eb893c0ea7907618ccb316fd2e7aa6b10ff1ab6e',64),(8137,'\n\"Last is just the slowest winner.\"\n- C. Hunter Boyd','eb893c0ea7907618ccb316fd2e7aa6b10ff1ab6e',44944),(8138,'\n\"It\'s not the beginning or the end of a race that counts, It\'s what\nhappens in between.\"\n- Unknown','ecc79e00cb10b5be627e5d87c3466e363f2e3ba1',36879),(8139,'\nFinster\'s Law: A closed mouth gathers no feet.','ecc79e00cb10b5be627e5d87c3466e363f2e3ba1',39809),(8140,'\n\"My mother said to me, \"If you are a soldier, you will become a \n general. If you are a monk, you will become the Pope.\" Instead,\n I was a painter, and became Picasso.\" -- Pablo Picasso.','ed2a8e459aa7b82fac3820b6ce0502f05296cce8',44944),(8141,'\nWeinberg\'s Law: If builders built buildings the way programmers \nwrite programs, then the first woodpecker that came along would \ndestroy civilization.','ed2a8e459aa7b82fac3820b6ce0502f05296cce8',34631),(8142,'\n\"Behind every great fortune there is a crime.\"\n -- Honore de Balzac (1799-1850)','ef0fe7be2421dcd006fcd976852510ae34c67503',36879),(8143,'\n\"He who will not reason is a bigot; he who cannot is a fool;\n and he who dares not is a slave.\"\n -- William Drummond','ef0fe7be2421dcd006fcd976852510ae34c67503',44281),(8144,'\n\"Kindness is a mark of faith, and whoever has not kindness has\n not faith.\"\n -- Prophet Muhammad','efba2e3a199defca4f3115b2c81e2f9ae470dc97',35658),(8145,'\n\"You can pretend to be serious; you can\'t pretend to be witty.\"\n -- Sacha Guitry (1885-1957)','efba2e3a199defca4f3115b2c81e2f9ae470dc97',36757),(8146,'\n\"If electricity comes from electrons, does that mean that \n morality comes from morons?\" -- Unknown','f07719b68ead188c19a737e1870f2594cd05903b',45883),(8147,'\n\"I contend that we are both atheists. I just believe in one\n fewer god than you do. When you understand why you dismiss all\n the other possible gods, you will understand why I dismiss\n yours.\"\n -- Stephen Roberts','f07719b68ead188c19a737e1870f2594cd05903b',44944),(8148,'\n\"Analyzing humor is like dissecting a frog. Few people are \n interested and the frog dies of it.\" \n -- E. B. White (1899-1985)','f0fc9226beb514b84dc732b6ce53b1ea01eb15d3',45090),(8149,'\n\"The difference between \'involvement\' and \'commitment\' is like an \n eggs-and-ham breakfast: the chicken was \'involved\' - the pig was \n \'committed\'.\" -- unknown','f0fc9226beb514b84dc732b6ce53b1ea01eb15d3',44281),(8150,'\n\"All men are created equal. They are endowed by their Creator\n with certain unalienable rights, among these are life, liberty\n and the pursuit of happiness.\"\n -- Ho Chi Minh, 1945, as the Democratic Republic of Vietnam\n    was created','f166048d6fb38c895db324b1e2d58e02d7ae9f81',42471),(8151,'\n\"Alas, to wear the mantle of Galileo it is not enough that you\n be persecuted by an unkind establishment, you must also be\n right.\" -- Bob Park','f166048d6fb38c895db324b1e2d58e02d7ae9f81',35952),(8152,'\n\"And the users exclaimed with a laugh and a taunt: \'It\'s just what \n we asked for but not what we want.\'\"','f2bef084253a87cd5ac59534d7e47e4a3d7dba48',34631),(8153,'\n\"A man can\'t be too careful in the choice of his enemies.\"\n -- Oscar Wilde (1854-1900)','f2bef084253a87cd5ac59534d7e47e4a3d7dba48',33738),(8154,'\n\"Pray: To ask the laws of the universe to be annulled on behalf\n of a single petitioner confessedly unworthy.\"\n -- Ambrose Bierce','f5a59f622ecfd57cac0f0467330d9847a08114d6',35658),(8155,'\n\"All I need to make a comedy is a park, a policeman and a pretty \n girl.\" -- Charlie Chaplin (1889-1977), in My Autobiography (1964)','f5a59f622ecfd57cac0f0467330d9847a08114d6',44944),(8156,'\n\"If Stupidity got us into this mess, then why can\'t it get us \n out?\" -- Will Rogers (1879-1935)','f5ca8c8552c95526a48c9a4b7db15fa4e86c11f8',34631),(8157,'\n\"I find that most men would rather have their bellies opened\n for five hundred dollars than have a tooth pulled for five.\"\n -- Martin H. Fischer','f5ca8c8552c95526a48c9a4b7db15fa4e86c11f8',44281),(8158,'\n\"A witty saying proves nothing.\"\n -- Voltaire (1694-1778)','f6b6855cce3c5d42a40ba7296f6b5fb0e89bb1cb',33738),(8159,'\n\"We all agree that your theory is crazy, but is it crazy enough?\"\n -- Niels Bohr (1885-1962)','f6b6855cce3c5d42a40ba7296f6b5fb0e89bb1cb',35941),(8160,'\n\"To achieve all that is possible, we must attempt the impossible - to be\n as much as we can, we must dream of being more.\"\n- Unknown','f9100ae90639e687ef86741c13ac7713b84b8857',43080),(8161,'\n\"They couldn\'t hit an elephant at this dist--\" \n -- John B. Sedwick, general, dying words, 1864','f9100ae90639e687ef86741c13ac7713b84b8857',42471),(8162,'\n\"Any race you can walk away from, is a bad race\"\n- Coach Pete Waters','fb0a89208aa0d38a73ec36b64cf35dc6949a1ac5',44403),(8163,'\n\"The runner need not break four minutes in the mile or four hours in the\nmarathon. It is only neccessary that he runs and runs and sometimes\nsuffers. Then one day he will wake up and discover that somewhere along the\nthe way he has begun to see the order and law and love and truth that makes\nmen free.\"\n- George Sheehan','fb0a89208aa0d38a73ec36b64cf35dc6949a1ac5',43080),(8164,'\n\"Throughout American history, the government has said we\'re in an \n unprecedented crisis and that we must live without civil \n liberties until the crisis is over. It\'s a hoax.\" \n -- Yale Kamisar, 1990.','fc2dcda259b73344ef93a7517f91c126741c4065',32929),(8165,'\n\"Chaos is found in greatest abundance wherever order is being\n sought. It always defeats order, because it is better organized.\"\n -- Terry Pratchett (Interesting Times) ','fc2dcda259b73344ef93a7517f91c126741c4065',43599),(8166,'\n\"We should forget about small efficiencies, say about 97% of the \n time: premature optimization is the root of all evil.\"\n -- Donald Knuth','fcd6e47442fb40aa9ab8fc1c890e14c5b5a3ede4',34631),(8167,'\n\"If computers get too powerful, we can organize them into a \n committee -- that will do them in.\" -- Bradley\'s Bromide.','fcd6e47442fb40aa9ab8fc1c890e14c5b5a3ede4',31909),(8168,'\n\"To eat well in England, you should have breakfast three times \n a day.\" -- W. Somerset Maugham, 1925','fefd47cb7691a8016da2735af04ce41b46a8365e',42471),(8169,'\n\"They show you how detergents take out bloodstains. I think if \n you\'ve got a T-shirt with bloodstains all over it, maybe your \n laundry isn\'t your biggest problem.\" -- George Carlin','fefd47cb7691a8016da2735af04ce41b46a8365e',35658),(8170,'\n\"Forgive your enemies, but never forget their names.\"\n -- John F. Kennedy (1917-1963)','fffe51167f1ad1bf26dda45ccfc40b5d7fab8384',34631),(8171,'\n\"Why is propaganda so much more successful when it stirs up\n hatred than when it tries to stir up friendly feeling?\"\n -- Bertrand Russell','fffe51167f1ad1bf26dda45ccfc40b5d7fab8384',34631),(8172,'\n\"If there is no God, who pops up the next Kleenex?\"\n -- Art Hoppe.','00cdb3b8adec075de214e685a1d832d6113cc033',45090),(8173,'\n\"The thing I don\'t like about Western States is that you show up at the\nstarting line in the best shape of your life and a day later you are in\nAuburn in the worst shape of your life.\"\n- Andy Black, on Western States','00cdb3b8adec075de214e685a1d832d6113cc033',45561),(8174,'\n\"For all the hardship, I was still excited to be on the trail, testing my\nendurance, feeling especially alive as strength and fatigue flowed\nalternately through my limbs.\"\n- Colin Powell','01a779d7b59498f9c2e4acc3f9f3081cc492f858',35952),(8175,'\n\"I can write better than anybody who can write faster, and I can \n write faster than anybody who can write better.\"\n -- A. J. Liebling (1904-1963)','01a779d7b59498f9c2e4acc3f9f3081cc492f858',39809),(8176,'\n\"What do you take me for, an idiot?\"\n -- General Charles de Gaulle (1890-1970), when a journalist \n    asked him if he was happy','04c5be6ef82e5c1d2b2339d4d2bb57efab89903a',36879),(8177,'\n\"Once a new technology starts rolling, if you\'re not part of the\n steamroller, you\'re part of the road.\" -- Stewart Brand','04c5be6ef82e5c1d2b2339d4d2bb57efab89903a',36879),(8178,'\n\"I don\'t know that atheists should be considered citizens, nor\n should they be considered patriots. This is one nation under\n God.\"\n -- President George Bush, August 27, 1988','04d07acaf8aef1dddc3ba8b0e1ab6af98e609d2e',35658),(8179,'\n\"Let us change our traditional attitude to the construction of\n programs. Instead of imagining that our main task is to\n instruct a computer what to do, let us concentrate rather on\n explaining to human beings what we want a computer to do.\" \n -- Donald Knuth','04d07acaf8aef1dddc3ba8b0e1ab6af98e609d2e',43346),(8180,'\n\"If you want to make an apple pie from scratch, you must first \n create the universe.\" -- Carl Sagan','05810a31a7f2df79e8e19bcc6fbdc5c86d89db2a',43080),(8181,'\n\"Security is mostly a superstition; it does not exist in nature.  Life\nis ei