w to solve the problem. But when I have \n finished, if the solution is not beautiful, I know it is wrong.\"\n -- Buckminster Fuller (1895-1983)','1996d0e5a5e646c8e80c600e3f9e692b58bb9792',36879),(8202,'\n\"I would have made a good pope.\"\n -- Richard Nixon','19afca7482367f22ec3f418a04029acb1ab6b325',33738),(8203,'\n\"Could a being create the fifty billion galaxies, each with two\n hundred billion stars, then rejoice in the smell of burning\n goat flesh?\"\n -- Ron Patterson','19afca7482367f22ec3f418a04029acb1ab6b325',32929),(8204,'\n\"Five exclamation marks, the sure sign of an insane mind.\"\n -- Terry Pratchett (Reaper Man) ','1bb86249e47b0487ade26cd7adce54e3df97f638',32929),(8205,'\n\"Respect the distance or it won\'t respect you.\"\n- Unknown','1bb86249e47b0487ade26cd7adce54e3df97f638',45883),(8206,'\nWilcox\'s Law: A pat on the back is only a few centimeters from a \nkick in the pants.','1d05c5478179123d708ea97f87ad547a49f2d8eb',45881),(8207,'\n\"My advice to you is get married: if you find a good wife you\'ll \n be happy; if not, you\'ll become a philosopher.\"\n -- Socrates (470-399 B.C.)','1d05c5478179123d708ea97f87ad547a49f2d8eb',43348),(8208,'\n\"I wasn\'t a truly genuine trail ultrarunner until March 7, 1992 at the\nWild Oak 50 near Harrisonburg, Virginia.  It was a rainy day and\nsimultaneously, while I was piddling on the run, chewing on an energy\nbar and washing it down with Mountain Dew, my nose was dripping and I\nfarted.  That was the ultimate defining moment in my trail running\ncareer, if not my entire life.\"\n- Bob Boeder','1f7e13aed475ec7e7e2e5dbdbea127f87da762b1',35950),(8209,'\n\"Barabsi\'s Law of Programming: Program development ends when the \n program does what you expect it to do - whether it is correct or\n not.\" -- Albert-Lszl Barabsi','1f7e13aed475ec7e7e2e5dbdbea127f87da762b1',42471),(8210,'\n\"Real knowledge is to know the extent of one\'s ignorance.\"\n -- Confucius','1fca884ab7f76f68ae1b9b3fb61b56fd506da05e',34631),(8211,'\n\"Vi