ver does quite what I want\n But only what I tell it.\"','8d87e825f300530dc4b74ce802d15841bf9a528c',44127),(8799,'\n\"I do not have a body, I am a body.\" -- Unknown','8d87e825f300530dc4b74ce802d15841bf9a528c',43080),(8800,'\n\"You have a cough?  Go home tonight, eat a whole box of Ex-Lax \n -- tomorrow you\'ll be afraid to cough.\" -- Pearl Williams.','8ff2933e16c95ef5fa35bc0106f5d7ab5fd33957',34631),(8801,'\n\"You\'ll never have a quiet world till you knock the patriotism\n out of the human race.\"\n -- George Bernard Shaw','8ff2933e16c95ef5fa35bc0106f5d7ab5fd33957',33738),(8802,'\n\"It\'s not at all important to get it right the first time. It\'s\n vitally important to get it right the last time.\" \n -- Andrew Hunt and David Thomas','92f2fd99879b0c2466ab8648afb63c49032379c1',35941),(8803,'\n\"Power is the ability to control things, moral authority is the\n ability to change things\" -- Jim Wallis','92f2fd99879b0c2466ab8648afb63c49032379c1',45561),(8804,'\nGoebel\'s Theorem Of Software Schedules: Always multiply a \nsoftware schedule by pi.  This is because you think you\'re going \nin a straight line but always end up going full circle.','947b79cc2bf52dea2a768313a83fd95ba8c44a80',42471),(8805,'\n\"Adversity introduces a man to himself.\"\n- Unknown','947b79cc2bf52dea2a768313a83fd95ba8c44a80',44127),(8806,'\n\"Every great advance in natural knowledge has involved the\n absolute rejection of authority.\"\n -- Thomas Huxley','97a87b470fe9ed5ff51ff9b8543e937e6016d48c',36757),(8807,'\n\"There is no sport in hate when all the rage is on one side.\"\n -- Percy B. Shelley','97a87b470fe9ed5ff51ff9b8543e937e6016d48c',36757),(8808,'\n\"Every normal man must be tempted at times to spit upon his \n hands, hoist the black flag, and begin slitting throats.\"\n -- Henry Louis Mencken (1880-1956)','97fa224caa40699a081af4d3f27be35b7a63f84e',35658),(8809,'\n\"Convictions are more dangerous foes of truth than lies.\"\n -- Nietzsche','97fa224caa40699a081af4d3f27be35b7a63f84e',43080)