ving passed through a \n very expensive machine, is somehow enobled and no-one dares \n criticize it.\" -- Pierre Gallois.','b46b552c427284465e90940d05754954a9d2e275',64),(8854,'\n\"You simply cannot hang a millionaire in America.\"\n -- Bourke Cockran','b4bd5cd7bdd48d144a055bd207e9623f159e4a07',44403),(8855,'\n\"Imagine if every Thursday your shoes exploded if you tied them\n the usual way. This happens to us all the time with computers,\n and nobody thinks of complaining.\" -- Jeff Raskin','b4bd5cd7bdd48d144a055bd207e9623f159e4a07',44403),(8856,'\n\"Everybody wants to go to heaven, but nobody wants to die.\"\n -- Joe Louis.','b60069c04c8aa62657c2aa75569c961afdde99ce',35952),(8857,'\n\"Violence is the last refuge of the incompetent.\" -- Issac Asimov','b60069c04c8aa62657c2aa75569c961afdde99ce',33738),(8858,'\n\"Your biggest challenge isn\'t someone else.  It\'s the ache in your lungs\nand the burning in your legs, and the voice inside you that yells\n\'CAN\'T\", but you don\'t listen.  You just push harder.  And then you hear\nthe voice whisper \'can\'.  And you discover that the person you thought\nyou were is no match for the one you really are.\"\n- Unknown','b6b715499c4135ca6105ac7096e4da6e3c4e7979',35950),(8859,'\n\"It\'s astounding, time is fleeting\n Madness takes it\'s toll\n But listen closely, not for very much longer\n I\'ve got to keep control.\"\n- from \"The Rocky Horror Picture Show\", submitted by Brian Collings & Steve Reagan','b6b715499c4135ca6105ac7096e4da6e3c4e7979',43348),(8860,'\n\"I just bought a Mac to help me design the next Cray.\"\n -- Seymoure Cray (1925-1996) when was informed that Apple Inc. \n    had recently bought a Cray supercomputer to help them design \n    the next Mac.','b6ba6c90d7120a7c3f15363bb4d2bfa92e3752df',43599),(8861,'\n\"A verbal contract is not worth the paper it\'s written on.\"\n -- Samuel Goldwyn','b6ba6c90d7120a7c3f15363bb4d2bfa92e3752df',45253),(8862,'\n\"The difference between me and Rick Hogan is that I always leave the\nrattlesnake for the next guy.\"\n- Andy Petterson at Old Dominion, referring to a snake killed by Rick\n  near the Peach Orchard aid station','b9d749ca4e5a1ec451f195cb9c7ffdecf3cdd975',35952),(8863,'\n\"It is better to die on your feet than to live on your knees.\"\n- Dolores Ibarruri','b9d749ca4e5a1ec451f195cb9c7ffdecf3cdd975',35952),(8864,'\n\"A fast word about oral contraception. I asked a girl to go to \n bed with me, she said \'no\'.\" -- Woody Allen','ba92f7a88c1de9cf08e1613b6f69ba5c2448c903',45253),(8865,'\n\"First you forget names, then you forget faces. Next you forget to\n pull your zipper up and finally, you forget to pull it down.\"\n -- George Burns.','ba92f7a88c1de9cf08e1613b6f69ba5c2448c903',45090),(8866,'\n\"None are more hopelessly enslaved than those who falsely\n believe they are free.\"\n -- Johann Wolfgang von Goethe','bafde46b1c4df25aeaa8c4d432759fb2dccf89b2',43348),(8867,'\nDr. Caligari\'s Come-Back: A bad sector disk error occurs only \nafter you\'ve done several hours of work without performing a \nbackup.','bafde46b1c4df25aeaa8c4d432759fb2dccf89b2',44944),(8868,'\n\"To travel is to discover that everyone is wrong about other\n countries.\"\n -- Aldous Huxley','bcdc09911adf931ceb3cb9d8ae39816b4465e2ff',43348),(8869,'\n\"The pessimist complains about the wind; the optimist expects it\n to change; the realist adjusts the sails.\" \n -- William Arthur Ward','bcdc09911adf931ceb3cb9d8ae39816b4465e2ff',43346),(8870,'\n\"It is difficult to get a man to understand something when his\n salary depends on his not understanding it.\" -- Upton Sinclair','bfbb1e6906bee948df24a560b5948c8fbf52d6f2',45881),(8871,'\n\"In America everybody is of the opinion that he has no social\n superiors, since all men are equal, but he does not admit that\n he has no social inferiors, for, from the time of Jefferson\n onward, the doctrine that all men are equal applies only\n upwards, not downwards.\" -- Bertrand Russell','bfbb1e6906bee948df24a560b5948c8fbf52d6f