ound that plans are useless, but planning is\n indispensable.\" -- Dwight Eisenhower','ca5a2b4e240cd173304d7967b5164b9b05ce313e',44944),(8883,'\n\"I am strongly in favor of using poisoned gas against\n uncivilized tribes. The moral effect should be good and it\n would spread a lively terror.\"\n -- Winston Churchill commenting on the British use of poison\n gas against the Iraqis after World War I','ca5a2b4e240cd173304d7967b5164b9b05ce313e',35658),(8884,'\n\"In theory, there is no difference between theory and practice. \n But, in practice, there is.\" -- Jan L.A. van de Snepscheut','cdb9a488f498b61ef129839a102e864b79612a69',35658),(8885,'\n\"All Bibles are man-made.\"\n -- Thomas Edison','cdb9a488f498b61ef129839a102e864b79612a69',43080),(8886,'\nGovernment\'s Law: There is an exception to all laws.','ce1c14f7779551ac24a7b47ce3032bf5645150f9',34631),(8887,'\n\"Guard against the impostures of pretended patriotism.\"\n -- George Washington','ce1c14f7779551ac24a7b47ce3032bf5645150f9',44281),(8888,'\n\"The competent programmer is fully aware of the strictly limited\n size of his own skull; therefore he approaches the programming\n task in full humility, and among other things he avoids clever\n tricks like the plague.\" -- Edsger Dijkstra','d000123f8b493a57f194a3b9cf19d27dba872fd2',35658),(8889,'\n\"My opinions might have changed, but not the fact that I am \n right.\"','d000123f8b493a57f194a3b9cf19d27dba872fd2',35941),(8890,'\n\"Haste is of the devil. Slowness is of God.\" -- H L Mencken','d0ac2dfae0a97576989952eb002c812b357509a1',43348),(8891,'\n\"I never advocated war except as a means of peace.\"\n -- Ulysses S. Grant','d0ac2dfae0a97576989952eb002c812b357509a1',35950),(8892,'\n\"The President has kept all of the promises he intended to keep.\"\n -- Clinton aide George Stephanopolous speaking on Larry \n    King Live','d19de1701bdaeb97fc5be89f166b5a0192d34254',34631),(8893,'\n\"Yes, I\'m fat, but you\'re ugly and I can go on a diet.\" \n -- bumper sticker','d19de1701