 the Innocent\n   o Praise for non-participants\"','dad97feeb29459f49b8b8172b8ff8ed728054fa7',34631),(8906,'\n\"War is fear cloaked in courage.\" -- General William Westmoreland','db667c0b2e0c54430dd741993db8d4af89482889',44944),(8907,'\n\"There are three truths: my truth, your truth, and the truth.\"\n -- Chinese proverb','db667c0b2e0c54430dd741993db8d4af89482889',43348),(8908,'\n\"Invisible Pink Unicorns are beings of awesome mystical power.\n We know this because they manage to be invisible and pink at\n the same time. Like all religions, the Faith of the Invisible\n Pink Unicorns is based upon both logic and faith. We have faith\n that they are pink; we logically know that they are invisible\n because we can\'t see them.\"\n -- Steve Eley','dca5e1e83098b1c79a1748edb5ff326ee1a94291',43080),(8909,'\n\"Work like you don\'t need the money. Love like you\'ve never\n been hurt. Dance like nobody\'s watching.\"\n -- Satchel Paige','dca5e1e83098b1c79a1748edb5ff326ee1a94291',43080),(8910,'\n\"I have four children which is not bad considering I\'m\n not a Catholic.\" -- Peter Ustinov.','dd4571bd1e95610b72faea02f4e00c84d0885219',39809),(8911,'\n\"A man who is afraid will do anything.\"\n -- Jawaharlal Nehru','dd4571bd1e95610b72faea02f4e00c84d0885219',45090),(8912,'\n\"I choose a block of marble and chop off whatever I don\'t need.\"\n -- Francois-Auguste Rodin (1840-1917), when asked how he managed\n    to make his remarkable statues','e3f4f4dc776a6c50f707092209dbae7d83b7db6a',31913),(8913,'\n\"It\'s so easy to become mesmerized by the immediacy of a result\n that you don\'t question its validity.\" -- Naomi Karten','e3f4f4dc776a6c50f707092209dbae7d83b7db6a',34631),(8914,'\n\"Computers are good at following instructions, but not at reading\n your mind.\" -- Donald Knuth','e5658cf3924e0c0d9756340097e279b0ad3ff4e6',43348),(8915,'\n\"I am become death, shatterer of worlds.\"\n -- Robert J. Oppenheimer (1904-1967) (citing from the \n    Bhagavad Gita, after witnessing the world\'s first nuclear \n    explosion)','e5658cf3924e0c0d9756340097e279b0ad3ff4e6',64),(8916,'\n\"Where humor is concerned there are no standards - no one can \n say what is good or bad, although you can be sure that everyone \n will.\" -- John Kenneth Galbraith (1908-2006)','e5ab5daa878977866193850eb40c14b6eda10080',64),(8917,'\n\"To jaw-jaw is always better than to war-war.\" \n -- Winston Churchill','e5ab5daa878977866193850eb40c14b6eda10080',44944),(8918,'\n\"Nobody is going to finish this damn thing for me, but me.\"\n- Unknown','e9a296a651685295f2eae6e586bebec76fe11b34',35658),(8919,'\n\"Self-destructive is doing something to hurt yourself. It is doing\npermanent damage to yourself. I have done neither. As for being\nobsessive, I am. I love to run.\"\n- John Barltrop','e9a296a651685295f2eae6e586bebec76fe11b34',35952),(8920,'\n\"Theology is never any help; it is searching in a dark cellar\n at midnight for a black cat that isn\'t there. Theologians can\n persuade themselves of anything.\"\n -- Robert Heinlein','eb11de4bb8e2a6c50f0440b536d040165927c47f',45253),(8921,'\n\"He is not only dull himself, he is the cause of dullness \n in others.\" -- Samuel Johnson','eb11de4bb8e2a6c50f0440b536d040165927c47f',36879),(8922,'\n\"Mr. Wagner has beautiful moments but bad quarters of an hour.\"\n    - Gioacchino Rossini (1792-1868)','eb782cb36fc6e7eecc8f689731b2ba7bb73a7710',64),(8923,'\n\"If you can\'t fly, then run.\nIf you can\'t run, then walk.\nIf you can\'t walk, then crawl.\nBut whatever you do, keep moving.\"\n- Martin Luther King, Jr.','eb782cb36fc6e7eecc8f689731b2ba7bb73a7710',32929),(8924,'\n\"The competent programmer is fully aware of the limited size of \n his own skull. He therefore approaches his task with full \n humility, and avoids clever tricks like the plague.\"\n -- Edsger W. Dijkstra, EWD340','ef36435c34f8511dc56447b46bf3caeef811a7af',45090),(8925,'\n\"Disobedience is the true foundation of liberty. The obedient\n must be slaves.\"\n -- Henry David Thorea