ies in this index may be explained by the fact \n that it has been sorted with the help of a computer.\" \n -- Donald Knuth Sorting and Searching','dae40cb6316d320130e860e2dd9e9177809d689e',64),(9679,'\n\"We are faced with an insurmountable opportunity.\" -- W. Kelley','dae40cb6316d320130e860e2dd9e9177809d689e',45253),(9680,'\n\"He loves nature in spite of what it did to him.\" \n -- Forrest Tucker','dc3c03160a963f53d408a0ed65f17901fe7ad6b8',44403),(9681,'\n\"If you have a procedure with 10 parameters, you probably \n missed some.\" -- Alan Perlis','dc3c03160a963f53d408a0ed65f17901fe7ad6b8',43348),(9682,'\n\"Do, or do not. There is no \'try\'.\"\n -- Yoda (\'The Empire Strikes Back\')','dc898fe83986e202968df1fb6ee626594a78330f',45449),(9683,'\n\"A closed mouth gathers no foot.\"','dc898fe83986e202968df1fb6ee626594a78330f',44281),(9684,'\n\"I am convinced that I am acting as the agent of our Creator.\n By fighting off the Jews, I am doing the Lord\'s work.\"\n -- Adolf Hitler','dcfe776f4efedb4c60ce47c58075ee231e94959a',45253),(9685,'\n\"You know, sometimes a man just can\'t satisfy all of a woman\'s\n desires.  Which is why God invented dental floss.\"\n -- Author Unknown','dcfe776f4efedb4c60ce47c58075ee231e94959a',43599),(9686,'\n\"Death does not concern us, because as long as we exist, death is \n not here. And when it does come, we no longer exist.\" \n -- Epicurus.','de39190f2ae2433d5e9e95a92ecde0aa04ada20f',31909),(9687,'\n\"If we knew what it was we were doing, it would not be called \n research, would it?\" -- Albert Einstein','de39190f2ae2433d5e9e95a92ecde0aa04ada20f',43348),(9688,'\n\"Climb the mountains and get their good tidings.  The winds will blow\ntheir freshness into you, and the storms, their energy.  Your cares\nand tensions will drop away like the leaves of autumn.\"\n- John Muir','df0580d5b3419297bb0795e5949ce67c2c800bb6',35950),(9689,'\n\"The fear of death is the most unjustified of all fears, for \n there\'s no risk of accident for someone who\'