el of his teeth.  \n Some evils admit of consolations, but there are no comforters for\n dyspepsia and the toothache.\" -- Henry Lytton Bulwer','fef3c0cabf9b57525084a7385684c74b37ec1a1c',34631),(9726,'\n\"Democracy is four wolves and a lamb voting on what to have for\n lunch.\"\n -- Ambrose Bierce','ff1f11caf1ddfb29216d0af9510aa46c27541992',43080),(9727,'\n\"Terrorism is the war of the poor, and war is the terrorism of \n the rich.\" -- Sir Peter Ustinov','ff1f11caf1ddfb29216d0af9510aa46c27541992',43599),(9728,'\n\"Distrust all in whom the impulse to punish is powerful.\"\n -- Nietzsche','ffcfe351b0fdac5d8f8d204046564d1070bb80a3',45090),(9729,'\n\"We all agree that your theory is crazy, but is it crazy enough?\"\n -- Niels Bohr (1885-1962)','ffcfe351b0fdac5d8f8d204046564d1070bb80a3',44403),(9730,'\n\"Even if you\'re on the right track, you\'ll get run over if you\n just sit there.\" -- Will Rogers','006e9c3a82f814fa415bf832e346c8b2fb2f1c9f',45090),(9731,'\n\"\'Abstinence-only sex education\' is a little like saying \n \'Just-hold-it potty training\'.\" -- Roy Zimmerman','006e9c3a82f814fa415bf832e346c8b2fb2f1c9f',44281),(9732,'\n\"I like those people. They are calmer and cooler, I think. Personality-\nwise, they are rich. An ultra runner is not somebody who is normally\ngoing to wish you bad. On the contrary if you are down an ultra runner\nwill help you.\"\n- Michel Careau','024ec013e7170f13b94b01f45057653fbfb1d78b',34631),(9733,'\n\"Kindness is a mark of faith, and whoever has not kindness has\n not faith.\"\n -- Prophet Muhammad','024ec013e7170f13b94b01f45057653fbfb1d78b',45253),(9734,'\n\"Mythology is what we call someone else\'s religion.\"\n -- Joseph Campbell','0519a3b8d19f6d01501da1960c19385b5e938f86',45561),(9735,'\n\"If computers get too powerful, we can organize them into a \n committee -- that will do them in.\" -- Bradley\'s Bromide.','0519a3b8d19f6d01501da1960c19385b5e938f86',43348),(9736,'\n\"Been there, done that, don\'t need to do it again.\"\n- Unknown','05dd287873cb0a418344e43e4ceec003edd1a143',35658),(9737,'\n\"Just erotic. Nothing kinky. It\'s the difference between \n using a feather and using a chicken.\"\n -- Terry Pratchett (Eric) ','05dd287873cb0a418344e43e4ceec003edd1a143',35658),(9738,'\n\"Oh man! They should just put me out to stud!\"\n- Len Kuentzm just after finishing his first 50-miler','06dd5be6fbd8d391bd906e39cff1ad2c2fb1e790',45449),(9739,'\n\"The question of whether a computer can think is no more \n interesting than the question of whether a submarine can swim.\" \n -- Edsger Dijkstra ','06dd5be6fbd8d391bd906e39cff1ad2c2fb1e790',43346),(9740,'\nFlo Capp\'s Observation: The next best thing to doing something \nsmart is not doing something stupid.','07e9caa5baaf30fdb44691d7d12418bd0acf53a7',64),(9741,'\n\"A mathematician is a machine for turning coffee into theorems.\"\n -- Alfrd Rnyi (also attributed to Paul Erds)','07e9caa5baaf30fdb44691d7d12418bd0acf53a7',33738),(9742,'\n\"Manifest plainness, embrace simplicity, reduce selfishness,\n have few desires.\"\n -- Lao tzu','0a8d7ab6dba032798cda410b6d1c848c2a33c209',39809),(9743,'\n\"If child molestation is actually your concern, how come we\n don\'t see Bradley tanks knocking down Catholic churches?\"\n -- Bill Hicks, 1993, referencing the Waco siege','0a8d7ab6dba032798cda410b6d1c848c2a33c209',43346),(9744,'\n\"It is dangerous to be right in matters on which the\n established authorities are wrong.\"\n -- Voltaire','0c24fb1a52a1ffb633c7ffc3105859d42c190819',45449),(9745,'\n\"Make everything as simple as possible, but not simpler.\"\n -- Albert Einstein (1879-1955)','0c24fb1a52a1ffb633c7ffc3105859d42c190819',32929),(9746,'\nFinagle\'s Laws:\n\n   1. Once a job is fouled up, anything done to improve it makes \n      it worse.\n   2. No matter what results are expected, someone is always \n      willing to fake it.\n   3. No matter what the result, someone is always eager to \n      misinterpret it.\n   4. No matter what occurs, someone believes it happened \n      according to his pet theory.','0c6da8812bc2c3c3b5fec60ac1c51ee06b3048c0',44403),(9747,'\n\"Christian is a VERB not a noun.\"\n -- Meria Heller','0c6da8812bc2c3c3b5fec60ac1c51ee06b3048c0',64),(9748,'\n\"You\'ll have no trouble keeping up. Remember, I\'m a 35 minute miler.\"\n(when discussing a training run)\n- Mark Williams, first of 253 people to finish Barkley 100','0cd82a171ca4e3fb79ea0cbc01b5da23e96324dc',45883),(9749,'\n\"We are what we think. All that we are arises with our\n thoughts. With our thoughts, we make the world.\"\n -- Buddha','0cd82a171ca4e3fb79ea0cbc01b5da23e96324dc',64),(9750,'\n\"Who are you going to believe, me or your own eyes?\"\n -- Groucho Marx','0f001e383ec011fbea9f2072f57add9424f69ecc',44944),(9751,'\n\"Basically, I no longer work for anything but the sensation I \n have while working.\"\n -- Albert Giacometti (sculptor)','0f001e383ec011fbea9f2072f57add9424f69ecc',43080),(9752,'\n\"When you run there are no mistakes, only lessons. The art and\nscience of ultrarunning is a process of trial, error and\nexperimentation. The failed experiments are as much a part of the\nprocess as the combination that ultimately works.\"\n- Keith Pippin','0fe59d5147871b7fae0d85bf1fdd37f556a70191',34631),(9753,'\n\"Because I can.\" (when asked \"Why do you run 100 mile races?\")\n- Tom Johnson','0fe59d5147871b7fae0d85bf1fdd37f556a70191',44944),(9754,'\n\"We can often do more for other men by trying to correct our\n own faults than by trying to correct theirs.\"\n -- Francois Fenelon','0ff286d25175f678944151fe2a79106fb574304f',43346),(9755,'\n\"Minsky\'s Second Law: Don\'t just do something. Stand there.\"\n-- Marvin Minsky','0ff286d25175f678944151fe2a79106fb574304f',36879),(9756,'\n\"Each time you run you will receive lessons. You have enrolled in\nthe school of ultrarunning. You may like the lessons or think them\nirrelevant and stupid. What you think makes no difference; the\nlessons will be presented until they are learned.\"\n- Keith Pippin','124e0f9ab5f6e91c4c54e403f28e9bd06b2096e5',35950),(9757,'\n\"When did I realize I was God? Well, I was praying and I\n suddenly realized I was talking to myself.\"\n -- Jack Gurney - \"The Ruling Class\"','124e0f9ab5f6e91c4c54e403f28e9bd06b2096e5',45253),(9758,'\n\"If you want to play the game you have to train.\"\n- Unknown','132fda1bdecd783b79ba8f381b55250edc8dc52e',39809),(9759,'\n\"It\'s easy to imagine how you will act when things go according to plan,\nthat\'s why you must always prepare yourself for what you will do when\nthey don\'t.\"\n- Unknown','132fda1bdecd783b79ba8f381b55250edc8dc52e',44281),(9760,'\n\"Whatever you do will be insignificant, but it is very\n important that you do it.\"\n -- Mohandas Gandhi','1683e1014d9007a4b9bce2c4c43cafc813c3e36b',35952),(9761,'\n\"Giving birth is like taking your lower lip and forcing it over\n your head.\" - Carol Burnett.','1683e1014d9007a4b9bce2c4c43cafc813c3e36b',31913),(9762,'\n\"Nietzsche was stupid and abnormal.\"\n -- Leo Tolstoy (1828-1910)','17d8dc890e2e4ac019c4c111fff255a0da7841c7',35952),(9763,'\n\"One word sums up probably the responsibility of any Governor, \n and that one word is \'to be prepared\'.\" -- George W. Bush','17d8dc890e2e4ac019c4c111fff255a0da7841c7',35941),(9764,'\n\"There are people in the world so hungry, that God cannot appear \n to them except in the form of bread.\"\n -- Mahatma Gandhi (1869-1948)','1894044bed246387fe27024e1fca0df7bf105b1d',35941),(9765,'\n\"It is better to have a permanent income than to be fascinating.\"\n -- Oscar Wilde (1854-1900)','1894044bed246387fe27024e1fca0df7bf105b1d',31913),(9766,'\n\"I had a lover\'s quarrel with the world.\"\n -- Robert Frost','18e25c1d6c53fda1695ce0edbe739497fec0af11',45090),(9767,'\n\"It has been said that the great scientific disciplines are \n examples of giants standing on the shoulders of other giants. \n It has also been said that the software industry is an example\n of midgets standing on the toes of other midgets.\" \n -- Alan Cooper About Face','18e25c1d6c53fda1695ce0edbe739497fec0af11',36757),(9768,'\n\"If cats looked like frogs we\'d realize what nasty, cruel little \n bastards they are. Style. That\'s what people remember.\"\n -- Terry Pratchett (Lords and Ladies) ','1a46245771102986256d3007e7c6fa04f51e3a15',31913),(9769,'\n\"The number of miles I have run since I was a toddler would have\ntaken me around the world several times, and I still cannot define\nprecisely my joy in running.  There is no sacrifice in it.  I lead\nwhat I regard a normal life.  In my case, I thoroughly enjoy\nrunning 100-odd miles a week.  If I didn\'t I wouldn\'t do it.  Who\ncan define happiness? To some, happiness is a warm puppy or a glass\nof cold beer.  To me, happiness is running in the hills with my\nmates around me.\" \n- Ron Clarke','1a46245771102986256d3007e7c6fa04f51e3a15',44127),(9770,'\n\"In the begining there was nothing and God said \'Let there be \n light\', and there was still nothing but everybody could see it.\" \n -- Dave Thomas.','1e587263e3e1bf03411c4415cc1743a8aba34915',44944),(9771,'\n\"It\'s still magic even if you know how it\'s done.\"\n -- Terry Pratchett (A Hat Full of Sky) ','1e587263e3e1bf03411c4415cc1743a8aba34915',45881),(9772,'\n\"So long as the deceit ran along quiet and monotonous, all of \n us let ourselves be deceived, abetting it unawares or maybe \n through cowardice...\" -- William Faulkner','1e86f923a706f617980bad57d7314855c28f92f2',64),(9773,'\n\"There\'s no trick to being a humorist when you have the whole \n government working for you.\" -- Will Rogers (1879-1935)       ','24f5f8f01126f43a6e228fbc5a402ccc8843b175',43348),(9774,'\n\"We only acknowledge small faults in order to make it appear\n that we are free from great ones.\" -- La Rochefoucauld','24f5f8f01126f43a6e228fbc5a402ccc8843b175',45090),(9775,'\n\"I did say something along the lines of \'C makes it easy to\n shoot yourself in the foot; C++ makes it harder, but when you\n do, it blows your whole leg off.\'\" -- Bjarne Stroustrup','260520b6c29f505d4fc09edf58115bd9d1c6206e',44127),(9776,'\n\"The gods too are fond of a joke.\" -- Aristotle (384-322 B.C.)','260520b6c29f505d4fc09edf58115bd9d1c6206e',36757),(9777,'\n\"If economists were held in the same regard as medical \n practitioners, our courts would be overwhelmed with malpractice\n suits\" -- unknown','28a721317b51cc6bc677d65335d266c51cc6bff2',45561),(9778,'\n\"Computer dating is fine, if you\'re a computer.\"\n -- Rita May Brown.','28a721317b51cc6bc677d65335d266c51cc6bff2',39809),(9779,'\n\"On the outskirts of every agony sits some observant fellow who\n points.\"\n -- Virginia Woolf','290ae5785c2c061f6070b88aa70984ef1329510b',31913),(9780,'\n\"All religions are founded on the fear of the many and the\n cleverness of the few.\"\n -- Stendhal','290ae5785c2c061f6070b88aa70984ef1329510b',35941),(9781,'\n\"All our lauded technological progress, our very civilization,\n is like the axe in the hand of the pathological criminal.\"\n -- Albert Einstein','2994737431c28e9a5f0b26b9bfd6a20292490921',35658),(9782,'\n\"I think it would be a good idea.\"\n -- Mahatma Gandhi (1869-1948), when asked what he thought of \n    Western civilization','2994737431c28e9a5f0b26b9bfd6a20292490921',45883),(9783,'\n\"If you get tired on a trail run, lie down in the middle of the trail in\nsuch a way that no one could pass you without waking you up - it will\ninsure your finish line position.\"\n- Glen Zirbel','2996abdb7066821d2b008c83fa572c8059609867',45561),(9784,'\n\"Either God wants to abolish evil, and cannot; or he can, but\n does not want to. If he wants to, but cannot, he is impotent.\n If he can, but does not want to, he is wicked. If, as they say,\n God can abolish evil, and God really wants to do it, why is\n there evil in the world?\"\n -- Epicurus','2996abdb7066821d2b008c83fa572c8059609867',43346),(9785,'\n\"There\'s no sense being exact about something if you don\'t even\n know what you\'re talking about.\" -- John von Neumann','29ddae77b611c4223d4f41e229f2d74a6aeba0f9',64),(9786,'\n\"Once that distance had been passed in training, an important physical\nand psychological threshold had been crossed. It was no longer a\nquestion of *if* it could be done.  Rather, it became a question of\n*how fast* it could be done.\"\n- Mike Plant (about Dave Scott)','29ddae77b611c4223d4f41e229f2d74a6aeba0f9',35952),(9787,'\nGlyme\'s Formula For Success: The secret of success is sincerity. \nOnce you can fake that, you\'ve got it made.','2bcfa8738e33a812169be93ff81ff482e30d72a6',35950),(9788,'\n\"Even if truth destroys the whole universe, still it is truth;\n stand by it.\"\n -- Swami Vivekananda','2bcfa8738e33a812169be93ff81ff482e30d72a6',35941),(9789,'\n\"Everything secret degenerates, even the administration of \n justice.\" -- Lord Acton','2c0f73707e1750dd5b47ce620db6e5f9ab61283a',33738),(9790,'\n\"I can\'t embrace a male god who has persecuted female sexuality\n throughout the ages; and that persecution still goes on today,\n all over the world.\"\n -- Amanda Donohoe','2c0f73707e1750dd5b47ce620db6e5f9ab61283a',44127),(9791,'\n\"Speed and strength are of diminishing importance at greater and greater\ndistances.\"\n- David Costill','2cf677a4567a1c787edd581dd898449285eff9df',44281),(9792,'\n\"If you can dream it, you can do it.\"\n- Angeles Crest motto','2cf677a4567a1c787edd581dd898449285eff9df',42471),(9793,'\n\"All I know is that I am not a Marxist.\"\n -- Karl Marx','2d98d2c65fce016e3abab6728e05915fc60c1e4a',43348),(9794,'\n\"And the little screaming fact that sounds through all history:\n repression works only to strengthen and knit the repressed.\"\n -- John Steinbeck','2d98d2c65fce016e3abab6728e05915fc60c1e4a',43348),(9795,'\n\"Real knowledge is to know the extent of one\'s ignorance.\"\n -- Confucius','2ec9cc870b9395246fe58083275dabbb2dab2cd3',34631),(9796,'\n\"Some cause happiness wherever they go; others, whenever they go.\"\n -- Oscar Wilde (1854-1900)','2ec9cc870b9395246fe58083275dabbb2dab2cd3',36757),(9797,'\n\"A doctor can bury his mistakes but an architect can only advise \n his clients to plant vines.\"\n -- Frank Lloyd Wright (1868-1959)','2ee90c16bdc4752d40f8e7c8a76f43be265f8808',44403),(9798,'\n\"The act of focusing our mightiest intellectual resources on the\n elusive goal of goto-less programs has helped us get our minds\n off all those really tough and possibly unresolvable problems\n and issues with which today\'s professional programmer would\n otherwise have to grapple.\" -- John Brown','2ee90c16bdc4752d40f8e7c8a76f43be265f8808',34631),(9799,'\n\"Comedy is simply a funny way of being serious.\"\n --  Peter Ustinov (1921-2004)','2f40a163840c5d45e5eceaaa5e9fddce63d825c3',31909),(9800,'\n\"if you keep doing what you\'ve always done, you\'ll keep getting\n what you\'ve always gotten.\"\n -- Jim Rohn','2f40a163840c5d45e5eceaaa5e9fddce63d825c3',44127),(9801,'\n\"Sometimes I lie awake at night, and I ask, \'Where have I gone \n wrong?\' Then a voice says to me, \'This is going to take more \n than one night.\'\" -- Charlie Brown.','311d1923521540b4b61fc933bbd248fdc3b47eca',35950),(9802,'\n\"There are some experiences in life which should not be demanded \n twice from any man, and one of them is listening to the Brahms \n Requiem.\"\n -- George Bernard Shaw (1856-1950)','311d1923521540b4b61fc933bbd248fdc3b47eca',44403),(9803,'\n\"The body is given out on loan - don\'t waste it and expect to use it\ntomorrow.\"\n- Shapiro','36c48a4786eafadfbd56ad840ec7cba38d1e4367',36757),(9804,'\n\"It is true that liberty, so precious, must be rationed.\"\n -- Nikolai Lenin','36c48a4786eafadfbd56ad840ec7cba38d1e4367',36757),(9805,'\nCarlson\'s Consolation: Nothing is ever a complete failure; it can \nalways serve as a bad example.','397ff4e176057eee3e5bf8936024f8db98bf81c8',45883),(9806,'\n\"In ancient times they had no statistics so they had to fall back \n on lies.\" -- Stephen Leacock.','397ff4e176057eee3e5bf8936024f8db98bf81c8',33738),(9807,'\n\"I was raised in the Jewish tradition, taught never to marry a\n Gentile woman, shave on a Saturday night and, most especially, \n never to shave a Gentile woman on a Saturday night.\" \n -- Woody Allen.','39c4be3cb630fb189e89b8d626e64036a4d59019',64),(9808,'\n\"Getting an education was a bit like a communicable sexual disease. \n It made you unsuitable for a lot of jobs and then you had the urge\n to pass it on.\" -- Terry Pratchett, Hogfather','39c4be3cb630fb189e89b8d626e64036a4d59019',44281),(9809,'\n\"It\'s very hard in the beginning to understand that the whole idea is not\nto beat the other runners. Eventually you learn that the competition is\nagainst the little voice inside you that wants you to quit.\"\n- George Sheehan','3abb2c704de83074078dd74b39578f40b133434d',33738),(9810,'\n\"... one of the main causes of the fall of the Roman Empire was \n that, lacking zero, they had no way to indicate successful \n termination of their C programs.\" -- Robert Firth','3abb2c704de83074078dd74b39578f40b133434d',45449),(9811,'\n\"Debugging is twice as hard as writing the code in the first place.\n Therefore, if you write the code as cleverly as possible, you are,\n by definition, not smart enough to debug it.\"\n -- Brian Kernighan','3aca064ac13d759f44ddd4e9cc148d8b193e994b',32929),(9812,'\n\"The actions of men are the best interpreters of their\n thoughts.\"\n --John Locke','3aca064ac13d759f44ddd4e9cc148d8b193e994b',44127),(9813,'\n\"Let\'s not bring age into this discussion. I will not let \n my opponent\'s youth and inexperience become an issue.\"\n -- Ronald Reagan on Walter Mondale','3b0e554c21be5c337f42849fcc2bc89940e76a2c',44944),(9814,'\n\"Lying is done with words and also with silence.\"\n -- Adrienne Rich','3b79d2ba2298897a817f22aa3e73d037fab72d1e',39809),(9815,'\n\"The purpose of software engineering is to control complexity,\n not to create it.\" -- Dr. Pamela Zave','3b79d2ba2298897a817f22aa3e73d037fab72d1e',44944),(9816,'\n\"Biologically speaking, if something bites you it\'s more likely \n to be female.\" -- Desmond Morris.','3ebcceec7da43d5693fddb0bcf233e5fc9bd70fe',45883),(9817,'\n\"Real Programmers never work from 9 to 5. If any real programmer\n is around at 9 a.m., it\'s because they were up all night.\"\n -- Some Computer Geek','3ebcceec7da43d5693fddb0bcf233e5fc9bd70fe',44944),(9818,'\n\"Nothing unites the English like war. Nothing divides them like\n Picasso.\"\n -- Hugh Mills','3ed5c43f1bee182193213a32b736e00efed6de7b',43599),(9819,'\n\"I know of no crime that has not been defended by the church,\n in one form or other. The church is not a pioneer; it accepts a\n new truth, last of all, and only when denial has become\n useless.\"\n -- Robert G. Ingersoll','3ed5c43f1bee182193213a32b736e00efed6de7b',36757),(9820,'\n\"Don\'t sweat the petty things, just pet the sweaty things.\"','3fa79e5d234b35dc7ebdf6b9c4661bf621e96f8d',39809),(9821,'\n\"Kindness is more important than wisdom, and the recognition of\n this is the beginning of wisdom.\"\n -- Theodore Isaac Rubin','3fa79e5d234b35dc7ebdf6b9c4661bf621e96f8d',43348),(9822,'\n\"Once is happenstance. Twice is coincidence. Three times is \n enemy action.\" -- Auric Goldfinger, in \"Goldfinger\" by \n                   Ian L. Fleming (1908-1964)','42c439185fb05e88b39b7184b4755e2da77ebdc7',35658),(9823,'\n\"Humor is the great thing, the saving thing. The minute it crops \n up, all our irritations and resentments slip away and a sunny \n spirit takes their place.\" -- Mark Twain (1835-1910)','42c439185fb05e88b39b7184b4755e2da77ebdc7',31913),(9824,'\n\"It\'s kind of fun to do the impossible.\"\n    - Walt Disney (1901-1966)','43c7558c6cad9ae73bc2db12b9ef4bcf03b4d071',34631),(9825,'\n\"When his life was ruined, his family killed, his farm \n destroyed, Job knelt down on the ground and yelled up to the \n heavens, \'Why god? Why me?\' and the thundering voice of God \n answered, \'There\'s just something about you that pisses me \n off.\'\" -- Stephen King.','43c7558c6cad9ae73bc2db12b9ef4bcf