 from Vassar were laid end-to-end, I wouldn\'t \n be surprised.\" -- Dorothy Parker','489414ea7f2c8f7ddbcb318c0bc20be022b75484',43348),(9838,'\n\"The difference between what the most and the least learned \n people know is inexpressibly trivial in relation to that which \n is unknown.\"  -- Albert Einstein','49c2ad0acc151a565bf00a30b012471a984c42b6',35952),(9839,'\n\"Ask her to wait a moment - I am almost done.\"\n -- Carl Friedrich Gauss (1777-1855), while working, when \n    informed that his wife is dying','49c2ad0acc151a565bf00a30b012471a984c42b6',45883),(9840,'\n\"I wasn\'t a truly genuine trail ultrarunner until March 7, 1992 at the\nWild Oak 50 near Harrisonburg, Virginia.  It was a rainy day and\nsimultaneously, while I was piddling on the run, chewing on an energy\nbar and washing it down with Mountain Dew, my nose was dripping and I\nfarted.  That was the ultimate defining moment in my trail running\ncareer, if not my entire life.\"\n- Bob Boeder','4aa80d7f5db8cfbbfa490f3791870533904d9cf1',45883),(9841,'\n\"Moral indignation is jealousy with a halo.\"\n-- H. G. Wells (1866-1946)','4aa80d7f5db8cfbbfa490f3791870533904d9cf1',45561),(9842,'\n\"Simplicity is the ultimate sophistication.\"\n -- Leonardo da Vinci','4afe98453ca74b91f00881ecefe2df8e96fd27b0',64),(9843,'\n\"Modern morality and manners suppress all natural instincts,\n keep people ignorant of the facts of nature and make them\n fighting drunk on bogey tales.\"\n -- Aleister Crowley','4afe98453ca74b91f00881ecefe2df8e96fd27b0',44944),(9844,'\n\"They always say time changes things, but you actually have to\n change them yourself.\" -- Andy Warhol','4e0dddac212083e3184da04b92b6e0cdc4926c51',44127),(9845,'\n\"I have six locks on my door, all in a row. When I go out, I \n lock every other one. I figure no matter how long somebody \n stands there picking the locks, they are always locking three \n of them.\" -- George Carlin','4e0dddac212083e3184da04b92b6e0cdc4926c51',31909),(9846,'\n\"The fear of death is the most unjustified of all fears, for \n there\'s no risk of accident for someone who\'s dead.\" \n -- Albert Einstein.','515767854b4e13b91da99c349036e9211a359cc3',45090),(9847,'\n\"We don\'t like their sound, and guitar music is on the way out.\"\n -- Decca Recording Co. rejecting the Beatles, 1962','515767854b4e13b91da99c349036e9211a359cc3',45881),(9848,'\n\"Wherever there is great property, there is great inequality,\n for one very rich man; there must be at least five hundred\n poor.\"\n -- Adam Smith','51b6c874fec4e4df55a63c1efe24199295f2589e',43599),(9849,'\nGummidges\'s Law: The amount of expertise varies in inverse \nproportion to the number of statements understood by the general \npublic.','51b6c874fec4e4df55a63c1efe24199295f2589e',44944),(9850,'\n\"My humble friend, we know not how to live this life which is\n so short yet seek one that never ends.\"\n -- Anatole France','53178a1e69088fd25b19c8170862ccfeb04cd73d',39809),(9851,'\n\"Nothing except a battle lost can be half as melancholy as a\n battle won.\"\n -- Duke of Wellington','53178a1e69088fd25b19c8170862ccfeb04cd73d',45883),(9852,'\n\"Modern capitalism is not about free markets, it is about \n building sufficient mass that the market gravitationally \n collapses around you.\"-- Alisdair Meredith','5568a42fdb62652cc51e8f40d98ceac9004c7862',45881),(9853,'\n\"Do you program in Assembly ?\" she asked. \"NOP,\" he said.','5568a42fdb62652cc51e8f40d98ceac9004c7862',44944),(9854,'\n\"Getting an education was a bit like a communicable sexual disease. \n It made you unsuitable for a lot of jobs and then you had the urge\n to pass it on.\" -- Terry Pratchett, Hogfather','5a0782a85481fa3b119f02e7897ea3b11e56d666',39809),(9855,'\n\"We are apt to shut our eyes against a painful truth.... For my\n part, I am willing to know the whole truth; to know the worst;\n and to provide for it.\" -- Patrick Henry','5a0782a85481fa3b119f02e7897ea3b11e56d666',32929),(9856,'\n\"The people that I have met are not foolish; they are aware of how\ntired and cold and hungry and frightened and hurting and discouraged\nand disoriented and how possibly injured they will become. They know\nthey will face great physical, mental, emotional, and possibly\nspiritual challenges as they make their way to the finish. This is\nwhat they are racing against. This is their challenge. This is what\nI admire.\"\n- Carolyn Erdman','5cea478733fd836f7011cad7ebcab19ffc029d96',42471),(9857,'\n\"A distributed system is one in which the failure of a computer\n you didn\'t even know existed can render your own computer\n unusable.\" -- Leslie Lamport','5cea478733fd836f7011cad7ebcab19ffc029d96',45449),(9858,'\n\"If you haven\'t got anything nice to say about anybody, come sit \n next to me.\" -- Alice Roosevelt Longworth (1884-1980)','5d44b070770437672cefc331ee68516c9be4baf3',44403),(9859,'\n\"Any inaccuracies in this index may be explained by the fact \n that it has been sorted with the help of a computer.\" \n -- Donald Knuth Sorting and Searching','5d44b070770437672cefc331ee68516c9be4baf3',45090),(9860,'\n\"Computers are good at following instructions, but not at reading\n your mind.\" -- Donald Knuth','5de34098fb80dc620a0633997e1a9c362d5ee468',44127),(9861,'\n\"Men have become the tools of their tools.\"\n -- Henry David Thoreau (1817-1862)','5de34098fb80dc620a0633997e1a9c362d5ee468',45883),(9862,'\n\"If a person is to get to the meaning of life, he must learn to\n like the facts about himself, ugly as they may seem to his\n sentimental vanity, before he can learn the truth behind the\n facts. And the truth is never ugly.\"\n -- Eugene O\'Neill','5ea4cdaef6d8edfe44b7f29c1db824ab4bc3cdd5',32929),(9863,'\n\"People only see what they are prepared to see.\"\n -- Ralph Waldo Emerson','5ea4cdaef6d8edfe44b7f29c1db824ab4bc3cdd5',44944),(9864,'\n\"There\'s a lot to be said for LSD -- long, slow distance in this case.\"\n- Joe Henderson','5eeaddbc60dd897842d30567c89314632d2ddfb9',36879),(9865,'\nMuir\'s Law: When we try to pick out anything by itself, we find \nit hitched to everything else in the universe.','5eeaddbc60dd897842d30567c89314632d2ddfb9',44281),(9866,'\n\"Those who hate and fight must stop themselves; otherwise it is\n not stopped.\"\n -- Spock, Day of the Dove','5f7a14b2d12ab2c466a00d9a3dee2c1dddeae81b',45883),(9867,'\n\"If there\'s one thing I know it\'s God does love a good joke.\"\n -- Hugh Elliott, Standing Room Only weblog, 05-01-04','5f7a14b2d12ab2c466a00d9a3dee2c1dddeae81b',36757),(9868,'\n\"Ah well, then I suppose I shall have to die beyond my means.\" \n -- Oscar Wilde, dying words','5f9c406e16a500f0657bac6fa555e5dc041f8dfc',42471),(9869,'\n\"The multitude of books is a great evil. There is no limit to\n this fever for writing.\"\n -- Martin Luther','5f9c406e16a500f0657bac6fa555e5dc041f8dfc',45883),(9870,'\n\"We do have a zeal for laughter in most situations, give or\n take a dentist.\" -- Joseph Heller','5fbc756c6c029ad667640367e835fb24d9a0bfc1',44281),(9871,'\n\"If quantum physics doesn\'t confuse you then you don\'t \n understand it.\" -- Niels Bohr  ','5fbc756c6c029ad667640367e835fb24d9a0bfc1',35941),(9872,'\n\"All religions are founded on the fear of the many and the\n cleverness of the few.\"\n -- Stendhal','604c9f70880a080ae825505ad751fde6da520af8',45881),(9873,'\n\"Time is the best teacher; Unfortunately it kills all its \n students!\" -- bumper sticker','604c9f70880a080ae825505ad751fde6da520af8',35952),(9874,'\n\"Invisible Pink Unicorns are beings of awesome mystical power.\n We know this because they manage to be invisible and pink at\n the same time. Like all religions, the Faith of the Invisible\n Pink Unicorns is based upon both logic and faith. We have faith\n that they are pink; we logically know that they are invisible\n because we can\'t see them.\"\n -- Steve Eley','60fb738483bcb3038a8aa63df5f7c9d15fbdc48d',45449),(9875,'\n\"A scholar who cherishes the love of comfort is not fit to be \n deemed a scholar.\" -- Lao-Tzu (570?-490? BC)','60fb738483b