ey are at\npeace in themselves.\"\n- Ayers','ac6075bd4a3163362104cab4eedc2f4f8c6f550c',44281),(9993,'\n\"This isn\'t life in the fast lane, it\'s life in the oncoming traffic.\"\n -- Terry Pratchett','ac6075bd4a3163362104cab4eedc2f4f8c6f550c',43599),(9994,'\n\"Once that distance had been passed in training, an important physical\nand psychological threshold had been crossed. It was no longer a\nquestion of *if* it could be done.  Rather, it became a question of\n*how fast* it could be done.\"\n- Mike Plant (about Dave Scott)','ac826cb617b41ee99a4f00ebfe0fa922be9f5206',42471),(9995,'\n\"Quotation confesses inferiority.\" -- Ralph Waldo Emerson ','ac826cb617b41ee99a4f00ebfe0fa922be9f5206',34631),(9996,'\n\"Reality is that which, when you stop believing in it, doesn\'t \ngo away.\" -- Philip K. Dick.','ad1e57b13ad27a4e519a0b6e1e8afff294949679',44281),(9997,'\n\"Humor is a rubber sword - it allows you to make a point without \n drawing blood.\" -- Mary Hirsch','ad1e57b13ad27a4e519a0b6e1e8afff294949679',35941),(9998,'\n\"If there is no Hell, a good many preachers are obtaining money \n under false pretences.\" -- William Sunday.','af35f31db4766616c1056d36b263ebf3246492da',39809),(9999,'\n\"The behavior of any bureaucratic organization can best be\n understood by assuming that it is controlled by a secret\n cabal of its enemies.\" -- Robert Conquest\'s Second Law of Politics','af35f31db4766616c1056d36b263ebf3246492da',35950),(10000,'\n\"The trouble with the world is that the stupid are cocksure and\n the intelligent are full of doubt.\"\n -- Bertrand Russell','b12e3fe2b8b93abad180ddc4404b768423b59cc8',43599),(10001,'\n\"I was raised in the Jewish tradition, taught never to marry a\n Gentile woman, shave on a Saturday night and, most especially, \n never to shave a Gentile woman on a Saturday night.\" \n -- Woody Allen.','b12e3fe2b8b93abad180ddc4404b768423b59cc8',43599),(10002,'\n\"Java: the elegant simplicity of C++ and the blazing speed of\n Smalltalk.\" -- Roland Turner