o Rossini (1792-1868)','b9abf4cce982fdb8d77daad3864eb4f65088e03a',44127),(10024,'\n\"The whole of life is just like watching a film. Only it\'s as \n though you always get in ten minutes after the big picture has\n started, and no-one will tell you the plot, so you have to work\n it out all yourself from the clues.\"\n -- Terry Pratchett (Moving Pictures) ','ba0075e70e8c0b741d2278cc9a4a40272b43ef55',45881),(10025,'\n\"Peace is over rated. Any slave can have peace. Just pick the\n cotton.\"\n -- TheSong','ba0075e70e8c0b741d2278cc9a4a40272b43ef55',31913),(10026,'\n\"It is difficult to produce a television documentary that is\n both incisive and probing when every twelve minutes one is\n interrupted by twelve dancing rabbits singing about toilet\n paper.\"\n -- Rod Serling','ba79e372dbd5aadecfab2b6bdacce7b9bc35d12c',44281),(10027,'\n\"Simplicity is prerequisite for reliability\" -- Edsger W. Dijkstra','ba79e372dbd5aadecfab2b6bdacce7b9bc35d12c',31913),(10028,'\n\"It is not so much the suffering as the senselessness of it that\n is unendurable.\"\n -- Nietzsche','bb37c062326fd431231cd57ef969c17e750df4d6',44281),(10029,'\n\"The power of accurate observation is frequently called cynicism \n by those who don\'t have it.\"\n -- George Bernard Shaw (1856-1950)','bb37c062326fd431231cd57ef969c17e750df4d6',43346),(10030,'\n\"He has all the virtues I dislike and none of the vices I \n admire.\" -- Winston Churchill','bc2f66451a2411725e7b35c7a6d2c5f96a82ae26',44281),(10031,'\n\"Civilization began the first time an angry person cast a word \n instead of a rock.\" -- Sigmund Freud','bc2f66451a2411725e7b35c7a6d2c5f96a82ae26',45090),(10032,'\n\"Finagle\'s Law of Dynamic Negatives: Anything that can go wrong, \n will -- at the worst possible moment.\"','bca2996361ff3efd0460f34d7e769922ebff88fd',36879),(10033,'\n\"If you plan to throw one away, you will throw away two.\" \n -- Craig Zerouni','bca2996361ff3efd0460f34d7e769922ebff88fd',45090),(10034,'\nBove\'s Theorem: The remaining work 