hen you hear hoofbeats, think of horses, not zebras.\"\n-- Old saying','d5a52f7444942265bbb2edc4a66e0696202bf086',44127),(10066,'\n\"When a thing has been said and said well, have no scruple.\n Take it and copy it.\"\n -- Anatole France','d66886e86179731ffb7203da6f98961134d78b77',45883),(10067,'\n\"We totally deny the allegations, and we are trying to identify\n the allegators.\"','d66886e86179731ffb7203da6f98961134d78b77',45253),(10068,'\n\"Manifest plainness, embrace simplicity, reduce selfishness,\n have few desires.\"\n -- Lao tzu','d7227f56eddcec26bfeee9d2e95ea700e89c243f',31913),(10069,'\n\"I\'m in shape. Round is a shape.\" -- George Carlin','d7227f56eddcec26bfeee9d2e95ea700e89c243f',44127),(10070,'\n\"Whatever you do will be insignificant, but it is very\n important that you do it.\"\n -- Mohandas Gandhi','d81d94c63c94e24b2228b7b422ed4ef43d4413b6',34631),(10071,'\n\"The only one listening to both sides of an argument\n is the neighbor in the next apartment\" -- unknown','d81d94c63c94e24b2228b7b422ed4ef43d4413b6',45881),(10072,'\n\"Form no covetous desire, so that the demon of greediness may\n not deceive thee, and the treasure of the world may not be\n tasteless to thee.\"\n -- Zoroaster','daca074ac78cd119df791119ec3d25a5c3f8471d',45561),(10073,'\n\"A pessimist sees the difficulty in every opportunity; an \n optimist sees the opportunity in every difficulty.\"\n -- Sir Winston Churchill (1874-1965)','daca074ac78cd119df791119ec3d25a5c3f8471d',43599),(10074,'\n\"It\'s the pain of the consequences that\'s all out of proportion.\"\n- Kenny Moore','db62a706088db6124fbed0efd1c91c0980208f07',39809),(10075,'\n\"You know, somebody actually complimented me on my driving today.\n They left a little note on the windscreen, it said \'Parking Fine.\'\"\n -- Tommy Cooper','db62a706088db6124fbed0efd1c91c0980208f07',45883),(10076,'\n\"A clever man commits no minor blunders.\"\n -- Goethe (1749-1832)','dcfbd5518946ad08ebaa9ea2b49c6f0825371c54',43080),(10077,'\n\"It is dangerous to be right in matters on which the\n established authorities are wrong.\"\n -- Voltaire','dcfbd5518946ad08ebaa9ea2b49c6f0825371c54',36879),(10078,'\n\"Statistics is like a bikini. What they reveal is suggestive.\n What they conceal is vital.\"\n -- Arthur Koestler','dda46a8bc2006d94d82d87c04ffa6a825986dde3',42471),(10079,'\n\"I have had a perfectly wonderful evening, but this wasn\'t it.\"\n -- Groucho Marx','dda46a8bc2006d94d82d87c04ffa6a825986dde3',35658),(10080,'\n\"Science has done more for the development of western\n civilization in one hundred years than Christianity did in\n eighteen hundred years.\"\n -- Jeff Burroughs','df66df636bd528fbd5c52038dd6917a7a8b1f805',64),(10081,'\n\"If you want a product with certain characteristics, you must\n ensure that the team has those characteristics before the\n product\'s development.\" \n -- Jim McCarthy and Michele McCarthy - Software for your Head','df66df636bd528fbd5c52038dd6917a7a8b1f805',43346),(10082,'\n\"The Barkley, of course.  It was 20 hours longer\".\n- Mark Williams, when asked whether Hardrock or Barkley was harder','e0989f1e6ad4ab52c90fda65e11162b9869150b4',43599),(10083,'\n\"What I am against is quotas. I am against hard quotas, quotas \n they basically delineate based upon whatever. However they \n delineate, quotas, I think, vulcanize society. So I don\'t know \n how that fits into what everybody else is saying, their relative \n positions, but that\'s my position.\" -- George W. Bush','e0989f1e6ad4ab52c90fda65e11162b9869150b4',45883),(10084,'\n\"I never would have agreed to the formulation of the Central\n Intelligence Agency back in forty-seven, if I had known it\n would become the American Gestapo.\"\n -- Harry S Truman, 1961','e12809c9823bd87c393ef4771deedde51bf314b2',36879),(10085,'\nGoebel\'s Law Of Intellectual Obscurity: WHAT FUN IS IT TO BE AN \nEXPERT IF YOU MAKE YOURSELF EASY TO UNDERSTAND?','e12809c9823bd87c393ef4771deedde51bf314b2',43346),(10086,'\n\"Getting an education was a bit like