e back of a cat\n and drop it?\" -- Steven Wright.','eaec28a39fa8c263acc509a4c785493b068ea844',36879),(10097,'\n\"Pushing your body past what you thought it was capable of is easy; the hard part is \npushing yourself even further ... past what your mind wants to let you.  That\'s what \nultrarunning is all about; introducing you to a self you\'ve never known.    \n- Rex Pace','eaec28a39fa8c263acc509a4c785493b068ea844',44281),(10098,'\n\"Life is like an overlong drama through which we sit being\n nagged by the vague memories of having read the reviews.\"\n -- John Updike','ec6de4c24a50e4788b61a9b4346f8f3315afc723',43346),(10099,'\n\"It may be that our role on this planet is not to worship God,\n but to create him.\"\n -- Arthur C. Clarke','ec6de4c24a50e4788b61a9b4346f8f3315afc723',39809),(10100,'\n\"Any man who is under 30, and is not a liberal, has not heart; \n and any man who is over 30, and is not a conservative, has no \n brains.\"\n -- Sir Winston Churchill (1874-1965)','ec7aea454ced430b95207e1b1dde62f4eb60e13a',44127),(10101,'\n\"When you give food to the poor, they call you a saint. When\n you ask why the poor have no food, they call you a communist.\"\n -- Archbishop Helder Camara','ec7aea454ced430b95207e1b1dde62f4eb60e13a',33738),(10102,'\n\"If it weren\'t for electricity we\'d all be watching television by\n candlelight.\" -- George Gobel.','ec9b608d7575d511e26b814d699d766a056ec4de',35941),(10103,'\n\"Contraction of theological influence has at once been the best\n measure, and the essential condition of intellectual advance.\"\n -- William H. Lecky','ec9b608d7575d511e26b814d699d766a056ec4de',43346),(10104,'\n\"We\'ve all heard that a million monkeys banging on a million\n typewriters will eventually reproduce the entire works of \n Shakespeare. Now, thanks to the Internet, we know this is not \n true.\" -- Robert Wilensky ','ef43da838af80dab7b6bf3f809a996f715945686',43599),(10105,'\n\"A coward is a hero with a wife, kids, and a mortgage.\" \n -- Marvin Ki