ountry is now geared to an arms economy which was bred in an\n artificially induced psychosis of war hysteria and nurtured\n upon an incessant propaganda of fear.\"\n -- General Douglas MacArthur','209e73b950e3a2f3640808ed14fca53bca827a90',45881),(10172,'\n\"If someone says, \'Hey, I ran 100 miles this week.  How far did you\nrun?\' ignore him!  What the hell difference does it make? ...\nThe magic is in the man, not the 100 miles.\"\n- Bill Bowerman','20f173e65ab241d487b8295214adda3847131e2a',45561),(10173,'\n\"True and false are attributes of speech, not of things. And\n where speech is not, there is neither truth nor falsehood.\"\n -- Thomas Hobbes','20f173e65ab241d487b8295214adda3847131e2a',43599),(10174,'\n\"They said I was the greatest pitcher they ever saw; I couldn\'t\n understand why they couldn\'t give me no justice.\"\n -- Satchel Paige','214b42078b5891c09ee432a77af09d555b988b78',34631),(10175,'\n\"Computers are useless; they can only give you answers.\" \n -- Pablo Picasso ','214b42078b5891c09ee432a77af09d555b988b78',44403),(10176,'\n\"We are ensnared by the wisdom of the serpent; we are set free\n by the foolishness of God.\"\n -- Saint Augustine','25b04cb8e702c2fb0e7d9d530e5e42ba1a2c1cbb',45883),(10177,'\n\"Science is always discovering odd scraps of magical wisdom and\n making a tremendous fuss about its cleverness.\"\n -- Aleister Crowley','25b04cb8e702c2fb0e7d9d530e5e42ba1a2c1cbb',34631),(10178,'\n\"You can\'t wake a person who is pretending to be asleep.\"\n -- Native Proverb','293c01a03c7e78b9fcf70627562b1a1d0864bfb3',45253),(10179,'\n\"Distrust all in whom the impulse to punish is powerful.\"\n -- Nietzsche','293c01a03c7e78b9fcf70627562b1a1d0864bfb3',35941),(10180,'\n\"There are two ways of disliking poetry; one way is to \n dislike it, the other is to read Pope.\"\n -- Oscar Wilde on Alexander Pope','29d8a899737bbb7b64541a9ca4de1fab41e67ca6',45881),(10181,'\n\"Don\'t try to teach a pig to sing, it can\'t be done and it only\n ticks off the pig.\