t alone, imposed and\nsupervised by an exacting conscience.  The applause soon dies away, the\nprize is left behind, but the character you build is yours forever.\"\n- Unknown','68077b8dd611b4d7811b1ca3030f237f182b0823',36757),(10290,'\n\"You ask me if I keep a notebook to record my great ideas. I\'ve \n only ever had one.\" -- Albert Einstein.','68376424cdab1b6dd712e84912a5bcb154c30116',44403),(10291,'\nI cannot do everything, but still I can do something and because I\ncannot do everything, I will not refuse to do the something that I\ncan do.\"\n- Edward Everett Hale','68376424cdab1b6dd712e84912a5bcb154c30116',45090),(10292,'\n\"A sure cure for seasickness is to sit under a tree.\" \n -- Spike Milligan.','68ecbf29bc06f656a27369b8fc67a4396c5a9c1a',45090),(10293,'\n\"The first clergyman was the first rascal who met the first\n fool.\"\n -- Voltaire','68ecbf29bc06f656a27369b8fc67a4396c5a9c1a',43599),(10294,'\n\"My advice to you is get married: if you find a good wife you\'ll \n be happy; if not, you\'ll become a philosopher.\" -- Socrates.','69bd525af9fc5f62e13ba1bd153fc1c0cdd5fc17',32929),(10295,'\n\"If you see a fork in the road, take it!\"\n- Yogi Berra','69bd525af9fc5f62e13ba1bd153fc1c0cdd5fc17',43599),(10296,'\nParkinson\'s Law, Modified: The components you have will expand to \nfill the available space.','6aa78b79a6a6611daa2eba520d3d2afb00625fc5',31909),(10297,'\n\"Well done is better than well said.\" \n -- Benjamin Franklin (1706-1790)','6aa78b79a6a6611daa2eba520d3d2afb00625fc5',42471),(10298,'\n\"Too many of today\'s children have straight teeth and crooked\n morals.\" -- Unknown high school principal','6f05604eb5806dbcd1d006d31cea9a094d8b41d8',44281),(10299,'\nWeinberg\'s Law: If builders built buildings the way programmers \nwrite programs, then the first woodpecker that came along would \ndestroy civilization.','6f05604eb5806dbcd1d006d31cea9a094d8b41d8',32929),(10300,'\n\"Why do you sit there looking like an envelope without any \n address on it?\" -- Mark Twain','6feb444eab7a96d2471bb1163fcb0dd99382b94a',43080),(10301,'\n\"Benny Goodman plays the clarinet. I play music.\" \n -- Artie Shaw','6feb444eab7a96d2471bb1163fcb0dd99382b94a',45090),(10302,'\n\"Organizations which design systems are constrained to produce\n designs which are copies of the communication structures of these\n organizations. (For example, if you have four groups working on\n a compiler, you\'ll get a 4-pass compiler)\" -- Conway\'s Law','71e05ea3aebfd5b2272ac3ad3f626502b47656e1',39809),(10303,'\n\"The finish line is just ahead.\"\n\"The aid station is just ahead.\"\n\"Trust me ... this is the last hill.\"\n\"You\'re almost there.\"\n\"The trail is well marked.\"\n- Unknown','71e05ea3aebfd5b2272ac3ad3f626502b47656e1',32929),(10304,'\n\"I am not a communist and neither is the revolutionary\n movement.\"\n -- Fidel Castro','72c0c626d3648043161444a176c5384927612025',31909),(10305,'\n\"I still live.\" -- Daniel Webster, dying words','72c0c626d3648043161444a176c5384927612025',42471),(10306,'\n\"Know thy enemy and know thy self and you will win a hundred\n battles.\"\n -- Sun tzu','759e32769a2af771f28f3314dd110948a94f5571',31909),(10307,'\n\"I\'m sick of the pain!\"  Well, now, that\'s a shame\nBut you\'re strong, you\'re healthy, and bright.\nSo you\'ve had a bad stretch and you\'re ready to retch,\nShoulders back, move forward, and fight.\nIt\'s the plugging away that will win you the day,\nNow don\'t be a loser my friend!\nSo the goal isn\'t near, why advance to the rear.\nAll struggles eventually end.','759e32769a2af771f28f3314dd110948a94f5571',31909),(10308,'\n\"I\'m living so far beyond my income that we may almost be said \n to be living apart.\" -- e e cummings (1894-1962)','761f298f1a235896d1a803de537503649a5c80ff',44127),(10309,'\n\"Elegance is not a dispensable luxury but a factor that decides \n between success and failure.\" -- Edsger Dijkstra ','761f298f1a235896d1a803de537503649a5c80ff',45883),(10310,'\nRule Of Accuracy: When working toward the solution of a problem \nit always helps you to know the answer.','772082eb47a71ed249818a9c135bf6f15c16e0d2',35941),(10311,'\n\"Everywhere is walking distance if you have the time.\"\n -- Steven Wright','772082eb47a71ed249818a9c135bf6f15c16e0d2',44403),(10312,'\n\"Over the centuries, mankind has tried many ways of combating the forces\n of evil... prayer, fasting, good works and so on. Up until Doom, no one\n seemed to have thought about the double-barrel shotgun. Eat leaden\n death, demon...\"\n -- Terry Pratchett','77eb85941882d36ef6788201a0d650d34daaec49',44127),(10313,'\n\"... one of the main causes of the fall of the Roman Empire was \n that, lacking zero, they had no way to indicate successful \n termination of their C programs.\" -- Robert Firth','77eb85941882d36ef6788201a0d650d34daaec49',44403),(10314,'\n\"PHP is a minor evil perpetrated and created by incompetent\n amateurs, whereas Perl is a great and insidious evil, perpetrated\n by skilled but perverted professionals.\" -- Jon Ribbens','7faa30af58512b5ed0e5aa7cf027520c2f3636c1',43346),(10315,'\n\"You can know the name of a bird in all the languages of the \n world, but when you\'re finished, you\'ll know absolutely nothing\n whatever about the bird... So let\'s look at the bird and see\n what it\'s doing -- that\'s what counts. I learned very early \n the difference between knowing the name of something and knowing\n something.\" -- Richard Feynman','7faa30af58512b5ed0e5aa7cf027520c2f3636c1',39809),(10316,'\n\"We should leave our minds open, but not so open that our brains \n fall out.\" -- Alan Ross Anderson','80b638fe5ab0b59cc8c0d962862e14ecc697230c',43080),(10317,'\n\"Subtlety is the art of saying what you think and getting out of\n the way before it is understood.\" -- Unknown','8132507dc3d1ffe9201fab7a51ce4cf04cbefbef',44944),(10318,'\n\"Terrorism is the war of the poor, and war is the terrorism of \n the rich.\" -- Sir Peter Ustinov','8132507dc3d1ffe9201fab7a51ce4cf04cbefbef',45883),(10319,'\nFinagle\'s Law Of Military Superiority:\nThe bigger they are\nThe harder they hit.','82c94c8162f8c3e054a22f415d6f0a62965e6d4b',44281),(10320,'\n\"All truth passes through three stages. First, it is ridiculed. \n Second, it is violently opposed. Third, it is accepted as being \n self-evident.\"\n -- Arthur Schopenhauer (1788-1860)','82c94c8162f8c3e054a22f415d6f0a62965e6d4b',32929),(10321,'\n\"History is an account mostly false, of events mostly\n unimportant, which are brought about by rulers, mostly knaves,\n and soldiers, mostly fools.\"\n -- Ambrose Bierce','83c3b6a25f311ffa9135d8d85cb291d601109f60',33738),(10322,'\n\"The first 50 miles are run with the legs, the second 50 miles with the\nmind.\"\n- Unknown','83c3b6a25f311ffa9135d8d85cb291d601109f60',45253),(10323,'\n\"I\'m so poor I can\'t even pay attention.\" -- Unknown','879c533f64beab7c24441d4bfb77672505db7a98',45561),(10324,'\n\"Irrationally held truths may be more harmful than reasoned\n errors.\"\n -- Thomas Huxley','879c533f64beab7c24441d4bfb77672505db7a98',31909),(10325,'\n\"A fast word about oral contraception. I asked a girl to go to \n bed with me, she said \'no\'.\" -- Woody Allen','89d1c9fed3bb56983bc1ed0986843138a7602579',43080),(10326,'\n\"Be tolerant of the human race.  Your whole family belongs to it \n -- and some of your spouse\'s family too.\" -- Anonymous.','89d1c9fed3bb56983bc1ed0986843138a7602579',45883),(10327,'\n\"If the automobile had followed the same development cycle as \n the computer, a Rolls-Royce would today cost $100, get a \n million miles per gallon, and explode once a year, killing \n everyone inside.\" -- Robert X. Cringely.','89d60d119d4c3105ecd38520e336a31a4e072d4c',42471),(10328,'\n\"The race isn\'t always to the swiftest, but to those who keep on\nrunning.\"\n- Unknown','89d60d119d4c3105ecd38520e336a31a4e072d4c',31913),(10329,'\n\"A clever man commits no minor blunders.\"\n -- Goethe (1749-1832)','8b637c06f82727e3e7ac96a4f936a9274ef433d0',45881),(10330,'\n\"I get to eat *anything* and don\'t have to worry about putting on\nweight?\"\n- Unknown','8b637c06f82727e3e7ac96a4f936a9274ef433d0',64),(10331,'\n\"The luxurious ache of tired but not weary limbs.\"\n- Michael Fairless, \'The Roadmender\'.','8b9e10080360f5bd38dc2c48fd502c4fa8c93aaf',43348),(10332,'\n\"Coming back to where you started is not the same as never \n leaving.\"\n -- Terry Pratchett (A Hat Full of Sky) ','8b9e10080360f5bd38dc2c48fd502c4fa8c93aaf',35950),(10333,'\n\"A conservative is a man who is too cowardly to fight and too\n fat to run.\"\n -- Elbert Hubbard','8be7038c59532692a047d51b0ea9f17758d67120',35952),(10334,'\n\"You can\'t die from a stomach ache.  The worst that can happen is that\nyou\'ll throw up.  Then you can eat some more and start running again.\"\n- Jack Bristol','8be7038c59532692a047d51b0ea9f17758d67120',31913),(10335,'\n\"Everyone\'s values are defined by what they will tolerate when\n it is done to others.\"\n -- William Greider','8de8d2b3d001d4a9feed2e7cfb4e74ec81703c19',45883),(10336,'\n\"We are Dyslexia of Borg. Fusistance is retile. Your ass will\n be laminated.\" -- unknown','8de8d2b3d001d4a9feed2e7cfb4e74ec81703c19',45561),(10337,'\n\"Good teaching is one-fourth preparation and three-fourths \n theater.\" -- Gail Godwin','8e819c4cd8cfc122ef968ad1034c87221d89403f',35658),(10338,'\n\"To the Honourable Member opposite I say, when he goes home \n tonight, may his mother run out from under the porch and bark at \n him\" -- John G. Diefenbaker','8e819c4cd8cfc122ef968ad1034c87221d89403f',45090),(10339,'\n\"If you put tomfoolery into a computer, nothing comes out of it \n but tomfoolery. But this tomfoolery, having passed through a \n very expensive machine, is somehow enobled and no-one dares \n criticize it.\" -- Pierre Gallois.','8eef6a9d9cd458429acc0ad45332564a0279a2c1',43346),(10340,'\n\"Simplicity is prerequisite for reliability\" -- Edsger W. Dijkstra','8eef6a9d9cd458429acc0ad45332564a0279a2c1',45090),(10341,'\n\"Gentleman: Knows how to play the bagpipes, but doesn\'t.\"','8f2210ed0aceb25ea9ba088a748e5ff75c17026b',31913),(10342,'\n\"Always enjoy yourself.  Never give up.  Don\'t think of being tired.\nKeep on going until you cross the finish line.  Don\'t be upset if you\ndon\'t win.\"\n- Unknown','8f2210ed0aceb25ea9ba088a748e5ff75c17026b',39809),(10343,'\n\"Testing proves the presence, not the absence, of bugs.\"\n -- Edsger Dijkstra','904addefc74be7d6562a127a60c1b3c61ab17893',43080),(10344,'\n\"I hear Glenn Hoddle has found God. That must have been one hell\n of a pass.\" -- Bob Davies.','904addefc74be7d6562a127a60c1b3c61ab17893',34631),(10345,'\n\"The best is the enemy of the good.\" -- Voltaire','929372690258622726d738fe0c66d2cdf93df14c',43346),(10346,'\n\"Light thinks it travels faster than anything but it is wrong. \n No matter how fast light travels, it finds the darkness has \n always got there first, and is waiting for it.\"\n -- Terry Pratchett (Reaper Man) ','929372690258622726d738fe0c66d2cdf93df14c',45253),(10347,'\n\"Incorrect documentation is often worse than no documentation.\"\n -- Bertrand Meyer','93a90a6ecaff7d4147eff30f4a9b1b8a5112bfcc',44281),(10348,'\n\"This monkey mythology of Darwin is the cause of\n permissiveness, promiscuity, prophylactics, perversions,\n pregnancies, abortions, porno-therapy, pollution, poisoning and\n proliferation of crimes of all types.\"\n -- Judge Braswell Dean','93a90a6ecaff7d4147eff30f4a9b1b8a5112bfcc',36879),(10349,'\n\"Always code as if the guy who ends up maintaining your code will\n be a violent psychopath who knows where you live.\" \n -- John F. Woods','941aeddc9608883c9985a2ce2d7b867f310fbb28',64),(10350,'\n\"Running is a four weather sport.\"\n- Unknown','941aeddc9608883c9985a2ce2d7b867f310fbb28',33738),(10351,'\n\"If we do not like the world the way it is, then it is because\n we are not okay the way we are.\"\n -- deeshan','96081ec5f774946c7766b23bed372b284e43d4cf',44944),(10352,'\n\"Too much knowledge can hold you back.  Ignorance on the other hand, now\nthat was something that could get you to the finish line.\"\n- Mark Will-Weber','96081ec5f774946c7766b23bed372b284e43d4cf',34631),(10353,'\n\"As nightfall does not come at once, neither does oppression. In \n both instances, there is a twilight when everything remains \n unchanged. And it is in such twilight that we all must be most\n aware of change in the air - however slight - lest we become\n unwitting victims of the darkness.\" \n -- Supreme Court Justice William O. Douglas','96307ff7902e413b1389ccecaf960d7286c3597e',45883),(10354,'\n\"I like your Christ; I do not like your Christians. Your\n Christians are so unlike your Christ.\"\n -- Mohandas Gandhi','96307ff7902e413b1389ccecaf960d7286c3597e',33738),(10355,'\n\"I meant,\" said Ipslore bitterly, \"what is there in this world\n that truly makes living worthwhile?\"\n Death thought about it.\n \"Cats,\" he said eventually. \"Cats are nice.\"\n -- Terry Pratchett (Sourcery)','966d8ae1e56917d010d08a5aa83674ba8e2386a6',33738),(10356,'\n\"The illegal we do immediately. The unconstitutional takes a\n bit longer.\"\n -- Henry Kissinger','966d8ae1e56917d010d08a5aa83674ba8e2386a6',64),(10357,'\n\"There is no satisfaction without a struggle first.\"\n- Marty Liquori','96e4ffe10a111021957f4e07c7a30f0d60226a75',42471),(10358,'\n\"It is better to be quotable than to be honest.\" -- Tom Stoppard','96e4ffe10a111021957f4e07c7a30f0d60226a75',45253),(10359,'\nWoodward\'s Law: A theory is better than its explanation.','9831570659e06e49832679b22317fad548d8abcb',45449),(10360,'\n\"The radical invents the views. When he has worn them out, the\n conservative adopts them.\"\n -- Mark Twain','9831570659e06e49832679b22317fad548d8abcb',45090),(10361,'\n\"The finishing line isn\'t given; it is earned.\"\n- Unknown','9920a578e5eaa28768de2a3d7a186126da7875dd',39809),(10362,'\n\"Last is just the slowest winner.\"\n- C. Hunter Boyd','9920a578e5eaa28768de2a3d7a186126da7875dd',36757),(10363,'\n\"The law, in its majestic equality, forbids the rich, as well\n as the poor, to sleep under the bridges, to beg in the streets,\n and to steal bread.\"\n -- Anatole France','99e1b1eb079e175cf6573eb68ae975be1c5f86a4',44944),(10364,'\n\"Einstein argued that there must be simplified explanations of \n nature, because God is not capricious or arbitrary. No such \n faith comforts the software engineer.\" -- Fred Brooks','99e1b1eb079e175cf6573eb68ae975be1c5f86a4',34631),(10365,'\n\"Security is mostly a superstition; it does not exist in nature.  Life\nis either a daring adventure or nothing.\"\n- Helen Keller','9bb39721fb399ea23b1273ebe6a4cd44318b08c5',43348),(10366,'\n\"Common sense is necessary ... more so than high tech.  Race to the\nfinish not race from the start, pace yourself, run your own race and\ndon\'t get sucked into someone else\'s, walk when you need too, run when\nyou can, eat, drink and be merry for tomorrow we will hurt.\"\n- Kevin Sayers','9bb39721fb399ea23b1273ebe6a4cd44318b08c5',36757),(10367,'\n\"I\'ve had a wonderful time, but this wasn\'t it.\"\n -- Groucho Marx (1895-1977)','9e68b941fd96f1bf527ed09293dccf778f16f514',36879),(10368,'\n\"Invading Iraq after 9/11 was like invading Mexico after Pearl\n Harbor.\" -- Richard Clarke','9e68b941fd96f1bf527ed09293dccf778f16f514',43080),(10369,'\n\"Thank you for sending me a copy of your book; I\'ll waste no \n time reading it.\" -- Moses Hadas','9e8c4fde5db7fbe8974a79ae93838aed010b5642',36757),(10370,'\n\"We could have saved the Earth but we were too damned cheap.\"\n -- Kurt Vonnegut','9e8c4fde5db7fbe8974a79ae93838aed010b5642',33738),(10371,'\n\"Java, the best argument for Smalltalk since C++.\" -- unknown','9eb8417a2c7050417ce55c2e127538e7f0057f13',36757),(10372,'\n\"A dentist at work in his vocation always looks down in the\n mouth.\" -- George D. Prentice','9eb8417a2c7050417ce55c2e127538e7f0057f13',45883),(10373,'\n\"90% of ultrarunning is 100% mental.\"\n- Unknown','9ec169198ed9589be7ec3b9d9096e8a67edf2980',35952),(10374,'\nGummidges\'s Law: The amount of expertise varies in inverse \nproportion to the number of statements understood by the general \npublic.','9ec169198ed9589be7ec3b9d9096e8a67edf2980',64),(10375,'\n\"It\'s not at all important to get it right the first time. It\'s\n vitally important to get it right the last time.\" \n -- Andrew Hunt and David Thomas','a009b39852acf9de0a6b7c938e73c22946218e7e',64),(10376,'\n\"Climb the mountains and get their good tidings.  The winds will blow\ntheir freshness into you, and the storms, their energy.  Your cares\nand tensions will drop away like the leaves of autumn.\"\n- John Muir','a009b39852acf9de0a6b7c938e73c22946218e7e',45881),(10377,'\n\"The greatest artists of this world are never puritans, and\n seldom even ordinarily respectable.\"\n -- H. L. Mencken','a1d3c86e896becfca67943bfdbd96e02b3ed55c7',44403),(10378,'\n\"They have computers, and they may have other weapons of mass\n destruction.\" -- Janet Reno, Us Attorney General, 02-27-98','a1d3c86e896becfca67943bfdbd96e02b3ed55c7',43348),(10379,'\n\"We choose our joys and sorrows long before we experience\n them.\"\n -- Kahlil Gibran','a381cf11d64503b25903a96d2b14c31f52e1d182',45561),(10380,'\n\"Because I do it with one small ship, I am called a terrorist\n(pirate?). You do it with a whole fleet and are called an\n emperor.\"\n -- St. Augustine','a381cf11d64503b25903a96d2b14c31f52e1d182',43080),(10381,'\n\"A fast word about oral contraception. I asked a girl to go to \n bed with me, she said \'no\'.\" -- Woody Allen','a4d6d7701a87242dc1b54430c529b73683de48c3',31913),(10382,'\n\"May God grant me the grace to one day know the truth. Until then, \n may he spare me the company of those who\'ve already found it.\" \n -- unknown','a4d6d7701a87242dc1b54430c529b73683de48c3',43348),(10383,'\n\"There was a time when I believed in the story and the scheme\n of salvation, so far as I could understand it, just as I\n believed there was a Devil. Suddenly the light broke through to\n me and I saw a silly story,