82e16d00d00e35482889e0b2bb38ca598c',45881),(10394,'\n\"Every revolution evaporates and leaves behind it only the\n slime of bureaucracy.\"\n -- Franz Kafka','a8782e82e16d00d00e35482889e0b2bb38ca598c',43080),(10395,'\n\"The exact contrary of what is generally believed is often the\n truth.\"\n -- Jean de la Bruyre','ab571f647827059af1f427e1932b8e95fe464034',35950),(10396,'\n\"In ultrarunning, the pain is inevitable, but the suffering is\noptional.\"\n- Al Bogenhuber','ab571f647827059af1f427e1932b8e95fe464034',43348),(10397,'\n\"If you can\'t be a good example, then you\'ll just have to serve as\n a horrible warning.\" -- Catherine Aird','aec0f891c3b27ce85e4bd174dc21e51b4708d925',31913),(10398,'\n\"There are only two industries that refer to their customers as\n \'users\'.\" -- Edward Tufte','aec0f891c3b27ce85e4bd174dc21e51b4708d925',45253),(10399,'\n\"The second 50 is done with the mind.\"\n- Unknown','afc22e9ff9923f322d32bb744d8e392c39d8378c',33738),(10400,'\n\"If you plan to throw one away, you will throw away two.\" \n -- Craig Zerouni','afc22e9ff9923f322d32bb744d8e392c39d8378c',44281),(10401,'\n\"The philosopher has never killed any priests, whereas the\n priest has killed a great many philosophers.\"\n -- Denis Diderot','b1791a1190d20001459b8832d13124a8e3356b49',34631),(10402,'\n\"When you are 99 miles into a 100-mile running race, your brain is not\nthe same brain you started with\".\n- Paul Huddle','b1791a1190d20001459b8832d13124a8e3356b49',64),(10403,'\n\"The wireless music box has no imaginable commercial value. Who \n would pay for a message sent to nobody in particular?\" \n -- David Sarnoff\'s associates in response to his urging for \n    investment in the radio in the 1920s.','b26817c971fc06673c6ffca23e0cd4cb33c69681',33738),(10404,'\n\"Haste is of the devil. Slowness is of God.\" -- H L Mencken','b26817c971fc06673c6ffca23e0cd4cb33c69681',35941),(10405,'\n\"The music business is a cruel and shallow money trench, a long\n plastic hallway where thieves and pimps run free, and good men\n die like dogs. There\'s also a negative side\". \n -- Hunter S. Thompson','b33706a1959de7491afa7bd9d4bffd67d120be1f',44403),(10406,'\n\"Wit is educated insolence.\"\n -- Aristotle (384-322 B.C.)','b33706a1959de7491afa7bd9d4bffd67d120be1f',45881),(10407,'\n\"It was God who made me so beautiful. If I weren\'t, then I\'d be\n a teacher.\" -- Linda Evangelista.','b3d741708f6cf661e71ab396e47d646952c1a203',35952),(10408,'\n\"Running is a big question mark that\'s there each and every day.\nIt asks you, \'Are you going to be a wimp or are you going to be\nstrong today?\'\"\n- Peter Maher','b3d741708f6cf661e71ab396e47d646952c1a203',33738),(10409,'\n\"The competent programmer is fully aware of the strictly limited\n size of his own skull; therefore he approaches the programming\n task in full humility, and among other things he avoids clever\n tricks like the plague.\" -- Edsger Dijkstra','b522e0d2339697f48193d67f54f375bc03198d64',36879),(10410,'\n\"It would now be technically possible to unify the world,\n abolish war and poverty altogether, if men desired their own\n happiness more than the misery of their enemies.\"\n -- Bertrand Russel','b522e0d2339697f48193d67f54f375bc03198d64',43348),(10411,'\n\"Nine out of ten doctors agree that one out of ten doctors is \n an idiot.\"','b52f3d47b54c3dee966a4d2b278cfa1b45f3ebb7',64),(10412,'\n\"Self-destructive is doing something to hurt yourself. It is doing\npermanent damage to yourself. I have done neither. As for being\nobsessive, I am. I love to run.\"\n- John Barltrop','b52f3d47b54c3dee966a4d2b278cfa1b45f3ebb7',35952),(10413,'\n\"A mind all logic is like a knife all blade. It makes the hand \n bleed that uses it.\" -- Rabindranath Tagore','b5f175ef6f57f1773ab5615946a6080f06a5fc71',43080),(10414,'\n\"I was thrown out of college for cheating on the metaphysics \n exam; I looked into the soul of the boy next to me.\" \n -- Woody Allen.','b5f175ef6f57f1773ab5615946a6080f06a5fc71',45883),(10415,'\n\"The hardest years in life are those between ten and seventy.\"\n -- Helen Hayes, age 83','b69a6212221c60bf91275fb42ae3f092d57f2d69',34631),(10416,'\n\"Each problem that I solved became a rule which served afterwards \n to solve other problems.\"\n -- Rene Descartes (1596-1650), \"Discours de la Methode\"','b69a6212221c60bf91275fb42ae3f092d57f2d69',39809),(10417,'\n\"> > > Goodbye to all! Thanks for years of great fun and good \n > > > business!\n > > Suicide or MS C++?\n > Is there a difference?\n Suicide hurts only once...\"\n -- Conversation on borland.public.delphi.non-technical','b895065ea78dc2bfc5c4ddb677d8f0c0ab250ccb',45090),(10418,'\n\"Almost all absurdity of conduct arises from the imitation of\n those whom we cannot resemble.\"\n -- Samuel Johnson','b895065ea78dc2bfc5c4ddb677d8f0c0ab250ccb',64),(10419,'\n\"You can\'t say civilizations don\'t advance, because they kill\n you in a new way in each war.\"\n -- Will Rogers','ba7cf3b462401f7a89ea76d953276bc52f5622c0',35950),(10420,'\n\"TeX has found at least one bug in every Pascal compiler it\'s \n been run on, I think, and at least two in every C compiler.\" \n -- Donald Knuth','ba7cf3b462401f7a89ea76d953276bc52f5622c0',44403),(10421,'\n\"Why would anyone want to do this a second time?\"\n- Sue Haupt','bc9b51eb4e72d0ebc8a149e474700f836f019635',33738),(10422,'\n\"In spite of everything I still believe that people are really\n good at heart.\"\n -- Anne Frank, holocaust victim','bc9b51eb4e72d0ebc8a149e474700f836f019635',36879),(10423,'\n\"Thank God I\'m an atheist.\" -- Luis Bunuel.','beba905c31687e5d3418c85c90927b7dd91ccff3',44944),(10424,'\n\"Once that distance had been passed in training, an important physical\nand psychological threshold had been crossed. It was no longer a\nquestion of *if* it could be done.  Rather, it became a question of\n*how fast* it could be done.\"\n- Mike Plant (about Dave Scott)','beba905c31687e5d3418c85c90927b7dd91ccff3',43080),(10425,'\n\"I run distance because I want to be in good shape when I die.\"\n- Unknown','c14f1927d91971decd2ca435eff371344b3ae83e',45090),(10426,'\n\"Why yes -- a bulletproof vest.\" \n -- James Rodges, murderer, on his final request before the \n    firing squad.','c14f1927d91971decd2ca435eff371344b3ae83e',44127),(10427,'\n\"If you can\'t learn anything from losing, don\'t lose.\"\n- Unknown','c5aa09e5f00033397bb3eed2b4343318bc216f7b',36757),(10428,'\n\"To err is human, but to really foul things up you need a \n computer.\" -- Paul Ehrlich.','c5aa09e5f00033397bb3eed2b4343318bc216f7b',44127),(10429,'\n\"Even if truth destroys the whole universe, still it is truth;\n stand by it.\"\n -- Swami Vivekananda','c718f17cf6a0e4b5bad9a406b8cc95f0daa45a8f',44281),(10430,'\n\"The surest way to corrupt a youth is to instruct him to hold in\n higher esteem those who think alike than those who think \n differently\" -- Friedrich Nietzsche','c718f17cf6a0e4b5bad9a406b8cc95f0daa45a8f',44403),(10431,'\n\"I\'m Jewish. I don\'t work out. If God had wanted us to bend over, \n He would have put diamonds on the floor.\" -- Joan Rivers.','c71ce8327ddb80f5f2d66ef497a4c2f2ed295a15',43599),(10432,'\n\"It\'s not the races you enter that count. It\'s your runs in training\nand sticking with it. It\'s how you adjust to injury and how you recover\nthat makes you a good runner.\"\n- Dave Hladysh','c71ce8327ddb80f5f2d66ef497a4c2f2ed295a15',44127),(10433,'\n\"The instinct of nearly all societies is to lock up anybody who \n is truly free. First, society begins by trying to beat you up. \n If this fails, they try to poison you. If this fails too, the \n finish by loading honors on your head.\"\n -- Jean Cocteau (1889-1963)','c7300e6d5e37b7747453ebe9140162ba941d9eee',43346),(10434,'\n\"I know of no crime that has not been defended by the church,\n in one form or other. The church is not a pioneer; it accepts a\n new truth, last of all, and only when denial has become\n useless.\"\n -- Robert G. Ingersoll','c783e913593ba8caadabe7cd77b8b27cd1a850f1',32929),(10435,'\n\"The perfect computer has been developed. You just feed in your\n problems and they never come out again.\" -- Al Goodman.','c783e913593ba8caadabe7cd77b8b27cd1a850f1',45561),(10436,'\n\"In modern war there is no such thing as victor and \n vanquished... There is only a loser, and the loser is \n mankind.\" -- U Thant, Burmese UN Secretary General','c822deda3d74fad45d1bd92fd020f24ae4d3b035',45449),(10437,'\n\"We choose our joys and sorrows long before we experience\n them.\"\n -- Kahlil Gibran','c822deda3d74fad45d1bd92fd020f24ae4d3b035',43599),(10438,'\n\"Once all struggle is grasped, miracles are possible.\"\n -- Mao Tse Tung','c9ca1d6def4b58de4cdb3d56410c8528bfe703c1',43599),(10439,'\n\"It used to freak me out when I threw up, now I don\'t even slow down.\"\n- Unknown','c9ca1d6def4b58de4cdb3d56410c8528bfe703c1',45561),(10440,'\n\"Democracy is where you can say what you think even if you don\'t \n think.\"','ca278c46bc2f78479593313d0d2998b96283b520',45561),(10441,'\n\"Humor is just another defense against the universe.\"\n -- Mel Brooks (1926- )','ca278c46bc2f78479593313d0d2998b96283b520',31909),(10442,'\n\"Solutions are not the answer.\"\n -- Richard Nixon, former U.S. President','cab80775aceaee73cb412b261a415f063394e9b1',45883),(10443,'\n\"Let\'s not bring age into this discussion. I will not let \n my opponent\'s youth and inexperience become an issue.\"\n -- Ronald Reagan on Walter Mondale','cab80775aceaee73cb412b261a415f063394e9b1',45881),(10444,'\n\"Why did God create dentists? -- In his infinite love, he \n thought it would be charitable to His creatures to let them \n see what Hell is like, during their lives.\" -- PhR','caeac19e6be8a09e082a28ff3a15af6a00fbb64a',64),(10445,'\n\"If we knew what it was we were doing, it would not be called \n research, would it?\" -- Albert Einstein','caeac19e6be8a09e082a28ff3a15af6a00fbb64a',31909),(10446,'\n\"I think there is a world market for maybe five computers.\"\n -- Thomas Watson (1874-1956), Chairman of IBM, 1943','d190a65f2e0cb6057e78880ff3e2b183db0ddabf',44127),(10447,'\n\"Over breakfast coffee we read of 40,000 American dead in\n Vietnam. Instead of vomiting, we reach for the toast. Our\n morning rush through crowded streets is not to cry murder but\n to hit that trough before somebody else gobbles our share.\"\n -- Dalton Trumbo','d190a65f2e0cb6057e78880ff3e2b183db0ddabf',36757),(10448,'\n\"Talent hits a target no one else can hit; Genius hits a target\n no one else can see.\"\n -- Arthur Schopenhauer','d78ba61ca26d60aac42ce0ad1a0905134487263c',32929),(10449,'\n\"My experience in Amsterdam is that cyclists ride where the hell \n they like and aim in a state of rage at all pedestrians while \n ringing their bell loudly, the concept of avoiding people being \n foreign to them. \n \n My dream holiday would be a) a ticket to Amsterdam b) immunity \n from prosecution and c) a baseball bat.\"\n -- Terry Pratchett','d78ba61ca26d60aac42ce0ad1a0905134487263c',45253),(10450,'\n\"The behavior of any bureaucratic organization can best be\n understood by assuming that it is controlled by a secret\n cabal of its enemies.\" -- Robert Conquest\'s Second Law of Politics','d7ada496f6ee0550fd92a3e4063da7c6e7711032',32929),(10451,'\n\"A narcissist is someone better looking than you are.\"\n    - Gore Vidal','d7ada496f6ee0550fd92a3e4063da7c6e7711032',33738),(10452,'\n\"The gulf between what we feel we are doing and what others perceive us\nto be doing will remain the most ultra of all distances, one that no\namount of miles or words can finally bridge.\"\n- Hart','d965a463ac183af4828302b14522bb3371cec49f',45561),(10453,'\n\"They show you how detergents take out bloodstains. I think if \n you\'ve got a T-shirt with bloodstains all over it, maybe your \n laundry isn\'t your biggest problem.\" -- George Carlin','d965a463ac183af4828302b14522bb3371cec49f',43599),(10454,'\n\"I took a course in speed reading and was able to read War and\n Peace in twenty minutes.  It\'s about Russia.\" -- 