e truth than he whose mind\n is filled with falsehoods and errors.\"\n -- Thomas Jefferson','ecacae52b5fb785e1062b2db0471bdc945ba4c11',31909),(10479,'\n\"Never interrupt your enemy when he is making a mistake.\"\n    - Napoleon Bonaparte (1769-1821)','ecacae52b5fb785e1062b2db0471bdc945ba4c11',42471),(10480,'\n\"Luck is the residue of design.\"\n -- Branch Rickey - former owner of the Brooklyn Dodger Baseball \n    Team','eccf8e455eca5d64c9ad752f8dc1db144dbc1daa',64),(10481,'\n\"Nothing overshadows truth so much as authority.\"\n -- Leon Battista Alberti','ee45e1a95c040354d081d63dd83fc89ee1ca0220',64),(10482,'\n\"The thing I don\'t like about Western States is that you show up at the\nstarting line in the best shape of your life and a day later you are in\nAuburn in the worst shape of your life.\"\n- Andy Black, on Western States','ee45e1a95c040354d081d63dd83fc89ee1ca0220',43346),(10483,'\n\"Solutions are not the answer.\"\n -- Richard Nixon, former U.S. President','f296b85216b48e172804e57f86b7ff6cdc1e41be',44944),(10484,'\n\"This is very true; for my words are my own, and my actions are\n my ministers.\"\n -- Charles II','f296b85216b48e172804e57f86b7ff6cdc1e41be',43080),(10485,'\n\"Elegance is not optional\" -- Richard O\'Keefe','f313a558e0afd3b77ef512ac4f7dbf6722fb3079',36879),(10486,'\n\"As we said in the preface to the first edition, C \'wears well\n as one\'s experience with it grows.\' With a decade more \n experience, we still feel that way.\" \n -- Brian Kernighan and Dennis Ritchie','f313a558e0afd3b77ef512ac4f7dbf6722fb3079',45253),(10487,'\n\"A multithreaded file system is only a performance hack.\" \n -- Prof. Andrew S. Tanenbaum','f40cd5ceedf3b36c5de1e669ccfc3f9687fda4d8',45449),(10488,'\n\"Learning is not compulsory. Neither is survival.\" \n -- W. Edwards Deming','f40cd5ceedf3b36c5de1e669ccfc3f9687fda4d8',35941),(10489,'\n\"In Christianity, neither morality nor religion comes into\n contact with reality at any point.\"\n -- Nietzsche','f5d44204ad8783373