eking the truth. Doubt those who find \n it.\" -- Andr Gide','0aeee979a64de2bcdf8c02fc02e65c67b4625e73',36879),(10523,'\n\"The worst barbarity of war is that it forces men collectively\n to commit acts against which individually they would revolt with\n their whole being.\" -- Ellen Key','10cc9ad16a2120ac04c115f1e6c5d0ede4511e63',43599),(10524,'\n\"The best time I ever had with Joan Crawford was when I pushed \n her down the stairs in \'Whatever Happened to Baby Jane?\'\"\n -- Bette Davis','10cc9ad16a2120ac04c115f1e6c5d0ede4511e63',36757),(10525,'\n\"Sometimes you should overcome the tiredness and speed up when you\'d\nnormally slow down.  Great source of strength and power.\"\n- Pritikin','111c78a9861e51488b88b8014476fbb56f3c0566',43348),(10526,'\n\"Every man dies, but not every man really lives.\"\n- William Wallace (as played by Mel Gibson in \"Braveheart\")','111c78a9861e51488b88b8014476fbb56f3c0566',35658),(10527,'\n\"Fascism is capitalism in decay.\"\n -- Vladimir Ilyich Lenin','12b657fc6d7393ef00713442087235048dfd8a9a',36879),(10528,'\n\"Roses are #FF0000\n Violets are #0000FF\n All my base are belong to you!\"\n -- Geek Valentine T-shirt at ThinkGeek  ','12b657fc6d7393ef00713442087235048dfd8a9a',35941),(10529,'\n\"It\'s easy to imagine how you will act when things go according to plan,\nthat\'s why you must always prepare yourself for what you will do when\nthey don\'t.\"\n- Unknown','12f7f7f68f383442760e1b330169f00a466d11b1',44281),(10530,'\n\"The more laws and order are made prominent, the more thieves\n and robbers there will be.\"\n -- Lao Tsu','12f7f7f68f383442760e1b330169f00a466d11b1',45881),(10531,'\n\"If it wasn\'t for muscle spasms, I wouldn\'t get any exercise at\n all.\"','133e9dcf0c5f3587e416a390376c27d1021471fe',45253),(10532,'\n\"Nothing is wrong with California that a rise in the ocean level\n wouldn\'t cure.\"\n -- Ross MacDonald (1915-1983)','133e9dcf0c5f3587e416a390376c27d1021471fe',35941),(10533,'\n\"Sex is like air.  It\'s only a big deal