inciples\" -- John Wilkes to the Earl of Sandwich','5e1b52f118d2f1e2db8104bb9f755a0de9337109',44944),(10631,'\n\"To err is human - and to blame it on a computer is even more so.\"\n -- Robert Orben','5e1b52f118d2f1e2db8104bb9f755a0de9337109',32929),(10632,'\n\"A charlatan makes obscure what is clear; a thinker makes clear\n what is obscure.\" -- Hugh Kingsmill','5ef23156c0aa1c931616c744bae90f8a2c00b7e7',31909),(10633,'\n\"You\'re better than you think you are and you can do more than you think you can!\"\n- Ken Chlouber at Leadville','5ef23156c0aa1c931616c744bae90f8a2c00b7e7',35952),(10634,'\n\"We are apt to shut our eyes against a painful truth.... For my\n part, I am willing to know the whole truth; to know the worst;\n and to provide for it.\" -- Patrick Henry','60b17371883aa78523873f0dd9c1948458d7f1af',44281),(10635,'\n\"He can compress the most words into the smallest idea of any man \n I know.\" -- Abraham Lincoln','60b17371883aa78523873f0dd9c1948458d7f1af',45090),(10636,'\n\"Clothes make the man.  Naked people have little or no influence\n on society.\" -- Mark Twain','6119911aeb69582df95e21c2fb2b082b70efd282',32929),(10637,'\n\"When you meet a worthy person, focus on reaching his level.\n When you meet an unworthy person, take a good look inside\n yourself.\"\n -- Confucius','6119911aeb69582df95e21c2fb2b082b70efd282',44944),(10638,'\n\"If English was good enough for Jesus, it\'s good enough for\n them Mexicans.\"\n -- Texas politician, Spanish as a second language','6430e172869e08cd1b5fff09a1921c8c4f284b42',35952),(10639,'\n\"I was under medication when I made the decision to burn the\n tapes.\"\n -- Richard Nixon','6430e172869e08cd1b5fff09a1921c8c4f284b42',34631),(10640,'\n\"I still live.\" -- Daniel Webster, dying words','644089cf3f9381846585e0856dd95ca59012fdaf',43348),(10641,'\n\"A lot of these people who keep a gun at home for safety are the\n same ones who refuse to wear a seat belt.\" -- George Carlin','644089cf3f9381846585e0856dd95ca59012fdaf',36879)