t or says it.\"\n -- Malcolm X','70b9075edf6b199f93b50ddce93ea90a4f36ffec',42471),(10655,'\n\"We must question the story logic of having an all-knowing\n all-powerful God, who creates faulty humans, and then blames\n them for his own mistakes.\"\n -- Gene Roddenberry','70b9075edf6b199f93b50ddce93ea90a4f36ffec',33738),(10656,'\n\"I don\'t feel good.\"\n -- The last words of Luther Burbank (1849-1926)','70bd9ca836e33ad03b80b0b95fa751e8614e877f',34631),(10657,'\n\"\'Everything you say is boring and incomprehensible\', she said, \n \'but that alone doesn\'t make it true.\'\" -- Franz Kafka','70bd9ca836e33ad03b80b0b95fa751e8614e877f',44944),(10658,'\nCorrespondence Corollary: An experiment may be considered a \nsuccess if no more than half of your data must be discarded to \nobtain correspondence with your theory.','71b1631806f5f9667b47838fbaa77851173d4d86',35658),(10659,'\n\"Theory is when you know something, but it doesn\'t work. Practice \n is when something works, but you don\'t know why. Programmers combine \n theory and practice: Nothing works and they don\'t know why.\"','71b1631806f5f9667b47838fbaa77851173d4d86',33738),(10660,'\n\"You move from doing things to show other people you could, to\n where you do things to look into yourself, into your soul, and\n see who you are and what youre all about.\"\n- Scott Weber','7676610da8860c85121518160221926c6b30d0f9',35941),(10661,'\n\"Science can be useful, or it can just get in the way.\"\n- Karl King','7676610da8860c85121518160221926c6b30d0f9',42471),(10662,'\n\"The belief in the possibility of a short decisive war appears to\n be one of the most ancient and dangerous of human illusions.\"\n -- Robert Lynd','78a72822ca2038493ef79ca4cc4bf311eb0c0023',32929),(10663,'\n\"No mention of God. They keep Him up their sleeves for as long as\n they can, vicars do. They know it puts people off.\" \n -- Alan Bennett.','78a72822ca2038493ef79ca4cc4bf311eb0c0023',33738),(10664,'\n\"Even pearls are dark before the whiteness of his teeth.\"\n -- William R. Alger','7ad2d957d5e51ca09c88183daea2e889f690fdbe',43348),(10665,'\n\"Happy trails to you, until we meet again\"\n- Roy Rogers and Dale Evans','7ad2d957d5e51ca09c88183daea2e889f690fdbe',45090),(10666,'\n\"Generosity is not giving me that which I need more than you\n do, but it is giving me that which you need more than I do.\"\n -- Kahlil Gibran','7bc7bd7ba80095ecdd5fc25a56e90ecb398511dc',35658),(10667,'\n\"In America everybody is of the opinion that he has no social\n superiors, since all men are equal, but he does not admit that\n he has no social inferiors, for, from the time of Jefferson\n onward, the doctrine that all men are equal applies only\n upwards, not downwards.\" -- Bertrand Russell','7bc7bd7ba80095ecdd5fc25a56e90ecb398511dc',43080),(10668,'\n\"Thank God I\'m an atheist.\" -- Luis Bunuel.','7be3d0351383e0242a83f9848654e6b22f234623',43599),(10669,'\n\"Too much is better than not enough.\"\n- Kyle Rothweiler','7be3d0351383e0242a83f9848654e6b22f234623',45253),(10670,'\n\"Unformed people delight in the gaudy and in novelty. Cooked\n people delight in the ordinary.\" -- Erik Naggum','7c6a9a0a484fc78abe447bc863f689fd399c2d8b',45253),(10671,'\n\"The more you own, the more it owns you.\"\n -- Henry Rollins','7c6a9a0a484fc78abe447bc863f689fd399c2d8b',45253),(10672,'\n\"Every nation has its war party. It is not the party of democracy.\n It is the party of autocracy. It seeks to dominate absolutely.\"\n -- Senator Robert M. La Follette','7c9e25951917246ce1986fc829f2efa3c614020a',44944),(10673,'\n\"Those who cannot remember the past are condemned to repeat it.\"\n -- George Santayana','7c9e25951917246ce1986fc829f2efa3c614020a',32929),(10674,'\n\"If you speak the truth, have one foot in the stirrup.\"\n -- Turkish proverb','7ca94ac5cc39d8ebddb358d420d9e39808a1073b',64),(10675,'\nMuir\'s Law: When we try to pick out anything by itself, we find \nit hitched to everything else in the universe.','7ca94ac5cc39d8ebddb358d420d9e39808a1073b',31913),(10676,'\n\"Behind every successful man is a woman, behind her is his wife.\"\n -- Groucho Marx','7d7d654254f688db650cfcce6763f1d1dbabbb9f',45253),(10677,'\n\"Why yes -- a bulletproof vest.\" \n -- James Rodges, murderer, on his final request before the \n    firing squad.','7d7d654254f688db650cfcce6763f1d1dbabbb9f',45090),(10678,'\nBrilliant\'s Law Of Limited Ambition: If you can\'t learn how to do \nit well, learn how to enjoy doing it poorly.','7e6b7c5530ce3326f3a3ecff291473cf0cbbd361',32929),(10679,'\n\"I am enclosing two tickets to the first night of my new play; \n bring a friend... if you have one.\" \n -- George Bernard Shaw to Winston Churchill\n\n\"Cannot possibly attend first night, will attend second... if \n there is one.\" - Winston Churchill, in response.','7e6b7c5530ce3326f3a3ecff291473cf0cbbd361',32929),(10680,'\n\"Should array indices start at 0 or 1? My compromise of 0.5 was\n rejected without, I thought, proper consideration.\"\n -- Stan Kelly-Bootle','7e91fc74bdce4a3f16e20ba0a17815f93b37cf9f',43348),(10681,'\n\"Finish with a smile on your face.\"\n- Joe Trask','7e91fc74bdce4a3f16e20ba0a17815f93b37cf9f',43348),(10682,'\n\"Hain\'t we got all the fools in town on our side? And ain\'t\n that a big enough majority in any town?\"\n -- Mark Twain','7f25e70c2e6d91d4c4a908f9ea301f9a6827f45a',34631),(10683,'\n\"If the lessons of history teach us anything it is that nobody \n learns the lessons that history teaches us.\"','7f25e70c2e6d91d4c4a908f9ea301f9a6827f45a',43348),(10684,'\n\"The inside of a computer is as dumb as hell but it goes like\n mad!\" -- Richard Feynman','806cd5051e7cba4dd8d1267b65a25f40c9c75278',64),(10685,'\n\"I\'m ineffably tired of pro-war ideologues moaning about how\n the anti-war folk are just \'complaining\' without \'offering\n solutions\' to global dilemmas. Peace doesn\'t need a freekin\n moral, ethical, economical, or political qualification; war\n does. Peace doesn\'t ravage, plunder, rape, or kill; war does.\n Peace does not need justification, war does.\"\n -- <|OnAir|>','806cd5051e7cba4dd8d1267b65a25f40c9c75278',45090),(10686,'\n\"Art is dangerous. It is one of the attractions: when it ceases\n to be dangerous, you don\'t want it.\"\n -- Duke Ellington','8145abf752492c717f08f71ca1b9cf0f3d374e45',44281),(10687,'\nMurphy\'s Law Of Thermodynamics: Things get worse under pressure.','8145abf752492c717f08f71ca1b9cf0f3d374e45',44281),(10688,'\n\"The first 90% of the code accounts for the first 90% of the\n development time. The remaining 10% of the code accounts for\n the other 90% of the development time.\" -- Tom Cargill','81ea8be1af26fa1f9dfcd078e6471d549f88a70d',45090),(10689,'\n\"At some point it doesn\'t get any worse.\"\n- Unknown','81ea8be1af26fa1f9dfcd078e6471d549f88a70d',44281),(10690,'\n\"These machines have no common sense; they have not yet learned\n to \'think\', and they do exactly as they are told, no more and \n no less. This fact is the hardest concept to grasp when one \n first tries to use a computer.\" -- Donald Knuth','825c8bf5dfc889e24c9d9f51874d6007aaca021d',35941),(10691,'\n\"Fear, like pain, may only be God\'s way ... of hurting us.\"\n- Unknown','825c8bf5dfc889e24c9d9f51874d6007aaca021d',34631),(10692,'\n\"Crossposting isn\'t inherently evil, in the same sense that \n necrophilia doesn\'t really hurt anybody.  One wonders only \n whether it\'s appropriate to the occasion.\" -- Rick Gordon','8499fc5ad3be9269c190fb44d834ead8e0a436cc',31909),(10693,'\n\"Whenever I climb I am followed by a dog called \'Ego\'.\"\n    - Friedrich Nietzsche (1844-1900)','8499fc5ad3be9269c190fb44d834ead8e0a436cc',33738),(10694,'\n\"If you can\'t get rid of the skeleton in your closet, you\'d best \n teach it to dance.\" -- George Bernard Shaw (1856-1950)','857e17ffc4781a2ec016adfe176349d1719eb34a',35941),(10695,'\n\'What our ancestors would really be thinking, if they were alive\n today, is: \"Why is it so dark in here?\"\'\n -- Terry Pratchett, (Pyramids)','857e17ffc4781a2ec016adfe176349d171