nce is always discovering odd scraps of magical wisdom and\n making a tremendous fuss about its cleverness.\"\n -- Aleister Crowley','9ac748b9919894f0be1b2c5d896de2adf86d561b',45561),(10709,'\n\"It\'s not that I\'m afraid to die, I just don\'t want to be there\n when it happens.\" -- Woody Allen, From \'Death\' 1975.','9b12d972a9a907be29e79037a6d95b6ccae751bc',45090),(10710,'\n\"The first clergyman was the first rascal who met the first\n fool.\"\n -- Voltaire','9b12d972a9a907be29e79037a6d95b6ccae751bc',35950),(10711,'\n\"Small minds run in the same gutter.\"\n -- Alfred E. Neuman','9cab2d02817e2ac9d27c48c2a09edb901e5abf1e',45883),(10712,'\n\"It always takes longer than you expect, even when you take into\n account Hofstadter\'s Law.\" -- Hofstadter\'s Law','9cab2d02817e2ac9d27c48c2a09edb901e5abf1e',43346),(10713,'\n\"Liberty and democracy become unholy when their hands are dyed\n red with innocent blood.\" -- Mahatma Gandhi','9fadb295c54637aeada09836c08d082d02f3d222',35952),(10714,'\n\"Maybe her popularity stems from the fact that watching her is\n sometimes like watching a train wreck.\"\n -- John McCain\'s daughter Meghan about Ann Coulter','9fadb295c54637aeada09836c08d082d02f3d222',43080),(10715,'\n\"You\'re about as useful as a one-legged man at an arse kicking\n contest.\" -- Rowan Atkinson.','9fb8adf7b229518ce54b323d828395429ea431ef',44281),(10716,'\n\"Nothing is more surprising than the easiness with which the\n many are governed by the few.\"\n -- David Hume','9fb8adf7b229518ce54b323d828395429ea431ef',45561),(10717,'\n\"I\'m very proud of my gold pocket watch. My grandfather, on his\n deathbed, sold me this watch.\" -- Woody Allen','9fc350985c27737c00626ca5428a720d77ae7bed',45253),(10718,'\n\"Sir, you will either die of the pox or on the gallows.\"\n -- The Earl Of Sandwich to John Wilkes \n \n\"That depends, sir, On whether I embrace your mistress or \n your principles\" -- John Wilkes to the Earl of Sandwich','9fc350985c27737c00626ca5428a720d77ae7bed',43080),(10719,'\n\"Facts are the enemy of truth.\"\n -- Don Quixote - \"Man of La Mancha\"','a1629358a5983b27d967fe033f7099c9e7813009',45090),(10720,'\n\"The crimes of the U.S. throughout the world have been\n systematic, constant, clinical, remorseless, and fully\n documented but nobody cares to talk about them.\"\n -- Harold Pinter','a1629358a5983b27d967fe033f7099c9e7813009',45090),(10721,'\n\"In the beginning there was nothing, which exploded.\"\n -- Terry Pratchett (Lords and Ladies) ','a170c8689e2340bc3ef4b1210380b2559aabd20a',44944),(10722,'\n\"Finish with a smile on your face.\"\n- Joe Trask','a170c8689e2340bc3ef4b1210380b2559aabd20a',31913),(10723,'\n\"Some problems are so complex that you have to be highly\n intelligent and well informed just to be undecided about them.\"\n -- Laurence J. Peter','a812f5ddfdd241c29f9645ea09e14dedbdae2f1b',45449),(10724,'\n\"Complexity kills. It sucks the life out of developers, it makes\n products difficult to plan, build and test, it introduces\n security challenges and it causes end-user and administrator\n frustration.\" -- Ray Ozzie','a812f5ddfdd241c29f9645ea09e14dedbdae2f1b',43348),(10725,'\n\"I must say Bernard Shaw is greatly improved by music.\"\n -- T.S. Elliot referring to \'My Fair Lady\'','a980942f60e0dc3c0819001b6ce7fcf42942943f',43346),(10726,'\n\"The company doesn\'t tell me what to say, and I don\'t tell them\nwhere to stick it.\" -- Unknown','a980942f60e0dc3c0819001b6ce7fcf42942943f',44127),(10727,'\n\"In nature, there are neither rewards nor punishments; there\n are consequences.\"\n -- Robert G. Ingersoll','ab49f7673a310014d59e742b3827d27ee0674f1c',32929),(10728,'\n\"The spirit of resistance to government is so valuable on\n certain occasions that I wish it to be always kept alive.\"\n -- Thomas Jefferson','ab49f7673a310014d59e742b3827d27ee0674f1c',33738),(10729,'\n\"So far as I can remember, there is not one word in the Gospels\n in praise of intelligence.\"\n -- Bertrand Russel','ad2491b2742d13e641c978377a2