\n near.\" -- Andrew Marvell (1621-1678)','b7ab516baf4a5812ba881e1e5d985367a2b04bc7',45253),(10741,'\n\"Every program has (at least) two purposes: the one for which\n it was written, and another for which it wasn\'t.\" \n -- Alan J. Perlis','b7ab516baf4a5812ba881e1e5d985367a2b04bc7',45561),(10742,'\nFinagle\'s Law Of Government Contracting: Dealing with the \ngovernment is like kicking a 300-pound sponge.','b8dbc188bd6536ec9d180a55743d3ba6864d8a6e',32929),(10743,'\n\"When you hear hoofbeats, think of horses, not zebras.\"\n-- Old saying','b8dbc188bd6536ec9d180a55743d3ba6864d8a6e',34631),(10744,'\n\"Trying to outsmart a compiler defeats much of the purpose of\n using one.\" \n -- Kernighan and Plauger, The Elements of Programming Style.','ba36687c762b89d564db272299d5b01252ef94ab',45561),(10745,'\n\"I doubt, therefore I might be.\" -- Unknown','ba36687c762b89d564db272299d5b01252ef94ab',35950),(10746,'\n\"Missionaries are perfect nuisances and leave every place worse\n than they found it.\"\n -- Charles Dickens','bac014abce9fbc2ba56e839e54c7aaa74fb8f4ea',64),(10747,'\n\"There is no sincerer love than the love of food.\"\n -- George Bernard Shaw (1856-1950)','bac014abce9fbc2ba56e839e54c7aaa74fb8f4ea',43348),(10748,'\n\"I\'m Jewish. I don\'t work out. If God had wanted us to bend over, \n He would have put diamonds on the floor.\" -- Joan Rivers.','bc786e95a0e11c478615ec1c93df71f3fe6da439',44944),(10749,'\n\"It has been said that the great scientific disciplines are \n examples of giants standing on the shoulders of other giants. \n It has also been said that the software industry is an example\n of midgets standing on the toes of other midgets.\" \n -- Alan Cooper About Face','bc786e95a0e11c478615ec1c93df71f3fe6da439',31913),(10750,'\n\"When a thing has been said and said well, have no scruple.\n Take it and copy it.\"\n -- Anatole France','bce2a3dee1df6cd73032292baa4b095c3d3a4e8e',36757),(10751,'\n\"All Bibles are man-made.\"\n -- Thomas Edison','bce2a3dee1df6cd73032292baa4b095c3d3a4e8e',35952),(10752,'\n\"If the automobile had followed the same development cycle as \n the computer, a Rolls-Royce would today cost $100, get a \n million miles per gallon, and explode once a year, killing \n everyone inside.\" -- Robert X. Cringely.','be06b8428a051e6cba6c25f2278ee82b32669679',44944),(10753,'\n\"Every gun that is made, every warship launched, every rocket\n fired signifies in the final sense, a theft from those who\n hunger and are not fed, those who are cold and are not clothed.\n This world in arms is not spending money alone. It is spending\n the sweat of its laborers, the genius of its scientists, the\n hopes of its children. This is not a way of life at all in any\n true sense. Under the clouds of war, it is humanity hanging on\n a cross of iron.\"\n -- Dwight D. Eisenhower','be06b8428a051e6cba6c25f2278ee82b32669679',42471),(10754,'\n\"We are ensnared by the wisdom of the serpent; we are set free\n by the foolishness of God.\"\n -- Saint Augustine','bf76edf6048ecda2e7da13885abfd2dbcdd60a66',43599),(10755,'\n\"Determine that the thing can and shall be done, and then we will find\nthe way.\"\n- Abraham Lincoln','bf76edf6048ecda2e7da13885abfd2dbcdd60a66',34631),(10756,'\n\"Well, dear, I hope you know what you\'re doing.\"\n- Unknown','c17ece1ef4818595d96d145b0b62751779d67f63',35950),(10757,'\nUnnamed Law: If it happens, it must be possible.','c17ece1ef4818595d96d145b0b62751779d67f63',44281),(10758,'\n\"He\'d been wrong, there was a light at the end of the tunnel, \n and it was a flamethrower.\"\n -- Terry Pratchett (Mort) ','c29b28e6eb25453faae5ca94ffc55bf574593042',36757),(10759,'\n\"1001 words say more than one picture\" -- Chinese proverb','c29b28e6eb25453faae5ca94ffc55bf574593042',45561),(10760,'\n\"I heard someone tried the monkeys-on-typewriters bit trying for \n the plays of W. Shakespeare, but all they got was the collected \n works of Francis Bacon.\" -- Bill Hirst','c443b5377b509e990dca447059509706e034cd0c',45881),(10761,'\n\"A conservative is a man who is too cowardly to fight and too\n fat to run.\"\n -- Elbert Hubbard','c443b5377b509e990dca447059509706e034cd0c',43348),(10762,'\n\"You can sleep when you die.\"\n- Roger Rehwald (seen on a T-shirt)','c897f1ec50a9c373df5a44291bfceb2e68da3258',45561),(10763,'\n\"We need a common enemy to unite us.\"\n -- Condoleezza Rice, March 2000','c897f1ec50a9c373df5a44291bfceb2e68da3258',45561),(10764,'\n\"The amount of time the body needs to recuperate is not a sign of\nweakness but a fact of life.\"\n- Unknown','c93042253c40323ad43a4f3e6212ddb097998bfe',45090),(10765,'\n\"Ignorance simplifies ANY problem.\" -- R. Lucke','c93042253c40323ad43a4f3e6212ddb097998bfe',43346),(10766,'\n\"One death is a tragedy. A million deaths is a statistic.\"\n -- Josef Stalin','cc98514b76643375f7e0c0d64f9d8ddae63d6f5f',45881),(10767,'\n\"The good Christian should beware of mathematicians and all\n those who make empty prophecies. The danger already exists that\n mathematicians have made a covenant with the devil to darken\n the spirit and confine man in the bonds of Hell.\"\n --Saint Augustine','cc98514b76643375f7e0c0d64f9d8ddae63d6f5f',31913),(10768,'\n\"Room service? Send up a larger room.\"\n -- Groucho Marx','ce665c570f0dd9e93de3daa7eaebc446cec2e88b',31909),(10769,'\n\"When liberty is taken away by force it can be restored by\n force. When it is relinquished voluntarily by default, it can\n never be recovered.\"\n -- Dorothy Thompson','ce665c570f0dd9e93de3daa7eaebc446cec2e88b',43599),(10770,'\n\"You can\'t say civilizations don\'t advance, because they kill\n you in a new way in each war.\"\n -- Will Rogers','d09127a8d4c0c1e347fb707bd7bc7db0f3e98bd3',45883),(10771,'\n\"Guns make us powerful; butter will only make us fat.\"\n -- Nazi Hermann Goering','d09127a8d4c0c1e347fb707bd7bc7db0f3e98bd3',44127),(10772,'\n\"If you can\'t see over it, walk it.\"\n- Unknown','d308d6b4db194adea3895170a64b16165c47b59e',34631),(10773,'\n\"Religion is not merely the opium of the masses; it\'s the\n cyanide.\"\n -- Tom Robbins','d308d6b4db194adea3895170a64b16165c47b59e',31913),(10774,'\n\"Statistics is like a bikini. What they reveal is suggestive.\n What they conceal is vital.\"\n -- Arthur Koestler','d31779d6f0cb17ab3e22e7c2409d9052fdf5272c',44281),(10775,'\n\"The United States is in no sense founded upon the Christian\n doctrine.\"\n -- George Washington Administration Treaty','d31779d6f0cb17ab3e22e7c2409d9052fdf5272c',34631),(10776,'\n\"Have you ever felt worse after a run?\"\n- George Sheehan','d3efaa5acc98e8b4cf417af35296733a177541c6',39809),(10777,'\n\"My last cow just died, so I won\'t need your bull anymore.\"','d3efaa5acc98e8b4cf417af35296733a177541c6',35658),(10778,'\n\"We will not learn how to live together in peace by killing each\n other\'s children.\" -- Jimmy Carter','d49784030ff04923c480ac7a800b03fedd67d329',43346),(10779,'\n\"If we\'d been born where they were born and taught what they\n were taught, we would believe what they believe.\"\n -- A church sign in Northern Ireland','d49784030ff04923c480ac7a800b03fedd67d329',45090),(10780,'\n\"The whole of life is just like watching a film. Only it\'s as \n though you always get in ten minutes after the big picture has\n started, and no-one will tell you the plot, so you have to work\n it out all yourself from the clues.\"\n -- Terry Pratchett (Moving Pictures) ','d4c4b84bd7ec8b73bae95a1acb10f56530282c29',36879),(10781,'\n\"For centuries, theologians have been explaining the unknowable \n in terms of the-not-worth-knowing.\"\n -- Henry Louis Mencken (1880-1956)','d4c4b84bd7ec8b73bae95a1acb10f56530282c29',33738),(10782,'\n\"When I told the people of Northern Ireland that I was an\n atheist, a woman in the audience stood up and said, \'Yes, but\n is it the God of the Catholics or the God of the Protestants in\n whom you don\'t believe?\'\"\n -- Quentin Crisp','d633bbf31fecb2dd75080b12d0fbbd546b3ee75b',39809),(10783,'\n\"Logic is in the eye of the logician.\"\n -- Gloria Steinem','d633bbf31fecb2dd75080b12d0fbbd546b3ee75b',35941),(10784,'\n\"Incorrect documentation is often worse than no documentation.\"\n -- Bertrand Meyer','d764b9a532adfcd5a105af71e7278787b60fd43a',35941),(10785,'\n\"Free from desire, you realize the mystery. Caught in desire,\n you see only the manifestations.\"\n -- Tao Te Ching','d764b9a532adfcd5a105af71e7278787b60fd43a',45253),(10786,'\n\"Real life is that big, high-res, high-color screen saver behind\n all the windows.\" -- anonymous','d8d4f12b4a03c826b244b6365f4f3b162c5c27e2',43346),(10787,'\n\"The trouble with the world is that the stupid are cocksure and\n the intelligent are full of doubt.\" -- Bertrand Russell','d8d4f12b4a03c826b244b6365f4f3b162c5c27e2',44403),(10788,'\n\"Java, the best argument for Smalltalk since C++.\" -- unknown','d8e450ecddc6c0c7fc38e18e581e4e6f5d23d26e',45253),(10789,'\n\"If there has to be a blood bath, let\'s get it over with.\"\n --Ronald Reagan, Vietnam','d8e450ecddc6c0c7fc38e18e581e4e6f5d23d26e',43346),(10790,'\n\"Behind every great fortune there is a crime.\"\n -- Honore de Balzac (1799-1850)','da22f60ecdbde99a6bf8e9dbc2cc9d33dc6a2923',45449),(10791,'\n\"It is far easier to make war than peace.\" -- Georges Clemenceau','da22f60ecdbde99a6bf8e9dbc2cc9d33dc6a2923',35950),(10792,'\n\"A foolish consistency is the hobgoblin of little minds, adored\n by little statesmen and philosophers and divines.\"\n -- Ralph Waldo Emerson','da4bb577ce14531ff7a11e45e038be0991a3b6f8',43080),(10793,'\n\"If you can\'t learn anything from losing, don\'t lose.\"\n- Unknown','da4bb577ce14531ff7a11e45e038be0991a3b6f8',32929),(10794,'\n\"Style distinguishes excellence from accomplishment.\" \n-- James Coplien','db72fafe01ac873fcbd73aaeaf393112edc63443',45253),(10795,'\n\"Inanimate objects can be classified scientifically into three \n major categories; those that don\'t work, those that break down \n and those that get lost.\" -- Russell Baker.','db72fafe01ac873fcbd73aaeaf393112edc63443',39809),(10796,'\n\"In the end, we will remember not the words of our enemies, but\n the silence of our friends.\"\n -- Martin Luther King, Jr.','dc40b19d71eb00a80ad7bcf2b31df01b46d186a4',42471),(10797,'\n\"Rarely is the question asked: Is our children learning?\"\n -- George W. Bush','dc40b19d71eb00a80ad7bcf2b31df01b46d186a4',33738),(10798,'\n\"It\'s so easy to become mesmerized by the immediacy of a result\n that you don\'t question its validity.\" -- Naomi Karten','de5cc0629ed9c360c70281a825aa0cc2c3dd4e17',43080),(10799,'\nAlbrecht\'s Law: Social innovations tend to the level of minimum \ntolerable well-being.','deb0c1ce86a6aa52258d960ff94accc75e3f8067',45881),(10800,'\n\"A lie gets halfway around the world before the truth has a \n chance to get its pants on.\"\n -- Sir Winston Churchill (1874-1965)','deb0c1ce86a6aa52258d960ff94accc75e3f8067',64),(10801,'\n\"Why yes -- a bulletproof vest.\" \n -- James Rodges, murderer, on his final request before the \n    firing squad.','e2ca73520eccd51ff62e4a1d64376b527bc39719',32929),(10802,'\n\"A conservative government is an organized hypocrisy.\"\n -- Benjamin Disraeli','e4d993ba300e7773704a11b46a793c3e1153e069',35941),(10803,'\n\"We don\'t like their sound, and guitar music is on the way out.\"\n -- Decca Recording Co. rejecting the Beatles, 1962','e4d993ba300e7773704a11b46a793c3e1153e069',45881),(10804,'\n\"Computers are useless. They can only give you answers.\"\n -- Pablo Picasso','e4e772472093b48e8ee481684c0b59d92aaf0daa',45090),(10805,'\n\"It is curious that physical courage should be so common in the\n world and moral courage so rare.\"\n -- Mark Twain','e4e772472093b48e8ee481684c0b59d92aaf0daa',64),(10806,'\n\"It is hard, I submit, to loathe bloodshed, including war, more\n than I do, but it is still harder to exceed my loathing of the\n very nature of totalitarian states in which massacre is only an\n administrative detail.\"\n -- Vladimir Nabokov','e598c1cf40c2732e1d9cceae1233e0291078dfa1',31909),(10807,'\n\"Peace is only possible if men cease to place their happiness\n in the possession of things which cannot be shared.\"\n -- Julien Benda','e598c1cf40c2732e1d9cceae1233e0291078dfa1',34631),(10808,'\n\"I\'m fed up to the ears with old men dreaming up wars for \nyoung men to die in.\" -- George McGovern','e5e47470193149b829c0602c5df1ecab9499cfa9',45253),(10809,'\n\"I took a course in speed reading and was able to read War and\n Peace in twenty minutes.  It\'s about Russia.\" -- Woody Allen','e5e47470193149b829c0602c5df1ecab9499cfa9',33738),(10810,'\n\"The establishment of Christianity arrested the normal\n development of the physical sciences for over fifteen hundred\n years.\"\n -- Andrew Dickson White','e69dd3847de166e92e8bd2b1c9008860ba2aa0e1',45883),(10811,'\n\"Haste is of the devil. Slowness is of God.\" -- H L Mencken','e69dd3847de166e92e8bd2b1c9008860ba2aa0e1',45253),(10812,'\n\"Most people would sooner die than think; in fact, they do so.\"\n -- Bertrand Russell (1872-1970)','e78a99552c0bfc596d69733d6b52fa9d9d36230c',43346),(10813,'\n\"The way to heaven leads right through the depths of hell.\"\n- Peter Bakwin (from Andrea Feucht)','e78a99552c0bfc596d69733d6b52fa9d9d36230c',35941),(10814,'\n\"A woman is an occasional pleasure but a cigar is always a smoke.\"\n -- Groucho Marx','e86178ef870930fa52db4a8ea6347cd1f0af3576',35950),(10815,'\n\"Real programmers just throw a bunch of 1s and 0s at the computer \n to see what sticks\" -- Pete O\'Hanlon','e86178ef870930fa52db4a8ea6347cd1f0af3576',42471),(10816,'\n\"The secret of happiness is to admire without desiring.\"\n -- F. H. Bradley','e88d914e1f87bf6332730dda1f0ac4a485da524a',64),(10817,'\n\"Because I do it with one small ship, I am called a terrorist. \n You do it with a whole fleet and are called an emperor.\"\n -- A pirate, from St. Augustine\'s \"City of God\"','e88d914e1f87bf6332730dda1f0ac4a485da524a',36757),(10818,'\n\"The question of whether a computer can think is no more \n interesting than the question of whether a submarine can swim.\" \n -- Edsger Dijkstra ','e8dd6463fc60247ef056a211346d4631430ed2ef',44944),(10819,'\n\"He who knows nothing is closer to the truth than he whose mind\n is filled with falsehoods and errors.\"\n -- Thomas Jefferson','e8dd6463fc60247ef056a211346d4631430ed2ef',45449),(10820,'\n\"Well, dear, I hope you know what you\'re doing.\"\n- Unknown','eb24664551f8a0d04caf23d6efa95913cc34378c',44403),(10821,'\n\"Truth is for the minority.\"\n -- Baltasar Gracin','eb24664551f8a0d04caf23d6efa95913cc34378c',43346),(10822,'\n\"Man is certainly stark mad: he cannot make a worm, yet he will\n make gods by the dozen.\"\n -- Michel de Montaigne','ebeddaab85a4587bfd2d3ef2ed704f481c63ee38',34631),(10823,'\n\"The most important thing in life is not the triumph but the struggle.\nThe essential thing is not to have conquered but to have fought well.\"\n- Pierre de Courbertin','ebeddaab85a4587bfd2d3ef2ed704f481c63ee38',31913),(10824,'\n\"It is better to have a permanent income than to be fascinating.\"\n -- Oscar Wilde (1854-1900)','ec5eb0b6b4fd952af99a5179d1ca301df90e2250',35658),(10825,'\n\"I criticize by creation - not by finding fault.\" \n -- Cicero (106-43 B.C.)','ec5eb0b6b4fd952af99a5179d1ca301df90e2250',64),(10826,'\n\"The gods too are fond of a joke.\" -- Aristotle (384-322 B.C.)','ed99c5f582b150f4277585aa7b69b35e48ac192d',43080),(10827,'\n\"The injury we do and the one we suffer are not weighed in the\n same scale.\"\n -- Aesop','ed99c5f582b150f4277585aa7b69b35e48ac192d',45253),(10828,'\n\"A narcissist is someone better looking than you are.\"\n    - Gore Vidal','eeb6649bdb5bc30c41258761bfc1bc76560bb21b',34631),(10829,'\n\"Reports are sketchy, but we have heard that in the first \n heart transplant operation in Belgium, both patient and \n donor are doing fine.\" -- Radio news announcer','eeb6649bdb5bc30c41258761bfc1bc76560bb21b',44403),(10830,'\n\"There are two ways of disliking poetry; one way is to \n dislike it, the other is to read Pope.\"\n -- Oscar Wilde on Alexander Pope','f0d6caf672956573ed792304102375c6702ff87f',35952),(10831,'\n\"It is unbecoming for young men to utter maxims.\"\n -- Aristotle (384-322 B.C.)','f0d6caf672956573ed792304102375c6702ff87f',43599),(10832,'\n\"Unless Americans come to realize that they are not stronger in\n the world because they have the bomb but weaker because of\n their vulnerability to atomic attack, they are not likely to\n conduct their policy, in a spirit that furthers the arrival at\n an understanding.\"\n -- Albert Einstein','f168d56d8a68fa4df1610ac2764550baac473647',35658),(10833,'\n\"Man was born free, and everywhere he is in chains.\"\n -- Rousseau','f168d56d8a68fa4df1610ac2764550baac473647',39809),(10834,'\n\"Vote early and vote often.\" -- Al Capone (1899-1947)','f225a4c2362d303b21c09ee07e46748bcf9648a2',34631),(10835,'\n\"At some point it doesn\'t get any worse.\"\n- Unknown','f225a4c2362d303b21c09ee07e46748bcf9648a2',44281),(10836,'\n\"Yes, my friends, I too am prepared to die for a cause, but\n there is no cause for which I am prepared to kill.\"\n --Mohandas Gandhi','f2616f5d6774efbfe00ab4c50f1c145cb605295c',44944),(10837,'\n\"Insanity is catching.\"\n -- Terry Pratchett (Making Money) ','f2616f5d6774efbfe00ab4c50f1c145cb605295c',44281),(10838,'\n\"The trouble with having an open mind, of course, is that people \n will insist on coming along and trying to put things in it.\"\n -- Terry Pratchett (Diggers)','f3c10f2ec1e05ed678893ce8a2d2e2bc559d16d7',43346),(10839,'\nICTOARTCYAODHTIOTSSIWRTNCAHICGAWI, Acronym: \"I Can\'t Think Of \n Anything Reasonable To Counter Your Argument Or Don\'t Have The \n Least Inkling Of The Subject So I Will Resort To Name Calling \n And Hope I Can Get Away With It.\" \n -- Ken de Camargo, borland.public.off-topic','f3c10f2ec1e05ed678893ce8a2d2e2bc559d16d7',43346),(10840,'\n\"Biologically speaking, if something bites you it\'s more likely \n to be female.\" -- Desmond Morris.','f52225c40fd5c8341f26f539fa01ec364deb2c1c',39809),(10841,'\n\"The great thing about a computer notebook is that no matter how \n much you stuff into it, it doesn\'t get bigger or heavier.\" \n -- Bill Gates.','f52225c40fd5c8341f26f539fa01ec364deb2c1c',43080),(10842,'\nRule Of Accuracy: When working toward the solution of a problem \nit always helps you to know the answer.','f7433d6fbedefa862aaf4175a7847d3dba4eceea',45881),(10843,'\n\"The greatest pleasure in life is doing what people say you cannot do.\"\n- Bagehot','f7433d6fbedefa862aaf4175a7847d3dba4eceea',42471),(10844,'\n\"The man who does not read good books has no advantage over the \n man who cannot read them.\"\n -- Mark Twain (1835-1910)','f820d714b8c9ca9ca87c619f352da369535c1ce3',43080),(10845,'\n\"It was the experience of mystery -- even if mixed with fear -- \n that engendered religion.\"\n -- Albert Einstein (1879-1955)','f820d714b8c9ca9ca87c619f352da369535c1ce3',64),(10846,'\n\"For if he like a madman lived, At least he like a wise one died.\"\n -- Cervantes.','f859312238849fdf2da1a82bb3b6d4ff23e35731',45090),(10847,'\n\"Marry me and I\'ll never look at another horse!\"\n -- Groucho Marx','f859312238849fdf2da1a82bb3b6d4ff23e35731',42471),(10848,'\n\"Plan to throw one away, you will anyhow.\" -- Fred Brooks','f92378acbe5151c95d76c38716e617cdd44bec1c',39809),(10849,'\n\"Well done is better than well said.\" \n -- Benjamin Franklin (1706-1790)','f92378acbe5151c95d76c38716e617cdd44bec1c',35952),(10850,'\n\"To many managers, getting rid of the arrogant, undisciplined,\n over-paid, technology-obsessed, improperly-dressed etc.\n programmers would appear to be a significant added benefit.\" \n -- Bjarne Stroustrup The C++ Programming Language 3e, \n    section 24.2.4','fbb968e2f5e3bac7c0a0ceb14d847e367381e299',44127),(10851,'\n\"Naturally we feel that mentally ill people are not what we are\n looking for when we hire programmers - although there is no\n empirical data to support or contradict that view... Is it\n appropriate to give tests for mental illness to anyone applying\n for any kind of job?\" \n -- Weinberg The Psychology of Computer Programming','fbb968e2f5e3bac7c0a0ceb14d847e367381e299',36757),(10852,'\n\"It has been said that the great scientific disciplines are \n examples of giants standing on the shoulders of other giants. \n It has also been said that the software industry is an example\n of midgets standing on the toes of other midgets.\" \n -- Alan Cooper About Face','fcd9fb2d938862bff9b6fb45d4c5e83852124deb',39809),(10853,'\n\"You\'re bound to be unhappy if you optimize everything.\" \n -- Donald Knuth','fcd9fb2d938862bff9b6fb45d4c5e83852124deb',44281),(10854,'\n\"As soon as we started programming, we found to our surprise\n that it wasn\'t as easy to get programs right as we had thought.\n Debugging had to be discovered. I can remember the exact\n instant when I realized that a large part of my life from then\n on was going to be spent in finding mistakes in my own\n programs.\" -- Maurice Wilkes discovers debugging, 1949','feba5b00aa45ad164530435ce81ea1da4b2b66db',45881),(10855,'\n\"If you can\'t get rid of the skeleton in your closet, you\'d best \n teach it to dance.\" -- George Bernard Shaw (1856-1950)','feba5b00aa45ad164530435ce81ea1da4b2b66db',33738);
